INSERT INTO `article` VALUES (2,'GABON : LE GROUPE SUNU DÉVOILE SES AMBITIONS POUR LE GABON','GABON: SUNU GROUPE SUNU UNVEILS ITS AMBITIONS FOR GABON','<p>Présents à Libreville dans le cadre des conseils des comptes, les membres du comité de direction du Groupe SUNU : M. Pathé DIONE, PDG, Messieurs Mohamed BAH et Joël AMOUSSOU, Directeurs Généraux Délégués ont rencontré partenaires et clients locaux le 22 mars 2018. Les échanges axés sur les ambitions du Groupe SUNU en Afrique et particulièrement pour le Gabon, ont capté l’attention des invités. Ils étaient accompagnés par l’équipe dirigeante des filiales SUNU Assurances Vie et IARD du Gabon.</p>\r\n','<p>Present in Libreville for an audit council, members of SUNU Group Executive Committee: Mr. Pathé DIONE, CEO, Messrs. Mohamed BAH and Joël AMOUSSOU, Deputy Managing Directors, met partners and local customers on 22 March 2018. The discussions which were focused on SUNU Group&#39;s ambitions in Africa and particularly for Gabon captured the attention of the guests. The members of the management committee were accompanied by the management team of SUNU Assurances Vie and IARD Gabon.</p>\r\n',0,'21474848481525350474.jpg','2018-03-22 17:15:05',NULL,2147484848,'1'),(3,'CÔTE D\'IVOIRE : SUNU ASSURANCES VIE CI OSE AVEC LES FEMMES FEEF','CÔTE D’IVOIRE: SUNU ASSURANCES VIE CI TOOK THE LEAP WITH FEEF’s WOMEN','<p>Les 16 et 17 mars 2018, SUNU Assurances Vie CI a « Osé » en étant le partenaire de la 5ème édition du Forum de l’Emploi et de l’Entreprenariat Féminin « FEEF2018 ». Deux jours de festivités qui ont permis aux femmes venues de différents horizons de partager leurs expériences sur des problématiques liées à l’emploi à travers conférences et panels. Avec pour thème : « Osez ! Et Réalisez vos rêves », le FEEF 2018 a tenu encore ses promesses cette année. Un défilé de mode et un feu d’artifice ont permis de refermer les portes de cette 5ème édition.</p>\r\n','<p>On March 16 and 17, 2018, SUNU Assurances Vie CI crossed a new line by being the partner of the 5th edition of the Forum of Employment and Female Entrepreneurship \"FEEF 2018”. Two days of festivities that allowed women from different backgrounds to share their experiences on issues related to employment through conferences and panels. Dealing with the topic \"Dare! And Make your dreams come true”, the FEEF 2018 has kept its promises this year. A fashion show and fireworks marked the closure of this 5th edition.</p>\r\n',0,'21474848481525351152.jpg','2018-03-16 16:51:27',NULL,2147484848,'1'),(4,'CÔTE D\'IVOIRE : RÉFLEXION SUR LE DIGITAL À L\'AFRICA DIGITAL MONEY AND BANKING','','<p>Les 16 et 17 mars 2018, SUNU Assurances Vie CI a « Osé » en étant le partenaire de la 5ème édition du Forum de l’Emploi et de l’Entreprenariat Féminin « FEEF2018 ». Deux jours de festivités qui ont permis aux femmes venues de différents horizons de partager leurs expériences sur des problématiques liées à l’emploi à travers conférences et panels. Avec pour thème : « Osez ! Et Réalisez vos rêves », le FEEF 2018 a tenu encore ses promesses cette année. Un défilé de mode et un feu d’artifice ont permis de refermer les portes de cette 5ème édition.</p>\r\n','',0,'21474848481525351213.jpg','2018-03-16 11:44:26',NULL,2147484848,'1'),(5,'TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES','TOGO: SUNU ASSURANCES COMPANIES VISITED SURVEYORS','<p>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé. Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n','<p>In order to forge strong relationships with their partners, SUNU Assurances companies of Togo accompanied the meeting of Togolese surveyors held from the 7th to the 9th of March at Sarakawa Hotel in Lomé. Known as \"The French-speaking Universities of Surveyors\", this meeting was intended to enable exchanges between Togolese surveyors and their counterparts from other French-speaking countries. The discussions mainly focused on the profession and the role of surveyors in sustainable development. This event was an appropriate occasion for SUNU Group’s Life and General Insurance subsidiaries of Togo to present their best insurance offers.</p>\r\n',0,'21474848481525351428.jpg','2018-03-09 11:59:12',NULL,2147484848,'1'),(6,'LA BPEC REJOINT OFFICIELLEMENT LE GROUPE SUNU','BPEC OFFICIALLY JOINS SUNU GROUP','<p>Le mercredi 09 mai 2018, clients, partenaires et médias étaient dans les locaux de la Banque Populaire de l’Épargne et du Crédit (BPEC) du Togo pour prendre part à un petit déjeuner convivial. L&#39;objet de cette rencontre était l&#39;annonce officielle de l&#39;entrée de la BPEC dans le Groupe SUNU. Après l’intervention de M. Christophe LASSUS-LALANNE, DG de la BPEC, M. Razack FASSASSI, DG de SUNU Assurances Vie Togo a, au nom du Groupe SUNU, édifié les invités sur les intérêts de cette nouvelle acquisition pour les entreprises et les populations. La BPEC, première banque du Groupe SUNU, permettra d&#39;offrir des produits packagées banque & assurance plus accessibles en un lieu unique.</p>\r\n','<p>On Wednesday, May 09, 2018, customers, partners and media were in the premises of the Banque Populaire de l&#39;Épargne et du Crédit (BPEC) of Togo to take part in a convivial breakfast. The purpose of this meeting was the official announcement of BPEC&#39;s entry into SUNU Group. After the speech of Mr. Christophe LASSUS-LALANNE, CEO of BPEC, Mr. Razack FASSASSI, CEO of SUNU Assurances Vie Togo, on behalf of SUNU Group, enlightened the guests on the interests of this new acquisition for businesses and populations. BPEC, the first bank of SUNU Group, will offer more accessible packaged banking and insurance products in one place.</p>\r\n',0,'bpec_sunu_actu.jpg','2018-05-09 15:49:23','0000-00-00 00:00:00',2147484848,'1'),(7,'SUNU ASSURANCES AU SOMMET DU CHOISEUL AFRICA SUMMIT','SUNU ASSURANCES AT THE CHOISEUL AFRICA SUMMIT','<p>Le 4 et 5 mai 2018, une délégation de SUNU Assurances était au sommet CHOISEUL SUMMIT AFRICA qui s’est tenu à Abidjan. Une rencontre de jeunes leaders qui a drainé des managers venus de pays d’Afrique et de l’Europe pour faciliter les échanges et partager leurs expériences. La première journée a été marquée par une rencontre avec les autorités gouvernementales en particulier avec son Excellence M. Daniel Kablan DUNCAN, Premier Vice-Président de la République de Côte d’Ivoire. Plus tard, M. Mohamed BAH, Directeur Général Délégué du Groupe SUNU a pris part à un panel où il a fait un bref résumé de la « success story » de SUNU Assurances qui reste un modèle de réussite africaine. Les rencontres se sont ainsi poursuivies au lendemain pour prendre fin avec un diner gala.</p>\r\n','<p>On 4 and 5 May 2018, a delegation of SUNU Assurances was at the CHOISEUL AFRICA SUMMIT held in Abidjan. A meeting of young leaders that attracted managers from African and European countries in order to facilitate exchanges and experience sharing. The first day was marked by a meeting with the government authorities in particular with his Excellency Mr. Daniel Kablan DUNCAN, First Vice-President of the Republic of Côte d&#39;Ivoire. Later, Mr. Mohamed BAH, Deputy Managing Director of SUNU Group took part in a panel where he made a brief summary of the \"success story\" of SUNU Assurances which remains a model of African success. The meetings continued the next day and ended with a gala dinner.</p>\r\n',0,'sunu_choiseul.jpg','2018-05-04 10:47:40','0000-00-00 00:00:00',2147484848,'1'),(8,'BURKINA FASO : 12ÈME TIRAGE DE LAFIA AVEC SUNU ASSURANCES VIE BURKINA FASO ET ORABANK','BURKINA FASO: THE 12TH PRIZE DRAW OF “LAFIA” WITH SUNU ASSURANCES VIE BURKINA FASO and ORABANK','<p>Pour Le 12ème tirage du produit d’épargne « LAFIA», SUNU Assurances Vie Burkina Faso et ORABANK ont donné rendez-vous à leurs clients le jeudi 15 mars 2018. Une rencontre qui a fait d’heureux gagnants avec au total 24 numéros tirés. Occasion propice pour les représentants de SUNU Assurances Vie Burkina Faso d’expliquer le fonctionnement du produit qui offre chaque trimestre aux titulaires de comptes ORABANK la possibilité d’être millionnaire.</p>\r\n','<p>For the 12th prize draw of the savings product \"LAFIA\", SUNU Assurances Vie Burkina Faso and ORABANK have met with their clients on Thursday, March 15, 2018. This meeting has made some happy winners with a total of 24 numbers drawn for the prize. This has been a good opportunity for representatives of SUNU Assurances Vie Burkina Faso to explain how the product works. “LAFIA” is a product that offers every quarter to ORABANK account holders the chance to become millionaire.</p>\r\n',0,'lafia1.jpg','2018-03-15 12:01:56','0000-00-00 00:00:00',2147484848,'1'),(9,'SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE','SUNU ASSURANCES VIE COTE D’IVOIRE ATTENDED DELOITTE MEETINGS','<p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018,dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY, Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n','<p>SUNU Assurances Vie Benin received two awards for participating in the decoration of the city of Cotonou. It was on Thursday, February 15, 2018, in the premises of the subsidiary that the managers of the communication company Effet Media, initiator of the project, presented to Mr. Lassina COULIBALY, Managing Director of SUNU Assurances Vie Benin, the Certificate of Recognition for its participation in the illumination of the city and the \"Prix Lumière\" for the best decoration 2017. Note that this distinction was granted after a popular vote and the deliberation of a jury of experts composed of professionals of decoration. Congratulations to SUNU Assurances Vie Benin, leader of Life insurance in the country.</p>\r\n',0,'sunu_deloitte.jpg','2018-03-06 12:04:14','0000-00-00 00:00:00',2147484848,'1'),(10,'SUNU ASSURANCES VIE BÉNIN HONORÉE','SUNU ASSURANCES VIE BENIN HONOURED','<p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018, dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY </p>\r\n\r\n<p>Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n','<p>SUNU Assurances Vie Benin received two awards for participating in the decoration of the city of Cotonou. It was on Thursday, February 15, 2018, in the premises of the subsidiary that the managers of the communication company Effet Media, initiator of the project, presented to Mr. Lassina COULIBALY, Managing Director of SUNU Assurances Vie Benin, the Certificate of Recognition for its participation in the illumination of the city and the \"Prix Lumière\" for the best decoration 2017. Note that this distinction was granted after a popular vote and the deliberation of a jury of experts composed of professionals of decoration. Congratulations to SUNU Assurances Vie Benin, leader of Life insurance in the country.</p>\r\n',0,'prix_bnin.jpg','2018-02-15 12:06:12','0000-00-00 00:00:00',2147484848,'1'),(11,'SUNU ASSURANCES VIE BURKINA FASO PROCÈDE AU 13ÈME TIRAGE AU SORT DU PRODUIT ','SUNU ASSURANCES VIE BURKINA FASO HOLD THE 13TH DRAW FOR “ATLANTIQUE FORTUNE”','<p>SUNU Assurances Vie Burkina Faso et son partenaire Banque Atlantique ont effectué le 13ème  tirage du produit « Atlantique Fortune » le jeudi 15 février. En présence des responsables des deux entités et de quelques clients, le tirage a permis de récompenser 24 numéros de police. « Atlantique Fortune » est ouvert aux titulaires d’un compte à la Banque Atlantique et permet au souscripteur de se constituer une épargne à partir de 5 500 F CFA et d’avoir la possibilité d’être tiré au sort chaque trimestre pour gagner jusqu’à 6 000 000 F CFA.</p>\r\n','<p>SUNU Assurances Vie Burkina Faso and its partner Banque Atlantique have made the 13th draw of the « Atlantique Fortune » product on Thursday, February 15. In the presence of officials from both entities and some customers, the draw rewarded 24 police holders. \"Atlantique Fortune\" is open to holders of an account at Banque Atlantique and enables the subscriber to build up a saving from 5500 FCFA and to have the quarterly opportunity to win up to 6,000,000 FCFA.</p>\r\n',0,'tirag_atF_bf.jpg','2018-02-15 12:07:23','0000-00-00 00:00:00',2147484848,'1'),(12,'LE GROUPE SUNU À KIGALI POUR LA 42ÈME RENCONTRE ANNUELLE DE LA FANAF','SUNU GROUP IN KIGALI FOR THE 42nd ANNUAL MEETING OF FANAF ','<p>Pour leur 42ème rencontre annuelle, les responsables du secteur de l’assurance des pays africains sont réunis depuis ce lundi 12 février 2018 à Kigali (Rwanda) pour l’assemblée générale annuelle de la FANAF. Les dirigeants du Groupe SUNU ainsi que les acteurs de l’assurance auront jusqu’au 15 février 2018 pour échanger sur le thème : « L’assurance Africaine à l’épreuve de la disruption ». 4 jours de réflexions marqués par des panels et conférences pour trouver des solutions plus adaptées pour le bon fonctionnement de l’assurance en Afrique et pour le bien-être des populations.</p>\r\n','<p>The managers of the insurance sector of African countries are in session since Monday, February 12, 2018, in Kigali (Rwanda) for the 42<sup>nd</sup> annual general meeting of FANAF. The leaders of SUNU Group as well as the actors of insurance have until 15 February 2018 to debate on the topic \"African insurance sector facing disruption\". These four days of reflections, marked by panels and conferences, are intended to find more suitable solutions for the good functioning of insurance in Africa and for the well-being of the populations.</p>\r\n',0,'fanaf.jpg','2018-02-12 12:27:51','0000-00-00 00:00:00',2147484848,'1'),(13,'3ÈME ÉDITION DU TOURNOI DE GOLF SUNU ASSURANCES AU BURKINA FASO','3rd EDITION OF THE GOLF TOURNAMENT OF SUNU ASSURANCES IN BURKINA FASO','<p>Pour la 3ème  édition du tournoi de Golf SUNU Assurances du Burkina Faso, amateurs et professionnels de Golf se sont réunis les 10 et 11 Février 2018 sur l’aire de jeux du Golf Club de Ouagadougou. Sponsorisé depuis 3 ans par les sociétés SUNU Assurances du Burkina Faso, la mobilisation était de taille cette année et a permis de resserrer les liens avec les différents partenaires présents. Deux jours de compétitions qui ont permis de déceler de nouveaux talents et de récompenser les meilleurs joueurs parmi lesquels, M. Jean François KAMBOU, Directeur Général de SUNU Assurances Vie Burkina Faso.</p>\r\n','<p>For the 3rd edition of SUNU Assurances golf tournament of Burkina Faso, golf amateurs and professionals met on 10 and 11 February 2018 on the playground of the Golf Club of Ouagadougou. For 3 years, SUNU Assurances companies of Burkina Faso have been sponsoring the tournament. This year, the mobilisation was strong and permitted to strengthen the relations with the participating partners. Two days of competitions have allowed to detect new talents and to reward the best players among which, Mr. Jean François KAMBOU, Managing Director of SUNU Assurances Vie Burkina Faso.</p>\r\n',0,'golf_bf.jpg','2018-02-10 12:30:23','0000-00-00 00:00:00',2147484848,'1'),(14,'LES SOCIÉTÉS SUNU ASSURANCES DU GABON AU SALON DE LA JOURNÉE ECONOMIQUE 2018','THE COMPANIES SUNU ASSURANCES OF GABON WERE AT THE ECONOMIC DAY FAIR','<p>Au Gabon, les sociétés SUNU Assurances ont pris part au salon de la journée économique organisée chaque année par le Ministère gabonais de l’économie. Le salon s’est déroulé toute la journée du 7 février 2018 à l’auditorium de l’immeuble Arambo de Libreville.</p>\r\n\r\n<p>Cette année, une attention particulière a été accordée au secteur de l’assurance et avait pour thème : « Restaurer la confiance ». Après les panels, place à la visite des stands où les Ministres de l’économie, du travail et des PME de passage à l’espace SUNU Assurances ont bénéficié de la présentation des filiales du Gabon et des offres qu’elles proposent.</p>\r\n','<p>In Gabon, SUNU Assurances companies took part in the Economic Day Fair organised every year by the Gabonese Ministry of Economy. The show was held throughout the day on 7 February 2018 at the auditorium of Arambo building in Libreville.</p>\r\n\r\n<p>This year, special attention was given to the insurance sector and the event dealt with the topic “Restoring trust”. After the panels, the Ministers of Economy, Labor and SMEs visited the stand of SUNU Assurances where they were presented the Gabonese subsidiaries and the services they offer.</p>\r\n',0,'JE_cam.jpg','2018-02-07 12:35:25','0000-00-00 00:00:00',2147484848,'1'),(15,'LES HOMMES DE SUNU ASSURANCES VIE CI À LEUR TRADITIONNEL KICK OFF','THE STAFF OF SUNU ASSURANCE VIE COTE D’IVOIRE HELD THEIR TRADITIONAL KICK-OFF ','<p>Chaque année, les Hommes de SUNU Assurances Vie CI organisent leur traditionnel kick off. Au cours de la dernière rencontre qui s’est tenue le samedi 27 janvier 2018, le Directeur Général, M. Saliou BAKAYOKO a fait le bilan des activités 2017 et présenté le plan stratégique avec des travaux de réflexions et des ateliers sur différents thèmes.</p>\r\n\r\n<p>Puis dans une chaleureuse ambiance, les équipes motivées et optimistes pour l&#39;atteinte des objectifs, ont partagé un repas convivial et participé à des jeux.</p>\r\n','<p>Every year, the employees of SUNU Assurances Vie COTE D’IVOIRE organise their traditional kick off. During the last meeting held on Saturday, January 27, 2018, the Managing Director, Mr. Saliou BAKAYOKO made a review of 2017 activities and presented the new strategic plan. This was accompanied by reflections and workshops on various topics.<br>\r\nAfterwards, in a pleasant atmosphere, the teams which were motivated and optimistic about the achievement of their goals, shared a convivial meal and participated in various games.</p>\r\n',0,'21474848481526301679.jpg','2018-01-27 12:37:21','0000-00-00 00:00:00',2147484848,'1'),(16,'EQUITY ASSURANCES PLC NIGERIA, LA MARCHE ENGAGÉE CONTRE LE CANCER DU COL DE L\'UTÉRUS','EQUITY ASSURANCES PLC NIGERIA ENGAGED IN THE FIGHT AGAINST CERVICAL CANCER','<p>La marche sportive annoncée d’Equity Assurances Plc Nigeria, filiale du Groupe SUNU en soutien à The Optimal Cancer Care Foundation a connu un grand succès. Le samedi 27 janvier dernier, des femmes et des hommes venus des différents quartiers de la capitale Nigériane pour accompagner cette initiative.</p>\r\n\r\n<p>Les rues de la ville étaient bondées de bénévoles aux côtés du personnel d&#39;Equity Assurances pour sensibiliser les populations sur les risques de cette maladie.</p>\r\n','<p>The sporting walk organised by Equity Insurance Plc Nigeria, a subsidiary of SUNU Group, in support of The Optimal Cancer Care Foundation, was a great success. On Saturday, January 27, women and men came from different parts of the Nigerian capital to support this initiative.</p>\r\n\r\n<p>The streets of the city were crowded with volunteers alongside Equity Insurance staff to raise awareness of the risks of this disease.</p>\r\n',0,'marche_sant_equity.jpg','2018-01-27 17:04:24','0000-00-00 00:00:00',2147484848,'1'),(17,'SUNU ASSURANCES VIE CI CONVIE SES GOLDEN COSTUMER À UN DÎNER','SUNU ASSURANCES VIE COTE D’IVOIRE INVITED THEIR GOLDEN CUSTOMERS FOR A DINNER','<p>Pour témoigner sa reconnaissance envers sa fidèle clientèle, la direction de SUNU Assurances Vie CI a célébré le 25 janvier 2018, ses clients et partenaires à l’Heden Golf Club Abidjan au cours d’un diner dénommé « Golden Customer »</p>\r\n\r\n<p>En présence de M. Saliou BAKAYOKO, Directeur Général de la société et son Directeur Central Opérationnel, M. Gildas NZOUBA, cette soirée a été marquée par des distinctions avec la remise du diplôme d’honneur aux clients présents et celle du « Trophée de la fidélité » aux trois plus fidèles clients de SUNU Assurances Vie CI depuis plus de 20 ans.</p>\r\n','<p>To express its gratitude to its loyal customers, the management of SUNU ASSURANCES VIE COTE D’IVOIRE celebrated its customers and partners at the Heden Golf Club in Abidjan on 25 January 2018 during a dinner called \"Golden Customer\".</p>\r\n\r\n<p>In the presence of Mr. Saliou BAKAYOKO, Managing Director of the company and Mr. Gildas NZOUBA, the Central Operational Director, this evening has seen distinctions awarded to customers. The participating customers were awarded with a diploma of honour and the three most loyal customers with more than 20 years subscription were given the “trophy of loyalty\".</p>\r\n',0,'dej_clien_vie1.jpg','2018-01-25 17:06:51','0000-00-00 00:00:00',2147484848,'1'),(18,'CÔTE D\'IVOIRE : SUNU ASSURANCES VIE CI À LA CÉRÉMONIE DE PRÉSENTATION DE VŒUX DE L\'ONMCI','COTE D’IVOIRE: SUNU ASSURANCE VIE COTE D’IVOIRE ATTENDED THE CEREMONY OF NEW WISHES OF “ONMCI”','<p>Le jeudi 25 janvier 2018, une délégation de SUNU Assurances Vie CI prenait part à la cérémonie de présentation de vœux de l’Ordre National des Médecins de Côte d’Ivoire « ONMCI ». M. Thierry Brou KOUADIO, Directeur Central Fonctionnel de SUNU Assurances Vie CI, après une brève présentation de la compagnie a donné ses motivations à cette cérémonie.</p>\r\n\r\n<p> La cérémonie s’est déroulée en présence du représentant du Ministre de la santé et s’est poursuivie par une visite de stands où les invités ont bénéficié des conseils des commerciaux SUNU pour plus de souscriptions.</p>\r\n','<p>On Thursday, 25 January 2018, a delegation of SUNU Assurances Vie CI took part in the ceremony of new year wishes presentation of the national medical association of Côte d&#39;Ivoire (ONMCI). </p>\r\n\r\n<p>Mr. Thierry Brou KOUADIO, Central Functional Director of SUNU Assurances Vie CI, after a brief presentation of the company gave the reasons behind the presence of the company at this ceremony.</p>\r\n\r\n<p>The ceremony took place in the presence of the representative of the Minister of Health and was followed by a visit of the stands where guests received advice from SUNU’s sales team for more subscriptions.</p>\r\n',0,'voeux_onmci.jpg','2018-01-25 17:06:07','0000-00-00 00:00:00',2147484848,'1'),(22,'LES SOCIÉTÉS SUNU ASSURANCES DU TOGO ACCOMPAGNENT LA 4ÈME ÉDITION DU FEST\'IMMO','THE COMPANIES SUNU ASSURANCES OF TOGO BACKED THE 4TH EDITION OF FEST’IMMO','<p>Au Togo, la 4ème édition du Festival de l’immobilier « FEST’IMMO » s’est déroulée du 11 au 13 Mai 2018 avec la participation de SUNU Assurances IARD Togo comme partenaire. Cette année encore, différents exposants dont les banques, cabinets d’architecture, sociétés immobilières, sociétés d’assurance etc. sont venus enrichir le quotidien des visiteurs. Pour SUNU Assurances, ce fut l’occasion de présenter certains produits comme l’assurance multirisques Habitation, Tous risques chantier et la Responsabilité Civile. </p>\r\n','<p>In Togo, the 4th edition of the Real Estate Festival \"FEST&#39;IMMO\" took place from 11 to 13 May 2018 with the participation of SUNU Assurances IARD Togo as a partner. This year again, different exhibitors including banks, architectural firms, real estate companies, insurance companies, etc. have enriched the daily lives of participants. For SUNU Assurances, it was an opportunity to present some products such as home multi-risk, construction all risks and civil liability insurances.</p>\r\n',0,'festimoo_tog.jpg','2018-05-11 15:48:46','0000-00-00 00:00:00',2147484848,'1'),(19,'POSE DE LA PREMIÈRE PIERRE DU NOUVEAU SIÈGE SUNU ASSURANCES AU BURKINA FASO','LAYING OF THE FIRST FOUNDATION STONE OF SUNU ASSURANCES BURKINA FASO NEW HEAD OFFICE','<p>Bientôt un nouveau siège pour SUNU Assurances dans la capitale Burkinabé. Cette information a été rendue officielle le jeudi 4 janvier 2018 lors de la cérémonie de pose de la première pierre qui marque le début des travaux de construction du bâtiment.</p>\r\n\r\n<p>M. Seydou DIAKITE, PCA des sociétés SUNU Assurances du Burkina Faso était accompagné par Messieurs Osée G. QUENUM et François KAMBOU, DG respectifs de SUNU Assurances IARD Burkina Faso et SUNU Assurances Vie Burkina Faso pour le déroulement de cette cérémonie.</p>\r\n','<p>Soon, SUNU Assurances will have a new head office in the capital of Burkina Faso. This information was officially released on Thursday, January 4, 2018 during the ceremony of the laying of the foundation stone which marks the beginning of the construction of the building.</p>\r\n\r\n<p>At this ceremony, Mr. Seydou DIAKITE, Chairman of SUNU Assurances of Burkina Faso was accompanied by Messrs. Osée G. QUENUM and François KAMBOU, respectively Managing Directors of SUNU Assurances IARD Burkina Faso and SUNU Assurances Vie Burkina Faso.</p>\r\n',0,'bf_new_sige.jpg','2018-01-04 12:49:14','0000-00-00 00:00:00',2147484848,'0'),(20,'L\'EX CAMINSUR DEVENUE SUNU ASSURANCES IARD CAMEROUN','EX-CAMINSUR BECOMES SUNU ASSURANCES IARD CAMEROON','<p>Pour son entrée dans le Groupe SUNU, l&#39;ex CAMINSUR devenue SUNU Assurances IARD Cameroun a revêtu son siège dans les couleurs du Groupe. A Douala, précisément à la rue Narvik, ne soyez pas déroutés, restez toujours en de bonnes mains dans les locaux de la nouvelle filiale SUNU Assurances.</p>\r\n','<p>Following its entry into SUNU Group, ex-CAMINSUR’s head office has now been rebranded with the colours of the Group. In Douala, precisely on Narvik Street, do not feel confused! you are still in good hands in the premises of the new subsidiary, SUNU Assurances.</p>\r\n',0,'sige_sunu_iard_camv2.jpg','2018-01-04 17:07:50','0000-00-00 00:00:00',2147484848,'1'),(21,'SUNU ASSURANCES SPONSOR DE LA 39ÈME ÉDITION DU SABRE NATIONAL DU NIGER','SUNU ASSURANCES, SPONSOR OF THE 39TH EDITION OF “SABRE NATIONAL DU NIGER','<p>Pendant 10 jours, les sociétés SUNU Assurances du Niger étaient à Zinder, à 900 Km de Niamey pour la 39ème édition du sabre national du Niger. Les compétitions à fortes valeurs culturelles et traditionnelles ont débuté le 25 décembre 2017 et ont marqué leur apothéose le mercredi 3 janvier 2018. SUNU Assurances était présente pour échanger, sensibiliser et proposer ses offres aux populations venues des quatre coins du pays.</p>\r\n','<p>For 10 days, SUNU Assurances companies of Niger were in Zinder, 900 km away from Niamey for the 39th edition of “Sabre National du Niger”. The contests with strong cultural and traditional values connotations began on 25 December 2017 and reached their apotheosis on Wednesday, January 3, 2018. SUNU Assurances was there to discuss, raise awareness and promote its offers to people from all over the country.</p>\r\n',0,'zinder_niger.jpg','2018-01-03 12:51:03','0000-00-00 00:00:00',2147484848,'0'),(23,'CÔTE D\'IVOIRE : UN PAS DE PLUS À LA 10 ÈME ÉDITION DU SILA AVEC SUNU ASSURANCES','COTE D’IVOIRE: AN EXTRA STEP DURING THE 10TH EDITION OF SILA WITH SUNU ASSURANCES','<p>Pour la 10ème édition du Salon International du Livre d’Abidjan (SILA), les sociétés SUNU Assurances de Côte d’Ivoire ont donné rendez-vous aux écrivains et amoureux du livre du 16 au 20 Mai 2018 au palais de la culture de Treichville. A cette rencontre de l’industrie du livre qui a vu bon nombre d’écrivains primés, M. Saliou BAKAYOKO, DG de SUNU Assurances Vie CI a animé un panel sur le thème : « Livre et Economie ». Il a ensuite entretenu les participants sur la discipline de l’Actuariat et sur des notions propres au métier de l’assurance méconnues du grand public.</p>\r\n','<p>During the 10th edition of the International Book Fair of Abidjan (SILA), SUNU Assurances companies of Cote d’Ivoire met writers and book lovers from 16 to 20 May 2018 at the Palace of Culture (Palais de la culture) located in Treichville. At this meeting of the Book industry, which saw many award-winning writers, Mr. Saliou BAKAYOKO, CEO of SUNU Assurances Vie CI led a panel on the topic \"Book and Economy\". He then spoke to the participants about the discipline of Actuarial Science and about notions of the insurance profession that are not well known to the general public.</p>\r\n',0,'sila_abj.jpg','2018-05-16 10:42:33','0000-00-00 00:00:00',2147484848,'1'),(24,'LES SOCIÉTÉS SUNU ASSURANCES DE CI FONT UN RETOUR AUX VALEURS AVEC AFRIQUE CONSCIENTE','THE COMPANIES SUNU ASSURANCES OF COTE D’IVOIRE HAVE MADE A RETURN TO VALUES WITH « AFRIQUE CONSCIENTE »','<p>En Côte d’Ivoire, les sociétés SUNU Assurances ont fait un « Retour aux valeurs » en accompagnant le mouvement « Afrique Consciente » lors des premières Universités de la Société Civique Africaine qui se sont tenues le 19 Mai 2018, au Sofitel Hôtel Ivoire. Cette grande première a permis de connaitre « l’histoire de l’Afrique, ses inerties, les Success-stories de la société civique en Afrique et les opportunités de l’Afrique. Et cela à travers des hommes engagés tels que Denise EPOTE, Séry BAILLY, Alain FOKA qui étaient parmi les panelistes de cette rencontre. Ce fut un bel évènement auquel SUNU Assurances, groupe conscient des valeurs africaines n’a voulu rester en marge pour participer aussi aux challenges d’un meilleur avenir du continent africain.</p>\r\n','<p>In Côte d’Ivoire, the companies SUNU Assurances have made a « return to values » by supporting the movement « AFRIQUE CONSCIENTE » during the first Universities of the African Civic Society held on 19 May 2018 at Sofitel Hotel Ivoire. This occasion, the first of its kind, shed light on “the history of Africa, its inertias, the success stories of the civic society in Africa and the opportunities of Africa”. This was achieved through committed people such as Denise EPOTE, Sery BAILLY, Alain FOKA who were among the panellists of this meeting. SUNU Assurances, conscious of African values, did not want to stay on the sidelines of such a great event. It therefore participated in these challenges for a better future for the African continent.</p>\r\n',0,'afrique_consciente.jpg','2018-05-19 15:46:42','0000-00-00 00:00:00',2147484848,'1'),(25,'GROUPE SUNU : Le Groupe au  Brokerslink Africa Forum 2018','SUNU GROUP AT THE BROKERSLINK AFRICA FORUM 2018','<p>Le jeudi 19 juillet 2018, SUNU Assurances a participé au Brokerslink Africa Forum, qui a eu lieu au Sofitel Hôtel Ivoire. M. Faustin ATEBI-ZIRIGA, Directeur Général de SUNU Assurances IARD CI et Mlle Déborah GNAGNE, Directeur du Développement Commercial ont présenté le Groupe SUNU aux courtiers membres du réseau Brokerslink. <br>\r\nPar la suite, SUNU Assurances a offert un diner ethnique. Hôtes et convives ont soufflé ensemble les bougies marquant les 20 ans du Groupe SUNU. Ce fut un moment bien apprécié qui a permis à chacun d’exprimer sa joie à travers des pas de danse et remises de lots cadeaux et goodies.</p>\r\n','<p>On Thursday, July 19, 2018, SUNU Assurances participated in the Brokerslink Africa Forum, which took place at Sofitel Hotel Ivoire. Mr. Faustin ATEBI-ZIRIGA, Managing Director of SUNU Assurances IARD CI and Miss Déborah GNAGNE, Director of Business Development presented SUNU Group to brokers who are members of Brokerslink network.<br>\r\nAfterwards, SUNU Assurances offered an ethnic dinner. Hosts and guests together blew out the candles commemorating the 20th anniversary of SUNU Group. It was an enjoyable moment that allowed everyone to express their joy through dance moves, gifts and goodies.</p>\r\n',0,'img1.jpg','2018-07-19 10:36:38','0000-00-00 00:00:00',2147204895,'1'),(26,'TEST','','<p>test</p>\r\n','',0,'img11.jpg','2018-07-27 09:40:11','0000-00-00 00:00:00',2147204895,'3'),(27,'Côte d\'Ivoire : Campagne produit VISA ETUDES PLUS','Côte d\'Ivoire : Product Campaign VISA ETUDES PLUS','<p>Du 01 au 09 Septembre 2018, s’est tenue la campagne du produit « VISA ETUDES PLUS ».<br>\r\nComme tous les ans, en période de pré-rentrée scolaire, SUNU Assurances Vie Côte d’Ivoire organise une promotion de son produit VISA ETUDES PLUS qui garantit les études de votre enfant même si vous n’êtes plus là.<br>\r\nCette campagne s’est déroulée sous forme d’activation dans plusieurs centres commerciaux et librairies de renom à Abidjan.</p>\r\n','<p>From 01 to 09 September 2018, the campaign of the product \"VISA ETUDES PLUS\" was held. As every year, in the period of pre-school, SUNU Assurances Vie Côte d’Ivoire organizes a promotion of its product VISA ETUDES PLUS which guarantees the studies of your child even if you are not there any more. This campaign took place in the form of activation in several shopping malls and renowned bookshops in Abidjan.</p>\r\n',0,'campvep20180.jpg','2018-09-19 09:04:52','0000-00-00 00:00:00',2147204895,'1'),(28,'Equity Assurance Liberia Ltd. devient SUNU Assurances','Equity Assurance Liberia Ltd. becomes SUNU Assurances','<p>Equity Assurance Liberia Ltd., filiale libérienne du Groupe SUNU, a officiellement changé de nom au cours de la cérémonie de rebranding qui a eu lieu le mercredi 19 septembre 2018 au City Hall. C’est en présence de nombreuses personnalités comme les Sénateurs, Représentants des Ministères des Finances et du Commerce, de la Chambre de Commerce, de l’association des chefs d’entreprise, des hommes d’affaires et DG de sociétés bancaires et d’assurance, tous les courtiers du marché, la police, les chefs religieux, le président de la presse et tous les médias que Equity Assurance Liberia Ltd. est devenue SUNU Assurances Liberia Ltd.</p>\r\n','<p>Equity Assurance Liberia Ltd., a Liberian subsidiary of the SUNU Group, officially changed its name during the rebranding ceremony held on Wednesday, September 19, 2018 at City Hall. This is in the presence of many personalities such as Senators, Representatives of the Ministries of Finance and Commerce, the Chamber of Commerce, the Association of Business Leaders, businessmen and CEO of banking companies and insurance, all market brokers, police, religious leaders, the president of the press and all media that Equity Assurance Liberia Ltd. became SUNU Insurance Liberia Ltd.</p>\r\n',0,'1.jpg','2018-09-20 16:48:05','0000-00-00 00:00:00',2147204895,'1'),(29,'Célébration du 20ème client','Celebration of the 20th customer','<p>Pour célébrer son 20ème anniversaire, les différentes filiales du Groupe SUNU ont décidé de récompenser leurs 20èmes clients tous les 20 du mois dans les sièges et agences. C’est ainsi qu’ils ont bénéficié de bilans de santé gratuits, de complets de pagnes, de moutons (à l’occasion de la Tabaski) et de cadeaux lors de coupures et dégustations surprises de gâteaux dans les sociétés SUNU Assurances du Niger, de la Côte d’Ivoire, du Togo et du Sénégal. Les 20 de chaque mois, célébrons ensemble nos 20 ans d’assurance.</p>\r\n','<p>To celebrate its 20th anniversary, the various subsidiaries of the SUNU Group have decided to reward their 20th customers every 20 months in the offices and agencies. This is how they benefited from free health check-ups, complete pagnes, sheep (on the occasion of the Tabaski) and gifts during cuts and surprise cake tastings in the SUNU Assurances of Niger companies, from Côte d&#39;Ivoire, Togo and Senegal. The 20th of each month, let&#39;s celebrate together our 20 years of insurance.</p>\r\n',0,'20ans.jpg','2018-09-20 18:51:13','0000-00-00 00:00:00',2147204895,'1'),(30,'Côte d\'Ivoire : SUNU Assurances sponsor de la 2ème édition du SADA','Côte d\'Ivoire : SUNU Assurances sponsor of the 2nd edition of the SADA','<p>SUNU Assurances a participé à la 2ème édition du SADA (Salon Africain des Assurances) qui s’est tenue les 27, 28 et 29 septembre 2018. Les sociétés d’assurances et les représentants des consommateurs présents à cet évènement, ont animé des panels autour du thème « Qu’est-ce que l’assurance ? » M. ATEBI-ZIRIGA, DG de SUNU Assurances IARD CI et M. Saliou BAKAYOKO, DG de SUNU Assurances Vie CI ont présenté le Groupe SUNU à l’assemblée tout en l’invitant à visiter le stand de SUNU Assurances et encouragé les initiateurs du SADA à la pérennisation du salon. Le prix SADA 2018 de la 1ère Compagnie en Assurance Vie a été décerné à SUNU Assurances Vie CI.</p>\r\n','<p>SUNU Assurances took part in the 2nd edition of the SADA (Salon Africain des Assurances) held on 27, 28 and 29 September 2018. Insurance companies and consumer representatives present at this event, led panels around of the theme \"What is insurance? Mr. ATEBI-ZIRIGA, CEO of SUNU Assurances IARD CI and Mr. Saliou BAKAYOKO, CEO of SUNU Assurances Vie CI presented the SUNU Group to the assembly while inviting him to visit the stand of SUNU Assurances and encouraged the initiators from SADA to the sustainability of the show. The SADA 2018 Award of the 1st Life Assurance Company was awarded to SUNU Assurances Vie CI.</p>\r\n',0,'sada.jpg','2018-10-09 09:38:14','0000-00-00 00:00:00',2147204895,'1'),(31,'Côte d\'Ivoire : Campagne Produit BELEMI Scolarité','Campaign Product BELEMI Scolarité','<p><span xss=removed>Le mercredi 19 septembre 2018, SUNU Assurances Vie CI en partenariat avec CMAC Assurances (Cabinet Moaye de Courtage d&#39;Assurance) a entamé la campagne du produit BELEMI Scolarité Assurances, au sein de plusieurs établissements scolaires du district d’Abidjan. Ce produit permet de couvrir les frais de scolarité restant à payer pour un ou plusieurs enfant(s) scolarisé(s) en cas de décès du parent. Par cette campagne de proximité, SUNU Assurances vise avant tout à se rapprocher des parents d’élèves et aussi à mieux faire connaître BELEMI Scolarité Assurance. Ces activités achèveront le mercredi 03 octobre 2018. </span></p>\r\n','<p><span xss=removed>On Wednesday, September 19, 2018, SUNU Assurances Vie CI in partnership with CMAC Assurances (Cabinet Moaye de Coutarge d&#39;Assurance) began the campaign BELEMI Scolarité Assurances, in several schools in the district of Abidjan. This product covers the tuition fees still to be paid for one or more child (ren) enrolled in the event of the death of the parent. Through this local campaign, SUNU Assurances aims above all to get closer to the parents of students and also to raise awareness of BELEMI Scolarité Assurance. These activities will end on Wednesday 03 October 2018.</span></p>\r\n',0,'belemi2018.jpg','2018-10-09 10:46:52','0000-00-00 00:00:00',2147204895,'1'),(32,'Groupe SUNU : Participation au Brokerslink\'s Risk Management Forum','SUNU Group : Participation in the Brokerslink\'s Risk Management Forum','<p>SUNU Assurances a pris part au forum du Brokerslink&#39;s Risk Management Forum en tant que sponsor Or. Cette édition qui se déroule à Hong Kong, depuis le jeudi 11 octobre 2018 a réuni les gestionnaires de risques du monde entier pour discuter des tendances clés de la gestion des risques et partager leurs connaissances.</p>\r\n\r\n<p>M. Mohamed BAH, Directeur Général Délégué à SUNU Participations Holding SA, M. Osée QUENUM Directeur Général de SUNU Assurances IARD Burkina Faso et Mme Déborah GNAGNE, Directeur du Développement Commercial du Groupe SUNU ont participé à ce forum pour trouver les meilleurs moyens d’offrir aux organisations et aux populations africaines sécurité et protection dans la réalisation de leurs projets.</p>\r\n','<p>SUNU Assurances took part in the Brokerslink&#39;s Risk Management Forum as a Gold Sponsor. This edition, which has been taking place in Hong Kong since Thursday, October 11, 2018, brought together risk managers from around the world to discuss key risk management trends. and share their knowledge. Mr. Mohamed BAH, Deputy Managing Director at SUNU Participations Holding SA, Mr. Osée QUENUM General Manager of SUNU Assurances IARD Burkina Faso and Mrs. Déborah GNAGNE, Director of Business Development of SUNU Group participated in this forum to find the best ways to to offer African organizations and populations security and protection in carrying out their projects.</p>\r\n',0,'brokersforum.jpg','2018-10-12 17:04:01','0000-00-00 00:00:00',2147204895,'1'),(33,' Côte d\'Ivoire : Afterwork balade lagunaire de SUNU Assurances Vie CI','Côte d\'Ivoire : Afterwork lagoon ride of SUNU Assurances Vie CI','<p>Le traditionnel Business Afterwork de SUNU Assurances Vie CI, a eu lieu le vendredi 12 Octobre 2018 au cours d’une balade lagunaire. Le thème de cette soirée : « Quelle protection sociale pour votre Capital humain ? » a été animé par M. Gildas NZOUBA, Directeur Général Adjoint de SUNU Assurances Vie CI. Cet événement a été le cadre pour SUNU Assurances de présenter aux entreprises, les meilleurs produits d&#39;assurance vie pour fidéliser leur personnel en investissant dans leurs projets de vie. La cérémonie s’est déroulée dans un cadre amical et festif.</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n','<p>The traditional Business Afterwork of SUNU Aassurances Vie CI, took place on Friday, October 12, 2018 during a lagoon ride. The theme of this evening : \"What social protection for your Human Capital?\" was led by Mr. Gildas NZOUBA, Deputy General Manager of SUNU Assurances Vie CI. This event was the framework for SUNU Assurances to present companies with the best life insurance products to retain their staff by investing in their life projects. The ceremony was held in a friendly and festive setting.</p>\r\n',0,'44155145_1106152752892994_3926221439987875840_n.jpg','2018-10-18 11:41:23','0000-00-00 00:00:00',2147204895,'1'),(34,'Côte d\'Ivoire : Lancement de la web-émission \"COEUR DE STAR','Côte d\'Ivoire : Launch of \"COEUR DE STAR\" web-broadcast','<p>Le mercredi 17 Octobre 2018, SUNU Assurances en Côte d’Ivoire participait au lancement de la web-émission \"CŒUR DE STAR\" de l’ONG Smile. Cette belle soirée a vu la participation de nombreuses stars, influenceurs web et de plusieurs ONG et associations. Au cours de l’évènement, Mme Awa Ba, Présidente de l’ONG Smile, a procédé à la remise de gros lots surprises des sponsors aux différentes ONG et associations par des défis que des bénévoles ont relevé sur place. SUNU Assurances a offert une assurance Individuelle Accidents d’une valeur de 10.500.000 F. CŒUR DE STAR avec comme sponsor SUNU Assurances pour soutenir cette chaîne de solidarité pérenne.</p>\r\n','<p>On Wednesday, October 17, 2018, SUNU Assurances in Côte d&#39;Ivoire participated in the launch of the web-show CŒUR DE STAR of the NGO Smile. This beautiful evening saw the participation of many stars, web influencers and several NGOs and associations. During the event, Mrs. Awa Ba, President of the NGO Smile, proceeded to the delivery of large surprise prizes from the sponsors to the various NGOs and associations by challenges that volunteers identified on the spot. SUNU Assurances has offered an Individual Accident Insurance worth 10,500,000 F. HEART OF STAR with as sponsor SUNU Assurances to support this sustainable chain of solidarity.</p>\r\n',0,'coeurdestar.jpg','2018-10-22 11:00:15','0000-00-00 00:00:00',2147204895,'1'),(35,'Côte d\'ivoire : SUNU Assurances Vie CI sponsor de la 1ère édition du salon de l’épargne','Côte d\'Ivoire  : SUNU Assurances Vie CI sponsor of the first edition of the savings exhibition','<p>La première édition du Salon de l&#39;Epargne, de l&#39;Investissement et du Patrimoine (SEIP 2018) s’est déroulée le mercredi 31 octobre 2018 au Sofitel Hôtel Ivoire à Abidjan.</p>\r\n\r\n<p>SUNU Assurances Vie CI sponsor de l’évènement a été représentée par M. Saliou BAKAYOKO (Directeur Général de SUNU Assurances Vie CI) et M. Gildas N’ZOUBA (Directeur Général Adjoint de SUNU Assurances Vie CI) qui ont animé respectivement un panel sur l&#39;importance de l&#39;épargne dans l&#39;émergence économique et une master class sur l&#39;assurance vie par capitalisation.</p>\r\n\r\n<p>Les participants ont pu échanger sur la planification financière afin de mieux gérer leur épargne dans les établissements classiques.</p>\r\n','<p>The first edition of the Salon de l&#39;Epargne, Investment and Patrimoine (SEIP 2018) took place on Wednesday, October 31, 2018 at the Sofitel Hotel Ivoire in Abidjan.</p>\r\n\r\n<p>SUNU Assurances Vie CI sponsor of the event was represented by Mr. Saliou BAKAYOKO (General Manager of SUNU Assurances Vie CI) and Mr. Gildas N&#39;ZOUBA (Deputy General Manager of SUNU Assurances Vie CI) who respectively led a panel on the importance of savings in economic emergence and a master class on life insurance by capitalization.</p>\r\n\r\n<p>Participants were able to discuss financial planning to better manage their savings in conventional institutions.</p>\r\n',0,'seip2018.jpg','2018-11-06 17:54:47','0000-00-00 00:00:00',2147204895,'1'),(36,'Sénégal :  Journée \"don de sang\"','Senegal :  Day \"blood donation\"','<p>SUNU Assurances au Sénégal, en partenariat avec le Centre National de Transfusion Sanguine (CNTS), a organisé une journée « Don de Sang » le jeudi 25 Octobre 2018 dans ses locaux, à Dakar. Un geste volontaire, gratuit et anonyme, le don de sang reste nécessaire aujourd’hui encore plus qu’hier, pour sauver des vies.</p>\r\n','<p>SUNU Assurances in Senegal, in partnership with the National Blood Transfusion Center (CNTS), organized a \"blood donation\" day on Thursday, October 25, 2018 at its premises in Dakar. A voluntary gesture, free and anonymous, the donation of blood remains necessary today even more than yesterday, to save lives.</p>\r\n',0,'don2sang.jpg','2018-11-06 17:58:42','0000-00-00 00:00:00',2147204895,'1'),(37,'Togo :  Event 20 ans','Togo :   Event 20 years ','<p>Le vendredi 02 novembre 2018, SUNU Assurances et SUNU Santé ont célébré ensemble le 20ème anniversaire du Groupe SUNU. Les clients, partenaires et les personnels des différentes sociétés du Groupe SUNU ainsi que le comité de Direction de la Banque Populaire récemment membre du Groupe SUNU étaient présents.</p>\r\n\r\n<p>Pr. Etienne AYITE (Président du Conseil d’Administration de SUNU Assurances Vie Togo, Directeur Général de SUNU Santé) a donné le ton de cette ambiance chaleureuse au cours de laquelle les pionniers du groupe SUNU au Togo ont été célébrés. La cérémonie a été le lieu de présenter aux différents partenaires et clients, M. Yannick GOTTA (Nouveau Directeur Général Adjoint de SUNU Assurances IARD Togo) ainsi que Mme Myriam ADOTEVI (Nouvelle Directrice Générale de la BPEC).</p>\r\n','<p>On Friday, November 2nd, 2018, SUNU Assurances and SUNU Santé celebrated together the 20th anniversary of the SUNU Group. The clients, partners and staff of the various companies of the SUNU Group as well as the Management Committee of the Banque Populaire recently member of the SUNU Group were present. Pr. Etienne AYITE (Chairman of the Board of Directors of SUNU Assurances Vie Togo, Director General of SUNU Santé) set the tone for this warm atmosphere during which the pioneers of the SUNU group in Togo were celebrated. The ceremony was the place to present to the various partners and customers, Mr. Yannick GOTTA (New Deputy Director General of SUNU Assurances IARD Togo) as well as Mrs. Myriam ADOTEVI (New Director General of BPEC).</p>\r\n',0,'11.jpg','2018-11-06 18:04:11','0000-00-00 00:00:00',2147204895,'1'),(38,'Centrafrique : Célébration des 20 ans du Groupe SUNU','Centrafrique :  Celebration of the 20th anniversary of the SUNU Group','<p>SUNU Assurances IARD Centrafrique et SUNU Assurances Vie Cameroun Succursale Centrafrique ont célébré les 20 ans du Groupe SUNU, le samedi 10 novembre 2018. L’évènement s’est déroulé autour de deux actions majeures : un don composé de différents produits pharmaceutiques a été offert à la maternité de l’hôpital Communautaire de Bangui pour remédier aux récurrents décès des suites de césarienne et un hommage a été rendu à 6 employés qui ont totalisé plus de 20 ans de service (Mme Bengonda, M. Bangué, M. Konga, Mme Koyaweda, M. Kitambo et Mme Bada). Les Perroquets de Bangui (deuxième lauréat de la Saison 2 de l’émission «L’Afrique a un Incroyable Talent») ont présenté un spectacle teinté de beaucoup d’humour sur la nécessité de souscrire à une police d’assurance. Le partage du gâteau des 20 ans a marqué la fin de la célébration.</p>\r\n','<p>SUNU Assurances IARD Centrafrique and SUNU Assurances Vie Cameroon Centrafrique branch celebrated the 20th anniversary of the SUNU Group on Saturday, November 10, 2018. The event was organized around two major actions: a donation made up of various pharmaceutical products was offered to the maternity ward of the Bangui Community Hospital to rectify the recurring deaths from cesarean section and a tribute was paid to 6 employees who had more than 20 years of service (Ms. Bengonda, Mr. Bangué, Mr. Konga, Ms. Koyaweda Mr. Kitambo and Ms. Bada). The Parrots of Bangui (second winner of Season 2 of the show \"L’Afrique a un Incroyable Talent\") presented a show tinged with a lot of humor on the need to subscribe to an insurance policy. The sharing of the cake of 20 years marked the end of the celebration.</p>\r\n',0,'1event20ansrca.jpg','2018-11-22 15:36:50','0000-00-00 00:00:00',2147204895,'3'),(39,'Centrafrique : Célébration des 20 ans du Groupe SUNU','Centrafrique :  Celebration of the 20th anniversary of the SUNU Group','<p>SUNU Assurances IARD Centrafrique et SUNU Assurances Vie Cameroun Succursale Centrafrique ont célébré les 20 ans du Groupe SUNU, le samedi 10 novembre 2018. L’évènement s’est déroulé autour de deux actions majeures : un don composé de différents produits pharmaceutiques a été offert à la maternité de l’hôpital Communautaire de Bangui pour remédier aux récurrents décès des suites de césarienne et un hommage a été rendu à 6 employés qui ont totalisé plus de 20 ans de service (Mme Bengonda, M. Bangué, M. Konga, Mme Koyaweda, M. Kitambo et Mme Bada). Les Perroquets de Bangui (deuxième lauréat de la Saison 2 de l’émission «L’Afrique a un Incroyable Talent») ont présenté un spectacle teinté de beaucoup d’humour sur la nécessité de souscrire à une police d’assurance. Le partage du gâteau des 20 ans a marqué la fin de la célébration.</p>\r\n','<p>SUNU Assurances IARD Centrafrique and SUNU Assurances Vie Cameroon Centrafrique branch celebrated the 20th anniversary of the SUNU Group on Saturday, November 10, 2018. The event was organized around two major actions: a donation made up of various pharmaceutical products was offered to the maternity ward of the Bangui Community Hospital to rectify the recurring deaths from cesarean section and a tribute was paid to 6 employees who had more than 20 years of service (Ms. Bengonda, Mr. Bangué, Mr. Konga, Ms. Koyaweda Mr. Kitambo and Ms. Bada). The Parrots of Bangui (second winner of Season 2 of the show \"L’Afrique a un Incroyable Talent\") presented a show tinged with a lot of humor on the need to subscribe to an insurance policy. The sharing of the cake of 20 years marked the end of the celebration.</p>\r\n',0,'1event20ansrca1.jpg','2018-11-22 15:36:51','0000-00-00 00:00:00',2147204895,'1'),(40,'Côte d\'ivoire : Célébration des 20 ans du Groupe SUNU','Côte d\'Ivoire :  Celebration of the 20th anniversary of the SUNU Group','<p>Dans la soirée du vendredi 16 novembre 2018, les sociétés SUNU Assurances de Côte d’Ivoire ont célébré les 20 ans du Groupe SUNU à l’Espace Latrille Event d’Abidjan. L’évènement s’est déroulé en présence de M. Pathé DIONE (PDG du Groupe SUNU) et des différents DG et DGA des sociétés SUNU Assurances et autres entités. Après l’allocution de M. Saliou BAKAYOKO (DG de SUNU Assurances Vie CI), les récipiendaires ont reçu des médailles du ministère de l’Emploi et de la Protection sociale en guise de reconnaissance pour le dévouement dans l’exercice de leur fonction. La soirée a été égayée par des artistes de 2 générations (nouvelle génération et ancienne génération) qui ont permis aux participants de se défouler sur la piste de danse. La coupure du gâteau des 20 ans s’est faite autour d’un cocktail avant de laisser place au bal poussière au cours duquel plusieurs talents ont été découverts.</p>\r\n','<p>During the retro evening of Friday, November 16, 2018, employees of the SUNU group in Côte d&#39;Ivoire celebrated its 20th anniversary at Espace Latrille Event. The event took place in the presence of Mr Pathé DIONE (CEO of the SUNU Group) who gave a moving and motivating testimony, and the various DGs and DGAs of the SUNU companies. Following the presentation by Mr. Saliou BAKAYOKO (CEO of SUNU Assurances Vie CI), the recipients received medals from the Ministry of Employment and Social Protection in recognition of dedication in the performance of their duties. The evening was enlivened by artists of different generations (Bailly Spinto, LeMagnific, Kérozène, Mulukuku Dj) who allowed the participants to let off steam on the dance floor. The cut of the cake of the 20 years was made around a cocktail before giving way to the dust ball during which several talents were discovered.</p>\r\n',0,'1event20ansci.jpg','2018-11-22 15:46:27','0000-00-00 00:00:00',2147204895,'1'),(41,'Côte d\'ivoire : SUNU Assurances Vie CI sponsor d\'Africa Fintech Forum 2018','Côte d\'Ivoire : SUNU Assurances Vie CI sponsor of Africa Fintech Forum','<p>M. Gildas N’ZOUBA, Directeur Général Adjoint de SUNU Assurances Vie CI a animé le thème : \"Comment le numérique peut transformer/perturber le secteur de l&#39;assurance en Afrique et quels seront les segments en croissance ?\" à l&#39;Africa Fintech Forum qui s&#39;est déroulé à Azalaï Hôtel Abidjan les 26 et 27 novembre 2018. Le thème de cette année est « Fintech en Afrique : au-delà du paiement ». <br>\r\nL’objectif de l’événement est de promouvoir l’industrie de la Finance Digitale et de participer au positionnement de la Fintech (technologies financières) au cœur des stratégies de développement en Afrique car elles sont un outil formidable pour développer nos économies.</p>\r\n\r\n<p> </p>\r\n','<p>Mr. Gildas N&#39;ZOUBA, Deputy General Manager of SUNU Assurances Vie CI led the theme: \"How can the digital sector transform / disrupt the insurance sector in Africa and which segments will be growing?\" at the Africa Fintech Forum which took place in Azalaï Hotel Abidjan on November 26 and 27, 2018. The theme of this year is \"Fintech in Africa: beyond payment\".<br>\r\nThe objective of the event is to promote the Digital Finance industry and to participate in the positioning of Fintech (financial technologies) at the heart of development strategies in Africa as they are a great tool for developing our economies.</p>\r\n',0,'1africafintech.jpg','2018-11-29 14:02:15','0000-00-00 00:00:00',2147204895,'1'),(42,'Côte d\'Ivoire : SUNU Assurances à la 3ème édition de la Finance s’engage','Côte d\'Ivoire : SUNU Assurances, at the 3rd edition of Finance commits','<p>La plateforme d’échanges entre Entrepreneurs et acteurs de l’écosystème financier ivoirien, « La Finance S’engage », s’est ouverte ce jeudi 22 novembre Maison de l’Entreprise à Abidjan en présence du gotha du monde des affaires, des financiers et du gouvernement. La Finance S’Engage a pour objet de mobiliser les acteurs du système financier afin de mener la réflexion sur l’accompagnement des Petites et moyennes entreprises (PME). Partenaire privilégié de ce forum de réflexion, SUNU Assurances Vie CI a réitéré son engagement à apporter sa pierre à la construction d’une économie prospère. L’enjeu majeur de cette 3e édition était de renforcer la crédibilité déjà créée, en présentant les résultats concrets de cette forte mobilisation aux membres de l’écosystème financier.</p>\r\n','<p>The platform for exchanges between entrepreneurs and actors of the Ivorian financial ecosystem, \"La Finance S&#39;engage\", opened this Thursday, November 22, Maison de l&#39;Entreprise in Abidjan in the presence of the business elite, financiers and the government. The purpose of the S&#39;Engage Finance is to mobilize the players in the financial system to lead the reflection on the support of Small and Medium Enterprises (SMEs). Privileged partner of this forum for reflection, SUNU Assurances Vie CI has reiterated its commitment to contribute to building a prosperous economy. The major challenge of this third edition was to strengthen the credibility already created by presenting the concrete results of this strong mobilization to the members of the financial ecosystem.</p>\r\n',0,'0lafinancesengage.jpg','2018-11-29 14:04:50','0000-00-00 00:00:00',2147204895,'1'),(43,'Côte d\'ivoire : SUNU Assurances Vie CI invité de la 20ème édition du Business Connexion','Côte d\'Ivoire : SUNU Assurances Vie CI invited to the 20th edition of Business Connection','<p>Ce vendredi 23 novembre 2018 à Azalai Hôtel Abidjan, Business Connexion était à sa 20ème édition avec pour speaker du jour M. Gildas N’ZOUBA, Directeur Général Adjoint de SUNU Assurances Vie CI. Business Connexion est un évènement d’affaires et de networking direct pour les entreprises et leurs dirigeants. Au cours des échanges sur le thème : « L’économie ivoirienne à l’heure de la transformation digitale : Défis et Opportunités » M. Gildas N’ZOUBA a démontré que la transformation de l’économie digitale est centrée sur les humains. Cette rencontre fructueuse a pris fin par un cocktail et a permis aux participants de partager leurs expériences et d’échanger les contacts professionnels.</p>\r\n','<p>his Friday, November 23, 2018, at Azalai Hotel Abidjan, Business Connection was at its 20th edition with the daily speaker Mr. Gildas N&#39;ZOUBA, Assistant General Manager of SUNU Assurances Vie CI. Business Connection is a business and direct networking event for businesses and their leaders. During exchanges on the subject: \"The Ivorian Economy at Digital Time: Challenges and Opportunities\" Mr Gildas N&#39;ZOUBA has shown that the transformation of the digital economy is centered on humans. This successful meeting ended with a cocktail and allowed participants to share their experiences and trade professional contacts.</p>\r\n',0,'0businessconnect.jpg','2018-11-29 14:30:10','0000-00-00 00:00:00',2147204895,'1'),(44,'Gabon : SUNU Assurances sponsor de la 6ème édition du \"Marathon du Gabon\" ','Gabon : SUNU Assurances sponsor of 6th edition of \"Gabon Marathon\"','<p>Les sociétés SUNU Assurances au Gabon participent à la 6ème édition du « Marathon du Gabon » qui se tiendra du samedi 1er au dimanche 2 décembre à Libreville. Le « Marathon du Gabon » est une course de marathon qui se déroule tous les ans, dans les rues de Libreville, au Gabon. L&#39;épreuve fait partie depuis 2015 du circuit international des IAAF Road Race Bronze (circuit regroupant les meilleures compétitions mondiales hors-stade). A cet effet, un village marathon a été installé le jeudi 29 novembre 2018 dans la ville pour accueillir les différents coureurs. SUNU Assurances sponsor de l’évènement a tenu un stand au village marathon pour faire la promotion des produits SUNU Assurances.</p>\r\n','<p>SUNU Assurances companies in Gabon are taking part in the 6th edition of the \"Gabon Marathon\" which will be held from Saturday 1st to Sunday 2nd December in Libreville. The \"Gabon Marathon\" is a marathon race that takes place every year in the streets of Libreville, Gabon. Since 2015, the event has been part of the IAAF Road Race Bronze International Circuit (circuit bringing together the best non-stadium world competitions). To this end, a marathon village was installed on Thursday, November 29, 2018 in the city to accommodate the different runners. SUNU Assurances sponsor of the event held a booth at the marathon village to promote SUNU Assurances products.</p>\r\n',0,'1marathong2018.jpg','2018-12-12 12:38:34','0000-00-00 00:00:00',2147204895,'1'),(45,'Groupe SUNU : Diner Gala de la célébration des 20 ans du groupe','SUNU Group: Gala dinner celebrating 20 years of the Group','<p>Le Groupe SUNU a célébré ses 20 ans lors d’un Diner Gala qui a eu lieu le samedi 01 décembre 2018 au King Fahd Palace à Dakar au Sénégal. Cette soirée qui réunissait plus de 400 invités du Groupe s’est déroulée avec la participation de M. Pathé DIONE (Président Directeur Général du Groupe SUNU), les principaux actionnaires du Groupe, les Administrateurs et Directeurs Généraux des filiales, les employés et clients qui nous font confiance depuis le début de l’aventure. Mme Awa BA Directrice Communication de Groupe SUNU a ouvert la série des allocutions en annonçant les couleurs de cette cérémonie qui se voulait « Panafricaine et Digitale » avant de laisser la place à M. Pathé DIONE qui a fait la genèse du Groupe SUNU et remercié les différents partenaires et clients du groupe. La célèbre artiste sénégalaise Viviane CHIDID et l’orchestre Aragon ont permis aux invités de se défouler sur la piste de danse.</p>\r\n','<p>The SUNU Group celebrated its 20th anniversary at a Gala Dinner on Saturday, December 01, 2018 at the King Fahd Palace in Dakar, Senegal. This evening, which brought together more than 400 guests of the Group, took place with the participation of Mr. Pathé DIONE (Chairman and CEO of the SUNU Group), the main shareholders of the Group, the Directors and Managing Directors of the subsidiaries, the employees and customers who trust us from the beginning of the adventure. Ms. Awa BA Communication Director of Groupe SUNU opened the series of speeches by announcing the colors of this ceremony which was intended \"Panafricaine and Digitale\" before giving way to Mr. Pathé DIONE who made the genesis of the SUNU Group and thanked the different partners and customers of the group. The famous Senegalese artist Viviane CHIDID and the Aragon orchestra allowed guests to let off steam on the dance floor.</p>\r\n',0,'01apothéose20ans.jpg','2018-12-12 12:42:37','0000-00-00 00:00:00',2147204895,'1'),(46,'Bénin : Signature de convention entre SUNU Assurances Vie Bénin et ASMA GROUP S.A','Benin: Signature of an agreement between SUNU Assurances Vie Benin and ASMA GROUP S.A','<p>Le mercredi 05 décembre 2018, SUNU Assurances Vie Bénin a signé une convention de partenariat sur l’assurance décès sur le crédit avec l’Agence du Système Monétique Appliqué (ASMA GROUP S.A) qui est une structure de digitalisation monétique en microassurance. Cette convention de partenariat est le résultat du travail des équipes de SUNU Assurances Vie Bénin menée par M. Landry DJETE, Directeur du Développement Commercial et Mme Amina BABA IBRAHIM, Responsable Micro & Mobile Assurance de la filiale. Cette plateforme digitale regroupera 10 SFD (Systèmes Financiers Décentralisés), financés par des banques partenaires, qui auront chacun leur plateforme de connexion et de gestion des contrats. SUNU Assurances Vie Bénin gère ainsi, via le portail web dédié à l’assurance, les polices générées par les 10 SFD. La gestion des sinistres et prestations sera entièrement digitalisée. Par ailleurs, SUNU Assurances bénéficiera du réseau de l’ASMAB pour commercialiser ses produits d’assurances. Le lancement de la plateforme de gestion de crédit aura lieu en 2019.</p>\r\n','<p>On Wednesday, December 05, 2018, SUNU Assurances Vie Benin signed a partnership agreement on life insurance on credit with the Agency of the Applied Monetics System &#40;ASMA GROUP S.A&#41; which is a microinsurance electronic payment structure. This partnership agreement is the result of the work of the SUNU Assurances Vie Benin teams led by Mr. Landry DJETE, Director of Business Development and Mrs. Amina BABA IBRAHIM, Head of Micro & Mobile Insurance of the subsidiary. This digital platform will bring together 10 SFD (Decentralized Financial Systems), financed by partner banks, each of which will have their connection and contract management platform. SUNU Assurances Vie Benin manages the policies generated by the 10 SFDs via the insurance web portal. Claims and benefits management will be fully digitalized. In addition, SUNU Assurances will benefit from the ASMAB network to market its insurance products. The launch of the credit management platform will take place in 2019.</p>\r\n',0,'01conventionbénin.jpg','2018-12-12 12:53:49','0000-00-00 00:00:00',2147204895,'1'),(47,'GROUPE SUNU : Caravane du Bonheur 2019/CI','SUNU GROUP : Caravan of Happiness 2019 / CI','<p>Les sociétés SUNU Assurances de Côte d’Ivoire en partenariat avec l’ONG Les Zinzins du Bonheur ont offert ce samedi 12 janvier 2019 aux enfants souffrant d’insuffisance rénale et ceux en pédiatrie du CHU de Yopougon à Abidjan des cadeaux à travers « la caravane du bonheur ».<br>\r\nCes cadeaux ont permis d’apporter de la joie et du réconfort aux enfants, et permis aux parents d’oublier un tant soit peu leur présence en ces lieux. <br>\r\nC’est dans une atmosphère de joie et de réconfort qu’a pris fin cette donation.</p>\r\n\r\n<p> </p>\r\n','<p>The companies SUNU Assurances of Côte d&#39;Ivoire in partnership with the NGO Les Zinzins du Bonheur offered this Saturday, January 12, 2019 to children suffering from kidney failure and those pediatric hospital Yopougon to Abidjan gifts through \"the caravan happiness \".<br>\r\nThese gifts have brought joy and comfort to the children, and allowed parents to forget their presence in these places.<br>\r\nIt was in an atmosphere of joy and comfort that this donation ended.</p>\r\n',0,'caravanedubonheur0.jpg','2019-02-12 15:21:25','0000-00-00 00:00:00',2147204895,'1'),(48,'Côte d\'Ivoire : SUNU Assurances IARD 2ème prix « LES PÉPITES DE L’ACCUEIL »','Côte d\'Ivoire : SUNU Assurances IARD, 2nd prize ','<p>Le jeudi 10 janvier, le ministre du Plan et du Développement, Mme KABA NIALE, recevait à son cabinet au Plateau, les lauréats de la deuxième édition du trophée “ les pépites de l’accueil” organisé par le cabinet Académie du service CI. <br>\r\nC’est au total, une vingtaine d&#39;entreprises issues de vingt-cinq secteurs d&#39;activités qui ont été distinguées dont SUNU Assurances IARD Côte d’Ivoire.  <br>\r\nCette compétition annuelle se veut être un baromètre de la qualité de l’accueil, visant à promouvoir l’excellence dans les administrations publiques et privées du pays.</p>\r\n','<p>On Thursday, January 10, the Minister of Planning and Development, Mrs. KABA NIALE, received at her office at the Plateau, the winners of the second edition of the trophy \"the nuggets of hospitality\" organized by the firm Academy of CI service.<br>\r\nIn total, about twenty companies from twenty-five business sectors were distinguished including SUNU Assurances IARD Côte d&#39;Ivoire.<br>\r\nThis annual competition is intended to be a barometer of the quality of the welcome, aiming to promote excellence in the public and private administrations of the country.</p>\r\n',0,'pepitesdelaccueilsunuiardci0_2019.jpg','2019-01-10 15:16:28','0000-00-00 00:00:00',2147204895,'1'),(49,'LE GROUPE SUNU A LA 43ème EDITION DE LA FANAF','THE SUNU GROUP AT THE 43rd EDITION OF FANAF','<p>Comme chaque année, se tiennent les rencontres annuelles de la FANAF (Fédération des Sociétés d&#39;Assurances de Droit National Africaines).<br>\r\nPour sa 43ème édition, la FANAF se déroule à Tunis du 18 au 22 février 2019 avec pour thème : « Quelle structure de marché pour promouvoir le développement de l’assurance africaine ? ».<br>\r\nLe PDG M. Pathé DIONE accompagné des Directeurs Généraux du Groupe et de quelques filiales ont représenté le Groupe SUNU à cette rencontre incontournable du secteur de l’assurance.</p>\r\n\r\n<p> </p>\r\n','<p>As every year, the annual meetings of FANAF (Federation of African National Insurance Companies) are held.<br>\r\nFor its 43rd edition, FANAF is taking place in Tunis from 18 to 22 February 2019 with the theme: \"What market structure to promote the development of African insurance? \".<br>\r\nThe CEO Mr. Pathé DIONE accompanied by the Group&#39;s General Managers and some subsidiaries represented the SUNU Group at this essential meeting of the insurance sector.</p>\r\n',0,'fanaf0_2019.jpg','2019-02-18 15:12:18','0000-00-00 00:00:00',2147204895,'1'),(50,'Côte d\'Ivoire : 1er tirage au sort du produit \"Top Epargne\"','Côte d\'Ivoire : 1st draw of the product \"Top Epargne\"','<p>SUNU Assurances Vie CI en partenariat avec BAOBAB (ex MICROCRED) a procédé au 1er tirage du produit Top Epargne. Le tirage a eu lieu au siège de BAOBAB aux Vallons à Abidjan, le vendredi 14 décembre 2018. Me HYKPO, huissier de justice, a procédé au tirage avec la participation du public venu pour la circonstance. Pour ce tirage, deux clientes issues de l’agence de San-Pédro ont été les heureuses gagnantes. Les numéros tirés au sort sont : 368 et 665 Tous les numéros de police qui se terminent par 368 et 665 sont gagnants de 1 000 000 FCFA si le client est à jour de cotisation.<o></o></p>\r\n','<p>SUNU Assurances Vie CI in partnership with BAOBAB (formerly MICROCRED) has made the first draw of the Top Epargne product. The draw took place at BAOBAB&#39;s headquarters in Vallons, Abidjan, on Friday, December 14, 2018. Mr. HYKPO, bailiff, proceeded to the draw with the participation of the public who came for the occasion. For this draw, two clients from the San-Pédro agency were the lucky winners. The numbers drawn are: 368 and 665 All the police numbers that end with 368 and 665 are winners of 1,000,000 FCFA if the client is up to date.</p>\r\n',0,'0topépargne.jpg','2018-12-14 15:31:22','0000-00-00 00:00:00',2147204895,'1'),(51,'Côte d\'Ivoire : SUNU Assurances aux Mining Olympiades','Côte d\'Ivoire : SUNU Assurances at the Mining Olympiades','<p>Le Samedi 15 décembre à l’INP-HB de Yamoussoukro, le Groupement Professionnel des Miniers de Côte d’Ivoire (GPMCI) a convié les acteurs du secteur minier à la 3e édition de ses activités sportives dénommée les « Mining Olympiades ». Sponsors de l’évènement, les sociétés SUNU Assurances de Côte d’Ivoire ont matérialisé l’une des valeurs chères du groupe : la proximité clients. A cet effet, Monsieur Ramsès Kouakou, Chef du Département Marketing de SUNU Assurances Vie CI, a présenté brièvement le Groupe et réitéré le partenariat avec le GPMCI. Après l’allocution de M. IBRAHIMA DANSO, président dudit groupement, place a été donnée à l’ouverture des jeux. Un somptueux dîner fut offert, au cours duquel les gagnants des différentes disciplines ont été récompensés. Ce fut également l’occasion de célébrer les 10 ans du GPMCI.</p>\r\n','<p>On Saturday, December 15 at the INP-HB Yamoussoukro, the Professional Mining Group of Côte d&#39;Ivoire (GPMCI) invited the mining sector to the third edition of its sports activities called the \"Mining Olympiads\". Sponsor of the event, the SUNU Assurances companies of Côte d&#39;Ivoire have materialized one of the group&#39;s cherished values: customer proximity. To this end, Mr. Ramsès Kouakou, Head of Marketing Department of SUNU Life Insurance CI, briefly introduced the Group and reiterated the partnership with the GPMCI. After the speech of Mr. IBRAHIMA DANSO, president of the grouping, place was given to the opening of the games. A sumptuous dinner was offered, during which the winners of the various disciplines were rewarded. It was also an opportunity to celebrate the 10 years of GPMCI.</p>\r\n',0,'0miningolymp.jpg','2018-12-15 15:34:37','0000-00-00 00:00:00',2147204895,'1'),(52,'Côte d\'Ivoire : SUNU Assurances en partenariat avec la Chambre Nationale d\'Agriculture','Côte d\'Ivoire : SUNU Assurances in partnership with the National Chamber of Agriculture','<p>SUNU Assurances et la Chambre Nationale d’Agriculture de Côte d’Ivoire (CNA-CI) ont scellé leur partenariat par une signature de convention qui s’est déroulée ce jeudi 13 décembre 2018, au siège de SUNU Assurances Vie CI à Abidjan. Engagés dans la promotion de l’inclusion financière, SUNU Assurances et la CNA-CI ont décidé de concevoir et de proposer des offres adaptées des produits de micro assurance à fort  potentiel d’inclusion financière dans le secteur agricole. Au cours de cette cérémonie, M. Saliou BAKAYOKO représentant des sociétés de SUNU Assurances  a présenté brièvement sa structure tout en rassurant l’assemblée pour le règlement rapide des sinistres.</p>\r\n','<p>SUNU Assurances and the Côte d&#39;Ivoire National Chamber of Agriculture (CNA-CI) sealed their partnership with a convention signed on Thursday, December 13, 2018, at the headquarters of SUNU Assurances Vie CI in Abidjan. Committed to promoting financial inclusion, SUNU Assurances and CNA-CI have decided to design and offer tailored offers for microinsurance products with high potential for financial inclusion in the agricultural sector. During this ceremony, Mr. Saliou BAKAYOKO representing companies of SUNU Assurances briefly presented its structure while reassuring the assembly for the rapid settlement of claims.</p>\r\n',0,'1convention_cna.jpg','2018-12-13 15:46:49','0000-00-00 00:00:00',2147204895,'1'),(53,'Le Groupe SUNU au FESPACO 2019','The SUNU Group At FESPACO 2019','<p>Le Groupe SUNU a pris part au FESPACO (Le Festival panafricain du cinéma et de la télévision de Ouagadougou) du 24 Février au 1er Mars 2019 en tant que sponsor du film DESRANCES de la réalisatrice Burkinabé Apolline TRAORE avec comme acteur principal le célèbre Jimmy jean louis. <br>\r\nPour la première du film au Ciné Burkina, il y a eu la présence de la première dame du Burkina Faso, les Directeurs Généraux des sociétés SUNU Assurances au Burkina Faso... .<br>\r\nVu le monde qu’a drainé cette première du film, le Groupe SUNU espère que pour ce cinquantenaire du FESPACO le « yennega », l’étalon d’or soit remporté par une femme.  Ce qui sera une grande première dans le monde du cinéma africain. </p>\r\n','<p>The SUNU Group took part in FESPACO (The Panafrican Film and Television Festival of Ouagadougou) this <span xss=removed>February 24 to March 01, </span>2019 as sponsor of the film DESRANCES by the Burkinabé director Apolline TRAORE, with the famous actor Jimmy jean louis as main actor.<br>\r\nFor the premiere of the film at Ciné Burkina, there was the presence of the first lady of Burkina Faso, the Directors General of SUNU Assurances companies in Burkina Faso ....<br>\r\nGiven the world this film premiered, the SUNU Group hopes that for this fiftieth anniversary of FESPACO the \"yennega\", the gold standard will be won by a woman. This will be a great first in the world of African cinema.</p>\r\n',0,'projectiondesrances001.jpg','2019-02-24 07:57:46','0000-00-00 00:00:00',2147204895,'1'),(54,'Caravane SUNU Assurances au Burkina Faso','SUNU Assurances in Burkina Faso Caravan','<p>La caravane SUNU Assurances Ya Paalé a débuté le 30 mars 2019 à Bobo Dioulasso. La parade et les activations en matinée ont été suivies du concert en soirée à la place TIEFFO AMORO en présence du Haut-commissaire représentant le Gouverneur de la région des Hauts Bassins, du Directeur Général de SUNU Assurances Vie Burkina Faso, des Directeurs régionaux et des maires de communes. Cap sur la prochaine étape qui sera la ville de Dédougou.</p>\r\n\r\n<p> </p>\r\n','<p>The caravan SUNU Assurances Ya Paalé started on March 30, 2019 in Bobo Dioulasso. The morning parade and activations were followed by an evening concert at TIEFFO AMORO Square in the presence of the High Commissioner representing the Governor of the Hauts Bassins Region, the Director General of SUNU Assurances Vie Burkina Faso, Regional Directors and Mayors common. Head to the next step which will be the city of Dédougou.</p>\r\n\r\n<p> </p>\r\n',0,'caravanesunuassurancesyapaalébf0_2019.jpg','2019-03-30 20:04:15','0000-00-00 00:00:00',2147204895,'1'),(55,'SUNU Assurances Vie Côte d\'Ivoire participe aux activités sportives de la JCI Abidjan Elite','SUNU Assurances Vie Côte d\'Ivoire participates in sports activities of JCI Abidjan Elite','<p>L’équipe de football de SUNU Assurances Vie Côte d’Ivoire a pris part le samedi 09 mars 2019 aux activités sportives et de l’amitié initiée par la JCI (Jeunes Chambre Internationale) Abidjan Elite. Ces activités se sont déroulées au Lycée Classique d’Abidjan avec la participation de plusieurs équipes comme la BNETD FC, CGRAE FC, JUMIA, CIMCI, ELITE FC et SUNU FC). SUNU Assurances s’est fait remarquer grâce à l’équipe féminine qui a remporté la coupe face à l’ELITE FC par un score de deux buts à zéro (2-0). C’est dans cette ambiance conviviale qu’a pris fin ce tournoi.</p>\r\n\r\n<p> </p>\r\n','<p>The football team of SUNU Assurances Vie Côte d&#39;Ivoire took part on Saturday, March 09, 2019 in sports activities and friendship initiated by JCI (Young Chamber International) Abidjan Elite.<br>\r\nThese activities took place at the Abidjan Classic High School with the participation of several teams such as BNETD FC, CGRAE FC, JUMIA, CIMCI, ELITE FC and SUNU FC).<br>\r\nSUNU Assurances stood out thanks to the women&#39;s team that won the Cup against ELITE FC by scoring two goals to zero (2-0). It was in this friendly atmosphere that this tournament ended.</p>\r\n\r\n<p> </p>\r\n',0,'tournoijci0_2019.jpg','2019-03-09 20:11:12','0000-00-00 00:00:00',2147204895,'1'),(56,'Tirage du produit \"ça Gagne\" avec SUNU Assurances Vie Burkina Faso',' Draw of the product \"That wins\" with SUNU Assurances Vie Burkina Faso','<p>Le vendredi 15 mars 2019, SUNU Assurances Vie Burkina Faso en partenariat avec UBA a procédé au 8ème tirage du produit «Ça Gagne » dans les locaux de UBA.<br>\r\n« Ça gagne » est un produit bancassurance qui permet d’obtenir un gros capital à partir de petites cotisations. 6 numéros qui sont respectivement 0855, 5280, 9489, 4871, 6425 et le 0611 ont été tirés par les clients de la banque UBA en présence d’un huissier de justice, afin d’attester de la crédibilité du tirage. Lorsque le numéro d’un client est tiré, le capital prévu à la fin du contrat est versé de manière anticipée. </p>\r\n\r\n<p> </p>\r\n','<p>On Friday March 15, 2019, SUNU Assurances Vie Burkina Faso, in partnership with UBA, proceeded with the 8th draw of the \"Ça Gagne\" product at UBA&#39;s premises.<br>\r\n\"It wins\" is a bancassurance product that allows you to obtain large capital from small contributions. Six numbers are respectively 0855, 5280, 9489, 4871, 6425 and 0611 were drawn by the customers of the UBA bank in the presence of a bailiff, to attest to the credibility of the draw. When the number of a customer is drawn, the capital provided at the end of the contract is paid in advance.</p>\r\n\r\n<p> </p>\r\n',0,'Ca_gagnebfvie0_2019.jpg','2019-03-15 20:21:29','0000-00-00 00:00:00',2147204895,'1'),(57,'Allianz au Bénin, Burkina, Mali et Togo font désormais partie du Groupe SUNU','Allianz in Benin, Burkina Faso, Mali and Togo are now part of the SUNU Group','<p>Les filiales du groupe Allianz au Bénin, Burkina Faso, Mali et Togo font désormais partie du Groupe SUNU et changeront bientôt de nom pour devenir SUNU Assurances.<br>\r\nAvec cette opération, le Groupe SUNU confirme sa position de Leader en Assurance Vie dans les 14 pays de la zone CIMA et renforce son offre en Assurance IARD.<br>\r\nTous les engagements pris par Allianz auprès de ses collaborateurs, clients, courtiers et partenaires seront respectés par le Groupe SUNU, avec l’objectif de garantir une qualité de service optimale et une offre d’assurance parmi les meilleures du marché.</p>\r\n\r\n<p> </p>\r\n','<p>The subsidiaries of the Allianz group in Benin, Burkina Faso, Mali and Togo are now part of the SUNU Group and will soon change their name to SUNU Assurances.<br>\r\nWith this transaction, the SUNU Group confirms its position as Life Insurance Leader in the 14 countries of the CIMA zone and strengthens its P & C insurance offering.<br>\r\nAll commitments made by Allianz to its employees, customers, brokers and partners will be respected by the SUNU Group, with the aim of guaranteeing the highest quality of service and the best insurance offer on the market.</p>\r\n',0,'signature_bas_de_mail_Groupe_FR.jpg','2019-05-03 07:59:59','0000-00-00 00:00:00',2147204895,'1'),(58,'SUNU Assurances Vie CI – BICICI : Lancement des ASSUR’ DAYS','SUNU Assurances Vie CI - BICICI : Launch of Assur\' DAYS','<p>Le vendredi 07 juin 2019, la BICICI en collaboration avec ses partenaires dont SUNU Assurances Vie Côte d’Ivoire ont procédé au lancement d’un nouveau programme d’animation destiné à la bancassurance. Ce Programme a pour objectif de former et accompagner les équipes commerciales dans la prise en main des produits en vue de booster les ventes.<br>\r\nÀ cette occasion, Monsieur Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie Côte d’Ivoire a eu à animer un panel portant sur « Les enjeux de la Bancassurance pour la BICICI ».<br>\r\nÀ la suite de celui-ci, un somptueux déjeuner fut offert aux participants avant l’entame des différents ateliers.</p>\r\n','<p>On Friday 07 June 2019, BICICI, in collaboration with its partners, including SUNU Assurances Vie Côte d&#39;Ivoire, launched a new animation program for bancassurance.<br>\r\nThis program aims to train and support sales teams in the grip of products to boost sales.<br>\r\nOn this occasion, Mr. Saliou BAKAYOKO, General Manager of SUNU Assurances Vie Côte d&#39;Ivoire had to animate a panel on \"The stakes of Bancassurance for BICICI\".<br>\r\nFollowing this, a sumptuous lunch was offered to participants before the start of the various workshops.</p>\r\n',0,'Assurdays1_2019.jpg','2019-06-07 15:44:08','0000-00-00 00:00:00',2147204895,'0'),(59,'Burkina Faso : Caravane SUNU Assurances Ya Paalé à Banfora',' Burkina Faso: Caravan SUNU Assurances Ya Paalé in Banfora','<p>Pour la 4e étape de la caravane SUNU Assurances Ya Paalé, SUNU Assurances Vie Burkina Faso a posé ses valises dans la ville de Banfora le 31 mai.<br>\r\nAprès la visite de courtoisie aux autorités de ladite ville, s’en ai suivi une parade, des activations, le dépistage et la vaccination contre l’hépatite B.<br>\r\nUn concert avec des artistes locaux et en Guest star Fush Alpha venu de Ouagadougou a été offert en soirée à la population.</p>\r\n','<p><br>\r\nFor the 4th stage of the SUNU Assurances Ya Paalé caravan, SUNU Assurances Vie Burkina Faso settled in the city of Banfora on May 31st.<br>\r\nAfter the courtesy visit to the authorities of the said city, there followed a parade, activations, screening and vaccination against hepatitis B.<br>\r\nA concert with local artists and guest star Fush Alpha from Ouagadougou was offered in the evening to the population.</p>\r\n\r\n<p> </p>\r\n',0,'caravanbanfora0_2019.jpg','2019-05-31 15:55:56','0000-00-00 00:00:00',2147204895,'0'),(60,'3e étape de la marche sportive SUNU Assurances - FIDRA','3rd stage of the sports walk SUNU ASSURANCES - FIDRA','<p>Après les étapes de Yamoussoukro et Dabou, SUNU Assurances Vie CI et son partenaire de la retraite active le FIDRA étaient présents le 25 Mai 2019 dans la commune de Yopougon, pour la 3éme étape de la traditionnelle marche sportive organisée en faveur des personnes du 3ème âge.  <br>\r\nCe sont plus de 1000 retraités qui ont eu à parcourir les 4 Km du circuit dans une ambiance conviviale.</p>\r\n','<p>After the stages of Yamoussoukro and Dabou, SUNU Life Insurance CI and its active retirement partner FIDRA were present on May 25, 2019 in Yopougon commune, for the 3rd stage of the traditional sports walk organized for the benefit of the elderly. More than 1000 retirees had to travel the 4 km circuit in a friendly atmosphere.</p>\r\n',0,'fidra3etape_2019.jpg','2019-05-25 16:07:04','0000-00-00 00:00:00',2147204895,'0'),(61,'Les sociétés SUNU Assurances du TOGO à la 5ème édition du FESTIMMO','SUNU Assurances of TOGO at the 5th edition of FESTIMMO','<p>Du 10 au 12 mai 2019 les sociétés SUNU Assurances au Togo ont participé à la 5ème édition de la foire de l’immobilier du Togo (FESTIMMO).<br>\r\nCe fut l’occasion pour SUNU Assurances IARD et Vie TOGO de mieux faire comprendre aux visiteurs et exposants le secteur de l’assurance, avoir plus d’informations sur les contrats et faire directement des souscriptions.</p>\r\n','<p>From May 10 to 12, 2019 SUNU Assurances companies in Togo participated in the 5th edition of the real estate fair of Togo (FESTIMMO).<br>\r\nIt was an opportunity for SUNU Assurances IARD and Vie TOGO to make visitors and exhibitors better understand the insurance sector, to have more information on contracts and to make direct subscriptions.</p>\r\n',0,'festimmo0_2019.jpg','2019-05-10 16:15:39','0000-00-00 00:00:00',2147204895,'0'),(62,'Tirage du produit SAYE','Draw of SAYE product','<p>Le vendredi 3 mai 2019, SUNU Assurances Vie Niger a procédé au tirage du produit SAYE au siège de SUNU Assurances Vie Niger.<br>\r\nSAYE est un produit d’assurance épargne avec un volet tirage au sort  qui offre aux adhérents une cagnotte d’un million (1 000 000) de francs CFA par trimestre.<br>\r\nLa gagnante de ce mois Mme Razak RABAHA a reçu son chèque des mains de Mme Binta TINI Directeur Général de la filiale.</p>\r\n','<p>On Friday, May 3, 2019, SUNU Assurances Vie Niger proceeded with the draw of the SAYE product at the headquarters of SUNU Assurances Vie Niger.<br>\r\nSAYE is a savings insurance product with a component that offers members a pool of one million (1,000,000) CFA francs per quarter.<br>\r\nThis month&#39;s winner Mrs. Razak RABAHA received her check from Mrs. Binta TINI General Manager of the subsidiary.</p>\r\n\r\n<p> </p>\r\n',0,'SAYE.jpg','2019-05-03 16:22:50','0000-00-00 00:00:00',2147204895,'0'),(63,'Les sociétés SUNU Assurances de Côte d’Ivoire à la 11ème édition du SILA',' SUNU Assurances companies of Côte d\'Ivoire at the 11th edition of SILA','<p>Le mercredi 15 mai 2019, les sociétés SUNU Assurances de Côte d’Ivoire ont pris part à la 11ème édition du salon international du livre d’Abidjan (SILA).<br>\r\nIl s’est tenu au palais de la culture de Treichville avec pour pays invité la France.<br>\r\nCette année l’association des éditeurs et les passionnés du livre se sont fixé comme objectif de rendre le livre plus facile et accessible à tous les lecteurs d’où le thème : « le livre, mon compagnon au quotidien ». <br>\r\nPour ce rendez-vous littéraire, l’auteur Véronique TADJO était l’invitée d’honneur et la lauréate du prix littéraire d’éditeur.</p>\r\n','<p>On Wednesday, May 15, 2019, SUNU Assurances of Côte d&#39;Ivoire took part in the 11th edition of the International Book Fair of Abidjan (SILA).<br>\r\nIt was held at the Palace of Culture of Treichville with France as a guest country.<br>\r\nThis year, the association of publishers and book lovers have set themselves the goal of making the book easier and accessible to all readers, hence the theme: \"the book, my everyday companion\".<br>\r\nFor this literary event, the author Véronique TADJO was the guest of honor and laureate of the publisher&#39;s literary prize.</p>\r\n\r\n<p> </p>\r\n',0,'sila5_2019.jpg','2019-05-15 16:32:24','0000-00-00 00:00:00',2147204895,'0'),(64,'SUNU Assurances Vie CI participe au développement de l\'inclusion financière',' SUNU Assurances Vie participates in the development of financial inclusion','<p>Le vendredi 7 juin 2019, SUNU Assurances Vie Côte d’Ivoire a participé à la 1ère édition du forum Africa Fintech Tour 2019 qui a eu lieu à Orange Fab.<br>\r\nÉtaient présents à ce forum les acteurs de l&#39;industrie financière, de télécom et les communautés d&#39;innovation de plus de dix (10) pays africains pour échanger sur la digitalisation de l&#39;inclusion financière en zone rurale.<br>\r\nSUNU Assurances Vie Côte d’Ivoire, promoteur de l’assurance inclusive, a présenté ses offres digitales aux coopératives agricoles venues assister au forum.</p>\r\n','<p>On Friday, June 7, 2019, SUNU Assurances Vie Côte d&#39;Ivoire participated in the 1st edition of the Africa Fintech Tour 2019 forum which took place at Orange Fab.<br>\r\nPresent at this forum were the actors of the financial, telecom and innovation communities from more than ten (10) African countries to discuss the digitization of financial inclusion in rural areas.<br>\r\nSUNU Life Insurance Ivory Coast, promoter of inclusive insurance, presented its digital offers to agricultural cooperatives attending the forum.</p>\r\n',0,'fintech0-2019.jpg','2019-06-07 16:41:52','0000-00-00 00:00:00',2147204895,'1'),(65,'Cérémonie de distinction des agents de SUNU Assurances Vie Bénin ','Ceremony of distinction of agents of SUNU Assurances Vie Benin','<p>En prélude à la célébration de la fête du personnel, la direction Générale de SUNU Assurances Vie Bénin a décidé de distinguer les membres du personnel ayant plus de 10 années d’ancienneté dans la Société.<br>\r\nCette cérémonie s’est déroulée le jeudi 13 juin 2019 où huit (08) membres du personnel ont reçu un diplôme d’ancienneté signé par le Directeur Général M. Lassina COULIBALY ainsi qu’une prime.</p>\r\n','<p>As a prelude to the celebration of the staff party, the General Management of SUNU Assurances Vie Benin decided to distinguish the staff members with more than 10 years of seniority in the Society.<br>\r\nThis ceremony took place on Thursday, June 13, 2019 when eight (08) staff members received a seniority diploma signed by the Director General Mr. Lassina COULIBALY and a bonus.</p>\r\n',0,'cérémoniedistinctionSAVB2_2019.jpg','2019-06-13 16:55:07','0000-00-00 00:00:00',2147204895,'1'),(66,'Groupe SUNU : Les nouvelles filiales (EX-ALLIANZ) à SUNU Services','SUNU Group : New Subsidiaries (Ex-ALLIANZ) at SUNU Services','<p>SUNU Services a initié deux jours d&#39;échanges et d&#39;ateliers avec les sociétés Allianz acquises. <br>\r\nL&#39;objectif de cette rencontre réunissant les directeurs généraux et techniques est de mieux connaître les missions et activités de chaque département de SUNU Services mais aussi les filiales de SUNU Assurances de Côte d’Ivoire et d&#39;Allianz.<br>\r\nM. DIONE a introduit avec un mot de bienvenue motivant à plus de synergie pour plus de développement.</p>\r\n\r\n<p> </p>\r\n','<p>SUNU Services initiated two days of exchanges and workshops with the acquired Allianz companies.<br>\r\nThe objective of this meeting bringing together the general and technical directors is to better know the missions and activities of each department of SUNU Services but also the subsidiaries of SUNU Assurances of Côte d&#39;Ivoire and Allianz.<br>\r\nMr. DIONE introduced with a motivating welcome to more synergy for further development.</p>\r\n',0,'allianzàsunuservices0_2019.jpg','2019-06-17 17:05:06','0000-00-00 00:00:00',2147204895,'0'),(67,' SUNU assurances Vie Côte d\'Ivoire à la 10ème édition du MEET UP BUSINESS',' SUNU assurances Vie Côte d\'Ivoire at the 10th edition of MEET UP BUSINESS','<p>Le vendredi 28 juin 2019, le Directeur Général adjoint de SUNU Assurances Vie Côte d’Ivoire, M. Gildas NZOUBA était l’invité de la 10ème édition du MEET UP BUSINESS qui s’est déroulé au siège de la CGECI Academy.<br>\r\nLors de ce Meet Up, son parcours, son expérience professionnelle et ses ambitions pour SUNU Assurances Vie Côte d’Ivoire ont été dévoilés au public invité pour l’occasion.</p>\r\n','<p>On Friday, June 28, 2019, the Deputy Director General of SUNU Assurances Vie Côte d&#39;Ivoire, Mr Gildas NZOUBA was the guest of the 10th edition of the MEET UP BUSINESS which took place at the headquarters of the CGECI Academy.<br>\r\nDuring this Meet Up, his career, his professional experience and his ambitions for SUNU Assurances Vie Côte d&#39;Ivoire were unveiled to the public invited for the occasion</p>\r\n',0,'meetup0_2019.jpg','2019-06-28 08:22:40','0000-00-00 00:00:00',2147204895,'0'),(68,'Groupe SUNU : Réunion des dirigeants des filiales francophones de SUNU Assurances.','SUNU Group: Meeting of the managers of the French-speaking subsidiaries of SUNU Assurances.','<p>Du 16 au 18 Juillet 2019 s’est tenue à l’hôtel AZALAI la réunion des dirigeants des filiales Francophones de SUNU Assurances.<br>\r\nEtaient invités à ces réunions les dirigeants des filiales Allianz nouvellement acquises. <br>\r\nCette réunion a permis de faire la revue à mi-parcours des objectifs et chiffres d’affaires 2019 de chaque société.<br>\r\nAussi, les dirigeants ont bénéficié d’une formation sur le Lean Management (système d’amélioration des processus de gestion) et d’une présentation du test de la plateforme DIGITASS par SUPERNET.</p>\r\n\r\n<p> </p>\r\n','<p>The debate dinner of the Association of Ambassadors of Côte d&#39;Ivoire at retirement (AACIR) was at its 4th edition on Thursday, June 27, 2019 at Espace Latrille Event. At this meeting, several panelists were invited to develop the theme chosen for the occasion, \"the secrets of a happy longevity\".<br>\r\nMr. Saliou BAKAYOKO, General Manager of SUNU Assurances Vie Côte d&#39;Ivoire made a brilliant presentation on capitalization products that could allow everyone to ensure a decent retirement.<br>\r\nIn addition, the ambassador AMON TANOH Lambert, 93 years old, shared his life experience and afterwards, gave wise advice to the youngest, curious to know the secrets of his longevity.</p>\r\n\r\n<p> </p>\r\n',0,'réuniondirigeants0.jpg','2019-07-19 16:40:07','0000-00-00 00:00:00',2147204895,'0'),(69,' Les Matinales de SUNU Assurances IARD Cameroun',' The Matinales of SUNU Assurances IARD Cameroon','<p>Du 02 au 05 juillet derniers à l’espace Méridien au Pullman de DOUALA, SUNU Assurances IARD Cameroun a organisé des rencontres avec des professionnels de différents secteurs, baptisées les « Matinales de SUNU Assurances ».  Ainsi, tout au long de la semaine, l’équipe de la Direction du Développement Commercial a rencontré tour à tour des professionnels du Transport (Transitaires et Transporteurs), du Voyage (Agences de voyage) et du Logement (SCI). <br>\r\nCes rencontres ont permis de présenter les solutions d’assurances innovantes, de discuter d’opportunités d’affaires et de nouer de nouveaux partenariats.</p>\r\n','<p>From the 2nd to the 5th of July at the Meridien space at Pullman de DOUALA, SUNU Assurances IARD Cameroun organized meetings with professionals from different sectors, called \"Matinales de SUNU Assurances\".<br>\r\nThus, throughout the week, the team of the Direction of the Commercial Development met in turn professionals of Transport (Freight Forwarders and Transporters), Travel (Travel Agencies) and Housing (SCI).<br>\r\nThese meetings allowed us to present innovative insurance solutions, discuss business opportunities and forge new partnerships.</p>\r\n',0,'lesmatinales0cameroun_2019.jpg','2019-07-05 08:16:55','0000-00-00 00:00:00',2147204895,'0'),(70,'SUNU Assurances aux côtés des ambassadeurs de Côte d’Ivoire à la retraite','SUNU Assurances alongside retired Côte d\'Ivoire ambassadors','<p>Le dîner débat de l’Association des Ambassadeurs de Côte d’Ivoire à la retraite (AACIR) était à sa 4ème édition le jeudi 27 juin 2019 à l’espace Latrille Event.</p>\r\n\r\n<p>A cette rencontre, plusieurs panélistes avaient été invités à développer le thème choisi pour l’occasion, « les secrets d’une longévité heureuse ».<br>\r\nM. Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie Côte d’Ivoire a fait une brillante présentation sur les produits de capitalisation qui pourraient permettre à tous de s’assurer une retraite décente. <br>\r\nPar ailleurs, l’ambassadeur AMON TANOH Lambert, âgé de 93 ans a partagé son expérience de vie et a par la suite, prodigué de sages conseils aux plus jeunes, curieux de connaitre les secrets de sa longévité.</p>\r\n','<p>The debate dinner of the Association of Ambassadors of Côte d&#39;Ivoire at retirement (AACIR) was at its 4th edition on Thursday, June 27, 2019 at Espace Latrille Event. At this meeting, several panelists were invited to develop the theme chosen for the occasion, \"the secrets of a happy longevity\".<br>\r\nMr. Saliou BAKAYOKO, General Manager of SUNU Assurances Vie Côte d&#39;Ivoire made a brilliant presentation on capitalization products that could allow everyone to ensure a decent retirement.<br>\r\nIn addition, the ambassador AMON TANOH Lambert, 93 years old, shared his life experience and afterwards, gave wise advice to the youngest, curious to know the secrets of his longevity.</p>\r\n\r\n<p> </p>\r\n',0,'AACIR0_2019.jpg','2019-06-27 17:04:28','0000-00-00 00:00:00',2147204895,'1'),(71,'SUNU ASSURANCES Vie Côte d\'Ivoire partenaire d\'Afrique Consciente','SUNU Assurances Vie Côte d\'Ivoire partner of Africa Conscious','<p>Les 2èmes Universités ouvertes de la société civique en Afrique, se sont déroulées le samedi 29 juin 2019 à l’hôtel Sofitel Ivoire d’Abidjan. Au cours de cette journée, plusieurs personnalités venues d’ici et d’ailleurs, ont développé les valeurs africaines telles que la solidarité, le respect, la dignité. S’appuyant sur ces valeurs, des hommes et des femmes œuvrent tous les jours, chacun à leur niveau pour rendre la vie de milliers de personnes meilleure. Ils ont partagé avec le public venu nombreux pour l’occasion leurs expériences au niveau de la santé, l’éducation et l’environnement. Parmi les panélistes, un invité spécial venu du Burkina Faso, M. Yacouba SAWADOGO surnommé « l’homme qui a arrêté le désert », s’est vu décerner le prix Afrique consciente.<br>\r\nSUNU Assurances en tant qu’entreprise panafricaine qui épouse pleinement les valeurs d’Afrique Consciente (Solidarité, Respect, Dignité) n’a pas voulu rester en marge de cette belle initiative.</p>\r\n','<p>The 2nd Open Universities of the civic society in Africa, took place on Saturday, June 29, 2019 at the Sofitel Ivoire hotel in Abidjan. During this day, many personalities from here and elsewhere, have developed African values ​​such as solidarity, respect, dignity. Based on these values, men and women work every day, each at their level to make the lives of thousands of people better. They shared with the public come numerous for the occasion their experiences in health, education and the environment. Among the panellists, a special guest from Burkina Faso, Mr. Yacouba SAWADOGO nicknamed \"the man who stopped the desert\", was awarded the Africa conscious prize.<br>\r\nSUNU Assurances as a pan-African company that fully embraces the values ​​of Africa Consciente (Solidarity, Respect, Dignity) did not want to stay on the sidelines of this great initiative.</p>\r\n\r\n<p> </p>\r\n',0,'afriqueconsciente0_2019.jpg','2019-06-29 08:20:42','0000-00-00 00:00:00',2147204895,'0'),(72,'Le TEAM BUILDING de SUNU Assurances Vie TOGO ','TEAM BUILDING by SUNU Assurances Vie TOGO','<p><br>\r\nLe samedi 29 juin dernier a eu lieu le team building de SUNU Assurances Vie TOGO au complexe balnéaire le BLUE TURTLE BAE.<br>\r\nL’objectif de cette activité était de resserrer les liens des employés autour de plusieurs sujets, activités et formations. </p>\r\n\r\n<p> </p>\r\n','<p>On Saturday the 29th of June took place the team building of SUNU Assurances Vie TOGO at the seaside resort BLUE TURTLE BAE.<br>\r\nThe objective of this activity was to strengthen the links of the employees around several subjects, activities and trainings.</p>\r\n',0,'teambuild0togo-2019.jpg','2019-06-06 17:22:28','0000-00-00 00:00:00',2147204895,'0'),(73,' LES SOCIETES SUNU Assurances au Togo au FESTIVAL EVALA 2019','SOCIETES SUNU Assurances in Togo at the EVALA 2019 FESTIVAL','<p>Comme chaque année, SUNU Assurances proche des populations a apporté son soutien aux organisateurs des luttes traditionnelles dénommées EVALA.<br>\r\nCe festival qui a eu lieu du 15 au 21 Juillet en pays Kabyè au nord du Togo, est un rite initiatique qui fait entrer les jeunes dans le rang des hommes.<br>\r\nCet évènement a un programme d’activités culturelles (soirées culturelles, concerts, chants, danses, contes traditionnels, soirées théâtrales...) très engageant et draine énormément de personne.</p>\r\n\r\n<p> </p>\r\n','<p>As every year, SUNU Assurances close to the population has supported the organizers of the traditional struggles called EVALA.<br>\r\nThis festival, which took place from July 15th to 21st in Kabyè country in the north of Togo, is an initiation ritual that brings young people into the ranks of men.<br>\r\nThis event has a program of cultural activities (cultural evenings, concerts, songs, dances, traditional tales, theatrical nights ...) very engaging and drains a lot of people.</p>\r\n',0,'EVALA0-2019.jpg','2019-07-21 08:08:51','0000-00-00 00:00:00',2147204895,'1'),(74,'SUNU ASSURANCES Vie Bénin à la FIAC 2019',' SUNU Assurances Vie Benin at FIAC 2019','<p>Du 17 au 19 juin 2019, s’est tenu la 13e Assemblée Générale de la Fédération Interafricaine des Assureurs-Conseils (FIAC) à AZALAI hôtel Cotonou.  <br>\r\nM. Landry DJETE, Directeur du Développement Commercial de SUNU Assurances Vie Bénin est intervenu sur l’un des panels de la deuxième (2e) journée dont le thème était : « Quelle passerelle entre l’intermédiation financière et le courtage d’assurance à l’ère du numérique ? ». <br>\r\nL’objectif de ce panel étais de faire savoir que l’intermédiation financière ne peut être ignorée, et qu’elle sert à optimiser les offres d’assurance sur les rémunérations différées (IFC retraite, épargne salariale).</p>\r\n','<p>From June 17 to 19, 2019, it was held at the 13th General Assembly of the Interafrican Association of Insurance Providers (FIAC) at the AZALAI Cotonou Hotel.<br>\r\n <br>\r\nMr. Landry DJETE, Business Development Director of SUNU Assurances Vie Benin spoke on one of the panels of the second (2nd) day whose theme was: \"What is the financial interaction and the insurance broker? the digital age? \"<br>\r\nThe purpose of this panel is to know that financial intermediation can not be ignored, and that it optimizes the insurance offers on deferred remuneration (IFC retirement, employee savings).</p>\r\n\r\n<p> </p>\r\n',0,'Fiac0_2019.jpg','2019-06-17 17:53:38','0000-00-00 00:00:00',2147204895,'0'),(75,'SUNU Assurances Vie Côte d’Ivoire assure la mutuelle INPHB (MUPI)','SUNU Assurances Vie Côte d\'Ivoire insures Mutual INPHB (MUPI)','<p><br>\r\nLe Jeudi 18 juillet 2019, la mutuelle du personnel de L’INPHB (MUPI) Institut National Polytechnique Houphouët Boigny, a accordé leur confiance à SUNU Assurances Vie Côte d&#39;Ivoire pour la couverture d’assurance collective. Cet accord s’est matérialisé par une signature de convention au siège de ladite société d’assurance. Dans ce partenariat, Le produit décès proposé par SUNU Assurances dénommé Bokamin, apporte une assistance financière à la famille de l’assuré en cas de décès de celui-ci par le paiement d’une prime mensuelle.</p>\r\n\r\n<p>Mme KOUONON Olivia, Directeur Production et Encaissement de SUNU Assurances Vie et M. KONAN Jean-Claude, président de la MUPI ont échangé les parapheurs sous la supervision des participants venus pour l’occasion. </p>\r\n','<p>On Thursday, July 18, 2019, the INPHB (MUPI) National Houphouët Boigny National Institute of Polytechnic Institute, placed their trust in SUNU Assurances Vie Côte d&#39;Ivoire for the group insurance coverage . This agreement was materialized by a signature of agreement at the headquarters of the said insurance company. In this partnership, the death product offered by SUNU Assurances called Bokamin, provides financial assistance to the family of the insured in case of death of the latter by the payment of a monthly premium.<br>\r\n <br>\r\nMrs Kouonon Olivia, Production and Collection Director of SUNU Assurances Vie and Mr KONAN Jean-Claude, President of MUPI exchanged the paraphors under the supervision of the participants who came for the occasion.</p>\r\n\r\n<p> </p>\r\n',0,'signatureconvention0_2019.jpg','2019-07-18 08:13:14','0000-00-00 00:00:00',2147204895,'0'),(76,'SUNU Assurances Côte d’Ivoire accompagne les PME','SUNU Assurances Côte d\'Ivoire supports PME','<p>SUNU Assurances Côte d’Ivoire et son partenaire SINCA-RE (Société Internationale de Conseil en Assurances et Réassurances) ont convié les chefs d’entreprises des PME à une présentation des offres d’assurances. Cette rencontre a eu lieu à la Chambre de Commerce et d’Industrie de Côte d’Ivoire le vendredi 12 juillet 2019.</p>\r\n\r\n<p>Le thème abordé à cette formation était : Comment l’assurance peut-elle contribuer à la performance des PME ?<br>\r\nM. Ramses KOUAKOU, Chef de Département Marketing et Business Development, et son collègue M. AKA Responsable Bureau Direct IARD ont entretenu les chefs d’entreprises sur la discipline financière par la suite, ils ont proposé des produits adaptés aux petites moyennes entreprises (PME). </p>\r\n','<p>SUNU Assurances Côte d&#39;Ivoire and its partner SINCA-RE (International Insurance and Reinsurance Advisory Society) have invited PME entrepreneurs to present insurance offers. This meeting took place at the Chamber of Commerce and Industry of Côte d&#39;Ivoire on Friday, July 12, 2019.<br>\r\nThe theme of this training was: How can insurance contribute to the performance of  PME?<br>\r\nMr. Ramses Kouakou, Head of Marketing and Business Development Department, and his colleague Mr. AKA Head of the IARD Direct Office spoke with business leaders about financial discipline afterwards, they proposed products adapted to small and medium-sized enterprises (PME).</p>\r\n',0,'SINCARE0_2019.jpg','2019-07-12 10:39:28','0000-00-00 00:00:00',2147204895,'0'),(77,'SUNU Assurances Vie Partenaire de la 2ème édition de la Grande Soirée Retro','SUNU Assurances Vie Partner of the 2nd edition of the Great Retro Party','<p>Le samedi 3 août, les mélomanes des musiques rétro se sont donné rendez-vous à la 2ème édition de la grande soirée Rétro organisée en partenariat avec SUNU Assurances Vie Côte d’Ivoire. Cet évènement a vu la participation de certains pionniers, de la musique ivoirienne dont : Daouda le Sentimental, Antoinette KONAN, Bailly SPINTO, les Woody et bien d’autres gloires qui ont enflammé le public venu revivre en émotion leur plus belle jeunesse. Ceux-ci, n’ont pas boudé leur plaisir en esquissant des pas de danse au rythme de la musique distillée. Ce fut une soirée forte appréciée.</p>\r\n','<p>On Saturday, August 3rd, retro music lovers will meet at the 2nd edition of the Retro evening organized in partnership with SUNU Assurances Vie Côte d&#39;Ivoire. This event saw the participation of some pioneers, of Ivorian music including: Daouda the Sentimental, Antoinette KONAN, Bailly SPINTO, the Woody and many other glories that ignited the public came relive in emotion their most beautiful youth. These, have not shunned their pleasure by sketching dance steps to the rhythm of distilled music. It was a very popular evening.</p>\r\n',0,'soiréeintranet01.jpg','2019-08-27 08:01:30','0000-00-00 00:00:00',2147204895,'1'),(78,'Sponsoring ELS',' ELS Sponsorship','<p>Cette année, les sociétés SUNU Assurances au Cameroun font partie des sponsors de la Fondation Elessa Lothin Sen (Fondation lancée l’année dernière par l’un des principaux courtiers du marché), dont les activités s’articulent autour de 03 thèmes : l’Education, l’Economie et le Sport.</p>\r\n\r\n<div>Pour cette seconde édition, la Fondation a choisi de s’investir dans l’éducation, en accompagnant des élèves, à travers :</div>\r\n\r\n<div>-Le don de 300 bourses scolaires d’une valeur totale de 5.000.000 F CFA à des écoliers des villes de Mouanko et Edéa, les 16 et 18 Août 2019 ;</div>\r\n\r\n<div>-Et ce 27 septembre, le don d’une bibliothèque de 1 000 livres à une école de la ville de Yaoundé.</div>\r\n\r\n<div>Ces remises de bourses ont également été l’occasion pour SUNU Assurances de présenter ses solutions d’assurance Education aux personnes présentes, et de se positionner comme un acteur majeur de l’Education au Cameroun.</div>\r\n\r\n<div>Les activités de la Fondation se poursuivent jusqu’en décembre.</div>\r\n','<div>This year, the SUNU Assurances companies in Cameroon are part of the sponsors of the Elessa Lothin Sen Foundation (Foundation launched last year by one of the main brokers of the market), whose activities revolve around 03 themes: the Education, Economy and Sport.</div>\r\n\r\n<div>For this second edition, the Foundation has chosen to invest in education, accompanying students, through:</div>\r\n\r\n<div>- The donation of 300 scholarships worth a total of 5,000,000 CFA francs to schoolchildren in the cities of Mouanko and Edea on 16 and 18 August 2019;</div>\r\n\r\n<div>- And this 27th of September, the donation of a library of 1,000 books to a school in the city of Yaounde.</div>\r\n\r\n<div>These scholarship awards were also an opportunity for SUNU Assurances to present its education insurance solutions to those present, and to position itself as a major player in education in Cameroon.</div>\r\n\r\n<div>The activities of the Foundation continue until December.</div>\r\n',0,'sponsoringels0-2019.jpg','2019-08-16 08:05:29','0000-00-00 00:00:00',2147204895,'1'),(79,'Les sociétés SUNU Assurances en Côte d\'Ivoire à la 3ème édition du salon africain des assurances','SUNU Assurances at the 3rd edition of the African Insurance Exhibition','<p>Pour la 3e édition du Salon Africain des Assurances (SADA), tous les acteurs du secteur de l’assurance se sont donnés rendez-vous les 12 et 13 septembre 2019 à Abidjan précisément à la CAISTAB au Plateau.« La digitalisation des assurances au profit des populations » a été la thématique abordée au cours de ces deux (02) journées. Les sociétés SUNU Assurances en Côte d’Ivoire en tant que sponsor, ont présenté leurs offres d’assurance digitale au grand public présent. Les visiteurs présents à leur stand sont repartis très satisfaits par le service reçu.<br>\r\n </p>\r\n','<div>For the 3rd edition of the African Insurance Fair (SADA), all players in the insurance sector have met on September 12 and 13, 2019 in Abidjan specifically at CAISTAB Plateau.</div>\r\n\r\n<div>\"The digitalization of insurance for the benefit of the population\" was the theme addressed during these two (02) days. SUNU Assurances companies in Côte d&#39;Ivoire as a sponsor, presented their digital insurance offers to the general public present.</div>\r\n\r\n<div>The visitors present at their booth left very satisfied with the service received.</div>\r\n',0,'sada0-2019.jpg','2019-09-24 07:46:57','0000-00-00 00:00:00',2147204895,'1'),(80,'SUNU Assurances Vie Burkina Faso : premier tirage Kunadia O\'','SUNU Assurances Vie Burkina Faso : first print Kunadia O \'','<p>Le jeudi 12 septembre 2019, SUNU Assurances Vie Burkina Faso et Orange Money ont procédé au premier tirage au sort de leur produit d’épargne dénommé « Kunadia O’ » à l’agence principale de Sunu Assurances Vie Burkina Faso.<br>\r\nLe but du tirage est de permettre aux clients d’avoir la chance de disposer de l’épargne qui aurait dû être acquise en 25 ans avant échéance.<br>\r\nKunadia O’ conçu par SUNU Assurances Vie et mis en œuvre avec Orange Money Burkina Faso permet au souscripteur de se constituer une épargne de 500 000 FCFA ou 1 000 000 FCFA selon la formule choisie pour laquelle un prélèvement sera fait via Orange money. Le client tiré au sort repartira avec 500 000 ou 1 millions FCFA qu’il percevra dans un délai de 72 heures après réception du rapport de l’huissier.<br>\r\nCe premier tirage a fait deux heureux gagnants. Le prochain tirage aura lieu au mois de décembre 2019.</p>\r\n\r\n<p> </p>\r\n','<p>On Thursday, September 12, 2019, SUNU Assurances Vie Burkina Faso and Orange Money conducted the first draw of their savings product called \"Kunadia O &#39;\" at the main agency of SUNU Assurances Vie Burkina Faso.<br>\r\nThe purpose of the draw is to give customers the chance to have the savings that should have been earned in 25 years before maturity.<br>\r\nKunadia O &#39;designed by SUNU Assurances and implemented with Orange Money Burkina Faso allows subscribers to build up savings of 500,000 FCFA or 1,000,000 FCFA depending on the formula chosen for which a levy will be made via Orange money. The lucky customer will leave with 500,000 or 1 million FCFA that he will receive within 72 hours after receiving the bailiff&#39;s report.<br>\r\nThis first draw made two happy winners. The next draw will take place in December 2019.</p>\r\n',0,'kunadja_o0_2019.jpg','2019-09-12 07:51:13','0000-00-00 00:00:00',2147204895,'1'),(81,'GROUPE SUNU : DESRANCES à Abidjan','SUNU GROUP: DESRANCES in Abidjan','<p>Après le prix du meilleur décor, le prix spécial de l&#39;Assemblée Nationale du Burkina et le prix spécial de la ville de Ouagadougou au FESPACO 2019.<br>\r\nLe Film DESRANCES sponsorisé par SUNU Assurances a reçu le grand prix BUSTE D’OR du meilleur film au Bénin. Il est nominé au ZAFAA Global Awards (Les Zulu African Film Academy Awards) dans les catégories meilleur Film, meilleur scénario, meilleure réalisation.<br>\r\nEn marge de ces différentes nominations les acteurs du film ont été nominés :<br>\r\n- Mike DANON et Missa N’DRY au ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 du NIGERIA qui se tiendra en novembre à Abuja Dans la catégorie Meilleure Performance Masculine pour le Film DESRANCES<br>\r\n </p>\r\n','<p>After the prize for the best decoration, the special prize of the National Assembly of Burkina Faso and the special prize of the city of Ouagadougou at FESPACO 2019.<br>\r\nThe DESRANCES film sponsored by SUNU Insurance received the BUSTE D&#39;OR Grand Prize for the best film in Benin. He is nominated for the ZAFAA Global Awards (Les Zulu African Film Academy Awards) in the categories of Best Film, Best Screenplay, Best Director.<br>\r\nIn addition to these various nominations, the actors of the film were nominated:<br>\r\n- Mike DANON and Missa N&#39;DRY at the ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 NIGERIA in November in Abuja In the Best Male Performance category for the DESRANCES Film<br>\r\n </p>\r\n',0,'desrances_abj0.jpg','2019-09-26 08:00:35','0000-00-00 00:00:00',2147204895,'3'),(82,'GROUPE SUNU : DESRANCES à Abidjan','SUNU GROUP: DESRANCES in Abidjan','<p>Après le prix du meilleur décor, le prix spécial de l&#39;Assemblée Nationale du Burkina et le prix spécial de la ville de Ouagadougou au FESPACO 2019.<br>\r\nLe Film DESRANCES sponsorisé par SUNU Assurances a reçu le grand prix BUSTE D’OR du meilleur film au Bénin. Il est nominé au ZAFAA Global Awards (Les Zulu African Film Academy Awards) dans les catégories meilleur Film, meilleur scénario, meilleure réalisation.<br>\r\nEn marge de ces différentes nominations les acteurs du film ont été nominés :<br>\r\n- Mike DANON et Missa N’DRY au ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 du NIGERIA qui se tiendra en novembre à Abuja Dans la catégorie Meilleure Performance Masculine pour le Film DESRANCES</p>\r\n','<p>After the prize for the best decoration, the special prize of the National Assembly of Burkina Faso and the special prize of the city of Ouagadougou at FESPACO 2019.<br>\r\nThe DESRANCES film sponsored by SUNU Assurances received the BUSTE D&#39;OR Grand Prize for the best film in Benin. He is nominated for the ZAFAA Global Awards (Les Zulu African Film Academy Awards) in the categories of Best Film, Best Screenplay, Best Director.<br>\r\nIn addition to these various nominations, the actors of the film were nominated:<br>\r\n- Mike DANON and Missa N&#39;DRY at the ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 NIGERIA in November in Abuja In the Best Male Performance category for the DESRANCES Film</p>\r\n',0,'desrances_abj01.jpg','2019-09-26 17:42:16','0000-00-00 00:00:00',2147204895,'1'),(83,'SUNU FC vainqueur de la coupe du tournoi « MAO Maman AASO » ','SUNU FC winner of the ','<p>Le samedi 21 septembre 2019, l’équipe de SUNU Assurances Vie Côte d&#39;Ivoire a pris part à la 2ème édition du tournoi de maracana dénommé : la coupe de ‘’MAO MAMAN AASO’’. A cette 2 ème édition six équipes ont discuté la phase éliminatoire au stade du Complexe de YOPOUGON. Après les matches éliminatoires, la troupe de M. MONET André (président de FC SUNU) a battu en final au score de 2 buts à 1, l’équipe Gaulem de Port-bouët et remporta la 2 ème coupe de ‘’MAO MAMAN AASO’’.</p>\r\n','<p>On Saturday, September 21, 2019, the SUNU Assurances Vie Côte d&#39;Ivoire team took part in the 2nd edition of the maracana tournament called: the&#39;&#39;MAO MAMAN AASO&#39;&#39; cup. At this 2nd edition six teams discussed the elimination phase at the YOPOUGON Complex stadium. After the qualifying matches, the troop of Mr. MONET André (president of FC SUNU) defeated in the final (2-1) the Gaulem team of Port-bouët and won the 2nd cup of&#39;&#39;MAO MAMAN AASO&#39;&#39;. </p>\r\n',0,'sunufcoct0-20192.jpg','2019-10-10 17:40:26','0000-00-00 00:00:00',2147204895,'1'),(84,'Les Sociétés SUNU Assurances en Côte d\'Ivoire au rendez-vous des rencontres africaines','SUNU Assurances Companies in Côte d\'Ivoire to attend African meetings','<p>Les sociétés SUNU Assurances en Côte d’Ivoire ont pris part à la 1ère rencontre Africaine du Risk Management organisé par le RIMRAE (Réseau Ivoirien du Management des Risques des Assurances de l’Entreprise) qui s’est tenue le 03 octobre 2019 au Sofitel Hôtel Ivoire. Au cours de ces assises, plusieurs thématiques ont été abordées dont le thème central était : « La gouvernance au cœur de la transformation. ».  <br>\r\nM. Saliou BAKAYOKO, Président de l’Association des Sociétés d’Assurance de Côte d’Ivoire (ASACI) a encouragé l’initiative du panel qui concernait le secteur de l’assurance.</p>\r\n','<p>SUNU Assurances companies in Côte d&#39;Ivoire took part in the 1st African Risk Management Meeting organised by RIMRAE (Réseau Ivoirien du Gestion des Risques des Assurances de l&#39;Entreprise) which was held on 03 October 2019 at Sofitel Hôtel Ivoire. During these meetings, several themes were discussed, the central theme of which was: \"Governance at the heart of transformation. ».  <br>\r\nMr Saliou BAKAYOKO, President of the Association of Insurance Companies of Côte d&#39;Ivoire (ASACI), encouraged the panel&#39;s initiative concerning the insurance sector.</p>\r\n',0,'RIMRAE0-2019.jpg','2019-10-18 17:32:58','0000-00-00 00:00:00',2147204895,'1'),(85,'GROUPE SUNU : BROKERSLINK 2019','SUNU GROUP: BROKERSLINK 2019','<p>Du 17 au 18 Octobre 2019 SUNU Assurances prend part au Brokerslink&#39;s Risk Management Forum en tant que sponsor Platinum.<br>\r\nCette édition qui se déroule à Bordeaux réunit les plus grands courtiers du monde entier pour discuter des tendances clés de la gestion des risques et partager leurs connaissances.<br>\r\nM. Mohamed BAH Directeur Général Délégué du Groupe SUNU et M. Mohamed COMPAORE Directeur Général de la filiale IARD au Burkina participent à cette grande rencontre de l’Assurance.</p>\r\n','<p>From 17 to 18 October 2019 SUNU Insurance is participating in Brokerslink&#39;s Risk Management Forum as a Platinum sponsor.<br>\r\nThis edition, which takes place in Bordeaux, brings together the world&#39;s leading brokers to discuss key risk management trends and share their knowledge.<br>\r\nMr. Mohamed BAH, Deputy Chief Executive Officer of the SUNU Group and Mr. Mohamed COMPAORE, Chief Executive Officer of the IARD subsidiary in Burkina Faso, are participating in this major insurance meeting.</p>\r\n',0,'BROKESRLINK_2019_0.jpg','2019-10-18 16:21:19','0000-00-00 00:00:00',2147204895,'1'),(86,'GROUPE SUNU : Allianz Bénin Assurances devient SUNU Assurances IARD Bénin','SUNU GROUP: Allianz Benin becomes SUNU Assurances Benin','<p>Dès ce Vendredi 18 Octobre 2019, Allianz Bénin Assurances devient SUNU Assurances IARD Bénin, la filiale IARD du Groupe dans le pays.</p>\r\n','<p>As of this Friday, October 18, 2019 Allianz Benin Assurances becomes SUNU Assurances IARD Benin, the Group&#39;s property and casualty subsidiary in the country.</p>\r\n',0,'SUNU_Assurancesiardbénin0-20191.jpg','2019-10-18 17:35:15','0000-00-00 00:00:00',2147204895,'1'),(87,'Le Groupe SUNU honoré par le Groupe NSIA','The SUNU Group honoured by the NSIA Group','<p>C’est en présence de tous les barons de l’assurance que M. Pathé DIONE, PDG et fondateur du Groupe SUNU a reçu des mains de M. Jean KACOU DIAGOU, fondateur du Groupe NSIA un prix spécial décerné au Groupe SUNU. Cette remise de prix a eu lieu ce 18 février 2020, lors d&#39;un dîner offert par NSIA pendant la FANAF 2020. Ces deux géants de l&#39;assurance sont un exemple de réussite de groupes africains qui reconnaissent mutuellement leur expertise et leur constance dans la satisfaction des clients depuis plus de 20 ans.</p>\r\n','<p>It was in the presence of all the insurance barons that Mr Pathé DIONE, CEO and founder of the SUNU Group received from the hands of Mr Jean KACOU DIAGOU, founder of the NSIA Group, a special prize awarded to the SUNU Group. This award ceremony took place on February 18, 2020, during a dinner offered by NSIA during the FANAF 2020. These two insurance giants are an example of success stories of African groups that have mutually recognized their expertise and consistency in customer satisfaction for more than 20 years.</p>\r\n',0,'prixfanafdione_001.jpg','2020-02-18 17:53:45','0000-00-00 00:00:00',2147204895,'1'),(88,'Le Groupe SUNU à la 44ème Assemblée de la FANAF','SUNU Group at the 44th FANAF Assembly','<p>Les travaux de la 44ème Assemblée Générale de la Fédération des Sociétés d&#39;Assurances de Droit National Africaines (FANAF) ont débuté avec un cocktail de bienvenue et une marche solidaire. Après Tunis l’an dernier, Libreville accueille tous les acteurs du secteur de l’assurance du 16 au 20 février 2020 autour du thème général : « La Donnée et l’Innovation au cœur de l’Assurance ». Le moment culminant de cette AG sera sûrement les élections du nouveau président de la FANAF, du secrétaire général et des membres du bureau. Le Groupe y est, comme d’habitude, bien représenté avec notamment la présence du PDG M. Pathé Dione.</p>\r\n','<p>The proceedings of the 44th General Assembly of the Federation of African National Insurance Companies (FANAF) started with a welcome cocktail and a solidarity march. After Tunis last year, Libreville welcomes all the actors of the insurance sector from 16 to 20 February 2020 around the general theme: \"Data and Innovation at the heart of Insurance\". The high point of this GA will surely be the elections of the new FANAF president, the general secretary and the members of the board. The Group is, as usual, well represented with the presence of the CEO Mr. Pathé Dione.</p>\r\n',0,'fanaf0020.jpg','2020-02-16 19:18:06','0000-00-00 00:00:00',2147204895,'1'),(89,'SUNU Assurances en Côte d’Ivoire sponsor du concert de YVIDERO','SUNU Assurances in Côte d\'Ivoire sponsor of the YVIDERO concert','<p>Le vendredi 14 février 2020, fut marqué par le one man show de l’artiste-comédienne YVIDERO à L’Hôtel Sofitel Ivoire auquel ont pris part les sociétés SUNU Assurances en Côte d’Ivoire en qualité de sponsor. Un événement vivement attendu qui a vu la participation de plusieurs entreprises exerçant dans divers domaines d’activité.<br>\r\nPour matérialiser l’une de ses valeurs qui est de mettre « LE CLIENT AU CENTRE DE TOUT », les sociétés SUNU Assurances en Côte d&#39;Ivoire ont offert gracieusement des tickets VIP à leurs clients qui ont apprécié la marque d’attention. Une animation a permis au public de gagner des lots SUNU Assurances. La soirée s’est achevée par un bal poussière qui a permis au public d’esquisser des pas de danse avec la star.</p>\r\n\r\n<p> </p>\r\n','<p>Friday, February 14, 2020, was marked by the one man show of the artist-comedian YVIDERO at the Hotel Sofitel Ivoire in which took part the companies SUNU Assurances in Côte d&#39;Ivoire as a sponsor. An event eagerly awaited which saw the participation of several companies operating in various fields of activity.<br>\r\nTo materialize one of its values which is to put \"THE CUSTOMER AT THE CENTER OF EVERYTHING\", the SUNU Assurances companies in Côte d&#39;Ivoire offered free VIP tickets to their customers who appreciated the mark of attention. An animation allowed the public to win SUNU Assurances prizes. The evening ended with a dust ball that allowed the public to sketch out dance steps with the star.</p>\r\n',0,'yvideroshow20-00.jpg','2020-02-14 19:34:26','0000-00-00 00:00:00',2147204895,'1'),(90,'SUNU ASSURANCES VIE BURKINA FASO : OPERATION DON DE SANG DANS LE CADRE DE LA LUTTE CONTRE LA COVID-19','SUNU ASSURANCES VIE BURKINA FASO : OPERATION BLOOD DONATION AS PART OF THE FIGHT AGAINST COVID-19','<p>SUNU Assurances Vie Burkina Faso s’est récemment mobilisée aux côtés du Centre National de Transfusion Sanguine du Burkina Faso (CNTS). En effet, la lutte contre le COVID-19 a fortement bouleversé le système sanitaire du Burkina Faso entrainant, entre autres, la réduction drastique du stock de la banque de sang et des difficultés de ravitaillement. Le CNTS a lancé un appel à travers les médias nationaux auquel SUNU Assurances Vie Burkina Faso a répondu favorablement. Une opération don de sang a donc été organisée le mercredi 22 avril 2020 dans ses locaux avec le personnel de SUNU Assurances et des sociétés riveraines. Ce sont au total 52 poches de sang qui ont été collectées. Le Directeur Général de SUNU Assurances Vie Burkina Faso, M. Jean-François KAMBOU, n’a pas manqué de rappeler que sa société ne pouvait pas rester insensible à cette situation. Il a ensuite remercié l’ensemble des collaborateurs des filiales du Groupe SUNU au Burkina Faso et les riverains pour avoir donné un peu de leur personne pour sauver des vies.</p>\r\n','<p>SUNU Assurances Vie Burkina Faso has recently mobilized alongside the National Blood Transfusion Centre of Burkina Faso (CNTS). Indeed, the fight against COVID-19 has greatly disrupted the health system of Burkina Faso leading, among other things, to the drastic reduction of the blood bank stock and supply difficulties. The CNTS launched an appeal through the national media to which SUNU Assurances Vie Burkina Faso responded favourably. A blood donation operation was therefore organized on Wednesday, April 22<sup>th</sup>, 2020 in its premises with the staff of SUNU Assurances and local companies. A total of 52 bags of blood were collected. The Managing Director of SUNU Assurances Vie Burkina Faso, Mr. Jean-François KAMBOU, did not fail to recall that his company could not remain insensitive to this situation. He then thanked all the employees of the SUNU Group subsidiaries in Burkina Faso and the local residents for having given a little of themselves to save lives.</p>\r\n',0,'Don_de_sang_BF_001.jpg','2020-05-29 08:48:07','0000-00-00 00:00:00',2147204895,'1');
