INSERT INTO `description` VALUES (1,'SUNU Assurances IARD Burkina Faso','SUNU Assurances IARD Burkina Faso','','<div class=\"col-md-12 col-sm-12 col-xs-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-left: 15px; padding-right: 15px; float: left; width: 877.5px; color: rgb(119, 119, 119); font-family: Glober, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">\n<p>Created on 30 December 2005 by private investors from Burkina and SUNU Group, SUNU Assurances IARD Burkina Faso operates in the field of casualty insurance. Sticking to its commitments, it serves the people of Burkina Faso with a solid reinsurance program through the best reinsurers in the world and a young and dynamic staff.</p>\n</div>\n','<p><span style=\"background-color:rgb(255, 255, 255); color:rgb(102, 102, 102); font-family:glober,sans-serif; font-size:14px\">Cr&eacute;&eacute;e le 30 d&eacute;cembre 2005, par des priv&eacute;s burkinab&eacute;s et le Groupe SUNU, SUNU Assurances IARD Burkina Faso op&egrave;re dans le domaine des assurances de dommages. Fid&egrave;le &agrave; ses engagements, elle demeure l&rsquo;assureur au service des burkinab&eacute;s avec un programme de r&eacute;assurance solide avec les meilleurs r&eacute;assureurs mondiaux et un personnel jeune et dynamique.</span></p>\r\n','sunu-bf2.jpg','<p><span style=\"background-color:rgb(255, 255, 255); color:rgb(102, 102, 102); font-family:glober,sans-serif; font-size:14px\">Avenue du Dr Kwam&eacute; N&rsquo;krumah</span><br />\r\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(102, 102, 102); font-family:glober,sans-serif; font-size:14px\"