INSERT INTO `equipe` VALUES (4,'dione','pathé',1,'Président Directeur Général <br>\r\nFondateur du Groupe SUNU','Chairman and CEO <br>\r\nFounder of SUNU Group','<p>M. Pathé DIONE, fondateur du Groupe SUNU, a été professeur de Mathématiques avant de rejoindre la société d’assurance les Mutuelles du Mans en 1972. Après l’obtention de son doctorat en Economie à l’université de la Sorbonne et un passage à l’école des Assurances de Paris, il est embauché par CIGNA Corporation qu’il représente en Côte d’Ivoire à travers sa filiale COLINA. En 1984, il occupera la fonction de Directeur Afrique de l’Union des Assurances de Paris (UAP) jusqu’à son absorption par AXA en 1997. En 1998, il décide de créer avec d’anciens collaborateurs, un groupe panafricain au service du continent SUNU.</p>','<p>Mr. Pathé DIONE, founder of SUNU Group, was a Mathematics professor before joining the insurance company Mutuelles du Mans in 1972. After completing his PhD in Economics at Sorbonne University and a transition through Paris Insurance School (école des Assurances de Paris), he was hired by CIGNA Corporation that he represented in Côte d’Ivoire as the Head of its subsidiary COLINA. In 1984, he became Director for Africa at UAP (Union des Assurances de Paris) until UAP was taken over by AXA in 1997. In 1998, he decided to create, together with former colleagues, SUNU, a pan-African group that serves the continent.</p>','PatheDione.jpg','2018-06-03 12:47:31',NULL,2147483647,'1'),(5,'dione','karim-franck',0,'Directeur en charge du Contrôle de Gestion<br>\r\net de la Gestion Financière','Director, <br>\r\nHead of Management Control<br>\r\nand Financial Management Divisions.',NULL,NULL,'karim-dione.jpg','2018-06-03 13:00:19',NULL,2147483647,'1'),(6,'amoussou','joël',0,'Directeur Général Délégué <br>\r\nEn charge de la Gestion Comptable, <br>\r\nFinancière, Administrative et Juridique','Deputy Managing Director <br>\r\nHead of Accounting, Finance, <br>\r\nAdministration and Legal Affairs.',NULL,NULL,'JoelAmoussou.jpg','2018-06-03 13:01:21',NULL,2147483647,'1'),(7,'bah','mohamed',0,'Directeur Général Délégué En charge <br>\r\ndu Dévéloppement International, de la Stratégie, <br>\r\nCommerciale et de la Communication <br>','Deputy Managing Director<br>\r\nHead of International Development,<br>\r\nStrategy, Sales and Communication',NULL,NULL,'MohamedBah.jpg','2018-06-03 13:01:56',NULL,2147483647,'1');
