INSERT INTO `historique` VALUES (3,'1998','0','Monsieur Pathé DIONE crée avec d’autres partenaires la société SUNU Finances Holding SA, domiciliée à la Banque Bruxelles Lambert Trust (BBL, devenue ING Trust) au Luxembourg et bénéficiant du statut fiscal particulier attaché aux Holding 1929. La société a été créée dans un premier temps par deux structures (LOVETTE Overseas SA et GREBELLE Investments SA) de l’agent domiciliataire (BBL) puis les actions ont été cédées aux actionnaires historiques en septembre 1999. En novembre, la société SUNU Finances signe avec AXA-UAP un protocole d’accord qui l‘autorise à acquérir progressivement les sociétés qu’AXA souhaiterait céder en Afrique.\r\n','Pathé DIONE and other partners created the company SUNU Finances Holding SA domiciled at Banque Bruxelles Lambert Trust (BBL, now known as ING Trust) in Luxembourg. The company benefits from special tax status and operates under the 1929 holding regime.<br>\r\nFirst the company was created by two firms (LOVETTE Overseas SA et GREBELLE Investments SA) of the domiciliary agent (BBL); then the shares were transferred to the historical shareholders in 1999.<br>\r\nIn November, SUNU Finances and AXA-UAP signed a memorandum of agreement allowing SUNU Finances to gradually acquire the companies in Africa AXA would like to dispose of.\r\n','2018-06-03 09:51:40',NULL,2147484848,'1'),(4,'1999','0','<p>SUNU Finances (société mère du Groupe SUNU), rachète cinq filiales du groupe AXA-UAP à savoir :</p>\r\n\r\n<ul>\r\n <li>La CSAR-Vie au Sénégal désormais SUNU Assurances Vie Sénégal au Sénégal après avoir porté le nom de UASen-Vie,</li>\r\n <li>SUNU Assurances Vie Togo (ex UAT-Vie) au Togo,</li>\r\n <li>SUNU Assurances Vie Bénin (ex UBA-Vie) au Bénin,</li>\r\n <li>SUNU Assurances IARD Centrafrique (ex UAC-IARD) en Centrafrique,</li>\r\n <li>SUNU Assurances IARD Niger (ex UGAN-IARD) au Niger.</li>\r\n</ul>\r\n\r\n<p>SUNU Finances crée SUNU Gestion, une EURL en France, qui fournit des prestations d’assistance technique aux sociétés d’assurances du groupe SUNU.</p>\r\n','<p>SUNU Finances (parent company of SUNU Group), acquires the five subsidiaries of AXA-UAP Group that follow:</p>\r\n\r\n<ul>\r\n <li>CSAR-Vie in Senegal renamed UASen-Vie and now called SUNU Assurances Vie Sénégal.</li>\r\n <li>SUNU Assurances Vie Togo (ex UAT-Vie) in Togo,</li>\r\n <li>SUNU Assurances Vie Bénin (ex UBA-Vie) in Benin,</li>\r\n <li>SUNU Assurances IARD Centrafrique (ex UAC-IARD) in Central African Republic.</li>\r\n <li>SUNU Assurances IARD Niger (ex UGAN-IARD) in Niger.</li>\r\n</ul>\r\n\r\n<p>SUNU Finances created SUNU Gestion, a sole proprietorship limited liability company based in France. SUNU Finances provides technical support to the insurance companies of SUNU Group.</p>\r\n','2018-06-03 11:17:56',NULL,2147484848,'1'),(5,'2000','0','<p>Création de SUNU Assurances Vie Niger (ex UGAN-Vie) au Niger en partenariat avec des banques locales.</p>\r\n','<p>Incorporation of SUNU Assurances Vie Niger (ex UGAN-Vie) in partnership with some local banks.</p>\r\n','2018-06-03 11:18:55',NULL,2147484848,'1'),(6,'2001','0','<p>SUNU Finances crée SUNU Assurances Holding S.A, une holding 1929 au Luxembourg dans laquelle sont transférées les sociétés d’assurances détenues.</p>\r\n\r\n<p>Elle ouvre le capital de SUNU Assurances à hauteur de 49% à un partenaire, la Société d’Investissement (S.I.). L’arrivée de la S.I. a permis une accélération de la croissance externe du Groupe SUNU. </p>\r\n\r\n<p>Dans la même foulée, acquisition des deux filiales des Mutuelles du Mans en Côte d’Ivoire auparavant dénommées Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) désormais SUNU Assurances IARD Côte d’Ivoire et SUNU Assurances Vie Côte d’Ivoire. </p>\r\n\r\n<p>D’autre part, SUNU Assurances détient 80 du capital de SUNU Gestion après augmentation de capital de cette dernière.</p>\r\n','<p>SUNU Finances created SUNU Assurances Holding S.A, a 1929 holding company in Luxembourg and transferred all its daughter insurance companies to SUNU Assurances Holding S.A.</p>\r\n\r\n<p>SUNU Finances sold 49% of the shares of SUNU Assurances to its partner Société d’Investissement (S.I.). The entry of S.I in SUNU Assurances capital boosted the external growth of SUNU Group. </p>\r\n\r\n<p>Around the same time, SUNU Group acquired two subsidiaries of Les Mutuelles du Mans in Côte d’Ivoire. The two companies formerly called Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) have been respectively rebranded as SUNU Assurances IARD Côte d’Ivoire and SUNU Assurances Vie Côte d’Ivoire.<br>\r\n<br>\r\nOn the other hand, after the increase of SUNU Gestion capital, SUNU Assurances now holds 80 of its shares.</p>\r\n','2018-06-03 11:19:42',NULL,2147484848,'1'),(7,'2002','0','<p>Prise de contrôle de la société Alliance Africaine d’Assurances Vie (3A-Vie) à la suite de sa recapitalisation.</p>\r\n','<p>Takeover of Alliance Africaine d’Assurances Vie (3A-Vie) after its recapitalisation.</p>\r\n','2018-06-03 11:20:09',NULL,2147484848,'1'),(8,'2004','0','<p>Rachat de trois filiales Vie d’AXA en Côte d’Ivoire, au Cameroun et au Gabon. Ces trois sociétés alors dénommées, Union des Assurances de Côte d’Ivoire Vie (UA-Vie), Union des Assurances du Cameroun Vie (UACam-Vie), Union des Assurances du Gabon Vie (UAG-Vie). Ces sociétés portent respectivement aujourd’hui le nom de SUNU Assurances Vie Côte d’Ivoire, SUNU Assurances Vie Cameroun et SUNU Assurances Vie Gabon. Le groupe SUNU acquiert également la société SUNU Assurances IARD Togo alors UAT-IARD et une participation de 40%.</p>\r\n','<p>Acquisition of three Life insurance daughter companies of AXA in Côte d’Ivoire, Cameroon and Gabon. The three companies, formerly known as Union des Assurances de Côte d’Ivoire Vie (UA-Vie), Union des Assurances du Cameroun Vie (UACam-Vie), Union des Assurances du Gabon Vie (UAG-Vie) have been respectively rebranded as SUNU Assurances Vie Côte d’Ivoire, SUNU Assurances Vie Cameroun et SUNU Assurances Vie Gabon.<br>\r\nSUNU Group also acquired 40% of SUNU Assurances IARD Togo, formerly called UAT-IARD.</p>\r\n','2018-06-03 11:20:30',NULL,2147484848,'1'),(9,'2005','0','<p>Prise d’une participation de 45% dans le capital de SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.) au Burkina Faso.</p>\r\n','<p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n','2018-06-03 11:21:11',NULL,2147484848,'1'),(10,'2006','0','<p>Rachat total de la participation de la Société d’Investissement S.A dans SUNU Assurances Holding S.A par SUNU Finances.</p>\r\n','<p>SUNU Finances bought out the shares of Société d’Investissement S.A in SUNU Assurances Holding S.A.</p>\r\n','2018-06-03 11:21:37',NULL,2147484848,'1'),(11,'2010','7','Transfert des deux holding SUNU Assurances et SUNU Finances en France. Leurs nouvelles dénominations sociales sont respectivement SUNU Assurances Holding S.A et SUNU Finances Holding S.A.S. Les deux sociétés, qui étaient jusqu’alors des sociétés de droit luxembourgeois, ont changé leur nationalité, respectivement en société anonyme de droit français et en société par actions simplifiée, et transféré leur siège social en France. Cette opération, autorisée par les législations luxembourgeoise et française, s’est opérée, conformément auxdites législations, avec maintien de la personnalité morale desdites sociétés, et a pris effet à la date du 19 août 2010, date de leur immatriculation en France au Registre du Commerce et des Sociétés (« RCS ») du lieu de leur nouveau siège social (RCS de Créteil)\r\n','SUNU Assurances and SUNU Finances, the two holding companies are transferred to France. Their new corporate names are now respectively SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S. Both companies that were until now incorporated under Luxembourg law, have turned into French law, respectively as a public company and a simplified joint-stock company.<br>\r\nBoth companies moved their head offices to France. The operation was allowed by the authorities of France and Luxembourg and took place in accordance with both countries legislations. This process, during which the legal personality of the companies was preserved, came into effect on 19 August 2010 when SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S got registered with the Registry of Companies of Creteil (RCS Creteil) where they are headquartered.\r\n','2018-06-03 11:22:25',NULL,2147484848,'1'),(12,'2010','12','SUNU Assurances Holding SA a décidé de dissoudre par anticipation la société SUNU Gestion SAS, dont elle était l’associée unique après avoir repris les parts de SUNU Finances, avec Transmission Universelle de Patrimoine en sa faveur, conformément aux dispositions de l’article 1844-5 alinéa 3 du code civil.\r\n','SUNU Assurances Holding SA proactively dissolved its daughter company SUNU Gestion SAS. After taking over the shares of SUNU Finances and after the universal transmission of its assets to SUNU Assurances Holding SA, the latter became the sole partner of the former in accordance with the provisions of article 1844-5 paragraph 3 of the civil code.\r\n','2018-06-03 11:23:10',NULL,2147484848,'1'),(13,'2012','1','SUNU Assurances Abidjan démarre ses activités et a pour rôle de regrouper les Directions Centrales du Groupe SUNU.\r\n','SUNU Assurances Abidjan was launched with the aim to group together all the central departments of SUNU Group.\r\n','2018-06-03 11:23:47',NULL,2147484848,'1'),(14,'2012','7','Démarrage des activités de SUNU Assurances IARD Mali (ex UA-IARD Mali) et de SUNU Assurances Guinée (ex UA-IARD Guinée).\r\n','Launch of SUNU Assurances IARD Mali (ex UA-IARD Mali) and SUNU Assurances Guinée (ex UA-IARD Guinée).\r\n','2018-06-03 11:24:13',NULL,2147484848,'1'),(15,'2013','4','Changement de dénomination sociale de SUNU Assurances Abidjan qui est désormais la suivante : SUNU Services.\r\n','Rebranding of SUNU Assurances Abidjan henceforth called SUNU Services.\r\n','2018-06-03 11:24:40',NULL,2147484848,'1'),(16,'2014','7','Démarrage des activités de SUNU Assurances Vie Burkina Faso (ex UA-Vie Burkina Faso).\r\n','Launch of SUNU Assurances Vie Burkina Faso (former UA-Vie Burkina Faso).\r\n','2018-06-03 11:25:35',NULL,2147484848,'1'),(17,'2014','9','Changement de dénomination sociale de SUNU Assurances Holding SA qui est désormais la suivante : SUNU Participations Holding SA.\r\n','Rebranding of SUNU Assurances Holding SA henceforth called SUNU Participations Holding SA.\r\n','2018-06-03 11:26:16',NULL,2147484848,'1'),(18,'2015','1','Changement de dénomination de 16 filiales du Groupe désormais appelées SUNU Assurances.\r\n','Rebranding of the 16 subsidiaries of SUNU Group now called SUNU Assurances.\r\n','2018-06-03 11:26:45',NULL,2147484848,'1'),(19,'2015','10','Fusion de LMAI Vie et SUNU Assurances Vie formant désormais SUNU Assurances Vie Côte d’Ivoire.\r\n','Merger of LMAI Vie and SUNU Assurances Vie henceforth to form SUNU Assurances Vie Côte d’Ivoire.\r\n','2018-06-03 11:27:08',NULL,2147484848,'1'),(20,'2015','12','Création d&#39;une nouvelle société IARD au Gabon: SUNU Assurances IARD Gabon.\r\n','Incorporation of a new General insurance company in Gabon: SUNU Assurances IARD Gabon.\r\n','2018-06-03 11:28:41',NULL,2147484848,'1'),(21,'2016','12','Avie et SUNU Assurances Vie Bénin fusionnent pour devenir la plus grande société vie du Bénin.\r\n','Avie and SUNU Assurances Vie Benin merge and become the biggest Health insurance company in Benin.\r\n','2018-06-03 11:29:06',NULL,2147484848,'1'),(22,'2017','6','Immatriculation au registre de commerce du Togo de SUNU santé, créée en Décembre 2016. Cette société a pour mission de gérer les contrats d&#39;assurances santé des sociétés IARD du groupe SUNU.\r\n','SUNU Santé, incorporated in December 2016, is registered in Togo. The mission of SUNU Santé is to manage the Health insurance contracts issued by General insurance companies of SUNU Group.\r\n','2018-06-03 11:29:30',NULL,2147484848,'1'),(23,'2017','7','Création de SUNU Assurances IARD Cameroun suite à la recapitalisation de la société CAMINSUR.\r\n','Incorporation of SUNU Assurances IARD Cameroon following the recapitalisation of the company CAMINSUR.\r\n','2018-06-03 11:29:57',NULL,2147484848,'1'),(24,'2017','7','Création de SUNU Investment Holding SA qui portera désormais les participations bancaires du Groupe SUNU.\r\n','Incorporation of SUNU Investment Holding SA that will be in charge of the bank holdings of SUNU Group.\r\n','2018-06-03 11:30:24',NULL,2147484848,'1'),(25,'2018','0','<p>Acquisition de la Banque Populaire pour l&#39;Epargne et le Crédit (BPEC) du Togo par le Groupe SUNU.</p>\r\n','<p>Acquisition of <em>Banque Populaire pour l&#39;Epargne et le Crédit</em> (BPEC) of Togo by SUNU Group.</p>\r\n','2018-06-03 11:30:44',NULL,2147484848,'1');
