INSERT INTO `log` VALUES (512,2147484848,'2018-05-03 09:27:06','_SESSION','login|all|1525346564|0|__ci_last_regenerate=>1525346564\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2018-05-02 08:24:56::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n'),(513,2147484848,'2018-05-03 09:53:37','article','insert|all|2|0|id_article=>2\ntitre_article=>GABON : LE GROUPE SUNU DÉVOILE SES AMBITIONS POUR LE GABON\ntexte_article=><p><span xss=removed>Présents à Libreville dans le cadre des conseils des comptes, les membres du comité de direction du Groupe SUNU : M. Pathé DIONE, PDG, Messieurs Mohamed BAH et Joël AMOUSSOU, Directeurs Généraux Délégués ont rencontré partenaires et clients locaux le 22 mars 2018.</span><span xss=removed>[...] </span></p>\r\n\r\n<p><span xss=removed>Les échanges axés sur les ambitions du Groupe SUNU en Afrique et particulièrement pour le Gabon, ont capté l’attention des invités. Ils étaient accompagnés par l’équipe dirigeante des filiales SUNU Assurances Vie et IARD du Gabon.</span></p>\r\n\nlecture_article=>0\nfichier_article=>5548894181525348417.jpg\ndateCreated_article=>2018-04-22 11:53:37\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(514,2147484848,'2018-05-03 10:00:09','article','insert|all|3|0|id_article=>3\ntitre_article=>CÔTE D\'IVOIRE : SUNU ASSURANCES VIE CI OSE AVEC LES FEMMES FEEF\ntexte_article=><p><span xss=removed>Les 16 et 17 mars 2018, SUNU Assurances Vie CI a « Osé » en étant le partenaire de la 5ème édition du Forum de l’Emploi et de l’Entreprenariat Féminin « FEEF2018 ». Deux jours de festivités qui ont permis aux femmes venues de différents horizons de partager leurs expériences sur des problématiques liées à l’emploi à travers conférences et panels.</span><span xss=removed> </span>[...] </p>\r\n\r\n<p>Avec pour thème : « Osez ! Et Réalisez vos rêves », le FEEF 2018 a tenu encore ses promesses cette année. Un défilé de mode et un feu d’artifice ont permis de refermer les portes de cette 5ème édition.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525348809.jpg\ndateCreated_article=>2018-03-16 12:00:09\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(515,2147484848,'2018-05-03 10:00:33','article','update|all|2|id_article=>2\ntitre_article=>GABON : LE GROUPE SUNU DÉVOILE SES AMBITIONS POUR LE GABON\ntexte_article=><p><span xss=removed>Présents à Libreville dans le cadre des conseils des comptes, les membres du comité de direction du Groupe SUNU : M. Pathé DIONE, PDG, Messieurs Mohamed BAH et Joël AMOUSSOU, Directeurs Généraux Délégués ont rencontré partenaires et clients locaux le 22 mars 2018.</span><span xss=removed>[...] </span></p>\r\n\r\n<p><span xss=removed>Les échanges axés sur les ambitions du Groupe SUNU en Afrique et particulièrement pour le Gabon, ont capté l’attention des invités. Ils étaient accompagnés par l’équipe dirigeante des filiales SUNU Assurances Vie et IARD du Gabon.</span></p>\r\n\nlecture_article=>0\nfichier_article=>5548894181525348417.jpg\ndateCreated_article=>2018-04-22 11:53:37\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>2\ntitre_article=>GABON : LE GROUPE SUNU DÉVOILE SES AMBITIONS POUR LE GABON\ntexte_article=><p>Présents à Libreville dans le cadre des conseils des comptes, les membres du comité de direction du Groupe SUNU : M. Pathé DIONE, PDG, Messieurs Mohamed BAH et Joël AMOUSSOU, Directeurs Généraux Délégués ont rencontré partenaires et clients locaux le 22 mars 2018.[...] </p>\r\n\r\n<p>Les échanges axés sur les ambitions du Groupe SUNU en Afrique et particulièrement pour le Gabon, ont capté l’attention des invités. Ils étaient accompagnés par l’équipe dirigeante des filiales SUNU Assurances Vie et IARD du Gabon.</p>\r\n\nlecture_article=>0\nfichier_article=>5548894181525348417.jpg\ndateCreated_article=>2018-03-22 12:00:33\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_ar