FEEF 2018 a tenu encore ses promesses cette année. Un défilé de mode et un feu d’artifice ont permis de refermer les portes de cette 5ème édition.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351213.jpg\ndateCreated_article=>2018-03-16 12:40:13\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(520,2147484848,'2018-05-03 10:43:48','article','insert|all|5|0|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntexte_article=><p> </p>\r\n\r\n<p><span xss=removed>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé.</span>[...] </p>\r\n\r\n<p>Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-15 12:43:48\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(521,2147484848,'2018-05-03 10:44:26','article','update|all|4|id_article=>4\ntitre_article=>CÔTE D\'IVOIRE : RÉFLEXION SUR LE DIGITAL À L\'AFRICA DIGITAL MONEY AND BANKING\ntexte_article=><p><span xss=removed>Les 16 et 17 mars 2018, SUNU Assurances Vie CI a « Osé » en étant le partenaire de la 5ème édition du Forum de l’Emploi et de l’Entreprenariat Féminin « FEEF2018 ». Deux jours de festivités qui ont permis aux femmes venues de différents horizons de partager leurs expériences sur des problématiques liées à l’emploi à travers conférences et panels.</span><span xss=removed> </span>[...] </p>\r\n\r\n<p>  Avec pour thème : « Osez ! Et Réalisez vos rêves », le FEEF 2018 a tenu encore ses promesses cette année. Un défilé de mode et un feu d’artifice ont permis de refermer les portes de cette 5ème édition.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351213.jpg\ndateCreated_article=>2018-03-16 12:40:13\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>4\ntitre_article=>CÔTE D\'IVOIRE : RÉFLEXION SUR LE DIGITAL À L\'AFRICA DIGITAL MONEY AND BANKING\ntexte_article=><p>Les 16 et 17 mars 2018, SUNU Assurances Vie CI a « Osé » en étant le partenaire de la 5ème édition du Forum de l’Emploi et de l’Entreprenariat Féminin « FEEF2018 ». Deux jours de festivités qui ont permis aux femmes venues de différents horizons de partager leurs expériences sur des problématiques liées à l’emploi à travers conférences et panels. [...] </p>\r\n\r\n<p>Avec pour thème : « Osez ! Et Réalisez vos rêves », le FEEF 2018 a tenu encore ses promesses cette année. Un défilé de mode et un feu d’artifice ont permis de refermer les portes de cette 5ème édition.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351213.jpg\ndateCreated_article=>2018-03-16 12:44:26\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(522,2147484848,'2018-05-03 10:44:45','article','update|all|5|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntexte_article=><p> </p>\r\n\r\n<p><span xss=removed>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé.</span>[...] </p>\r\n\r\n<p>Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-15 12:43:48\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntexte_article=><p>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé.[...] </p>\r\n\r\n<p>Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-15 12:44:45\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(523,2147484848,'2018-05-04 05:05:13','_SESSION','login|all|1525417303|0|__ci_last_regenerate=>1525417303\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2018-05-03 11:27:05::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n'),(524,2147484848,'2018-05-04 05:11:45','publication','insert|all|2|0|id_publication=>2\ntitre_publication=>INTERVIEW DE M. PATHÉ DIONE, PDG DU GROUPE DANS LE HS N°47 DE JEUNE AFRIQUE\ntexte_publication=><p><span xss=removed>Interview de M. Pathé DIONE, PDG du Groupe dans le HS N°47 de Jeune Afrique.</span></p>\r\n\nfichier_publication=>21474848481525417905.pdf\ndateCreated_publication=>2018-05-04 07:11:45\ndateDisabled_publication=>\ncreatedBy=>2147484848\nstatut_publication=>1