-05-04 05:39:57','publication','insert|all|11|0|id_publication=>11\ntitre_publication=>CLASSEMENT 100 PREMIERS ASSUREURS AFRICAINS\ntexte_publication=><p><span xss=removed>Dans le spécial Finances du magazine JEUNE AFRIQUE, un classement des 100 premières sociétés d’assurance du continent confirme une fois de plus la position de Leader de SUNU Assurances Vie Côte d’Ivoire en Afrique subsaharienne.</span></p>\r\n\nfichier_publication=>13758208571525419597.pdf\ndateCreated_publication=>2018-05-04 07:39:57\ndateDisabled_publication=>\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(534,2147484848,'2018-05-04 05:40:47','publication','insert|all|12|0|id_publication=>12\ntitre_publication=>ENTRETIEN / BAKAYOKO SALIOU (PRIX FANAF 2016)\ntexte_publication=><p><span xss=removed>ENTRETIEN / BAKAYOKO SALIOU (PRIX FANAF 2016) / Ce qu&#39;il pense du séminaire de Yamoussoukro « L’Assurance Vie évite de pleurer deux fois nos morts »</span></p>\r\n\nfichier_publication=>21474848481525419646.pdf\ndateCreated_publication=>2018-05-04 07:40:46\ndateDisabled_publication=>\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(535,2147484848,'2018-05-04 05:46:14','publication','insert|all|13|0|id_publication=>13\ntitre_publication=>RAPPORT ANNUEL 2015\ntexte_publication=><p><span xss=removed>2015 a été l&#39;année de consécration de notre image avec l’uniformisation de notre identité dans la majorité de nos filiales. La marque SUNU Assurances a su s’imposer dans l’esprit du grand public et donner une signature forte à toutes les entités du Groupe.</span></p>\r\n\nfichier_publication=>21474848481525419973.pdf\ndateCreated_publication=>2018-05-04 07:46:13\ndateDisabled_publication=>\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(536,2147484848,'2018-05-04 05:48:19','publication','insert|all|14|0|id_publication=>14\ntitre_publication=>INTERVIEW M. ATEBI ZIRIGA, DGA SUNU ASSURANCES IARD CÔTE D\'IVOIRE\ntexte_publication=><p><span xss=removed>Figurant parmi les leaders de l’assurance en zone CIMA, le Groupe SUNU peut s’enorgueillir d’une progression régulière de son chiffre d’affaires. M. ATEBI-ZIRIGA, directeur général adjoint, revient sur les raisons de ce succès. Le Groupe Sunu a entrepris une vaste campagne de communication ciblée sur la nouvelle dénomination de l’entreprise. Qu’est-ce qui a motivé ce choix ?</span></p>\r\n\nfichier_publication=>6529406471525420099.pdf\ndateCreated_publication=>2018-05-04 07:48:19\ndateDisabled_publication=>\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(537,2147484848,'2018-05-04 09:55:42','_SESSION','login|all|1525434684|0|__ci_last_regenerate=>1525434684\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2018-05-04 07:05:13::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n'),(538,2147484848,'2018-05-14 08:34:18','_SESSION','login|all|1526294058|0|__ci_last_regenerate=>1526294058\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2018-05-04 11:55:41::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n'),(539,2147484848,'2018-05-14 08:35:39','publication','update|all|15|id_publication=>15\ntitre_publication=>Plaquette 2016\ntexte_publication=>\nfichier_publication=>Plaquette _SUNU2016_web.pdf\ndateCreated_publication=>2018-05-04 05:01:00\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>15\ntitre_publication=>Plaquette 2016\ntexte_publication=><p>Présent dans 14 pays d’Afrique de l’ouest et centrale, le Groupe SUNU est un groupe d’assurances africain créé en 1998 par M. Pathé DIONE avec d’anciens collaborateurs. </p>\r\n\nfichier_publication=>Plaquette _SUNU2016_web.pdf\ndateCreated_publication=>2018-05-04 10:35:38\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(540,2147484848,'2018-05-14 08:55:48','publication','insert|all|19|0|id_publication=>19\ntitre_publication=>INTERVIEW DE M. MOHAMED BAH, DGD GROUPE SUNU (PME MAG : 12ÈME ÉDITION DES 500 PREMIÈRES ENTREPRISES DE CI)\ntexte_publication=><p><span xss=removed>Interview de M. Mohamed BAH, Directeur Général Délégué du Groupe SUNU dans le PME Mag : 12ème édition des 500 premières entreprises de Côte d&#39;Ivoire.</span></p>\r\n\nfichier_publication=>Interview_de_M_Mohamed_BAH.pdf\ndateCreated_publication=>2018-05-14 10:55:47\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(541,2147484848,'2018-05-14 10:12:47','article','insert|all|6|0|id_article=>6\ntitre_article=>LA BPEC REJOINT OFFICIELLEMENT LE GROUPE SUNU\ntexte_article=><p>Le mercredi 09 mai 2018, clients, partenaires et médias étaient dans les locaux de la Banque Populaire de l’Épargne et du Crédit (BPEC) du Togo pour prendre part à un petit déjeuner convivial. L&#39;objet de cette rencontre était l&#39;annonce officielle de l&#39;entrée de la BPEC dans le Groupe SUNU.[...] </p>\r\n\r\n<p>Après l’intervention de M. Christophe LASSUS-LALANNE, DG de la BPEC, M. Razack FASSASSI, DG de SUNU Assurances Vie Togo a, au nom du Groupe SUNU, édifié les invités sur les intérêts de cette nouvelle acquisition pour les entreprises et les populations. La BPEC, première banque du Groupe SUNU, permettra d&#39;offrir des produits packagées banque & assurance plus accessibles en un lieu unique.</p>\r\n\nlecture_article=>0\nfichier_article=>bpec_sunu_actu.jpg\ndateCreated_article=>2018-05-09 12:12:47\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(542,2147484848,'2018-05-14 10:14:17','article','insert|all|7|0|id_article=>7\ntitre_article=>SUNU ASSURANCES AU SOMMET DU CHOISEUL AFRICA SUMMIT\ntexte_article=><p>Le 4 et 5 mai 2018, une délégation de SUNU Assurances était au sommet CHOISEUL SUMMIT AFRICA qui s’est tenu à Abidjan. Une rencontre de jeunes leaders qui a drainé des managers venus de pays d’Afrique et de l’Europe pour faciliter les échanges et partager leurs expériences. La première journée a été marquée par une rencontre avec les autorités gouvernementales en particulier avec son Excellence M. Daniel Kablan DUNCAN, Premier Vice-Président de la République de Côte d’Ivoire.[...] </p>\r\n\r\n<p>Plus tard, M. Mohamed BAH, Directeur Général Délégué du Groupe SUNU a pris part à un panel où il a fait un bref résumé de la « success story » de SUNU Assurances qui reste un modèle de réussite africaine. Les rencontres se sont ainsi poursuivies au lendemain pour prendre fin avec un diner gala.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_choiseul.jpg\ndateCreated_article=>2018-05-04 12:14:16\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(543,2147484848,'2018-05-14 10:24:39','article','insert|all|8|0|id_article=>8\ntitre_article=>BURKINA FASO : 12ÈME TIRAGE DE LAFIA AVEC SUNU ASSURANCES VIE BURKINA FASO ET ORABANK\ntexte_article=><p>Pour Le 12ème tirage du produit d’épargne « LAFIA», SUNU Assurances Vie Burkina Faso et ORABANK ont donné rendez-vous à leurs clients le jeudi 15 mars 2018.  Une rencontre qui a fait d’heureux gagnants avec au total 24 numéros tirés.[...] </p>\r\n\r\n<p>Occasion propice pour les représentants de SUNU Assurances Vie Burkina Faso d’expliquer le fonctionnement du produit qui offre chaque trimestre aux titulaires de comptes ORABANK la possibilité d’être millionnaire.</p>\r\n\nlecture_article=>0\nfichier_article=>lafia1.jpg\ndateCreated_article=>2018-04-15 12:24:39\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(544,2147484848,'2018-05-14 10:26:08','article','insert|all|9|0|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntexte_article=><p>La Direction Générale de SUNU Assurances Vie CI a pris part le mardi 06 mars à la 7ème édition de la conférence annuelle sur les Tendances du Secteur des Technologies, des Médias et la Télécommunication. Une rencontre initiée par le cabinet DELOITTE et parrainée par le Ministre Ivoirien de la Communication, de l’Economie Numérique et de la Poste, M. Bruno KONE. [...] </p>\r\n\r\n<p> M. Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie CI a animé un panel sur la « Maturité Digitale des Entreprises Africaines ». Une présentation bien appréciée par l’assemblée.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-05-14 12:26:08\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(545,2147484848,'2018-05-14 10:27:05','article','update|all|9|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntexte_article=><p>La Direction Générale de SUNU Assurances Vie CI a pris part le mardi 06 mars à la 7ème édition de la conférence annuelle sur les Tendances du Secteur des Technologies, des Médias et la Télécommunication. Une rencontre initiée par le cabinet DELOITTE et parrainée par le Ministre Ivoirien de la Communication, de l’Economie Numérique et de la Poste, M. Bruno KONE. [...] </p>\r\n\r\n<p> M. Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie CI a animé un panel sur la « Maturité Digitale des Entreprises Africaines ». Une présentation bien appréciée par l’assemblée.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-05-14 12:26:08\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntexte_article=><p>La Direction Générale de SUNU Assurances Vie CI a pris part le mardi 06 mars à la 7ème édition de la conférence annuelle sur les Tendances du Secteur des Technologies, des Médias et la Télécommunication. Une rencontre initiée par le cabinet DELOITTE et parrainée par le Ministre Ivoirien de la Communication, de l’Economie Numérique et de la Poste, M. Bruno KONE. [...] </p>\r\n\r\n<p> M. Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie CI a animé un panel sur la « Maturité Digitale des Entreprises Africaines ». Une présentation bien appréciée par l’assemblée.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-03-06 12:27:05\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(546,2147484848,'2018-05-14 10:27:51','article','update|all|8|id_article=>8\ntitre_article=>BURKINA FASO : 12ÈME TIRAGE DE LAFIA AVEC SUNU ASSURANCES VIE BURKINA FASO ET ORABANK\ntexte_article=><p>Pour Le 12ème tirage du produit d’épargne « LAFIA», SUNU Assurances Vie Burkina Faso et ORABANK ont donné rendez-vous à leurs clients le jeudi 15 mars 2018.  Une rencontre qui a fait d’heureux gagnants avec au total 24 numéros tirés.[...] </p>\r\n\r\n<p>Occasion propice pour les représentants de SUNU Assurances Vie Burkina Faso d’expliquer le fonctionnement du produit qui offre chaque trimestre aux titulaires de comptes ORABANK la possibilité d’être millionnaire.</p>\r\n\nlecture_article=>0\nfichier_article=>lafia1.jpg\ndateCreated_article=>2018-04-15 12:24:39\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>8\ntitre_article=>BURKINA FASO : 12ÈME TIRAGE DE LAFIA AVEC SUNU ASSURANCES VIE BURKINA FASO ET ORABANK\ntexte_article=><p>Pour Le 12ème tirage du produit d’épargne « LAFIA», SUNU Assurances Vie Burkina Faso et ORABANK ont donné rendez-vous à leurs clients le jeudi 15 mars 2018.  Une rencontre qui a fait d’heureux gagnants avec au total 24 numéros tirés.[...] </p>\r\n\r\n<p>Occasion propice pour les représentants de SUNU Assurances Vie Burkina Faso d’expliquer le fonctionnement du produit qui offre chaque trimestre aux titulaires de comptes ORABANK la possibilité d’être millionnaire.</p>\r\n\nlecture_article=>0\nfichier_article=>lafia1.jpg\ndateCreated_article=>2018-03-15 12:27:51\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(547,2147484848,'2018-05-14 10:28:53','article','update|all|5|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntexte_article=><p>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé.[...] </p>\r\n\r\n<p>Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-15 12:44:45\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntexte_article=><p>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé.[...] </p>\r\n\r\n<p>Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-09 12:28:53\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(548,2147484848,'2018-05-14 10:30:01','article','insert|all|10|0|id_article=>10\ntitre_article=>SUNU ASSURANCES VIE BÉNIN HONORÉE\ntexte_article=><p><span xss=removed>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018, dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY,</span>[...] </p>\r\n\r\n<p>Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n\nlecture_article=>0\nfichier_article=>prix_bnin.jpg\ndateCreated_article=>2018-02-15 12:30:01\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(549,2147484848,'2018-05-14 10:31:11','article','insert|all|11|0|id_article=>11\ntitre_article=>SUNU ASSURANCES VIE BURKINA FASO PROCÈDE AU 13ÈME TIRAGE AU SORT DU PRODUIT \"ATLANTIQUE FORTUNE\"\ntexte_article=><p><span xss=removed>SUNU Assurances Vie Burkina Faso et son partenaire Banque Atlantique ont effectué le 13ème  tirage du produit « Atlantique Fortune » le jeudi 15 février. En présence des responsables des deux entités et de quelques clients, le tirage a permis de récompenser 24 numéros de police. </span>[...] </p>\r\n\r\n<p>« Atlantique Fortune » est ouvert aux titulaires d’un compte à la Banque Atlantique et permet au souscripteur de se constituer une épargne à partir de 5 500 F CFA et d’avoir la possibilité d’être tiré au sort chaque trimestre pour gagner jusqu’à 6 000 000 F CFA.</p>\r\n\nlecture_article=>0\nfichier_article=>tirag_atF_bf.jpg\ndateCreated_article=>2018-02-15 12:31:11\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(550,2147484848,'2018-05-14 10:32:49','article','insert|all|12|0|id_article=>12\ntitre_article=>LE GROUPE SUNU À KIGALI POUR LA 42ÈME RENCONTRE ANNUELLE DE LA FANAF\ntexte_article=><p><span xss=removed>Pour leur 42ème rencontre annuelle, les responsables du secteur de l’assurance des pays africains sont réunis depuis ce lundi 12 février 2018 à Kigali (Rwanda) pour l’assemblée générale annuelle de la FANAF.</span>[...] </p>\r\n\r\n<p>Les dirigeants du Groupe SUNU ainsi que les acteurs de l’assurance auront jusqu’au 15 février 2018 pour échanger sur le thème : « L’assurance Africaine à l’épreuve de la disruption ». 4 jours de réflexions marqués par des panels et conférences pour trouver des solutions plus adaptées pour le bon fonctionnement de l’assurance en Afrique et pour le bien-être des populations.</p>\r\n\nlecture_article=>0\nfichier_article=>fanaf.jpg\ndateCreated_article=>2018-02-12 12:32:48\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(551,2147484848,'2018-05-14 10:34:40','article','insert|all|13|0|id_article=>13\ntitre_article=>3ÈME ÉDITION DU TOURNOI DE GOLF SUNU ASSURANCES AU BURKINA FASO\ntexte_article=><p><span xss=removed>Pour la 3ème  édition du tournoi de Golf SUNU Assurances du Burkina Faso, amateurs et professionnels de Golf se sont réunis les 10 et 11 Février 2018 sur l’aire de jeux du Golf Club de Ouagadougou. Sponsorisé depuis 3 ans par les sociétés SUNU Assurances du Burkina Faso, la mobilisation était de taille cette année et a permis de resserrer les liens avec les différents partenaires présents.</span>[...] </p>\r\n\r\n<p>Deux jours de compétitions qui ont permis de déceler de nouveaux talents et de récompenser les meilleurs joueurs parmi lesquels, M. Jean François KAMBOU, Directeur Général de SUNU Assurances Vie Burkina Faso.</p>\r\n\nlecture_article=>0\nfichier_article=>golf_bf.jpg\ndateCreated_article=>2018-02-10 12:34:40\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(552,2147484848,'2018-05-14 10:35:34','article','insert|all|14|0|id_article=>14\ntitre_article=>LES SOCIÉTÉS SUNU ASSURANCES DU GABON AU SALON DE LA JOURNÉE ECONOMIQUE 2018\ntexte_article=><p><span xss=removed>Au Gabon, les sociétés SUNU Assurances ont pris part au salon de la journée économique organisée chaque année par le Ministère gabonais de l’économie. Le salon s’est déroulé toute la journée du 7 février 2018 à l’auditorium de l’immeuble Arambo de Libreville.</span>[...] </p>\r\n\r\n<p>Cette année, une attention particulière a été accordée au secteur de l’assurance et avait pour thème : « Restaurer la confiance ». Après les panels, place à la visite des stands où les Ministres de l’économie, du travail et des PME de passage à l’espace SUNU Assurances ont bénéficié de la présentation des filiales du Gabon et des offres qu’elles proposent.</p>\r\n\nlecture_article=>0\nfichier_article=>JE_cam.jpg\ndateCreated_article=>2018-02-07 12:35:33\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(553,2147484848,'2018-05-14 10:36:28','article','insert|all|15|0|id_article=>15\ntitre_article=>LES HOMMES DE SUNU ASSURANCES VIE CI À LEUR TRADITIONNEL KICK OFF\ntexte_article=><p><span xss=removed>Chaque année, les Hommes de SUNU Assurances Vie CI organisent leur traditionnel kick off. Au cours de la dernière rencontre qui s’est tenue le samedi 27 janvier 2018, le Directeur Général, M. Saliou BAKAYOKO a fait le bilan des activités 2017 et présenté le plan stratégique avec des travaux de réflexions et des ateliers sur différents thèmes.</span>[...] </p>\r\n\r\n<p>Puis dans une chaleureuse ambiance, les équipes motivées et optimistes pour l&#39;atteinte des objectifs, ont partagé un repas convivial et participé à des jeux.</p>\r\n\nlecture_article=>0\nfichier_article=>dej_clien_vie.jpg\ndateCreated_article=>2018-01-27 12:36:27\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(554,2147484848,'2018-05-14 10:41:20','article','update|all|15|id_article=>15\ntitre_article=>LES HOMMES DE SUNU ASSURANCES VIE CI À LEUR TRADITIONNEL KICK OFF\ntexte_article=><p><span xss=removed>Chaque année, les Hommes de SUNU Assurances Vie CI organisent leur traditionnel kick off. Au cours de la dernière rencontre qui s’est tenue le samedi 27 janvier 2018, le Directeur Général, M. Saliou BAKAYOKO a fait le bilan des activités 2017 et présenté le plan stratégique avec des travaux de réflexions et des ateliers sur différents thèmes.</span>[...] </p>\r\n\r\n<p>Puis dans une chaleureuse ambiance, les équipes motivées et optimistes pour l&#39;atteinte des objectifs, ont partagé un repas convivial et participé à des jeux.</p>\r\n\nlecture_article=>0\nfichier_article=>dej_clien_vie.jpg\ndateCreated_article=>2018-01-27 12:36:27\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>15\ntitre_article=>LES HOMMES DE SUNU ASSURANCES VIE CI À LEUR TRADITIONNEL KICK OFF\ntexte_article=><p>Chaque année, les Hommes de SUNU Assurances Vie CI organisent leur traditionnel kick off. Au cours de la dernière rencontre qui s’est tenue le samedi 27 janvier 2018, le Directeur Général, M. Saliou BAKAYOKO a fait le bilan des activités 2017 et présenté le plan stratégique avec des travaux de réflexions et des ateliers sur différents thèmes.[...] </p>\r\n\r\n<p>Puis dans une chaleureuse ambiance, les équipes motivées et optimistes pour l&#39;atteinte des objectifs, ont partagé un repas convivial et participé à des jeux.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481526301679.jpg\ndateCreated_article=>2018-01-27 12:41:19\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(555,2147484848,'2018-05-14 10:42:51','article','insert|all|16|0|id_article=>16\ntitre_article=>EQUITY ASSURANCES PLC NIGERIA, LA MARCHE ENGAGÉE CONTRE LE CANCER DU COL DE L\'UTÉRUS\ntexte_article=><p><span xss=removed>La marche sportive annoncée d’Equity Assurances Plc Nigeria, filiale du Groupe SUNU en soutien à The Optimal Cancer Care Foundation a connu un grand succès. </span>Le samedi 27 janvier dernier, des femmes et des hommes venus des différents quartiers de la capitale Nigériane pour accompagner cette initiative.[...] </p>\r\n\r\n<p>Les rues de la ville étaient bondées de bénévoles aux côtés du personnel d&#39;Equity Assurances pour sensibiliser les populations sur les risques de cette maladie.</p>\r\n\nlecture_article=>0\nfichier_article=>marche_sant_equity.jpg\ndateCreated_article=>2018-01-27 12:42:51\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(556,2147484848,'2018-05-14 10:43:49','article','insert|all|17|0|id_article=>17\ntitre_article=>SUNU ASSURANCES VIE CI CONVIE SES GOLDEN COSTUMER À UN DÎNER\ntexte_article=><p><span xss=removed>Pour témoigner sa reconnaissance envers sa fidèle clientèle, la direction de SUNU Assurances Vie CI a célébré le 25 janvier 2018, ses clients et partenaires à l’Heden Golf Club Abidjan au cours d’un diner dénommé « Golden Customer ».</span>[...] </p>\r\n\r\n<p>En présence de M. Saliou BAKAYOKO, Directeur Général de la société et son Directeur Central Opérationnel, M. Gildas NZOUBA, cette soirée a été marquée par des distinctions avec la remise du diplôme d’honneur aux clients présents et celle du « Trophée de la fidélité » aux trois plus fidèles clients de SUNU Assurances Vie CI depuis plus de 20 ans.</p>\r\n\nlecture_article=>0\nfichier_article=>dej_clien_vie1.jpg\ndateCreated_article=>2018-01-25 12:43:49\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(557,2147484848,'2018-05-14 10:44:39','article','insert|all|18|0|id_article=>18\ntitre_article=>CÔTE D\'IVOIRE : SUNU ASSURANCES VIE CI À LA CÉRÉMONIE DE PRÉSENTATION DE VŒUX DE L\'ONMCI\ntexte_article=><p><span xss=removed>Le jeudi 25 janvier 2018, une délégation de SUNU Assurances Vie CI prenait part à la cérémonie de présentation de vœux de l’Ordre National des Médecins de Côte d’Ivoire « ONMCI ». </span>M. Thierry Brou KOUADIO, Directeur Central Fonctionnel de SUNU Assurances Vie CI, après une brève présentation de la compagnie a donné ses motivations à cette cérémonie<span xss=removed>.</span>[...] </p>\r\n\r\n<p> La cérémonie s’est déroulée en présence du représentant du Ministre de la santé et s’est poursuivie par une visite de stands où les invités ont bénéficié des conseils des commerciaux SUNU pour plus de souscriptions.</p>\r\n\nlecture_article=>0\nfichier_article=>voeux_onmci.jpg\ndateCreated_article=>2018-01-25 12:44:39\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(558,2147484848,'2018-05-14 10:45:56','article','insert|all|19|0|id_article=>19\ntitre_article=>POSE DE LA PREMIÈRE PIERRE DU NOUVEAU SIÈGE SUNU ASSURANCES AU BURKINA FASO\ntexte_article=><p><span xss=removed>Bientôt un nouveau siège pour SUNU Assurances dans la capitale Burkinabé. Cette information a été rendue officielle le jeudi 4 janvier 2018 lors de la cérémonie de pose de la première pierre qui marque le début des travaux de construction du bâtiment.</span>[...] </p>\r\n\r\n<p>M. Seydou DIAKITE, PCA des sociétés SUNU Assurances du Burkina Faso était accompagné par Messieurs Osée G. QUENUM et François KAMBOU, DG respectifs de SUNU Assurances IARD Burkina Faso et SUNU Assurances Vie Burkina Faso pour le déroulement de cette cérémonie.</p>\r\n\nlecture_article=>0\nfichier_article=>bf_new_sige.jpg\ndateCreated_article=>2018-01-04 12:45:56\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(559,2147484848,'2018-05-14 10:46:51','article','insert|all|20|0|id_article=>20\ntitre_article=>L\'EX CAMINSUR DEVENUE SUNU ASSURANCES IARD CAMEROUN\ntexte_article=><p><span xss=removed>Pour son entrée dans le Groupe SUNU, l&#39;ex CAMINSUR devenue SUNU Assurances IARD Cameroun a revêtu son siège dans les couleurs du Groupe. A Douala, précisément à la rue Narvik, ne soyez pas déroutés, restez toujours en de bonnes mains dans les locaux de la nouvelle filiale SUNU Assurances.</span></p>\r\n\nlecture_article=>0\nfichier_article=>sige_sunu_iard_camv2.jpg\ndateCreated_article=>2018-01-04 12:46:50\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(560,2147484848,'2018-05-14 10:47:41','article','insert|all|21|0|id_article=>21\ntitre_article=>SUNU ASSURANCES SPONSOR DE LA 39ÈME ÉDITION DU SABRE NATIONAL DU NIGER\ntexte_article=><p><span xss=removed>Pendant 10 jours, les sociétés SUNU Assurances du Niger étaient à Zinder, à 900 Km de Niamey pour la 39ème édition du sabre national du Niger. Les compétitions à fortes valeurs culturelles et traditionnelles ont débuté le 25 décembre 2017 et ont marqué leur apothéose le mercredi 3 janvier 2018. SUNU Assurances était présente pour échanger, sensibiliser et proposer ses offres aux populations venues des quatre coins du pays.</span></p>\r\n\nlecture_article=>0\nfichier_article=>zinder_niger.jpg\ndateCreated_article=>2018-01-03 12:47:41\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(561,2147484848,'2018-06-03 08:21:21','_SESSION','login|all|1528021251|0|__ci_last_regenerate=>1528021251\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2018-05-14 10:34:18::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n'),(562,2147484848,'2018-06-03 08:52:54','photo','insert|all|21|0|id_photo=>21\nid_article=>13\nfichier_photo=>SUNU_ASSURANCES_IARD_CÔTE_DIVOIRE.jpg\ndateCreated_photo=>2018-06-03 10:52:54\ndateDisabled_photo=>\ncreatedBy=>2147484848\nstatut_photo=>1\n'),(563,2147484848,'2018-06-03 09:00:07','photo','insert|all|22|0|id_photo=>22\nid_article=>13\nfichier_photo=>guinee_iard.jpg\ndateCreated_photo=>2018-06-03 11:00:07\ndateDisabled_photo=>\ncreatedBy=>2147484848\nstatut_photo=>1\n'),(564,2147484848,'2018-06-03 09:51:40','historique','insert|all|3|0|id_historique=>3\nannee_historique=>1998\nmois_historique=>1\ntexte_historique=>Monsieur Pathé DIONE crée avec d’autres partenaires la société SUNU Finances Holding SA, domiciliée à la Banque Bruxelles Lambert Trust (BBL, devenue ING Trust) au Luxembourg et bénéficiant du statut fiscal particulier attaché aux Holding 1929. La société a été créée dans un premier temps par deux structures (LOVETTE Overseas SA et GREBELLE Investments SA) de l’agent domiciliataire (BBL) puis les actions ont été cédées aux actionnaires historiques en septembre 1999. \r\nEn novembre, la société SUNU Finances signe avec Axa-UAP un protocole d’accord qui l‘autorise à acquérir progressivement les sociétés qu’Axa souhaiterait céder en Afrique.\ntexte_historique_en=> \ndateCreated_historique=>2018-06-03 11:51:40\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(565,2147484848,'2018-06-03 11:17:56','historique','insert|all|4|0|id_historique=>4\nannee_historique=>1999\nmois_historique=>0\ntexte_historique=><p>SUNU Finances (société mère du Groupe SUNU), rachète cinq filiales du groupe AXA-UAP à savoir :</p>\r\n\r\n<ul>\r\n <li>La CSAR-Vie au Sénégal désormais SUNU Assurances Vie Sénégal au Sénégal après avoir porté le nom de UASen-Vie,</li>\r\n <li>SUNU Assurances Vie Togo (ex UAT-Vie) au Togo,</li>\r\n <li>SUNU Assurances Vie Bénin (ex UBA-Vie) au Bénin,</li>\r\n <li>SUNU Assurances IARD Centrafrique (ex UAC-IARD) en Centrafrique,</li>\r\n <li>SUNU Assurances IARD Niger (ex UGAN-IARD) au Niger.</li>\r\n</ul>\r\n\r\n<p>SUNU Finances crée SUNU Gestion, une EURL en France, qui fournit des prestations d’assistance technique aux sociétés d’assurances du groupe SUNU.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:17:56\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(566,2147484848,'2018-06-03 11:18:55','historique','insert|all|5|0|id_historique=>5\nannee_historique=>2000\nmois_historique=>0\ntexte_historique=><p>Création de SUNU Assurances Vie Niger (ex UGAN-Vie) au Niger en partenariat avec des banques locales.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:18:55\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(567,2147484848,'2018-06-03 11:19:42','historique','insert|all|6|0|id_historique=>6\nannee_historique=>2001\nmois_historique=>0\ntexte_historique=><p>SUNU Finances crée SUNU Assurances Holding S.A, une holding 1929 au Luxembourg dans laquelle sont transférées les sociétés d’assurances détenues.</p>\r\n\r\n<p>Elle ouvre le capital de SUNU Assurances à hauteur de 49% à un partenaire, la Société d’Investissement (S.I.). L’arrivée de la S.I. a permis une accélération de la croissance externe du Groupe SUNU. </p>\r\n\r\n<p>Dans la même foulée, acquisition des deux filiales des Mutuelles du Mans en Côte d’Ivoire auparavant dénommées Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) désormais SUNU Assurances IARD Côte d’Ivoire et SUNU Assurances Vie Côte d’Ivoire. </p>\r\n\r\n<p>D’autre part, SUNU Assurances détient 80% du capital de SUNU Gestion après augmentation de capital de cette dernière.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:19:42\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(568,2147484848,'2018-06-03 11:20:09','historique','insert|all|7|0|id_historique=>7\nannee_historique=>2002\nmois_historique=>0\ntexte_historique=><p>Prise de contrôle de la société Alliance Africaine d’Assurances Vie (3A-Vie) à la suite de sa recapitalisation.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:20:09\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(569,2147484848,'2018-06-03 11:20:30','historique','insert|all|8|0|id_historique=>8\nannee_historique=>2004\nmois_historique=>0\ntexte_historique=><p>Rachat de trois filiales Vie d’AXA en Côte d’Ivoire, au Cameroun et au Gabon. Ces trois sociétés alors dénommées, Union des Assurances de Côte d’Ivoire Vie (UA-Vie), Union des Assurances du Cameroun Vie (UACam-Vie), Union des Assurances du Gabon Vie (UAG-Vie). Ces sociétés portent respectivement aujourd’hui le nom de SUNU Assurances Vie Côte d’Ivoire, SUNU Assurances Vie Cameroun et SUNU Assurances Vie Gabon. Le groupe SUNU acquiert également la société SUNU Assurances IARD Togo alors UAT-IARD et une participation de 40\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:20:30\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(570,2147484848,'2018-06-03 11:21:11','historique','insert|all|9|0|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=>Prise d’une participation de 45\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(571,2147484848,'2018-06-03 11:21:37','historique','insert|all|10|0|id_historique=>10\nannee_historique=>2006\nmois_historique=>0\ntexte_historique=><p>Rachat total de la participation de la Société d’Investissement S.A dans SUNU Assurances Holding S.A par SUNU Finances.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:21:37\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(572,2147484848,'2018-06-03 11:22:25','historique','insert|all|11|0|id_historique=>11\nannee_historique=>2010\nmois_historique=>7\ntexte_historique=><p>Transfert des deux holding SUNU Assurances et SUNU Finances en France. Leurs nouvelles dénominations sociales sont respectivement SUNU Assurances Holding S.A et SUNU Finances Holding S.A.S. Les deux sociétés, qui étaient jusqu’alors des sociétés de droit luxembourgeois, ont changé leur nationalité, respectivement en société anonyme de droit français et en société par actions simplifiée, et transféré leur siège social en France. Cette opération, autorisée par les législations luxembourgeoise et française, s’est opérée, conformément auxdites législations, avec maintien de la personnalité morale desdites sociétés, et a pris effet à la date du 19 août 2010, date de leur immatriculation en France au Registre du Commerce et des Sociétés (« RCS ») du lieu de leur nouveau siège social (RCS de Créteil)</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:22:25\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(573,2147484848,'2018-06-03 11:23:10','historique','insert|all|12|0|id_historique=>12\nannee_historique=>2010\nmois_historique=>12\ntexte_historique=><p>SUNU Assurances Holding SA a décidé de dissoudre par anticipation la société SUNU Gestion SAS, dont elle était l’associée unique après avoir repris les parts de SUNU Finances, avec Transmission Universelle de Patrimoine en sa faveur, conformément aux dispositions de l’article 1844-5 alinéa 3 du code civil.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:23:10\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(574,2147484848,'2018-06-03 11:23:47','historique','insert|all|13|0|id_historique=>13\nannee_historique=>2012\nmois_historique=>1\ntexte_historique=><p>SUNU Assurances Abidjan démarre ses activités et a pour rôle de regrouper les Directions Centrales du Groupe SUNU.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:23:47\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(575,2147484848,'2018-06-03 11:24:14','historique','insert|all|14|0|id_historique=>14\nannee_historique=>2012\nmois_historique=>7\ntexte_historique=><p>Démarrage des activités de SUNU Assurances IARD Mali (ex UA-IARD Mali) et de SUNU Assurances Guinée (ex UA-IARD Guinée).</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:24:13\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(576,2147484848,'2018-06-03 11:24:40','historique','insert|all|15|0|id_historique=>15\nannee_historique=>2013\nmois_historique=>4\ntexte_historique=><p>Changement de dénomination sociale de SUNU Assurances Abidjan qui est désormais la suivante : SUNU Services.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:24:40\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(577,2147484848,'2018-06-03 11:25:35','historique','insert|all|16|0|id_historique=>16\nannee_historique=>2014\nmois_historique=>7\ntexte_historique=><p>Démarrage des activités de SUNU Assurances Vie Burkina Faso (ex UA-Vie Burkina Faso).</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:25:35\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(578,2147484848,'2018-06-03 11:26:16','historique','insert|all|17|0|id_historique=>17\nannee_historique=>2014\nmois_historique=>9\ntexte_historique=><p>Changement de dénomination sociale de SUNU Assurances Holding SA qui est désormais la suivante : SUNU Participations Holding SA.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:26:16\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(579,2147484848,'2018-06-03 11:26:45','historique','insert|all|18|0|id_historique=>18\nannee_historique=>2015\nmois_historique=>1\ntexte_historique=><p>Changement de dénomination de 16 filiales du Groupe désormais appelées SUNU Assurances.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:26:45\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(580,2147484848,'2018-06-03 11:27:08','historique','insert|all|19|0|id_historique=>19\nannee_historique=>2015\nmois_historique=>10\ntexte_historique=><p>Fusion de LMAI Vie et SUNU Assurances Vie formant désormais SUNU Assurances Vie Côte d’Ivoire.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:27:08\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(581,2147484848,'2018-06-03 11:28:41','historique','insert|all|20|0|id_historique=>20\nannee_historique=>2015\nmois_historique=>12\ntexte_historique=><p>Création d&#39;une nouvelle société IARD au Gabon: SUNU Assurances IARD Gabon.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:28:41\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(582,2147484848,'2018-06-03 11:29:06','historique','insert|all|21|0|id_historique=>21\nannee_historique=>2016\nmois_historique=>12\ntexte_historique=><p> Avie et SUNU Assurances Vie Bénin fusionnent pour devenir la plus grande société vie du Bénin.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:29:06\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(583,2147484848,'2018-06-03 11:29:30','historique','insert|all|22|0|id_historique=>22\nannee_historique=>2017\nmois_historique=>6\ntexte_historique=><p>Immatriculation au registre de commerce du Togo de SUNU santé, créée en Décembre 2016. Cette société a pour mission de gérer les contrats d&#39;assurances santé des sociétés IARD du groupe SUNU.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:29:30\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(584,2147484848,'2018-06-03 11:29:57','historique','insert|all|23|0|id_historique=>23\nannee_historique=>2017\nmois_historique=>7\ntexte_historique=><p>Création de SUNU Assurances IARD Cameroun suite à la recapitalisation de la société CAMINSUR.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:29:57\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(585,2147484848,'2018-06-03 11:30:24','historique','insert|all|24|0|id_historique=>24\nannee_historique=>2017\nmois_historique=>7\ntexte_historique=><p>Création de SUNU Investment Holding SA qui portera désormais les participations bancaires du Groupe SUNU.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:30:24\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(586,2147484848,'2018-06-03 11:30:44','historique','insert|all|25|0|id_historique=>25\nannee_historique=>2018\nmois_historique=>2\ntexte_historique=><p>Acquisition de la Banque Populaire pour l&#39;Epargne et le Crédit (BPEC) du Togo par le Groupe SUNU.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:30:44\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(587,2147484848,'2018-06-03 12:36:16','texte','insert|all|2|0|id_texte=>2\nid_type_texte=>1\ncontenu_texte=><p><strong>SUNU Participations Holding SA</strong> est administrée par un Conseil d’Administration composé de quatre (04) membres nommés par l’Assemblée Générale des actionnaires.</p>\r\n\r\n<p><strong>Missions et attributions</strong><br>\r\nLe Conseil d’Administration détermine les orientations de l’activité de la société et veille à leur mise en œuvre. Il exerce notamment les pouvoirs suivants :</p>\r\n\r\n<ul>\r\n <li>la nomination du Directeur Général ainsi que des Directeurs Généraux Délégués ;</li>\r\n <li>l’arrêté des comptes annuels</li>\r\n <li>la convocation des assemblées d’actionnaires ;</li>\r\n <li>l’autorisation des conventions « réglementées ».</li>\r\n</ul>\r\n\r\n<p>Certaines opérations ou questions importantes sont également soumises à l’autorisation préalable du Conseil d’Administration (cessions ou acquisitions, opérations de financement significatives ou opérations en dehors de la stratégie annoncée par la société...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nLes membres du Conseil d’Administration de SUNU Participations Holding S.A sont :</p>\r\n\r\n<ul>\r\n <li>Pathé DIONE, Président Directeur Général (Président de SUNU Finances Holding ; Fondateur du Groupe SUNU)</li>\r\n <li>Papa-Demba DIALLO, Administrateur (Président du Conseil d’Administration de la Société Générale de Banque du Sénégal SGBS)</li>\r\n <li>Federico ROMAN, Administrateur (Cadre Supérieur d’Assurances)</li>\r\n</ul>\r\n\ncontenu_texte_en=>\ndateCreated_texte=>2018-06-03 14:36:16\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(588,2147484848,'2018-06-03 12:36:58','texte','insert|all|3|0|id_texte=>3\nid_type_texte=>2\ncontenu_texte=><p>La Direction Générale de SUNU Participations Holding SA est composée du Président Directeur Général et de deux Directeurs Généraux Délégués.</p>\r\n\r\n<p><strong>Le Président Directeur Général</strong><br>\r\nLe Président Directeur Général est investi des pouvoirs les plus étendus pour agir en toute circonstance au nom de la société. Il exerce ses pouvoirs dans la limite de l’objet social et sous réserve de ce que la loi attribue expressément aux assemblées d’actionnaires et au Conseil d’Administration. Il représente la société dans ses rapports avec les tiers.</p>\r\n\r\n<p><strong>Les Directeurs Généraux Délégués</strong><br>\r\nIls ont pour mission d’assister le Président Directeur Général dans l’exercice de ses fonctions. Le Conseil détermine l’étendue et la durée des pouvoirs conférés aux Directeurs Généraux Délégués.</p>\r\n\r\n<p><strong>Le Comité de Direction</strong><br>\r\nLe Président Directeur Général a décidé de s’appuyer sur un Comité de Direction pour l’assister dans le pilotage de la gestion opérationnelle du Groupe. Ce Comité est composé de quatre membres :</p>\r\n\ncontenu_texte_en=>\ndateCreated_texte=>2018-06-03 14:36:58\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(589,2147484848,'2018-06-03 12:47:31','equipe','insert|all|4|0|id_equipe=>4\nnom_equipe=>pathé\nprenom_equipe=> dione\ndirecteur_equipe=>1\nfonction_equipe=>Président Directeur Général\r\nFondateur du Groupe SUNU\nfonction_equipe_en=>\nbiographie_equipe=><p>M. Pathé DIONE, fondateur du Groupe SUNU, a été professeur de Mathématiques avant de rejoindre la société d’assurance les Mutuelles du Mans en 1972. Après l’obtention de son doctorat en Economie à l’université de la Sorbonne et un passage à l’école des Assurances de Paris, il est embauché par CIGNA Corporation qu’il représente en Côte d’Ivoire à travers sa filiale COLINA. En 1984, il occupera la fonction de Directeur Afrique de l’Union des Assurances de Paris (UAP) jusqu’à son absorption par AXA en 1997. En 1998, il décide de créer avec d’anciens collaborateurs, un groupe panafricain au service du continent SUNU.</p>\r\n\nbiographie_equipe_en=>\nfichier_equipe=>PatheDione.jpg\ndateCreated_equipe=>2018-06-03 14:47:31\ndateDisabled_equipe=>\ncreatedBy=>2147483647\nstatut_equipe=>1\n'),(590,2147484848,'2018-06-03 12:50:15','experience','insert|all|2|0|id_experience=>2\nid_equipe=>4\nperiode_experience=>1941\ntexte_experience=>Naissance à Dakar, Sénégal\ntexte_experience_en=>Naissance à Dakar, Sénégal\ndateCreated_experience=>2018-06-03 14:50:15\ndateDisabled_experience=>\ncreatedBy=>2147484848\nstatut_experience=>1\n'),(591,2147484848,'2018-06-03 12:50:44','experience','insert|all|3|0|id_experience=>3\nid_equipe=>4\nperiode_experience=>1966 - 1972\ntexte_experience=>Professeur de mathématiques\ntexte_experience_en=>Professeur de mathématiques\ndateCreated_experience=>2018-06-03 14:50:44\ndateDisabled_experience=>\ncreatedBy=>2147484848\nstatut_experience=>1\n'),(592,2147484848,'2018-06-03 12:51:08','experience','insert|all|4|0|id_experience=>4\nid_equipe=>4\nperiode_experience=>1972 - 1979\ntexte_experience=>Mutuelles du Mans\ntexte_experience_en=>Mutuelles du Mans\ndateCreated_experience=>2018-06-03 14:51:08\ndateDisabled_experience=>\ncreatedBy=>2147484848\nstatut_experience=>1\n'),(593,2147484848,'2018-06-03 12:51:47','experience','insert|all|5|0|id_experience=>5\nid_equipe=>4\nperiode_experience=>1979 - 1980\ntexte_experience=>Cigna Corporation\ntexte_experience_en=>Cigna Corporation\ndateCreated_experience=>2018-06-03 14:51:47\ndateDisabled_experience=>\ncreatedBy=>2147484848\nstatut_experience=>1\n'),(594,2147484848,'2018-06-03 12:52:07','experience','insert|all|6|0|id_experience=