ES\ntexte_article=><p>Pour la 10ème édition du Salon International du Livre d’Abidjan (SILA), les sociétés SUNU Assurances de Côte d’Ivoire ont donné rendez-vous aux écrivains et amoureux du livre du 16 au 20 Mai 2018 au palais de la culture de Treichville. A cette rencontre de l’industrie du livre qui a vu bon nombre d’écrivains primés, M. Saliou BAKAYOKO, DG de SUNU Assurances Vie CI a animé un panel sur le thème : « Livre et Economie ». Il a ensuite entretenu les participants sur la discipline de l’Actuariat et sur des notions propres au métier de l’assurance méconnues du grand public.</p>\r\n\nlecture_article=>0\nfichier_article=>sila_abj.jpg\ndateCreated_article=>2018-05-16 04:14:38\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(644,2147484848,'2018-06-07 02:15:47','article','insert|all|24|0|id_article=>24\ntitre_article=>LES SOCIÉTÉS SUNU ASSURANCES DE CI FONT UN RETOUR AUX VALEURS AVEC AFRIQUE CONSCIENTE\ntexte_article=><p>En Côte d’Ivoire, les sociétés SUNU Assurances ont fait un « Retour aux valeurs » en accompagnant le mouvement « Afrique Consciente » lors des premières Universités de la Société Civique Africaine qui se sont tenues le 19 Mai 2018, au Sofitel Hôtel Ivoire. Cette grande première a permis de connaitre « l’histoire de l’Afrique, ses inerties, les Success-stories de la société civique en Afrique et les opportunités de l’Afrique. Et cela à travers des hommes engagés tels que Denise EPOTE, Séry BAILLY, Alain FOKA qui étaient parmi les panelistes de cette rencontre. Ce fut un bel évènement auquel SUNU Assurances, groupe conscient des valeurs africaines n’a voulu rester en marge pour participer aussi aux challenges d’un meilleur avenir du continent africain.</p>\r\n\nlecture_article=>0\nfichier_article=>afrique_consciente.jpg\ndateCreated_article=>2018-05-19 04:15:47\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(645,2147484848,'2018-06-07 02:16:57','photo','insert|all|54|0|id_photo=>54\nid_article=>12\nfichier_photo=>libre1.jpg\ndateCreated_photo=>2018-06-07 04:16:57\ndateDisabled_photo=>\ncreatedBy=>2147484848\nstatut_photo=>1\n'),(646,2147484848,'2018-06-07 02:17:01','photo','insert|all|55|0|id_photo=>55\nid_article=>12\nfichier_photo=>libre.jpg\ndateCreated_photo=>2018-06-07 04:17:01\ndateDisabled_photo=>\ncreatedBy=>2147484848\nstatut_photo=>1\n'),(647,2147484848,'2018-06-07 02:17:03','photo','insert|all|56|0|id_photo=>56\nid_article=>12\nfichier_photo=>libre2.jpg\ndateCreated_photo=>2018-06-07 04:17:03\ndateDisabled_photo=>\ncreatedBy=>2147484848\nstatut_photo=>1\n'),(648,2147484848,'2018-06-07 02:17:06','photo','insert|all|57|0|id_photo=>57\nid_article=>12\nfichier_photo=>libre0.jpg\ndateCreated_photo=>2018-06-07 04:17:06\ndateDisabled_photo=>\ncreatedBy=>2147484848\nstatut_photo=>1\n'),(649,2147484848,'2018-06-07 02:20:01','article','update|all|6|id_article=>6\ntitre_article=>LA BPEC REJOINT OFFICIELLEMENT LE GROUPE SUNU\ntexte_article=><p>Le mercredi 09 mai 2018, clients, partenaires et médias étaient dans les locaux de la Banque Populaire de l’Épargne et du Crédit (BPEC) du Togo pour prendre part à un petit déjeuner convivial. L&#39;objet de cette rencontre était l&#39;annonce officielle de l&#39;entrée de la BPEC dans le Groupe SUNU.<br/>\nAprès l’intervention de M. Christophe LASSUS-LALANNE, DG de la BPEC, M. Razack FASSASSI, DG de SUNU Assurances Vie Togo a, au nom du Groupe SUNU, édifié les invités sur les intérêts de cette nouvelle acquisition pour les entreprises et les populations. La BPEC, première banque du Groupe SUNU, permettra d&#39;offrir des produits packagées banque & assurance plus accessibles en un lieu unique.</p>\n\nlecture_article=>0\nfichier_article=>bpec_sunu_actu.jpg\ndateCreated_article=>2018-05-09 08:12:47\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>6\ntitre_article=>LA BPEC REJOINT OFFICIELLEMENT LE GROUPE SUNU\ntexte_article=><p>Le mercredi 09 mai 2018, clients, partenaires et médias étaient dans les locaux de la Banque Populaire de l’Épargne et du Crédit (BPEC) du Togo pour prendre<br>\r\npart à un petit déjeuner convivial. L&#39;objet de cette rencontre était l&#39;annonce officielle de l&#39;entrée de la BPEC dans le Groupe SUNU.<br>\r\nAprès l’intervention de M. Christophe LASSUS-LALANNE, DG de la BPEC, M. Razack FASSASSI, DG de SUNU Assurances Vie Togo a, au nom du Groupe<br>\r\nSUNU, édifié les invités sur les intérêts de cette nouvelle acquisition pour les entreprises et les populations. La BPEC, première banque du Groupe SUNU,<br>\r\npermettra d&#39;offrir des produits packagées banque & assurance plus accessibles en un lieu unique.</p>\r\n\nlecture_article=>0\nfichier_article=>bpec_sunu_actu.jpg\ndateCreated_article=>2018-05-09 04:20:01\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(650,2147484848,'2018-06-07 02:21:23','article','update|all|7|id_article=>7\ntitre_article=>SUNU ASSURANCES AU SOMMET DU CHOISEUL AFRICA SUMMIT\ntexte_article=><p>Le 4 et 5 mai 2018, une délégation de SUNU Assurances était au sommet CHOISEUL SUMMIT AFRICA qui s’est tenu à Abidjan. Une rencontre de jeunes leaders qui a drainé des managers venus de pays d’Afrique et de l’Europe pour faciliter les échanges et partager leurs expériences. La première journée a été marquée par une rencontre avec les autorités gouvernementales en particulier avec son Excellence M. Daniel Kablan DUNCAN, Premier Vice-Président de la République de Côte d’Ivoire. <br/>\nPlus tard, M. Mohamed BAH, Directeur Général Délégué du Groupe SUNU a pris part à un panel où il a fait un bref résumé de la « success story » de SUNU Assurances qui reste un modèle de réussite africaine. Les rencontres se sont ainsi poursuivies au lendemain pour prendre fin avec un diner gala.</p>\n\nlecture_article=>0\nfichier_article=>sunu_choiseul.jpg\ndateCreated_article=>2018-05-04 08:14:16\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>7\ntitre_article=>SUNU ASSURANCES AU SOMMET DU CHOISEUL AFRICA SUMMIT\ntexte_article=><p>Le 4 et 5 mai 2018, une délégation de SUNU Assurances était au sommet CHOISEUL SUMMIT AFRICA qui s’est tenu à Abidjan. Une rencontre de jeunes leaders<br>\r\nqui a drainé des managers venus de pays d’Afrique et de l’Europe pour faciliter les échanges et partager leurs expériences. La première journée a été marquée par<br>\r\nune rencontre avec les autorités gouvernementales en particulier avec son Excellence M. Daniel Kablan DUNCAN, Premier Vice-Président de la République de Côte <br>\r\nd’Ivoire. Plus tard, M. Mohamed BAH, Directeur Général Délégué du Groupe SUNU a pris part à un panel où il a fait un bref résumé de la « success story » de <br>\r\nSUNU Assurances qui reste un modèle de réussite africaine. Les rencontres se sont ainsi poursuivies au lendemain pour prendre fin avec un diner gala.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_choiseul.jpg\ndateCreated_article=>2018-05-04 04:21:23\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(651,2147484848,'2018-06-07 02:22:01','article','update|all|2|id_article=>2\ntitre_article=>GABON : LE GROUPE SUNU DÉVOILE SES AMBITIONS POUR LE GABON\ntexte_article=><p>Présents à Libreville dans le cadre des conseils des comptes, les membres du comité de direction du Groupe SUNU : M. Pathé DIONE, PDG, Messieurs Mohamed BAH et Joël AMOUSSOU, Directeurs Généraux Délégués ont rencontré partenaires et clients locaux le 22 mars 2018.<br/>\nLes échanges axés sur les ambitions du Groupe SUNU en Afrique et particulièrement pour le Gabon, ont capté l’attention des invités. Ils étaient accompagnés par l’équipe dirigeante des filiales SUNU Assurances Vie et IARD du Gabon.</p>\n\nlecture_article=>0\nfichier_article=>21474848481525350474.jpg\ndateCreated_article=>2018-03-22 08:27:54\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>2\ntitre_article=>GABON : LE GROUPE SUNU DÉVOILE SES AMBITIONS POUR LE GABON\ntexte_article=><p>Présents à Libreville dans le cadre des conseils des comptes, les membres du comité de direction du Groupe SUNU : M. Pathé DIONE, PDG, Messieurs<br>\r\nMohamed BAH et Joël AMOUSSOU, Directeurs Généraux Délégués ont rencontré partenaires et clients locaux le 22 mars 2018. Les échanges axés sur les<br>\r\nambitions du Groupe SUNU en Afrique et particulièrement pour le Gabon, ont capté l’attention des invités. Ils étaient accompagnés par l’équipe dirigeante des <br>\r\nfiliales SUNU Assurances Vie et IARD du Gabon.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525350474.jpg\ndateCreated_article=>2018-03-22 04:22:01\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(652,2147484848,'2018-06-07 02:22:38','article','update|all|3|id_article=>3\ntitre_article=>CÔTE D\'IVOIRE : SUNU ASSURANCES VIE CI OSE AVEC LES FEMMES FEEF\ntexte_article=><p>Les 16 et 17 mars 2018, SUNU Assurances Vie CI a « Osé » en étant le partenaire de la 5ème édition du Forum de l’Emploi et de l’Entreprenariat Féminin « FEEF2018 ». Deux jours de festivités qui ont permis aux femmes venues de différents horizons de partager leurs expériences sur des problématiques liées à l’emploi à travers conférences et panels. <br/>\nAvec pour thème : « Osez ! Et Réalisez vos rêves », le FEEF 2018 a tenu encore ses promesses cette année. Un défilé de mode et un feu d’artifice ont permis de refermer les portes de cette 5ème édition.</p>\n\nlecture_article=>0\nfichier_article=>21474848481525351152.jpg\ndateCreated_article=>2018-03-16 08:39:12\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>3\ntitre_article=>CÔTE D\'IVOIRE : SUNU ASSURANCES VIE CI OSE AVEC LES FEMMES FEEF\ntexte_article=><p>Les 16 et 17 mars 2018, SUNU Assurances Vie CI a « Osé » en étant le partenaire de la 5ème édition du Forum de l’Emploi et de l’Entreprenariat Féminin «<br>\r\nFEEF2018 ». Deux jours de festivités qui ont permis aux femmes venues de différents horizons de partager leurs expériences sur des problématiques liées à<br>\r\nl’emploi à travers conférences et panels. Avec pour thème : « Osez ! Et Réalisez vos rêves », le FEEF 2018 a tenu encore ses promesses cette année. Un défilé<br>\r\nde mode et un feu d’artifice ont permis de refermer les portes de cette 5ème édition.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351152.jpg\ndateCreated_article=>2018-03-16 04:22:38\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(653,2147484848,'2018-06-07 02:23:14','article','update|all|8|id_article=>8\ntitre_article=>BURKINA FASO : 12ÈME TIRAGE DE LAFIA AVEC SUNU ASSURANCES VIE BURKINA FASO ET ORABANK\ntexte_article=><p>Pour Le 12ème tirage du produit d’épargne « LAFIA», SUNU Assurances Vie Burkina Faso et ORABANK ont donné rendez-vous à leurs clients le jeudi 15 mars 2018.  Une rencontre qui a fait d’heureux gagnants avec au total 24 numéros tirés.<br/>\n\nOccasion propice pour les représentants de SUNU Assurances Vie Burkina Faso d’expliquer le fonctionnement du produit qui offre chaque trimestre aux titulaires de comptes ORABANK la possibilité d’être millionnaire.</p>\n\nlecture_article=>0\nfichier_article=>lafia1.jpg\ndateCreated_article=>2018-03-15 08:27:51\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>8\ntitre_article=>BURKINA FASO : 12ÈME TIRAGE DE LAFIA AVEC SUNU ASSURANCES VIE BURKINA FASO ET ORABANK\ntexte_article=><p>Pour Le 12ème tirage du produit d’épargne « LAFIA», SUNU Assurances Vie Burkina Faso et ORABANK ont donné rendez-vous à leurs clients le jeudi 15 mars<br>\r\n2018.  Une rencontre qui a fait d’heureux gagnants avec au total 24 numéros tirés. Occasion propice pour les représentants de SUNU Assurances Vie Burkina<br>\r\nFaso d’expliquer le fonctionnement du produit qui offre chaque trimestre aux titulaires de comptes ORABANK la possibilité d’être millionnaire..</p>\r\n\nlecture_article=>0\nfichier_article=>lafia1.jpg\ndateCreated_article=>2018-03-15 04:23:14\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(654,2147484848,'2018-06-07 02:23:51','article','update|all|5|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntexte_article=><p>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé.<br/>\n\nDénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\n\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-09 07:28:53\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntexte_article=><p>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo<br>\r\nqui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé. Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de<br>\r\npermettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un<br>\r\ndéveloppement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-09 04:23:51\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(655,2147484848,'2018-06-07 02:24:36','article','update|all|9|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntexte_article=><p>La Direction Générale de SUNU Assurances Vie CI a pris part le mardi 06 mars à la 7ème édition de la conférence annuelle sur les Tendances du Secteur des Technologies, des Médias et la Télécommunication. Une rencontre initiée par le cabinet DELOITTE et parrainée par le Ministre Ivoirien de la Communication, de l’Economie Numérique et de la Poste, M. Bruno KONE. [...] </p>\r\n\r\n<p> M. Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie CI a animé un panel sur la « Maturité Digitale des Entreprises Africaines ». Une présentation bien appréciée par l’assemblée.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-03-06 07:27:05\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntexte_article=><p>La Direction Générale de SUNU Assurances Vie CI a pris part le mardi 06 mars à la 7ème édition de la conférence annuelle sur les Tendances du Secteur des <br>\r\nTechnologies, des Médias et la Télécommunication. Une rencontre initiée par le cabinet DELOITTE et parrainée par le Ministre Ivoirien de la Communication, de<br>\r\nl’Economie Numérique et de la Poste, M. Bruno KONE. M. Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie CI a animé un panel sur la «<br>\r\nMaturité Digitale des Entreprises Africaines ». Une présentation bien appréciée par l’assemblée.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-03-06 04:24:35\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(656,2147484848,'2018-06-07 02:26:03','article','update|all|9|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntexte_article=><p>La Direction Générale de SUNU Assurances Vie CI a pris part le mardi 06 mars à la 7ème édition de la conférence annuelle sur les Tendances du Secteur des <br>\r\nTechnologies, des Médias et la Télécommunication. Une rencontre initiée par le cabinet DELOITTE et parrainée par le Ministre Ivoirien de la Communication, de<br>\r\nl’Economie Numérique et de la Poste, M. Bruno KONE. M. Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie CI a animé un panel sur la «<br>\r\nMaturité Digitale des Entreprises Africaines ». Une présentation bien appréciée par l’assemblée.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-03-06 04:24:35\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntexte_article=><p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018,dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY, Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. </p>\r\nBravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-03-06 04:26:03\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(657,2147484848,'2018-06-12 03:03:38','_SESSION','login|all|1528794218|0|__ci_last_regenerate=>15287