accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(853,2147204895,'2018-07-26 12:34:25','article','insert|all|25|0|id_article=>25\ntitre_article=>GROUPE SUNU : Le Groupe au  Brokerslink Africa Forum 2018\ntitre_article_en=>\ntexte_article=><p>Le jeudi 19 juillet 2018, SUNU Assurances a participé au Brokerslink Africa Forum, qui a eu lieu au Sofitel Hôtel Ivoire. M. Faustin ATEBI-ZIRIGA, Directeur Général de SUNU Assurances IARD CI et Mlle Déborah GNAGNE, Directeur du Développement Commercial ont présenté le Groupe SUNU aux courtiers membres du réseau Brokerslink. <br>\r\nPar la suite, SUNU Assurances a offert un diner ethnique. Hôtes et convives ont soufflé ensemble les bougies marquant les 20 ans du Groupe SUNU. Ce fut un moment bien apprécié qui a permis à chacun d’exprimer sa joie à travers des pas de danse et remises de lots cadeaux et goodies.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>img1.jpg\ndateCreated_article=>2018-07-19 14:34:24\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(854,2147204895,'2018-07-27 09:03:17','_SESSION','login|all|1532681958|0|__ci_last_regenerate=>1532681958\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-07-26 12:34:26::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(855,2147204895,'2018-07-27 09:17:22','publication','update|all|16|id_publication=>16\ntitre_publication=>Rapport annuel 2016\ntitre_publication_en=>\ntexte_publication=>La progression du chiffre d\'affaires consolidé du Groupe en 2014 -6,35%) est du même ordre que celle de l\'exercice 2013 (6,60%): le léger tassement est dû au fait que deux sociétés affiliées sont désormais consolidées par équivalence.\ntexte_publication_en=>\nfichier_publication=>RA_SUNU_2016_web.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 08:02:00\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>16\ntitre_publication=>Rapport annuel 2016\ntitre_publication_en=>Annual report 2016\ntexte_publication=><p>La progression du chiffre d&#39;affaires consolidé du Groupe en 2014 (6,35%) est du même ordre que celle de l&#39;exercice 2013 (6,60%): le léger tassement est dû au fait que deux sociétés affiliées sont désormais consolidées par équivalence.</p>\r\n\ntexte_publication_en=><p>The Group&#39;s consolidated revenue growth in 2014 (6.35%) is similar to that of 2013 (6.60%): the slight decrease is due to the fact that two affiliated companies are now consolidated by the equity method.</p>\r\n\nfichier_publication=>RA_SUNU_2016_web.pdf\nfichier_publication_en=>RA_SUNU_2016_V_anglaise_web.pdf\ndateCreated_publication=>2018-05-04 11:17:22\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(856,2147204895,'2018-07-27 09:26:34','publication','update|all|14|id_publication=>14\ntitre_publication=>Rapport annuel 2015\ntitre_publication_en=>\ntexte_publication=><p>2015 a été l&#39;année de consécration de notre image avec l&#39;uniformisation de notre identité dans la majorité de nos filiales. La marque SUNU Assurances a su s&#39;imposer dans l&#39;esprit du grand public et donner une signature forte à toutes les entités du Groupe.</p>\r\n\ntexte_publication_en=>\nfichier_publication=>RAPPORT_SUNU_2015.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 13:19:33\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>14\ntitre_publication=>Rapport annuel 2015\ntitre_publication_en=>Annual report 2015\ntexte_publication=><p>2015 a été l&#39;année de consécration de notre image avec l&#39;uniformisation de notre identité dans la majorité de nos filiales. La marque SUNU Assurances a su s&#39;imposer dans l&#39;esprit du grand public et donner une signature forte à toutes les entités du Groupe.</p>\r\n\ntexte_publication_en=><p>2015 was the year of consecration of our image with the standardisation of our identity in the majority of our subsidiaries. The SUNU Assurances brand has established itself in the mind of the general public and has given a strong signature to all the entities of the Group.</p>\r\n\nfichier_publication=>RAPPORT_SUNU_2015.pdf\nfichier_publication_en=>RapportAnnuel2015Vanglaise.pdf\ndateCreated_publication=>2018-05-04 11:26:34\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(857,2147204895,'2018-07-27 09:32:13','_SESSION','login|all|1532683792|0|__ci_last_regenerate=>1532683792\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-07-27 11:03:17::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(858,2147204895,'2018-07-27 09:33:38','publication','update|all|15|id_publication=>15\ntitre_publication=>Plaquette 2016\ntitre_publication_en=>\ntexte_publication=>Présent dans 14 pays d’Afrique de l’ouest et centrale, le Groupe\r\nSUNU est un groupe d’assurances africain créé en 1998 par\r\nM. Pathé DIONE avec d’anciens collaborateurs. Le Groupe SUNU, constitué de SUNU Participations Holding SA et\r\nde ses 23 filiales et sociétés affiliées \ntexte_publication_en=>\nfichier_publication=>Plaquette _SUNU2016_web.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 10:35:38\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>15\ntitre_publication=>Plaquette 2016\ntitre_publication_en=>Brochure 2016\ntexte_publication=><p>Présent dans 14 pays d’Afrique de l’ouest et centrale, le Groupe SUNU est un groupe d’assurances africain créé en 1998 par M. Pathé DIONE avec d’anciens collaborateurs. Le Groupe SUNU, constitué de SUNU Participations Holding SA et de ses 23 filiales et sociétés affiliées</p>\r\n\ntexte_publication_en=><