 West and Central Africa, SUNU Group is an African insurance group created in 1998 by Mr. Pathé DIONE and some former colleagues. SUNU Group consists of SUNU Participations Holding SA and its 23 subsidiaries and affiliated companies.</p>\r\n\nfichier_publication=>Plaquette _SUNU2016_web.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 11:34:31\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(860,2147204895,'2018-07-27 09:40:11','article','insert|all|26|0|id_article=>26\ntitre_article=>TEST\ntitre_article_en=>\ntexte_article=><p>test</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>img11.jpg\ndateCreated_article=>2018-07-27 11:40:11\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(861,2147204895,'2018-07-27 09:41:57','photo','insert|all|227|0|id_photo=>227\nid_article=>26\nfichier_photo=>img1.jpg\ndateCreated_photo=>2018-07-27 11:41:57\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(862,2147204895,'2018-07-27 09:42:24','photo','insert|all|228|0|id_photo=>228\nid_article=>26\nfichier_photo=>img11.jpg\ndateCreated_photo=>2018-07-27 11:42:24\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(863,2147204895,'2018-07-27 09:45:00','article','disable|statut_article|26|0,1,2|3'),(864,2147204895,'2018-07-27 09:49:24','publication','update|all|15|id_publication=>15\ntitre_publication=>Plaquette 2016\ntitre_publication_en=>Brochure 2016\ntexte_publication=><p>Présent dans 14 pays d’Afrique de l’ouest et centrale, le Groupe SUNU est un groupe d’assurances africain créé en 1998 par M. Pathé DIONE avec d’anciens collaborateurs. Le Groupe SUNU, constitué de SUNU Participations Holding SA et de ses 23 filiales et sociétés affiliées.</p>\r\n\ntexte_publication_en=><p>Present in 14 countries in West and Central Africa, SUNU Group is an African insurance group created in 1998 by Mr. Pathé DIONE and some former colleagues. SUNU Group consists of SUNU Participations Holding SA and its 23 subsidiaries and affiliated companies.</p>\r\n\nfichier_publication=>Plaquette _SUNU2016_web.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 11:34:31\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>15\ntitre_publication=>Plaquette 2016\ntitre_publication_en=>Brochure 2016\ntexte_publication=><p>Présent dans 14 pays d’Afrique de l’ouest et centrale, le Groupe SUNU est un groupe d’assurances africain créé en 1998 par M. Pathé DIONE avec d’anciens collaborateurs. Le Groupe SUNU, constitué de SUNU Participations Holding SA et de ses 23 filiales et sociétés affiliées.</p>\r\n\ntexte_publication_en=><p>Present in 14 countries in West and Central Africa, SUNU Group is an African insurance group created in 1998 by Mr. Pathé DIONE with former colleagues. SUNU Group consists of SUNU Participations Holding SA and its 23 subsidiaries and affiliated companies.</p>\r\n\nfichier_publication=>Plaquette _SUNU2016_web.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 11:49:24\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(865,2147204895,'2018-07-27 09:51:48','publication','update|all|13|id_publication=>13\ntitre_publication=>Plaquette 2015\ntitre_publication_en=>\ntexte_publication=>Le Groupe SUNU est un groupe africain d’assurances créé en 1999 par\r\nM. Pathé DIONE avec des collaborateurs. Ancien directeur Afrique\r\nde l’UAP (Union des Assurances de Paris et d’AXA), il a acquis et créé\r\nau fil des ans des sociétés dans 14 pays d’Afrique de l’Ouest et Centrale. \r\n\ntexte_publication_en=>\nfichier_publication=>Plaquette_SUNU_2015web.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 08:03:00\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>13\ntitre_publication=>Plaquette 2015\ntitre_publication_en=>Brochure 2015\ntexte_publication=><p>Le Groupe SUNU est un groupe africain d’assurances créé en 1999 par M. Pathé DIONE avec des collaborateurs. Ancien directeur Afrique de l’UAP (Union des Assurances de Paris et d’AXA), il a acquis et créé au fil des ans des sociétés dans 14 pays d’Afrique de l’Ouest et Centrale.</p>\r\n\ntexte_publication_en=><p>SUNU Group is an African insurance group created in 1998 by Mr. Pathé DIONE with some colleagues. Former Africa Director of UAP (Union des Assurances de Paris) and AXA, he acquired and created over the years companies in 14 countries of West and Central Africa.</p>\r\n\nfichier_publication=>Plaquette_SUNU_2015web.pdf\nfichier_publication_en=>PlaquetteSUNU2015V_anglaise.pdf\ndateCreated_publication=>2018-05-04 11:51:48\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(866,2147204895,'2018-07-27 10:04:15','publication','update|all|6|id_publication=>6\ntitre_publication=>CLASSEMENT 100 PREMIERS ASSUREURS AFRICAINS\ntitre_publication_en=>\ntexte_publication=>Dans le spécial Finances du magazine JEUNE AFRIQUE, un classement des 100 premières sociétés d’assurance du continent confirme une fois de plus la position de Leader de SUNU Assurances Vie Côte d’Ivoire en Afrique subsaharienne.\ntexte_publication_en=>\nfichier_publication=>classement_100_premiers_assureurs_africains.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-14 11:00:19\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>0\nstatut_publication=>1\n|id_publication=>6\ntitre_publication=>CLASSEMENT 100 PREMIERS ASSUREURS AFRICAINS\ntitre_publication_en=>RANKING OF THE TOP 100 AFRICAN INSURERS\ntexte_publication=><p>Dans le spécial Finances du magazine JEUNE AFRIQUE, un classement des 100 premières sociétés d’assurance du continent confirme une fois de plus la position de Leader de SUNU Assurances Vie Côte d’Ivoire en Afrique subsaharienne.</p>\r\n\ntexte_publication_en=><p>In the section dedicated to Finance of the magazine JEUNE AFRIQUE, a ranking of the top 100 insurance companies of the continent confirms once again the position of Leader of SUNU Assurances Vie Côte d’Ivoire in sub-Saharan Africa.</p>\r\n\nfichier_publication=>classement_100_premiers_assureurs_africains.pdf\nfichier_publication_en=>classement_100_premiers_assureurs_africains1.pdf\ndateCreated_publication=>2018-05-14 12:04:15\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>0\nstatut_publication=>1\n'),(867,2147204895,'2018-07-27 10:12:12','publication','update|all|12|id_publication=>12\ntitre_publication=>INTERVIEW DE M. PATHÉ DIONE, PDG DU GROUPE DANS LE HS N°47 DE JEUNE AFRIQUE\ntitre_publication_en=>\ntexte_publication=>Interview de M. Pathé DIONE, PDG du Groupe dans le HS N°47 de Jeune Afrique.\ntexte_publication_en=>\nfichier_publication=>JA_m_Dione.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 11:21:21\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>0\n|id_publication=>12\ntitre_publication=>INTERVIEW DE M. PATHÉ DIONE, PDG DU GROUPE DANS LE HS N°47 DE JEUNE AFRIQUE\ntitre_publication_en=>INTERVIEW WITH Mr. PATHÉ DIONE, CHAIRMAN AND CEO OF THE GROUP IN JEUNE AFRIQUE SPECIAL ISSUE N°47\ntexte_publication=><p>Interview de M. Pathé DIONE, PDG du Groupe dans le HS N°47 de Jeune Afrique.</p>\r\n\ntexte_publication_en=><p>Interview with Mr. Pathé DIONE, Chairman and CEO of the Group in Jeune Afrique special issue n°47.</p>\r\n\nfichier_publication=>JA_m_Dione.pdf\nfichier_publication_en=>JA_m_Dione1.pdf\ndateCreated_publication=>2018-05-04 12:12:12\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>0\n'),(868,2147204895,'2018-07-27 10:20:36','publication','update|all|11|id_publication=>11\ntitre_publication=>M. PATHÉ DIONE : « L\'ARROGANCE COLONIALE NE PASSERA PAS !»\ntitre_publication_en=>\ntexte_publication=>\ntexte_publication_en=>\nfichier_publication=>GroupeSUNU_Financials_Afrik.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 12:15:47\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>0\n|id_publication=>11\ntitre_publication=>M. PATHÉ DIONE : «L\'ARROGANCE COLONIALE NE PASSERA PAS!»\ntitre_publication_en=>Mr. PATHÉ DIONE : « COLONIAL ARROGANCE WON\'T WORK!»\ntexte_publication=><p>M. PATHÉ DIONE : « L&#39;arrogance coloniale ne passera pas!»</p>\r\n\ntexte_publication_en=><p>Mr. PATHÉ DIONE : « Colonial arrogance won&#39;t work!»</p>\r\n\nfichier_publication=>GroupeSUNU_Financials_Afrik.pdf\nfichier_publication_en=>GroupeSUNU_Financials_Afrik1.pdf\ndateCreated_publication=>2018-05-04 12:20:36\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>0\n'),(869,2147204895,'2018-07-27 10:33:57','publication','update|all|10|id_publication=>10\ntitre_publication=>LE GROUPE SUNU N\'EST PAS À VENDRE\ntitre_publication_en=>\ntexte_publication=>Le Groupe SUNU n\'est pas à vendre ! \r\n\r\nCette phrase, montrant toute l\'ambition du PDG du groupe SUNU pour son continent, n\'a pas été appréciée de certaines convoitises internationales qui souhaitaient entrer dans son capital. \ntexte_publication_en=>\nfichier_publication=>Le-Groupe-SUNU-nest-pas-a-vendre.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 12:15:14\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>0\n|id_publication=>10\ntitre_publication=>LE GROUPE SUNU N\'EST PAS À VENDRE\ntitre_publication_en=>SUNU GROUP IS NOT FOR SALE\ntexte_publication=><p>Le Groupe SUNU n&#39;est pas à vendre ! Cette phrase, montrant toute l&#39;ambition du PDG du groupe SUNU pour son continent, n&#39;a pas été appréciée de certaines convoitises internationales qui souhaitaient entrer dans son capital.</p>\r\n\ntexte_publication_en=><p>SUNU Group is not for sale! This sentence that shows all the ambition of SUNU Group CEO for his continent, was not appreciated by some international entities that eagerly wants to enter into its capital.</p>\r\n\nfichier_publication=>Le-Groupe-SUNU-nest-pas-a-vendre.pdf\nfichier_publication_en=>Le_Groupe_SUNU_nest_pas_à_vendre.pdf\ndateCreated_publication=>2018-05-04 12:33:57\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>0\n'),(870,2147204895,'2018-07-27 10:39:20','publication','update|all|9|id_publication=>9\ntitre_publication=>INTERVIEW DE M. VINCENT MVOLA, DIRECTEUR GÉNÉRAL ADJOINT DE SUNU ASSURANCES IARD GABON\ntitre_publication_en=>\ntexte_publication=>Interview de M. Vincent MVOLA, Directeur Général Adjoint de SUNU Assurances IARD Gabon :\"L\'un des trois principaux produits commercialisés porte sur l\'assurance automobile\".\ntexte_publication_en=>\nfichier_publication=>Interview_M_MVOLA_DGA_SUNU_IARD_GABON.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 12:12:12\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>9\ntitre_publication=>INTERVIEW DE M. VINCENT MVOLA, DIRECTEUR GÉNÉRAL ADJOINT DE SUNU ASSURANCES IARD GABON\ntitre_publication_en=>INTERVIEW WITH Mr. VINCENT MVOLA, DEPUTY MANAGING DIRECTOR OF SUNU ASSURANCES IARD GABON\ntexte_publication=><p>Interview de M. Vincent MVOLA, Directeur Général Adjoint de SUNU Assurances IARD Gabon :\"L&#39;un des trois principaux produits commercialisés porte sur l&#39;assurance automobile\".</p>\r\n\ntexte_publication_en=><p>Interview Mr.Vincent MVOLA, Deputy Managing Director of SUNU Assurances IARD Gabon :\" One of the top three products sold is car insurance\".</p>\r\n\nfichier_publication=>Interview_M_MVOLA_DGA_SUNU_IARD_GABON.pdf\nfichier_publication_en=>Interview_M_MVOLA_DGA_SUNU_IARD_GABON1.pdf\ndateCreated_publication=>2018-05-04 12:39:20\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(871,2147204895,'2018-07-27 10:44:30','_SESSION','login|all|1532688252|0|__ci