LE, Managing Director of SUNU Assurances Vie Cameroun and outstanding “amazon”, talks about her career and explains the ambitions of SUNU Group for the insurance sector in Cameroon.</p>\r\n\nfichier_publication=>Interview_mme_chantal_mouelle_dg_sunu_asssurances_vie_cam..pdf\nfichier_publication_en=>Interview_mme_chantal_mouelle_dg_sunu_asssurances_vie_cam_.pdf\ndateCreated_publication=>2018-05-14 12:55:39\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>0\nstatut_publication=>1\n'),(900,2147204895,'2018-07-27 11:04:02','publication','update|all|5|id_publication=>5\ntitre_publication=>ENTRETIEN / BAKAYOKO SALIOU (PRIX FANAF 2016)\ntitre_publication_en=>\ntexte_publication=>ENTRETIEN / BAKAYOKO SALIOU (PRIX FANAF 2016) / Ce qu\'il pense du séminaire de Yamoussoukro « L’Assurance Vie évite de pleurer deux fois nos morts »\ntexte_publication_en=>\nfichier_publication=>ENTRETIEN_BAKAYOKO_SALIOU.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-14 11:03:44\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>0\nstatut_publication=>1\n|id_publication=>5\ntitre_publication=>ENTRETIEN / BAKAYOKO SALIOU (PRIX FANAF 2016)\ntitre_publication_en=>INTERVIEW / BAKAYOKO SALIOU (FANAF 2016 AWARD)\ntexte_publication=><p>ENTRETIEN / BAKAYOKO SALIOU (PRIX FANAF 2016) / Ce qu&#39;il pense du séminaire de Yamoussoukro « L’Assurance Vie évite de pleurer deux fois nos morts ».</p>\r\n\ntexte_publication_en=><p>INTERVIEW / BAKAYOKO SALIOU (FANAF 2016 AWARD) / What he thinks about the seminar of Yamoussoukro « Life insurance saves us from mourning our dead twice».</p>\r\n\nfichier_publication=>ENTRETIEN_BAKAYOKO_SALIOU.pdf\nfichier_publication_en=>ENTRETIEN_BAKAYOKO_SALIOU1.pdf\ndateCreated_publication=>2018-05-14 13:04:02\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>0\nstatut_publication=>1\n'),(901,2147204895,'2018-07-27 11:14:21','photo','disable|statut_photo|244|0,1,2|3'),(902,2147204895,'2018-07-27 11:14:41','photo','disable|statut_photo|242|0,1,2|3'),(903,2147204895,'2018-07-27 11:14:48','photo','disable|statut_photo|235|0,1,2|3'),(904,2147204895,'2018-07-27 11:14:52','photo','disable|statut_photo|233|0,1,2|3'),(905,2147204895,'2018-07-27 11:15:11','photo','disable|statut_photo|241|0,1,2|3'),(906,2147204895,'2018-07-27 11:23:44','photo','disable|statut_photo|240|0,1,2|3'),(907,2147204895,'2018-07-27 11:23:57','photo','disable|statut_photo|238|0,1,2|3'),(908,2147204895,'2018-07-27 11:39:59','texte','update|all|2|id_texte=>2\nid_type_texte=>1\ncontenu_texte=><p><strong>SUNU Participations Holding SA</strong> est administrée par un Conseil d’Administration composé de quatre (04) membres nommés par l’Assemblée Générale des actionnaires.</p>\r\n\r\n<p><strong>Missions et attributions</strong><br>\r\nLe Conseil d’Administration détermine les orientations de l’activité de la société et veille à leur mise en œuvre. Il exerce notamment les pouvoirs suivants :</p>\r\n\r\n<ul>\r\n <li>la nomination du Directeur Général ainsi que des Directeurs Généraux Délégués ;</li>\r\n <li>l’arrêté des comptes annuels</li>\r\n <li>la convocation des assemblées d’actionnaires ;</li>\r\n <li>l’autorisation des conventions « réglementées ».</li>\r\n</ul>\r\n\r\n<p>Certaines opérations ou questions importantes sont également soumises à l’autorisation préalable du Conseil d’Administration (cessions ou acquisitions, opérations de financement significatives ou opérations en dehors de la stratégie annoncée par la société...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nLes membres du Conseil d’Administration de SUNU Participations Holding S.A sont :</p>\r\n\r\n<ul>\r\n <li>Pathé DIONE, Président Directeur Général (Président de SUNU Finances Holding ; Fondateur du Groupe SUNU)</li>\r\n <li>Papa-Demba DIALLO, Administrateur (Président du Conseil d’Administration de la Société Générale de Banque du Sénégal SGBS)</li>\r\n <li>Federico ROMAN, Administrateur (Cadre Supérieur d’Assurances)</li>\r\n</ul>\r\n\ncontenu_texte_en=>\ndateCreated_texte=>2018-06-03 14:36:16\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n|id_texte=>2\nid_type_texte=>1\ncontenu_texte=><p><strong>SUNU Participations Holding SA</strong> est administrée par un Conseil d’Administration composé de quatre (04) membres nommés par l’Assemblée Générale des actionnaires.</p>\r\n\r\n<p><strong>Missions et attributions</strong><br>\r\nLe Conseil d’Administration détermine les orientations de l’activité de la société et veille à leur mise en œuvre. Il exerce notamment les pouvoirs suivants :</p>\r\n\r\n<ul>\r\n <li>la nomination du Directeur Général ainsi que des Directeurs Généraux Délégués ;</li>\r\n <li>l’arrêté des comptes annuels</li>\r\n <li>la convocation des assemblées d’actionnaires ;</li>\r\n <li>l’autorisation des conventions « réglementées ».</li>\r\n</ul>\r\n\r\n<p>Certaines opérations ou questions importantes sont également soumises à l’autorisation préalable du Conseil d’Administration (cessions ou acquisitions, opérations de financement significatives ou opérations en dehors de la stratégie annoncée par la société...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nLes membres du Conseil d’Administration de SUNU Participations Holding S.A sont :</p>\r\n\r\n<ul>\r\n <li>Pathé DIONE, Président Directeur Général (Président de SUNU Finances Holding ; Fondateur du Groupe SUNU)</li>\r\n <li>Papa-Demba DIALLO, Administrateur (Président du Conseil d’Administration de la Société Générale de Banque du Sénégal SGBS)</li>\r\n <li>Federico ROMAN, Administrateur (Cadre Supérieur d’Assurances)</li>\r\n</ul>\r\n\ncontenu_texte_en=><p><strong>SUNU Participations Holding SA</strong>’s is administered by a Board of Directors is comprised of four (4) members appointed by the shareholders’ meeting.</p>\r\n\r\n<p><strong>Functions and Responsibilities</strong></p>\r\n\r\n<p>The Board of directors determines the company’s business policies and ensures the implementation thereof. It exercises the following powers:</p>\r\n\r\n<p xss=removed><strong>•</strong> appointing the Managing Director as well as the Deputy Managing Directors<br>\r\n<strong>•</strong> annual cut-offs<br>\r\n<strong>•</strong> convening shareholders’ meetings<br>\r\n<strong>•</strong> approving related-party agreements.</p>\r\n\r\n<p>Some important operations or issues need prior approval of the Board of Directors (disposals or acquisitions, major financing operations or operations that are not within the company’s strategy ...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nThe members of SUNU Participations Holding SA Board of directors are:</p>\r\n\r\n<p xss=removed><strong>•</strong> Mr Pathé DIONE, Chairman and Chief Executive Officer (Chairman of SUNU Finances Holding; Founder of SUNU Group)<br>\r\n<strong>•</strong> Mr Papa-Demba DIALLO, Non-Executive Director (former Chairman of Société Générale de Banque of Senegal (SGBS)<br>\r\n<strong>•</strong> Mr Federico ROMAN, Non-Executive Director (Senior Insurance Executive)</p>\r\n\ndateCreated_texte=>2018-06-03 14:36:16\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(909,2147204895,'2018-07-27 11:41:18','texte','update|all|2|id_texte=>2\nid_type_texte=>1\ncontenu_texte=><p><strong>SUNU Participations Holding SA</strong> est administrée par un Conseil d’Administration composé de quatre (04) membres nommés par l’Assemblée Générale des actionnaires.</p>\r\n\r\n<p><strong>Missions et attributions</strong><br>\r\nLe Conseil d’Administration détermine les orientations de l’activité de la société et veille à leur mise en œuvre. Il exerce notamment les pouvoirs suivants :</p>\r\n\r\n<ul>\r\n <li>la nomination du Directeur Général ainsi que des Directeurs Généraux Délégués ;</li>\r\n <li>l’arrêté des comptes annuels</li>\r\n <li>la convocation des assemblées d’actionnaires ;</li>\r\n <li>l’autorisation des conventions « réglementées ».</li>\r\n</ul>\r\n\r\n<p>Certaines opérations ou questions importantes sont également soumises à l’autorisation préalable du Conseil d’Administration (cessions ou acquisitions, opérations de financement significatives ou opérations en dehors de la stratégie annoncée par la société...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nLes membres du Conseil d’Administration de SUNU Participations Holding S.A sont :</p>\r\n\r\n<ul>\r\n <li>Pathé DIONE, Président Directeur Général (Président de SUNU Finances Holding ; Fondateur du Groupe SUNU)</li>\r\n <li>Papa-Demba DIALLO, Administrateur (Président du Conseil d’Administration de la Société Générale de Banque du Sénégal SGBS)</li>\r\n <li>Federico ROMAN, Administrateur (Cadre Supérieur d’Assurances)</li>\r\n</ul>\r\n\ncontenu_texte_en=><p><strong>SUNU Participations Holding SA</strong>’s is administered by a Board of Directors is comprised of four (4) members appointed by the shareholders’ meeting.</p>\r\n\r\n<p><strong>Functions and Responsibilities</strong></p>\r\n\r\n<p>The Board of directors determines the company’s business policies and ensures the implementation thereof. It exercises the following powers:</p>\r\n\r\n<p xss=removed><strong>•</strong> appointing the Managing Director as well as the Deputy Managing Directors<br>\r\n<strong>•</strong> annual cut-offs<br>\r\n<strong>•</strong> convening shareholders’ meetings<br>\r\n<strong>•</strong> approving related-party agreements.</p>\r\n\r\n<p>Some important operations or issues need prior approval of the Board of Directors (disposals or acquisitions, major financing operations or operations that are not within the company’s strategy ...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nThe members of SUNU Participations Holding SA Board of directors are:</p>\r\n\r\n<p xss=removed><strong>•</strong> Mr Pathé DIONE, Chairman and Chief Executive Officer (Chairman of SUNU Finances Holding; Founder of SUNU Group)<br>\r\n<strong>•</strong> Mr Papa-Demba DIALLO, Non-Executive Director (former Chairman of Société Générale de Banque of Senegal (SGBS)<br>\r\n<strong>•</strong> Mr Federico ROMAN, Non-Executive Director (Senior Insurance Executive)</p>\r\n\ndateCreated_texte=>2018-06-03 14:36:16\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n|id_texte=>2\nid_type_texte=>1\ncontenu_texte=><p><strong>SUNU Participations Holding SA</strong> est administrée par un Conseil d’Administration composé de quatre (04) membres nommés par l’Assemblée Générale des actionnaires.</p>\r\n\r\n<p><strong>Missions et attributions</strong><br>\r\nLe Conseil d’Administration détermine les orientations de l’activité de la société et veille à leur mise en œuvre. Il exerce notamment les pouvoirs suivants :</p>\r\n\r\n<ul>\r\n <li>la nomination du Directeur Général ainsi que des Directeurs Généraux Délégués ;</li>\r\n <li>l’arrêté des comptes annuels</li>\r\n <li>la convocation des assemblées d’actionnaires ;</li>\r\n <li>l’autorisation des conventions « réglementées ».</li>\r\n</ul>\r\n\r\n<p>Certaines opérations ou questions importantes sont également soumises à l’autorisation préalable du Conseil d’Administration (cessions ou acquisitions, opérations de financement significatives ou opérations en dehors de la stratégie annoncée par la société...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nLes membres du Conseil d’Administration de SUNU Participations Holding S.A sont :</p>\r\n\r\n<ul>\r\n <li>Pathé DIONE, Président Directeur Général (Président de SUNU Finances Holding ; Fondateur du Groupe SUNU)</li>\r\n <li>Papa-Demba DIALLO, Administrateur (Président du Conseil d’Administration de la Société Générale de Banque du Sénégal SGBS)</li>\r\n <li>Federico ROMAN, Administrateur (Cadre Supérieur d’Assurances)</li>\r\n</ul>\r\n\ncontenu_texte_en=><p><strong>SUNU Participations Holding SA</strong>’s is administered by a Board of Directors is comprised of four (4) members appointed by the shareholders’ meeting.</p>\r\n\r\n<p><strong>Functions and Responsibilities</strong><br>\r\nThe Board of directors determines the company’s business policies and ensures the implementation thereof. It exercises the following powers:</p>\r\n\r\n<p><strong>•</strong> appointing the Managing Director as well as the Deputy Managing Directors<br>\r\n<strong>•</strong> annual cut-offs<br>\r\n<strong>•</strong> convening shareholders’ meetings<br>\r\n<strong>•</strong> approving related-party agreements.</p>\r\n\r\n<p>Some important operations or issues need prior approval of the Board of Directors (disposals or acquisitions, major financing operations or operations that are not within the company’s strategy ...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nThe members of SUNU Participations Holding SA Board of directors are:</p>\r\n\r\n<p><strong>•</strong> Mr Pathé DIONE, Chairman and Chief Executive Officer (Chairman of SUNU Finances Holding; Founder of SUNU Group)<br>\r\n<strong>•</strong> Mr Papa-Demba DIALLO, Non-Executive Director (former Chairman of Société Générale de Banque of Senegal (SGBS)<br>\r\n<strong>•</strong> Mr Federico ROMAN, Non-Executive Director (Senior Insurance Executive)</p>\r\n\ndateCreated_texte=>2018-06-03 14:36:16\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(910,2147204895,'2018-07-27 11:46:24','texte','update|all|3|id_texte=>3\nid_type_texte=>2\ncontenu_texte=><p>La Direction Générale de SUNU Participations Holding SA est composée du Président Directeur Général et de deux Directeurs Généraux Délégués.</p>\r\n\r\n<p><strong>Le Président Directeur Général</strong><br>\r\nLe Président Directeur Général est investi des pouvoirs les plus étendus pour agir en toute circonstance au nom de la société. Il exerce ses pouvoirs dans la limite de l’objet social et sous réserve de ce que la loi attribue expressément aux assemblées d’actionnaires et au Conseil d’Administration. Il représente la société dans ses rapports avec les tiers.</p>\r\n\r\n<p><strong>Les Directeurs Généraux Délégués</strong><br>\r\nIls ont pour mission d’assister le Président Directeur Général dans l’exercice de ses fonctions. Le Conseil détermine l’étendue et la durée des pouvoirs conférés aux Directeurs Généraux Délégués.</p>\r\n\r\n<p><strong>Le Comité de Direction</strong><br>\r\nLe Président Directeur Général a décidé de s’appuyer sur un Comité de Direction pour l’assister dans le pilotage de la gestion opérationnelle du Groupe. Ce Comité est composé de quatre membres :</p>\r\n\ncontenu_texte_en=>\ndateCreated_texte=>2018-06-03 14:36:58\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n|id_texte=>3\nid_type_texte=>2\ncontenu_texte=><p>La Direction Générale de SUNU Participations Holding SA est composée du Président Directeur Général et de deux Directeurs Généraux Délégués.</p>\r\n\r\n<p><strong>Le Président Directeur Général</strong><br>\r\nLe Président Directeur Général est investi des pouvoirs les plus étendus pour agir en toute circonstance au nom de la société. Il exerce ses pouvoirs dans la limite de l’objet social et sous réserve de ce que la loi attribue expressément aux assemblées d’actionnaires et au Conseil d’Administration. Il représente la société dans ses rapports avec les tiers.</p>\r\n\r\n<p><strong>Les Directeurs Généraux Délégués</strong><br>\r\nIls ont pour mission d’assister le Président Directeur Général dans l’exercice de ses fonctions. Le Conseil détermine l’étendue et la durée des pouvoirs conférés aux Directeurs Généraux Délégués.</p>\r\n\r\n<p><strong>Le Comité de Direction</strong><br>\r\nLe Président Directeur Général a décidé de s’appuyer sur un Comité de Direction pour l’assister dans le pilotage de la gestion opérationnelle du Groupe. Ce Comité est composé de quatre membres :</p>\r\n\ncontenu_texte_en=><p>SUNU Participations Holding SA’s management team is comprised of the Chairman and Chief Executive Officer and two Deputy Managing Directors.</p>\r\n\r\n<p><strong>The Chairman and Chief Executive Officer</strong><br>\r\nThe Chairman and Chief Executive Officer is vested with the broadest powers to act on behalf of the company in all circumstances.<br>\r\nHe exercises his powers within the limits of the corporate purpose and subject to those powers expressly vested in law by shareholders and the Board of directors. He represents the company in its deals with third parties.</p>\r\n\r\n<p><strong>The Deputy Managing Directors</strong><br>\r\nThey are responsible for assisting the Chairman and Chief Executive Officer in the performance of his duties. The Board determines the scope and term of the powers conferred upon the Deputy Managing Directors.</p>\r\n\r\n<p><strong>The Executive Committee</strong><br>\r\nThe Chairman and Chief Executive Officer has decided to rely on an Executive Committee in assisting him for the Group’s operational management. This Committee comprises four members as follows:</p>\r\n\ndateCreated_texte=>2018-06-03 14:36:58\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(911,2147204895,'2018-07-27 11:49:26','texte','update|all|5|id_texte=>5\nid_type_texte=>4\ncontenu_texte=><p>Le Groupe SUNU comprend plus de 2200 collaborateurs et 24 sociétés : 9 compagnies d&#39;assurance Vie, 13 compagnies d&#39;assurance IARD, 1 banque, 1 société de microfinance, 1 société de gestion Santé répartis dans quatorze (14) pays africains.</p>\r\n\r\n<p>Dans chacune de ses filiales, le Groupe SUNU a choisi d&#39;assurer la vie, les projets, la santé, l&#39;immobilier et bien plus encore, tout en accompagnant les populations et les entreprises.</p>\r\n\ncontenu_texte_en=>\ndateCreated_texte=>2018-07-23 13:36:15\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n|id_texte=>5\nid_type_texte=>4\ncontenu_texte=><p>Le Groupe SUNU comprend plus de 2200 collaborateurs et 24 sociétés : 9 compagnies d&#39;assurance Vie, 13 compagnies d&#39;assurance IARD, 1 banque, 1 société de microfinance, 1 société de gestion Santé répartis dans quatorze (14) pays africains.</p>\r\n\r\n<p>Dans chacune de ses filiales, le Groupe SUNU a choisi d&#39;assurer la vie, les projets, la santé, l&#39;immobilier et bien plus encore, tout en accompagnant les populations et les entreprises.</p>\r\n\ncontenu_texte_en=><p>SUNU Group is made of 2200 employees and 24 companies: 9 Life insurance companies, 13 general insurance companies, 1 bank, 1 microfinance company and 1 health management company in fourteen (14) African countries.</p>\r\n\r\n<p>Through each of its subsidiaries, SUNU Group opted for insuring Life, projects, Health, properties and more, while supporting populations and companies.</p>\r\n\ndateCreated_texte=>2018-07-23 13:36:15\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(912,2147204895,'2018-07-27 11:56:04','texte','update|all|6|id_texte=>6\nid_type_texte=>5\ncontenu_texte=><p>Le Groupe SUNU ambitionne d&#39;être le groupe panafricain d&#39;assurances de référence par sa solidité financière, par son professionnalisme et par les valeurs qu&#39;il véhicule :</p>\r\n\r\n<ul>\r\n <li>la Proximité vis à vis de nos clients et des Hommes qui font le Groupe</li>\r\n <li>l&#39;Innovation dans les offres et services proposés</li>\r\n <li>la Qualité de service pour une confiance réciproque et pérenne</li>\r\n</ul>\r\n\ncontenu_texte_en=>\ndateCreated_texte=>2018-07-23 13:38:43\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n|id_texte=>6\nid_type_texte=>5\ncontenu_texte=><p>Le Groupe SUNU ambitionne d&#39;être le groupe panafricain d&#39;assurances de référence par sa solidité financière, par son professionnalisme et par les valeurs qu&#39;il véhicule :</p>\r\n\r\n<ul>\r\n <li>la Proximité vis à vis de nos clients et des Hommes qui font le Groupe</li>\r\n <li>l&#39;Innovation dans les offres et services proposés</li>\r\n <li>la Qualité de service pour une confiance réciproque et pérenne</li>\r\n</ul>\r\n\ncontenu_texte_en=><p>SUNU Group’s ambition is to be the leading Pan-African group of insurance by leaning on its financial solidity, its professionalism and the values it promotes:</p>\r\n\r\n<ul>\r\n <li>proximity with its customers and workforce which is the Group’s bone.</li>\r\n <li>Innovation in its offers and services.</li>\r\n <li>Quality of service for mutual and continuous trust.</li>\r\n</ul>\r\n\ndateCreated_texte=>2018-07-23 13:38:43\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(913,2147204895,'2018-07-27 12:10:07','texte','update|all|4|id_texte=>4\nid_type_texte=>3\ncontenu_texte=><p>Présent dans plus de 14 pays d&#39;Afrique subsaharienne et comptant une vingtaine de filiales & sociétés affiliées, le Groupe SUNU est un groupe d&#39;assurances africain créé en 1998 par M. Pathé DIONE avec d&#39;anciens collaborateurs.</p>\r\n\r\n<p>Leader de l&#39;assurance Vie sur toute la zone de la Conférence Interafricaine des Marchés d&#39;Assurances depuis cinq ans, SUNU Assurances a réalisé un chiffre d&#39;affaires de plus de <span xss=removed>155 milliards de francs CFA</span> en fin d&#39;exercice 2017 et un résultat net de 6,5 milliards de francs CFA. Le Groupe SUNU gère également <span xss=removed>377 milliards de francs CFA d&#39;actifs</span>.</p>\r\n\r\n<p>SUNU Assurances accompagne les populations, les entreprises et les gouvernements dans leur développement et dans la réalisation de leurs projets, suivant ses trois valeurs :</p>\r\n\r\n<ul>\r\n <li>la proximité vis à vis des clients et des Hommes qui font le Groupe</li>\r\n <li>l&#39;innovation dans des offres et des services étudiés</li>\r\n <li>la qualité de service pour une confiance réciproque et pérenne</li>\r\n</ul>\r\n\r\n<p>Aujourd&#39;hui leader en assurance Vie, le Groupe SUNU compte être la référence de l&#39;assurance en Afrique.</p>\r\n\ncontenu_texte_en=>\ndateCreated_texte=>2018-07-23 13:35:11\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n|id_texte=>4\nid_type_texte=>3\ncontenu_texte=><p>Présent dans plus de 14 pays d&#39;Afrique subsaharienne et comptant une vingtaine de filiales & sociétés affiliées, le Groupe SUNU est un groupe d&#39;assurances africain créé en 1998 par M. Pathé DIONE avec d&#39;anciens collaborateurs.</p>\r\n\r\n<p>Leader de l&#39;assurance Vie sur toute la zone de la Conférence Interafricaine des Marchés d&#39;Assurances depuis cinq ans, SUNU Assurances a réalisé un chiffre d&#39;affaires de plus de 155 milliards de francs CFA en fin d&#39;exercice 2017 et un résultat net de 6,5 milliards de francs CFA. Le Groupe SUNU gère également 377 milliards de francs CFA d&#39;actifs.</p>\r\n\r\n<p>SUNU Assurances accompagne les populations, les entreprises et les gouvernements dans leur développement et dans la réalisation de leurs projets, suivant ses trois valeurs :</p>\r\n\r\n<ul>\r\n <li>la proximité vis à vis des clients et des Hommes qui font le Groupe</li>\r\n <li>l&#39;innovation dans des offres et des services étudiés</li>\r\n <li>la qualité de service pour une confiance réciproque et pérenne</li>\r\n</ul>\r\n\r\n<p>Aujourd&#39;hui leader en assurance Vie, le Groupe SUNU compte être la référence de l&#39;assurance en Afrique.</p>\r\n\ncontenu_texte_en=><p>Present in 14 countries in West and Central Africa, SUNU Group is an African insurance group created in 1998 by Mr Pathe DIONE  with his former colleagues. SUNU Group comprises about 20 subsidiaries and affiliated companies.</p>\r\n\r\n<p>Leader of Life insurance of <em>the </em>Inter-African Conference on <em>Insurance</em> Markets zone (<em>Conférence Interafricaine des Marchés d&#39;Assurances, CIMA</em>) for more than five years, SUNU Assurances made a turnover of 155 billion francs CFA in 2017 and a net profit of 6.5 billion francs CFA. SUNU Group manages a portfolio of assets of 377 billion francs CFA.</p>\r\n\r\n<p>SUNU Assurances supports populations, companies and governments in their development and in the completion of their projects. All these actions are based on three values:</p>\r\n\r\n<ul>\r\n <li>Proximity with customers and workforce which is the Group’s backbone.</li>\r\n <li>Innovation in ioffers and services.</li>\r\n <li>Quality of service for mutual and continuous trust.</li>\r\n</ul>\r\n\ndateCreated_texte=>2018-07-23 13:35:11\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(914,2147204895,'2018-07-27 12:18:32','experience','update|all|2|id_experience=>2\nid_equipe=>4\nperiode_experience=>1941\ntexte_experience=>Naissance à Dakar, Sénégal\ntexte_experience_en=>Naissance à Dakar, Sénégal\ndateCreated_experience=>2018-06-03 14:50:15\ndateDisabled_experience=>\ncreatedBy=>2147484848\nstatut_experience=>1\n|id_experience=>2\nid_equipe=>4\nperiode_experience=>1941\ntexte_experience=>Naissance à Dakar, Sénégal\ntexte_experience_en=>Born in Dakar, Senegal\ndateCreated_experience=>2018-06-03 14:50:15\ndateDisabled_experience=>\ncreatedBy=>2147484848\nstatut_experience=>1\n'),(915,2147204895,'2018-07-27 12:18:57','experience','update|all|3|id_experience=>3\nid_equipe=>4\nperiode_experience=>1966 - 1972\ntexte_experience=>Professeur de mathématiques\ntexte_experience_en=>Professeur de mathématiques\ndateCreated_experience=>2018-06-03 14:50:44\ndateDisabled_experience=>\ncreatedBy=>2147484848\nstatut_experience=>1\n|id_experience=>3\nid_equipe=>4\nperiode_experience=>1966 - 1972\ntexte_experience=>Professeur de mathématiques\ntexte_experience_en=>Professor of Mathematics\ndateCreated_experience=>2018-06-03 14:50:44\ndateDisabled_experience=>\ncreatedBy=>2147484848\nstatut_experience=>1\n'),(916,2147204895,'2018-07-27 12:19:30','experience','update|all|6|id_experience=>6\nid_equipe=>4\nperiode_experience=>1980 - 1984\ntexte_experience=>Docteur en économie, La Sorbonne\ntexte_experience_en=>Docteur en économie, La Sorbonne\ndateCreated_experience=>2018-06-03 14:52:06\ndateDisabled_experience=>\ncreatedBy=>2147484848\nstatut_experience=>1\n|id_experience=>6\nid_equipe=>4\nperiode_experience=>1980 - 1984\ntexte_experience=>Docteur en économie, La Sorbonne\ntexte_experience_en=>PhD in Economics, Sorbonne University\ndateCreated_experience=>2018-06-03 14:52:06\ndateDisabled_experience=>\ncre