id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(943,2147204895,'2018-07-31 14:27:30','_SESSION','login|all|1533047237|0|__ci_last_regenerate=>1533047237\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-07-30 14:37:32::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(944,2147204895,'2018-07-31 14:41:52','historique','update|all|3|id_historique=>3\nannee_historique=>1998\nmois_historique=>\ntexte_historique=>Monsieur Pathé DIONE crée avec d’autres partenaires la société SUNU Finances Holding SA, domiciliée à la Banque Bruxelles Lambert Trust (BBL, devenue ING Trust) au Luxembourg et bénéficiant du statut fiscal particulier attaché aux Holding 1929. La société a été créée dans un premier temps par deux structures (LOVETTE Overseas SA et GREBELLE Investments SA) de l’agent domiciliataire (BBL) puis les actions ont été cédées aux actionnaires historiques en septembre 1999. \r\nEn novembre, la société SUNU Finances signe avec Axa-UAP un protocole d’accord qui l‘autorise à acquérir progressivement les sociétés qu’Axa souhaiterait céder en Afrique.\ntexte_historique_en=> \ndateCreated_historique=>2018-06-03 11:51:40\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>3\nannee_historique=>1998\nmois_historique=>0\ntexte_historique=><p>Monsieur Pathé DIONE crée avec d’autres partenaires la société SUNU Finances Holding SA, domiciliée à la Banque Bruxelles Lambert Trust (BBL, devenue ING Trust) au Luxembourg et bénéficiant du statut fiscal particulier attaché aux Holding 1929. La société a été créée dans un premier temps par deux structures (LOVETTE Overseas SA et GREBELLE Investments SA) de l’agent domiciliataire (BBL) puis les actions ont été cédées aux actionnaires historiques en septembre 1999. En novembre, la société SUNU Finances signe avec Axa-UAP un protocole d’accord qui l‘autorise à acquérir progressivement les sociétés qu’Axa souhaiterait céder en Afrique.</p>\r\n\ntexte_historique_en=><p>Mr Pathé DIONE and other partners created the company SUNU Finances Holding SA domiciled at Banque Bruxelles Lambert Trust (BBL, now known as ING Trust) in Luxembourg. The company benefits from special tax status and operates under the 1929 holding regime.<br>\r\nFirst the company was created by two firms (LOVETTE Overseas SA et GREBELLE Investments SA) of the domiciliary agent (BBL); then the shares were transferred to the historical shareholders in 1999.<br>\r\nIn November, SUNU Finances and Axa-UAP signed a memorandum of agreement allowing SUNU Finances to gradually acquire the companies in Africa Axa would like to dispose of.</p>\r\n\ndateCreated_historique=>2018-06-03 11:51:40\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(945,2147204895,'2018-07-31 14:44:21','historique','update|all|4|id_historique=>4\nannee_historique=>1999\nmois_historique=>0\ntexte_historique=><p>SUNU Finances (société mère du Groupe SUNU), rachète cinq filiales du groupe AXA-UAP à savoir :</p>\r\n\r\n<ul>\r\n <li>La CSAR-Vie au Sénégal désormais SUNU Assurances Vie Sénégal au Sénégal après avoir porté le nom de UASen-Vie,</li>\r\n <li>SUNU Assurances Vie Togo (ex UAT-Vie) au Togo,</li>\r\n <li>SUNU Assurances Vie Bénin (ex UBA-Vie) au Bénin,</li>\r\n <li>SUNU Assurances IARD Centrafrique (ex UAC-IARD) en Centrafrique,</li>\r\n <li>SUNU Assurances IARD Niger (ex UGAN-IARD) au Niger.</li>\r\n</ul>\r\n\r\n<p>SUNU Finances crée SUNU Gestion, une EURL en France, qui fournit des prestations d’assistance technique aux sociétés d’assurances du groupe SUNU.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:17:56\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>4\nannee_historique=>1999\nmois_historique=>0\ntexte_historique=><p>SUNU Finances (société mère du Groupe SUNU), rachète cinq filiales du groupe AXA-UAP à savoir :</p>\r\n\r\n<ul>\r\n <li>La CSAR-Vie au Sénégal désormais SUNU Assurances Vie Sénégal au Sénégal après avoir porté le nom de UASen-Vie,</li>\r\n <li>SUNU Assurances Vie Togo (ex UAT-Vie) au Togo,</li>\r\n <li>SUNU Assurances Vie Bénin (ex UBA-Vie) au Bénin,</li>\r\n <li>SUNU Assurances IARD Centrafrique (ex UAC-IARD) en Centrafrique,</li>\r\n <li>SUNU Assurances IARD Niger (ex UGAN-IARD) au Niger.</li>\r\n</ul>\r\n\r\n<p>SUNU Finances crée SUNU Gestion, une EURL en France, qui fournit des prestations d’assistance technique aux sociétés d’assurances du groupe SUNU.</p>\r\n\ntexte_historique_en=><p>SUNU Finances (parent company of SUNU Group), acquires the five subsidiaries of AXA-UAP Group that follow:</p>\r\n\r\n<ul>\r\n <li>CSAR-Vie in Senegal renamed UASen-Vie and now called SUNU Assurances Vie Sénégal.</li>\r\n <li>SUNU Assurances Vie Togo (ex UAT-Vie) in Togo,</li>\r\n <li>SUNU Assurances Vie Bénin (ex UBA-Vie) in Benin,</li>\r\n <li>SUNU Assurances IARD Centrafrique (ex UAC-IARD) in Central African Republic.</li>\r\n <li>SUNU Assurances IARD Niger (ex UGAN-IARD) in Niger.</li>\r\n</ul>\r\n\r\n<p>SUNU Finances created SUNU Gestion, a sole proprietorship limited liability company based in France. SUNU Finances provides technical support to the insurance companies of SUNU Group.</p>\r\n\ndateCreated_historique=>2018-06-03 13:17:56\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(946,2147204895,'2018-07-31 14:45:26','historique','update|all|5|id_historique=>5\nannee_historique=>2000\nmois_historique=>0\ntexte_historique=>Création de SUNU Assurances Vie Niger (ex UGAN-Vie) au Niger en partenariat avec des banques locales.\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:18:55\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>5\nannee_historique=>2000\nmois_historique=>0\ntexte_historique=><p>Création de SUNU Assurances Vie Niger (ex UGAN-Vie) au Niger en partenariat avec des banques locales.</p>\r\n\ntexte_historique_en=><p>Incorporation of SUNU Assurances Vie Niger (ex UGAN-Vie) in partnership with some local banks.</p>\r\n\ndateCreated_historique=>2018-06-03 13:18:55\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(947,2147204895,'2018-07-31 14:47:28','historique','update|all|6|id_historique=>6\nannee_historique=>2001\nmois_historique=>0\ntexte_historique=><p>SUNU Finances crée SUNU Assurances Holding S.A, une holding 1929 au Luxembourg dans laquelle sont transférées les sociétés d’assurances détenues.</p>\r\n\r\n<p>Elle ouvre le capital de SUNU Assurances à hauteur de 49% à un partenaire, la Société d’Investissement (S.I.). L’arrivée de la S.I. a permis une accélération de la croissance externe du Groupe SUNU. </p>\r\n\r\n<p>Dans la même foulée, acquisition des deux filiales des Mutuelles du Mans en Côte d’Ivoire auparavant dénommées Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) désormais SUNU Assurances IARD Côte d’Ivoire et SUNU Assurances Vie Côte d’Ivoire. </p>\r\n\r\n<p>D’autre part, SUNU Assurances détient 80% du capital de SUNU Gestion après augmentation de capital de cette dernière.</p>\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:19:42\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>6\nannee_historique=>2001\nmois_historique=>0\ntexte_historique=><p>SUNU Finances crée SUNU Assurances Holding S.A, une holding 1929 au Luxembourg dans laquelle sont transférées les sociétés d’assurances détenues.</p>\r\n\r\n<p>Elle ouvre le capital de SUNU Assurances à hauteur de 49% à un partenaire, la Société d’Investissement (S.I.). L’arrivée de la S.I. a permis une accélération de la croissance externe du Groupe SUNU. </p>\r\n\r\n<p>Dans la même foulée, acquisition des deux filiales des Mutuelles du Mans en Côte d’Ivoire auparavant dénommées Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) désormais SUNU Assurances IARD Côte d’Ivoire et SUNU Assurances Vie Côte d’Ivoire. </p>\r\n\r\n<p>D’autre part, SUNU Assurances détient 80% du capital de SUNU Gestion après augmentation de capital de cette dernière.</p>\r\n\ntexte_historique_en=><p>SUNU Finances created SUNU Assurances Holding S.A, a 1929 holding company in Luxembourg and transferred all its daughter insurance companies to SUNU Assurances Holding S.A.</p>\r\n\r\n<p>SUNU Finances sold 49% of the shares of SUNU Assurances to its partner Société d’Investissement (S.I.). The entry of S.I in SUNU Assurances capital boosted the external growth of SUNU Group. </p>\r\n\r\n<p>Around the same time, SUNU Group acquired two subsidiaries of Les Mutuelles du Mans in Côte d’Ivoire. The two companies formerly called Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) have been respectively rebranded as SUNU Assurances IARD Côte d’Ivoire and SUNU Assurances Vie Côte d’Ivoire.<br>\r\n<br>\r\nOn the other hand, after the increase of SUNU Gestion capital, SUNU Assurances now holds 80% of its shares.</p>\r\n\ndateCreated_historique=>2018-06-03 13:19:42\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(948,2147204895,'2018-07-31 14:48:23','historique','update|all|7|id_historique=>7\nannee_historique=>2002\nmois_historique=>0\ntexte_historique=>Prise de contrôle de la société Alliance Africaine d’Assurances Vie (3A-Vie) à la suite de sa recapitalisation.\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:20:09\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>7\nannee_historique=>2002\nmois_historique=>0\ntexte_historique=><p>Prise de contrôle de la société Alliance Africaine d’Assurances Vie (3A-Vie) à la suite de sa recapitalisation.</p>\r\n\ntexte_historique_en=><p>Takeover of Alliance Africaine d’Assurances Vie (3A-Vie) after its recapitalisation.</p>\r\n\ndateCreated_historique=>2018-06-03 13:20:09\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(949,2147204895,'2018-07-31 14:51:05','historique','update|all|8|id_historique=>8\nannee_historique=>2004\nmois_historique=>0\ntexte_historique=>Rachat de trois filiales Vie d’AXA en Côte d’Ivoire, au Cameroun et au Gabon. Ces trois sociétés alors dénommées, Union des Assurances de Côte d’Ivoire Vie (UA-Vie), Union des Assurances du Cameroun Vie (UACam-Vie), Union des Assurances du Gabon Vie (UAG-Vie). Ces sociétés portent respectivement aujourd’hui le nom de SUNU Assurances Vie Côte d’Ivoire, SUNU Assurances Vie Cameroun et SUNU Assurances Vie Gabon. Le groupe SUNU acquiert également la société SUNU Assurances IARD Togo alors UAT-IARD et une participation de 40\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:20:30\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>8\nannee_historique=>2004\nmois_historique=>0\ntexte_historique=><p>Rachat de trois filiales Vie d’AXA en Côte d’Ivoire, au Cameroun et au Gabon. Ces trois sociétés alors dénommées, Union des Assurances de Côte d’Ivoire Vie (UA-Vie), Union des Assurances du Cameroun Vie (UACam-Vie), Union des Assurances du Gabon Vie (UAG-Vie). Ces sociétés portent respectivement aujourd’hui le nom de SUNU Assurances Vie Côte d’Ivoire, SUNU Assurances Vie Cameroun et SUNU Assurances Vie Gabon. Le groupe SUNU acquiert également la société SUNU Assurances IARD Togo alors UAT-IARD et une participation de 40</p>\r\n\ntexte_historique_en=><p>Acquisition of three Life insurance daughter companies of AXA in Côte d’Ivoire, Cameroon and Gabon. The three companies, formerly known as Union des Assurances de Côte d’Ivoire Vie (UA-Vie), Union des Assurances du Cameroun Vie (UACam-Vie), Union des Assurances du Gabon Vie (UAG-Vie) have been respectively rebranded as SUNU Assurances Vie Côte d’Ivoire, SUNU Assurances Vie Cameroun et SUNU Assurances Vie Gabon.<br>\r\nSUNU Group also acquired 40% of SUNU Assurances IARD Togo, formerly called UAT-IARD.</p>\r\n\ndateCreated_historique=>2018-06-03 13:20:30\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(950,2147204895,'2018-07-31 14:51:43','historique','update|all|9|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=>Prise d’une participation de 45% dans le capital de SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.) au Burkina Faso.\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(951,2147204895,'2018-07-31 14:52:30','historique','update|all|10|id_historique=>10\nannee_historique=>2006\nmois_historique=>0\ntexte_historique=>Rachat total de la participation de la Société d’Investissement S.A dans SUNU Assurances Holding S.A par SUNU Finances.\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:21:37\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>10\nannee_historique=>2006\nmois_historique=>0\ntexte_historique=><p>Rachat total de la participation de la Société d’Investissement S.A dans SUNU Assurances Holding S.A par SUNU Finances.</p>\r\n\ntexte_historique_en=><p>SUNU Finances bought out the shares of Société d’Investissement S.A in SUNU Assurances Holding S.A.</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:37\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(952,2147204895,'2018-07-31 14:53:22','historique','update|all|9|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(953,2147204895,'2018-07-31 14:53:51','historique','update|all|9|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(954,2147204895,'2018-07-31 14:55:08','historique','update|all|9|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(955,2147204895,'2018-07-31 14:57:14','historique','update|all|9|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(956,2147204895,'2018-07-31 15:01:33','historique','update|all|11|id_historique=>11\nannee_historique=>2010\nmois_historique=>7\ntexte_historique=>Transfert des deux holding SUNU Assurances et SUNU Finances en France. Leurs nouvelles dénominations sociales sont respectivement SUNU Assurances Holding S.A et SUNU Finances Holding S.A.S. Les deux sociétés, qui étaient jusqu’alors des sociétés de droit luxembourgeois, ont changé leur nationalité, respectivement en société anonyme de droit français et en société par actions simplifiée, et transféré leur siège social en France. Cette opération, autorisée par les législations luxembourgeoise et française, s’est opérée, conformément auxdites législations, avec maintien de la personnalité morale desdites sociétés, et a pris effet à la date du 19 août 2010, date de leur immatriculation en France au Registre du Commerce et des Sociétés (« RCS ») du lieu de leur nouveau siège social (RCS de Créteil)\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:22:25\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>11\nannee_historique=>2010\nmois_historique=>0\ntexte_historique=><p>Transfert des deux holding SUNU Assurances et SUNU Finances en France. Leurs nouvelles dénominations sociales sont respectivement SUNU Assurances Holding S.A et SUNU Finances Holding S.A.S. Les deux sociétés, qui étaient jusqu’alors des sociétés de droit luxembourgeois, ont changé leur nationalité, respectivement en société anonyme de droit français et en société par actions simplifiée, et transféré leur siège social en France. Cette opération, autorisée par les législations luxembourgeoise et française, s’est opérée, conformément auxdites législations, avec maintien de la personnalité morale desdites sociétés, et a pris effet à la date du 19 août 2010, date de leur immatriculation en France au Registre du Commerce et des Sociétés (« RCS ») du lieu de leur nouveau siège social (RCS de Créteil)</p>\r\n\ntexte_historique_en=><p>SUNU Assurances and SUNU Finances, the two holding companies are transferred to France. Their new corporate names are now respectively SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S. Both companies that were until now incorporated under Luxembourg law, have turned into French law, respectively as a public company and a simplified joint-stock company.<br>\r\nBoth companies moved their head office to France. The operation was allowed by the authorities of France and Luxembourg and took place in accordance with both countries legislations. This process, during which the legal personality of the companies was preserved, came into effect on 19 August 2010 when SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S got registered with the Registry of Companies of Creteil where they are headquartered.</p>\r\n\ndateCreated_historique=>2018-06-03 13:22:25\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(957,2147204895,'2018-07-31 15:02:02','historique','update|all|9|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(958,2147204895,'2018-07-31 15:03:46','historique','update|all|11|id_historique=>11\nannee_historique=>2010\nmois_historique=>0\ntexte_historique=><p>Transfert des deux holding SUNU Assurances et SUNU Finances en France. Leurs nouvelles dénominations sociales sont respectivement SUNU Assurances Holding S.A et SUNU Finances Holding S.A.S. Les deux sociétés, qui étaient jusqu’alors des sociétés de droit luxembourgeois, ont changé leur nationalité, respectivement en société anonyme de droit français et en société par actions simplifiée, et transféré leur siège social en France. Cette opération, autorisée par les législations luxembourgeoise et française, s’est opérée, conformément auxdites législations, avec maintien de la personnalité morale desdites sociétés, et a pris effet à la date du 19 août 2010, date de leur immatriculation en France au Registre du Commerce et des Sociétés (« RCS ») du lieu de leur nouveau siège social (RCS de Créteil)</p>\r\n\ntexte_historique_en=><p>SUNU Assurances and SUNU Finances, the two holding companies are transferred to France. Their new corporate names are now respectively SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S. Both companies that were until now incorporated under Luxembourg law, have turned into French law, respectively as a public company and a simplified joint-stock company.<br>\r\nBoth companies moved their head office to France. The operation was allowed by the authorities of France and Luxembourg and took place in accordance with both countries legislations. This process, during which the legal personality of the companies was preserved, came into effect on 19 August 2010 when SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S got registered with the Registry of Companies of Creteil where they are headquartered.</p>\r\n\ndateCreated_historique=>2018-06-03 13:22:25\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>11\nannee_historique=>2010\nmois_historique=>0\ntexte_historique=><p>Transfert des deux holding SUNU Assurances et SUNU Finances en France. Leurs nouvelles dénominations sociales sont respectivement SUNU Assurances Holding S.A et SUNU Finances Holding S.A.S. Les deux sociétés, qui étaient jusqu’alors des sociétés de droit luxembourgeois, ont changé leur nationalité, respectivement en société anonyme de droit français et en société par actions simplifiée, et transféré leur siège social en France. Cette opération, autorisée par les législations luxembourgeoise et française, s’est opérée, conformément auxdites législations, avec maintien de la personnalité morale desdites sociétés, et a pris effet à la date du 19 août 2010, date de leur immatriculation en France au Registre du Commerce et des Sociétés (« RCS ») du lieu de leur nouveau siège social (RCS de Créteil)</p>\r\n\ntexte_historique_en=><p>SUNU Assurances and SUNU Finances, the two holding companies are transferred to France. Their new corporate names are now respectively SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S. Both companies that were until now incorporated under Luxembourg law, have turned into French law, respectively as a public company and a simplified joint-stock company.<br>\r\nBoth companies moved their head office to France. The operation was allowed by the authorities of France and Luxembourg and took place in accordance with both countries legislations. This process, during which the legal personality of the companies was preserved, came into effect on 19 August 2010 when SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S got registered with the Registry of Companies of Creteil (RCS Creteil) where they are headquartered.</p>\r\n\ndateCreated_historique=>2018-06-03 13:22:25\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(959,2147204895,'2018-07-31 15:05:32','historique','update|all|12|id_historique=>12\nannee_historique=>2010\nmois_historique=>12\ntexte_historique=>SUNU Assurances Holding SA a décidé de dissoudre par anticipation la société SUNU Gestion SAS, dont elle était l’associée unique après avoir repris les parts de SUNU Finances, avec Transmission Universelle de Patrimoine en sa faveur, conformément aux dispositions de l’article 1844-5 alinéa 3 du code civil.\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:23:10\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>12\nannee_historique=>2010\nmois_historique=>0\ntexte_historique=><p>SUNU Assurances Holding SA a décidé de dissoudre par anticipation la société SUNU Gestion SAS, dont elle était l’associée unique après avoir repris les parts de SUNU Finances, avec Transmission Universelle de Patrimoine en sa faveur, conformément aux dispositions de l’article 1844-5 alinéa 3 du code civil.</p>\r\n\ntexte_historique_en=><p>SUNU Assurances Holding SA proactively dissolved its daughter company SUNU Gestion SAS. After taking over the shares of SUNU Finances and after the universal transmission of its assets to SUNU Assurances Holding SA, the latter became the sole partner of the former in accordance with the provisions of article 1844-5 paragraph 3 of the civil code.</p>\r\n\ndateCreated_historique=>2018-06-03 13:23:10\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(960,2147204895,'2018-07-31 15:06:49','historique','update|all|13|id_historique=>13\nannee_historique=>2012\nmois_historique=>1\ntexte_historique=>SUNU Assurances Abidjan démarre ses activités et a pour rôle de regrouper les Directions Centrales du Groupe SUNU.\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:23:47\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>13\nannee_historique=>2012\nmois_historique=>0\ntexte_historique=><p>SUNU Assurances Abidjan démarre ses activités et a pour rôle de regrouper les Directions Centrales du Groupe SUNU.</p>\r\n\ntexte_historique_en=><p>SUNU Assurances Abidjan was launched with the aim to group together all the central departments of SUNU Group.</p>\r\n\ndateCreated_historique=>2018-06-03 13:23:47\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(961,2147204895,'2018-07-31 15:08:01','historique','update|all|14|id_historique=>14\nannee_historique=>2012\nmois_historique=>7\ntexte_historique=>Démarrage des activités de SUNU Assurances IARD Mali (ex UA-IARD Mali) et de SUNU Assurances Guinée (ex UA-IARD Guinée).\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:24:13\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>14\nannee_historique=>2012\nmois_historique=>0\ntexte_historique=><p>Démarrage des activités de SUNU Assurances IARD Mali (ex UA-IARD Mali) et de SUNU Assurances Guinée (ex UA-IARD Guinée).</p>\r\n\ntexte_historique_en=><p>Launch of SUNU Assurances IARD Mali (ex UA-IARD Mali) and SUNU Assurances Guinea (ex UA-IARD Guinée).</p>\r\n\ndateCreated_historique=>2018-06-03 13:24:13\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(962,2147204895,'2018-07-31 15:10:33','historique','update|all|14|id_historique=>14\nannee_historique=>2012\nmois_historique=>0\ntexte_historique=><p>Démarrage des activités de SUNU Assurances IARD M