que_en=><p>Incorporation of SUNU Assurances IARD Cameroon following the recapitalisation of the company CAMINSUR.</p>\r\n\ndateCreated_historique=>2018-06-03 13:30:24\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>24\nannee_historique=>2017\nmois_historique=>0\ntexte_historique=><p>Création de SUNU Investment Holding SA qui portera désormais les participations bancaires du Groupe SUNU.</p>\r\n\ntexte_historique_en=><p>Incorporation of SUNU Investment Holding SA that will be in charge of the bank holdings of SUNU Group.</p>\r\n\ndateCreated_historique=>2018-06-03 13:30:24\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(976,2147204895,'2018-07-31 15:39:05','historique','update|all|23|id_historique=>23\nannee_historique=>2017\nmois_historique=>7\ntexte_historique=>Création de SUNU Assurances IARD Cameroun suite à la recapitalisation de la société CAMINSUR.\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:29:57\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>23\nannee_historique=>2017\nmois_historique=>0\ntexte_historique=><p>Création de SUNU Assurances IARD Cameroun suite à la recapitalisation de la société CAMINSUR.</p>\r\n\ntexte_historique_en=><p>Incorporation of SUNU Assurances IARD Cameroon following the recapitalisation of the company CAMINSUR.</p>\r\n\ndateCreated_historique=>2018-06-03 13:29:57\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(977,2147204895,'2018-07-31 15:39:36','historique','update|all|25|id_historique=>25\nannee_historique=>2018\nmois_historique=>2\ntexte_historique=>Acquisition de la Banque Populaire pour l&#39;Epargne et le Crédit (BPEC) du Togo par le Groupe SUNU.\r\n\ntexte_historique_en=>\ndateCreated_historique=>2018-06-03 13:30:44\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>25\nannee_historique=>2018\nmois_historique=>0\ntexte_historique=><p>Acquisition de la Banque Populaire pour l&#39;Epargne et le Crédit (BPEC) du Togo par le Groupe SUNU.</p>\r\n\ntexte_historique_en=><p>Acquisition of <em>Banque Populaire pour l&#39;Epargne et le Crédit</em> (BPEC) of Togo by SUNU Group.</p>\r\n\ndateCreated_historique=>2018-06-03 13:30:44\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(978,2147204895,'2018-07-31 15:41:20','historique','update|all|6|id_historique=>6\nannee_historique=>2001\nmois_historique=>0\ntexte_historique=><p>SUNU Finances crée SUNU Assurances Holding S.A, une holding 1929 au Luxembourg dans laquelle sont transférées les sociétés d’assurances détenues.</p>\r\n\r\n<p>Elle ouvre le capital de SUNU Assurances à hauteur de 49% à un partenaire, la Société d’Investissement (S.I.). L’arrivée de la S.I. a permis une accélération de la croissance externe du Groupe SUNU. </p>\r\n\r\n<p>Dans la même foulée, acquisition des deux filiales des Mutuelles du Mans en Côte d’Ivoire auparavant dénommées Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) désormais SUNU Assurances IARD Côte d’Ivoire et SUNU Assurances Vie Côte d’Ivoire. </p>\r\n\r\n<p>D’autre part, SUNU Assurances détient 80% du capital de SUNU Gestion après augmentation de capital de cette dernière.</p>\r\n\ntexte_historique_en=><p>SUNU Finances created SUNU Assurances Holding S.A, a 1929 holding company in Luxembourg and transferred all its daughter insurance companies to SUNU Assurances Holding S.A.</p>\r\n\r\n<p>SUNU Finances sold 49% of the shares of SUNU Assurances to its partner Société d’Investissement (S.I.). The entry of S.I in SUNU Assurances capital boosted the external growth of SUNU Group. </p>\r\n\r\n<p>Around the same time, SUNU Group acquired two subsidiaries of Les Mutuelles du Mans in Côte d’Ivoire. The two companies formerly called Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) have been respectively rebranded as SUNU Assurances IARD Côte d’Ivoire and SUNU Assurances Vie Côte d’Ivoire.<br>\r\n<br>\r\nOn the other hand, after the increase of SUNU Gestion capital, SUNU Assurances now holds 80% of its shares.</p>\r\n\ndateCreated_historique=>2018-06-03 13:19:42\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>6\nannee_historique=>2001\nmois_historique=>0\ntexte_historique=><p>SUNU Finances crée SUNU Assurances Holding S.A, une holding 1929 au Luxembourg dans laquelle sont transférées les sociétés d’assurances détenues.</p>\r\n\r\n<p>Elle ouvre le capital de SUNU Assurances à hauteur de 49% à un partenaire, la Société d’Investissement (S.I.). L’arrivée de la S.I. a permis une accélération de la croissance externe du Groupe SUNU. </p>\r\n\r\n<p>Dans la même foulée, acquisition des deux filiales des Mutuelles du Mans en Côte d’Ivoire auparavant dénommées Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) désormais SUNU Assurances IARD Côte d’Ivoire et SUNU Assurances Vie Côte d’Ivoire. </p>\r\n\r\n<p>D’autre part, SUNU Assurances détient 80% du capital de SUNU Gestion après augmentation de capital de cette dernière.</p>\r\n\ntexte_historique_en=><p>SUNU Finances created SUNU Assurances Holding S.A, a 1929 holding company in Luxembourg and transferred all its daughter insurance companies to SUNU Assurances Holding S.A.</p>\r\n\r\n<p>SUNU Finances sold 49 of the shares of SUNU Assurances to its partner Société d’Investissement (S.I.). The entry of S.I in SUNU Assurances capital boosted the external growth of SUNU Group. </p>\r\n\r\n<p>Around the same time, SUNU Group acquired two subsidiaries of Les Mutuelles du Mans in Côte d’Ivoire. The two companies formerly called Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) have been respectively rebranded as SUNU Assurances IARD Côte d’Ivoire and SUNU Assurances Vie Côte d’Ivoire.<br>\r\n<br>\r\nOn the other hand, after the increase of SUNU Gestion capital, SUNU Assurances now holds 80 of its shares.</p>\r\n\ndateCreated_historique=>2018-06-03 13:19:42\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(979,2147204895,'2018-07-31 15:42:38','historique','update|all|9|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45% of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45 of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=>2018-06-03 13:21:11\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(980,2147204895,'2018-07-31 15:44:13','historique','update|all|8|id_historique=>8\nannee_historique=>2004\nmois_historique=>0\ntexte_historique=><p>Rachat de trois filiales Vie d’AXA en Côte d’Ivoire, au Cameroun et au Gabon. Ces trois sociétés alors dénommées, Union des Assurances de Côte d’Ivoire Vie (UA-Vie), Union des Assurances du Cameroun Vie (UACam-Vie), Union des Assurances du Gabon Vie (UAG-Vie). Ces sociétés portent respectivement aujourd’hui le nom de SUNU Assurances Vie Côte d’Ivoire, SUNU Assurances Vie Cameroun et SUNU Assurances Vie Gabon. Le groupe SUNU acquiert également la société SUNU Assurances IARD Togo alors UAT-IARD et une participation de 40</p>\r\n\ntexte_historique_en=><p>Acquisition of three Life insurance daughter companies of AXA in Côte d’Ivoire, Cameroon and Gabon. The three companies, formerly known as Union des Assurances de Côte d’Ivoire Vie (UA-Vie), Union des Assurances du Cameroun Vie (UACam-Vie), Union des Assurances du Gabon Vie (UAG-Vie) have been respectively rebranded as SUNU Assurances Vie Côte d’Ivoire, SUNU Assurances Vie Cameroun et SUNU Assurances Vie Gabon.<br>\r\nSUNU Group also acquired 40% of SUNU Assurances IARD Togo, formerly called UAT-IARD.</p>\r\n\ndateCreated_historique=>2018-06-03 13:20:30\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>8\nannee_historique=>2004\nmois_historique=>0\ntexte_historique=><p>Rachat de trois filiales Vie d’AXA en Côte d’Ivoire, au Cameroun et au Gabon. Ces trois sociétés alors dénommées, Union des Assurances de Côte d’Ivoire Vie (UA-Vie), Union des Assurances du Cameroun Vie (UACam-Vie), Union des Assurances du Gabon Vie (UAG-Vie). Ces sociétés portent respectivement aujourd’hui le nom de SUNU Assurances Vie Côte d’Ivoire, SUNU Assurances Vie Cameroun et SUNU Assurances Vie Gabon. Le groupe SUNU acquiert également la société SUNU Assurances IARD Togo alors UAT-IARD et une participation de 40</p>\r\n\ntexte_historique_en=><p>Acquisition of three Life insurance daughter companies of AXA in Côte d’Ivoire, Cameroon and Gabon. The three companies, formerly known as Union des Assurances de Côte d’Ivoire Vie (UA-Vie), Union des Assurances du Cameroun Vie (UACam-Vie), Union des Assurances du Gabon Vie (UAG-Vie) have been respectively rebranded as SUNU Assurances Vie Côte d’Ivoire, SUNU Assurances Vie Cameroun et SUNU Assurances Vie Gabon.<br>\r\nSUNU Group also acquired 40 of SUNU Assurances IARD Togo, formerly called UAT-IARD.</p>\r\n\ndateCreated_historique=>2018-06-03 13:20:30\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(981,2147204895,'2018-07-31 15:44:33','historique','update|all|9|id_historique=>9\nannee_historique=>2005\nmois_historique=>0\ntexte_historique=><p>Prise d’une participation de 45\ntexte_historique_en=><p>SUNU Group acquired 45 of SUNU Assurances IARD Burkina Faso (ex RAYNAL S.A.).</p>\r\n\ndateCreated_historique=