lénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) have been respectively rebranded as SUNU Assurances IARD Côte d’Ivoire and SUNU Assurances Vie Côte d’Ivoire.<br>\r\n<br>\r\nOn the other hand, after the increase of SUNU Gestion capital, SUNU Assurances now holds 80 of its shares.</p>\r\n\ndateCreated_historique=>2018-06-03 13:19:42\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(983,2147484848,'2018-08-01 15:43:15','_SESSION','login|all|1533138172|0|__ci_last_regenerate=>1533138172\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2018-07-18 19:04:14::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n'),(984,2147484848,'2018-08-01 15:46:42','article','update|all|24|id_article=>24\ntitre_article=>LES SOCIÉTÉS SUNU ASSURANCES DE CI FONT UN RETOUR AUX VALEURS AVEC AFRIQUE CONSCIENTE\ntitre_article_en=>\ntexte_article=><p>En Côte d’Ivoire, les sociétés SUNU Assurances ont fait un « Retour aux valeurs » en accompagnant le mouvement « Afrique Consciente » lors des premières Universités de la Société Civique Africaine qui se sont tenues le 19 Mai 2018, au Sofitel Hôtel Ivoire. Cette grande première a permis de connaitre « l’histoire de l’Afrique, ses inerties, les Success-stories de la société civique en Afrique et les opportunités de l’Afrique. Et cela à travers des hommes engagés tels que Denise EPOTE, Séry BAILLY, Alain FOKA qui étaient parmi les panelistes de cette rencontre. Ce fut un bel évènement auquel SUNU Assurances, groupe conscient des valeurs africaines n’a voulu rester en marge pour participer aussi aux challenges d’un meilleur avenir du continent africain.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>afrique_consciente.jpg\ndateCreated_article=>2018-05-19 08:15:47\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>24\ntitre_article=>LES SOCIÉTÉS SUNU ASSURANCES DE CI FONT UN RETOUR AUX VALEURS AVEC AFRIQUE CONSCIENTE\ntitre_article_en=>THE COMPANIES SUNU ASSURANCES OF COTE D’IVOIRE HAVE MADE A RETURN TO VALUES WITH « AFRIQUE CONSCIENTE »\ntexte_article=><p>En Côte d’Ivoire, les sociétés SUNU Assurances ont fait un « Retour aux valeurs » en accompagnant le mouvement « Afrique Consciente » lors des premières Universités de la Société Civique Africaine qui se sont tenues le 19 Mai 2018, au Sofitel Hôtel Ivoire. Cette grande première a permis de connaitre « l’histoire de l’Afrique, ses inerties, les Success-stories de la société civique en Afrique et les opportunités de l’Afrique. Et cela à travers des hommes engagés tels que Denise EPOTE, Séry BAILLY, Alain FOKA qui étaient parmi les panelistes de cette rencontre. Ce fut un bel évènement auquel SUNU Assurances, groupe conscient des valeurs africaines n’a voulu rester en marge pour participer aussi aux challenges d’un meilleur avenir du continent africain.</p>\r\n\ntexte_article_en=><p>In Côte d’Ivoire, the companies SUNU Assurances have made a « return to values » by supporting the movement « AFRIQUE CONSCIENTE » during the first Universities of the African Civic Society held on 19 May 2018 at Sofitel Hotel Ivoire. This occasion, the first of its kind, shed light on “the history of Africa, its inertias, the success stories of the civic society in Africa and the opportunities of Africa”. This was achieved through committed people such as Denise EPOTE, Sery BAILLY, Alain FOKA who were among the panellists of this meeting. SUNU Assurances, conscious of African values, did not want to stay on the sidelines of such a great event. It therefore participated in these challenges for a better future for the African continent.</p>\r\n\nlecture_article=>0\nfichier_article=>afrique_consciente.jpg\ndateCreated_article=>2018-05-19 17:46:42\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(985,2147484848,'2018-08-01 15:48:11','article','update|all|23|id_article=>23\ntitre_article=>CÔTE D\'IVOIRE : UN PAS DE PLUS À LA 10 ÈME ÉDITION DU SILA AVEC SUNU ASSURANCES\ntitre_article_en=>\ntexte_article=><p>Pour la 10ème édition du Salon International du Livre d’Abidjan (SILA), les sociétés SUNU Assurances de Côte d’Ivoire ont donné rendez-vous aux écrivains et amoureux du livre du 16 au 20 Mai 2018 au palais de la culture de Treichville. A cette rencontre de l’industrie du livre qui a vu bon nombre d’écrivains primés, M. Saliou BAKAYOKO, DG de SUNU Assurances Vie CI a animé un panel sur le thème : « Livre et Economie ». Il a ensuite entretenu les participants sur la discipline de l’Actuariat et sur des notions propres au métier de l’assurance méconnues du grand public.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>sila_abj.jpg\ndateCreated_article=>2018-05-16 08:14:38\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>23\ntitre_article=>CÔTE D\'IVOIRE : UN PAS DE PLUS À LA 10 ÈME ÉDITION DU SILA AVEC SUNU ASSURANCES\ntitre_article_en=>COTE D’IVOIRE: AN EXTRA STEP DURING THE 10TH EDITION OF SILA WITH SUNU ASSURANCES\ntexte_article=><p>Pour la 10ème édition du Salon International du Livre d’Abidjan (SILA), les sociétés SUNU Assurances de Côte d’Ivoire ont donné rendez-vous aux écrivains et amoureux du livre du 16 au 20 Mai 2018 au palais de la culture de Treichville. A cette rencontre de l’industrie du livre qui a vu bon nombre d’écrivains primés, M. Saliou BAKAYOKO, DG de SUNU Assurances Vie CI a animé un panel sur le thème : « Livre et Economie ». Il a ensuite entretenu les participants sur la discipline de l’Actuariat et sur des notions propres au métier de l’assurance méconnues du grand public.</p>\r\n\ntexte_article_en=><p>During the 10th edition of the International Book Fair of Abidjan (SILA), SUNU Assurances companies of Cote d’Ivoire met writers and book lovers from 16 to 20 May 2018 at the Palace of Culture (Palais de la culture) located in Treichville. At this meeting of the Book industry, which saw many award-winning writers, Mr. Saliou BAKAYOKO, CEO of SUNU Assurances Vie CI led a panel on the topic: \"Book and Economy\". He then spoke to the participants about the discipline of Actuarial Science and about notions of the insurance profession that are not well known to the general public.</p>\r\n\nlecture_article=>0\nfichier_article=>sila_abj.jpg\ndateCreated_article=>2018-05-16 17:48:11\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(986,2147484848,'2018-08-01 15:48:46','article','update|all|22|id_article=>22\ntitre_article=>LES SOCIÉTÉS SUNU ASSURANCES DU TOGO ACCOMPAGNENT LA 4ÈME ÉDITION DU FEST\'IMMO\ntitre_article_en=>\ntexte_article=><p>Au Togo, la 4ème édition du Festival de l’immobilier « FEST’IMMO » s’est déroulée du 11 au 13 Mai 2018 avec la participation de SUNU Assurances IARD Togo comme partenaire. Cette année encore, différents exposants dont les banques, cabinets d’architecture, sociétés immobilières, sociétés d’assurance etc. sont venus enrichir le quotidien des visiteurs. Pour SUNU Assurances, ce fut l’occasion de présenter certains produits comme l’assurance multirisques Habitation, Tous risques chantier et la Responsabilité Civile. </p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>festimoo_tog.jpg\ndateCreated_article=>2018-05-11 08:13:30\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>22\ntitre_article=>LES SOCIÉTÉS SUNU ASSURANCES DU TOGO ACCOMPAGNENT LA 4ÈME ÉDITION DU FEST\'IMMO\ntitre_article_en=>THE COMPANIES SUNU ASSURANCES OF TOGO BACKED THE 4TH EDITION OF FEST’IMMO\ntexte_article=><p>Au Togo, la 4ème édition du Festival de l’immobilier « FEST’IMMO » s’est déroulée du 11 au 13 Mai 2018 avec la participation de SUNU Assurances IARD Togo comme partenaire. Cette année encore, différents exposants dont les banques, cabinets d’architecture, sociétés immobilières, sociétés d’assurance etc. sont venus enrichir le quotidien des visiteurs. Pour SUNU Assurances, ce fut l’occasion de présenter certains produits comme l’assurance multirisques Habitation, Tous risques chantier et la Responsabilité Civile. </p>\r\n\ntexte_article_en=><p>In Togo, the 4th edition of the Real Estate Festival \"FEST&#39;IMMO\" took place from 11 to 13 May 2018 with the participation of SUNU Assurances IARD Togo as a partner. This year again, different exhibitors including banks, architectural firms, real estate companies, insurance companies, etc. have enriched the daily lives of participants. For SUNU Assurances, it was an opportunity to present some products such as home multi-risk, construction all risks and civil liability insurances.</p>\r\n\nlecture_article=>0\nfichier_article=>festimoo_tog.jpg\ndateCreated_article=>2018-05-11 17:48:46\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(987,2147484848,'2018-08-01 15:49:23','article','update|all|6|id_article=>6\ntitre_article=>LA BPEC REJOINT OFFICIELLEMENT LE GROUPE SUNU\ntitre_article_en=>\ntexte_article=><p>Le mercredi 09 mai 2018, clients, partenaires et médias étaient dans les locaux de la Banque Populaire de l’Épargne et du Crédit (BPEC) du Togo pour prendre part à un petit déjeuner convivial. L&#39;objet de cette rencontre était l&#39;annonce officielle de l&#39;entrée de la BPEC dans le Groupe SUNU. Après l’intervention de M. Christophe LASSUS-LALANNE, DG de la BPEC, M. Razack FASSASSI, DG de SUNU Assurances Vie Togo a, au nom du Groupe SUNU, édifié les invités sur les intérêts de cette nouvelle acquisition pour les entreprises et les populations. La BPEC, première banque du Groupe SUNU, permettra d&#39;offrir des produits packagées banque & assurance plus accessibles en un lieu unique.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>bpec_sunu_actu.jpg\ndateCreated_article=>2018-05-09 08:20:01\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>6\ntitre_article=>LA BPEC REJOINT OFFICIELLEMENT LE GROUPE SUNU\ntitre_article_en=>BPEC OFFICIALLY JOINS SUNU GROUP\ntexte_article=><p>Le mercredi 09 mai 2018, clients, partenaires et médias étaient dans les locaux de la Banque Populaire de l’Épargne et du Crédit (BPEC) du Togo pour prendre part à un petit déjeuner convivial. L&#39;objet de cette rencontre était l&#39;annonce officielle de l&#39;entrée de la BPEC dans le Groupe SUNU. Après l’intervention de M. Christophe LASSUS-LALANNE, DG de la BPEC, M. Razack FASSASSI, DG de SUNU Assurances Vie Togo a, au nom du Groupe SUNU, édifié les invités sur les intérêts de cette nouvelle acquisition pour les entreprises et les populations. La BPEC, première banque du Groupe SUNU, permettra d&#39;offrir des produits packagées banque & assurance plus accessibles en un lieu unique.</p>\r\n\ntexte_article_en=><p>On Wednesday, May 09, 2018, customers, partners and media were in the premises of the Banque Populaire de l&#39;Épargne et du Crédit (BPEC) of Togo to take part in a convivial breakfast. The purpose of this meeting was the official announcement of BPEC&#39;s entry into SUNU Group. After the speech of Mr. Christophe LASSUS-LALANNE, CEO of BPEC, Mr. Razack FASSASSI, CEO of SUNU Assurances Vie Togo, on behalf of SUNU Group, enlightened the guests on the interests of this new acquisition for businesses and populations. BPEC, the first bank of SUNU Group, will offer more accessible packaged banking and insurance products in one place.</p>\r\n\nlecture_article=>0\nfichier_article=>bpec_sunu_actu.jpg\ndateCreated_article=>2018-05-09 17:49:23\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(988,2147484848,'2018-08-01 15:49:57','article','update|all|7|id_article=>7\ntitre_article=>SUNU ASSURANCES AU SOMMET DU CHOISEUL AFRICA SUMMIT\ntitre_article_en=>\ntexte_article=><p>Le 4 et 5 mai 2018, une délégation de SUNU Assurances était au sommet CHOISEUL SUMMIT AFRICA qui s’est tenu à Abidjan. Une rencontre de jeunes leaders qui a drainé des managers venus de pays d’Afrique et de l’Europe pour faciliter les échanges et partager leurs expériences. La première journée a été marquée par une rencontre avec les autorités gouvernementales en particulier avec son Excellence M. Daniel Kablan DUNCAN, Premier Vice-Président de la République de Côte d’Ivoire. Plus tard, M. Mohamed BAH, Directeur Général Délégué du Groupe SUNU a pris part à un panel où il a fait un bref résumé de la « success story » de SUNU Assurances qui reste un modèle de réussite africaine. Les rencontres se sont ainsi poursuivies au lendemain pour prendre fin avec un diner gala.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>sunu_choiseul.jpg\ndateCreated_article=>2018-05-04 08:21:23\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>7\ntitre_article=>SUNU ASSURANCES AU SOMMET DU CHOISEUL AFRICA SUMMIT\ntitre_article_en=>SUNU ASSURANCES AT THE CHOISEUL AFRICA SUMMIT\ntexte_article=><p>Le 4 et 5 mai 2018, une délégation de SUNU Assurances était au sommet CHOISEUL SUMMIT AFRICA qui s’est tenu à Abidjan. Une rencontre de jeunes leaders qui a drainé des managers venus de pays d’Afrique et de l’Europe pour faciliter les échanges et partager leurs expériences. La première journée a été marquée par une rencontre avec les autorités gouvernementales en particulier avec son Excellence M. Daniel Kablan DUNCAN, Premier Vice-Président de la République de Côte d’Ivoire. Plus tard, M. Mohamed BAH, Directeur Général Délégué du Groupe SUNU a pris part à un panel où il a fait un bref résumé de la « success story » de SUNU Assurances qui reste un modèle de réussite africaine. Les rencontres se sont ainsi poursuivies au lendemain pour prendre fin avec un diner gala.</p>\r\n\ntexte_article_en=><p>On May 4th and 5th, 2018, a delegation of SUNU Assurances was at the CHOISEUL AFRICA SUMMIT held in Abidjan. A meeting of young leaders that attracted managers from African and European countries in order to facilitate exchanges and experience sharing. The first day was marked by a meeting with the government authorities in particular with his Excellency Mr. Daniel Kablan DUNCAN, First Vice-President of the Republic of Côte d&#39;Ivoire. Later, Mr. Mohamed BAH, Deputy Managing Director of SUNU Group took part in a panel where he made a brief summary of the \"success story\" of SUNU Assurances which remains a model of African success. The meetings continued the next day and ended with a gala dinner.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_choiseul.jpg\ndateCreated_article=>2018-05-04 17:49:57\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(989,2147484848,'2018-08-01 15:50:41','article','update|all|2|id_article=>2\ntitre_article=>GABON : LE GROUPE SUNU DÉVOILE SES AMBITIONS POUR LE GABON\ntitre_article_en=>\ntexte_article=><p>Présents à Libreville dans le cadre des conseils des comptes, les membres du comité de direction du Groupe SUNU : M. Pathé DIONE, PDG, Messieurs Mohamed BAH et Joël AMOUSSOU, Directeurs Généraux Délégués ont rencontré partenaires et clients locaux le 22 mars 2018. Les échanges axés sur les\r\nambitions du Groupe SUNU en Afrique et particulièrement pour le Gabon, ont capté l’attention des invités. Ils étaient accompagnés par l’équipe dirigeante des filiales SUNU Assurances Vie et IARD du Gabon.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>21474848481525350474.jpg\ndateCreated_article=>2018-03-22 08:22:01\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>2\ntitre_article=>GABON : LE GROUPE SUNU DÉVOILE SES AMBITIONS POUR LE GABON\ntitre_article_en=>GABON: SUNU GROUPE SUNU UNVEILS ITS AMBITIONS FOR GABON\ntexte_article=><p>Présents à Libreville dans le cadre des conseils des comptes, les membres du comité de direction du Groupe SUNU : M. Pathé DIONE, PDG, Messieurs Mohamed BAH et Joël AMOUSSOU, Directeurs Généraux Délégués ont rencontré partenaires et clients locaux le 22 mars 2018. Les échanges axés sur les ambitions du Groupe SUNU en Afrique et particulièrement pour le Gabon, ont capté l’attention des invités. Ils étaient accompagnés par l’équipe dirigeante des filiales SUNU Assurances Vie et IARD du Gabon.</p>\r\n\ntexte_article_en=><p>Present in Libreville for an audit council, members of SUNU Group Executive Committee: Mr. Pathé DIONE, CEO, Messrs. Mohamed BAH and Joël AMOUSSOU, Deputy Managing Directors, met partners and local customers on 22 March 2018. The Discussions were focused on SUNU Group&#39;s ambitions in Africa and particularly for Gabon and they captured the attention of the guests. The members of the management committee were accompanied by the management team of SUNU Assurances Vie and IARD Gabon.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525350474.jpg\ndateCreated_article=>2018-03-22 17:50:41\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(990,2147484848,'2018-08-01 15:51:27','article','update|all|3|id_article=>3\ntitre_article=>CÔTE D\'IVOIRE : SUNU ASSURANCES VIE CI OSE AVEC LES FEMMES FEEF\ntitre_article_en=>\ntexte_article=><p>Les 16 et 17 mars 2018, SUNU Assurances Vie CI a « Osé » en étant le partenaire de la 5ème édition du Forum de l’Emploi et de l’Entreprenariat Féminin « FEEF2018 ». Deux jours de festivités qui ont permis aux femmes venues de différents horizons de partager leurs expériences sur des problématiques liées à l’emploi à travers conférences et panels. Avec pour thème : « Osez ! Et Réalisez vos rêves », le FEEF 2018 a tenu encore ses promesses cette année. Un défilé de mode et un feu d’artifice ont permis de refermer les portes de cette 5ème édition.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>21474848481525351152.jpg\ndateCreated_article=>2018-03-16 08:22:38\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>3\ntitre_article=>CÔTE D\'IVOIRE : SUNU ASSURANCES VIE CI OSE AVEC LES FEMMES FEEF\ntitre_article_en=>CÔTE D’IVOIRE: SUNU ASSURANCES VIE CI TOOK THE LEAP WITH FEEF’s WOMEN\ntexte_article=><p>Les 16 et 17 mars 2018, SUNU Assurances Vie CI a « Osé » en étant le partenaire de la 5ème édition du Forum de l’Emploi et de l’Entreprenariat Féminin « FEEF2018 ». Deux jours de festivités qui ont permis aux femmes venues de différents horizons de partager leurs expériences sur des problématiques liées à l’emploi à travers conférences et panels. Avec pour thème : « Osez ! Et Réalisez vos rêves », le FEEF 2018 a tenu encore ses promesses cette année. Un défilé de mode et un feu d’artifice ont permis de refermer les portes de cette 5ème édition.</p>\r\n\ntexte_article_en=><p>On March 16 and 17, 2018, SUNU Assurances Vie CI crossed a new line by being the partner of the 5th edition of the Forum of Employment and Female Entrepreneurship \"FEEF 2018”. Two days of festivities that allowed women from different backgrounds to share their experiences on issues related to employment through conferences and panels. Dealing with the topic \"Dare! And Make your dreams come true”, the FEEF 2018 has kept its promises this year. A fashion show and fireworks marked the closure of this 5th edition.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351152.jpg\ndateCreated_article=>2018-03-16 17:51:27\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(991,2147484848,'2018-08-01 15:52:14','article','update|all|8|id_article=>8\ntitre_article=>BURKINA FASO : 12ÈME TIRAGE DE LAFIA AVEC SUNU ASSURANCES VIE BURKINA FASO ET ORABANK\ntitre_article_en=>\ntexte_article=><p>Pour Le 12ème tirage du produit d’épargne « LAFIA», SUNU Assurances Vie Burkina Faso et ORABANK ont donné rendez-vous à leurs clients le jeudi 15 mars 2018. Une rencontre qui a fait d’heureux gagnants avec au total 24 numéros tirés. Occasion propice pour les représentants de SUNU Assurances Vie Burkina Faso d’expliquer le fonctionnement du produit qui offre chaque trimestre aux titulaires de comptes ORABANK la possibilité d’être millionnaire.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>lafia1.jpg\ndateCreated_article=>2018-03-15 08:23:14\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>8\ntitre_article=>BURKINA FASO : 12ÈME TIRAGE DE LAFIA AVEC SUNU ASSURANCES VIE BURKINA FASO ET ORABANK\ntitre_article_en=>BURKINA FASO: 12TH PRIZE DRAW OF “LAFIA” WITH SUNU ASSURANCES VIE BURKINA FASO and ORABANK\ntexte_article=><p>Pour Le 12ème tirage du produit d’épargne « LAFIA», SUNU Assurances Vie Burkina Faso et ORABANK ont donné rendez-vous à leurs clients le jeudi 15 mars 2018. Une rencontre qui a fait d’heureux gagnants avec au total 24 numéros tirés. Occasion propice pour les représentants de SUNU Assurances Vie Burkina Faso d’expliquer le fonctionnement du produit qui offre chaque trimestre aux titulaires de comptes ORABANK la possibilité d’être millionnaire.</p>\r\n\ntexte_article_en=><p>For the 12th prize draw of the savings product \"LAFIA\", SUNU Assurances Vie Burkina Faso and ORABANK have met with their clients on Thursday, March 15, 2018. This meeting has made some happy winners with a total of 24 numbers drawn for the prize. This has been a good opportunity for representatives of SUNU Assurances Vie Burkina Faso to explain how the product works. “LAFIA” is a product that offers every quarter to ORABANK account holders the chance to become millionaire.</p>\r\n\nlecture_article=>0\nfichier_article=>lafia1.jpg\ndateCreated_article=>2018-03-15 17:52:14\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(992,2147484848,'2018-08-01 15:52:58','article','update|all|5|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntitre_article_en=>\ntexte_article=><p>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé. Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-09 09:23:51\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntitre_article_en=>TOGO: SUNU ASSURANCES COMPANIES VISITED SURVEYORS\ntexte_article=><p>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé. Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n\ntexte_article_en=><p>In order to forge strong relationships with their partners, SUNU Assurances companies of Togo accompanied the meeting of Togolese surveyors held from the 7th to the 9th of March at Sarakawa Hotel in Lomé. Known as \"The French-speaking Universities of Surveyors\", this meeting was intended to enable exchanges between Togolese surveyors and their colleagues from other French-speaking countries. The discussions mainly focused on the profession and the role of surveyors in sustainable development. This event was an appropriate occasion for SUNU Group’s Life and General Insurance subsidiaries of Togo to present their best insurance offers.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-09 17:52:58\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(993,2147484848,'2018-08-01 15:53:31','article','update|all|9|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntitre_article_en=>\ntexte_article=><p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018,dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY, Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-03-06 09:26:03\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntitre_article_en=>SUNU ASSURANCES VIE COTE D’IVOIRE ATTENDED DELOITTE MEETINGS\ntexte_article=><p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018,dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY, Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n\ntexte_article_en=><p>SUNU Assurances Vie Benin received two awards for participating in the decoration of the city of Cotonou. It was on Thursday, February 15, 2018, in the premises of the subsidiary that the managers of the communications company Effet Media, initiator of the project, presented to Mr. Lassina COULIBALY, Managing Director of SUNU Assurances Vie Benin, the Certificate of Recognition for its participation in the illumination of the city and the \"Prize Lumière\" for the best decoration 2017. Note that this distinction was granted after a popular vote and the deliberation of a jury of experts composed of professionals of decoration. Congratulations to SUNU Assurances Vie Benin, leader of Life insurance in the country.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-03-06 17:53:31\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(994,2147484848,'2018-08-01 15:54:02','article','update|all|11|id_article=>11\ntitre_article=>SUNU ASSURANCES VIE BURKINA FASO PROCÈDE AU 13ÈME TIRAGE AU SORT DU PRODUIT \"ATLANTIQUE FORTUNE\"\ntitre_article_en=>\ntexte_article=><p>SUNU Assurances Vie Burkina Faso et son partenaire Banque Atlantique ont effectué le 13ème  tirage du produit « Atlantique Fortune » le jeudi 15 février. En présence des responsables des deux entités et de quelques clients, le tirage a permis de récompenser 24 numéros de police. « Atlantique Fortune » est ouvert aux titulaires d’un compte à la Banque Atlantique et permet au souscripteur de se constituer une épargne à partir de 5 500 F CFA et d’avoir la possibilité d’être tiré au sort chaque trimestre pour gagner jusqu’à 6 000 000 F CFA.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>tirag_atF_bf.jpg\ndateCreated_article=>2018-02-15 12:31:11\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>11\ntitre_article=>SUNU ASSURANCES VIE BURKINA FASO PROCÈDE AU 13ÈME TIRAGE AU SORT DU PRODUIT \ntitre_article_en=>SUNU ASSURANCES VIE BURKINA FASO HOLD THE 13TH DRAW FOR “ATLANTIQUE FORTUNE”\ntexte_article=><p>SUNU Assurances Vie Burkina Faso et son partenaire Banque Atlantique ont effectué le 13ème  tirage du produit « Atlantique Fortune » le jeudi 15 février. En présence des responsables des deux entités et de quelques clients, le tirage a permis de récompenser 24 numéros de police. « Atlantique Fortune » est ouvert aux titulaires d’un compte à la Banque Atlantique et permet au souscripteur de se constituer une épargne à partir de 5 500 F CFA et d’avoir la possibilité d’être tiré au sort chaque trimestre pour gagner jusqu’à 6 000 000 F CFA.</p>\r\n\ntexte_article_en=><p>SUNU Assurances Vie Burkina Faso and its partner Banque Atlantique have made the 13th draw of the « Atlantique Fortune » product on Thursday, February 15th. In the presence of officials from both entities and some customers, the draw rewarded 24 police holders. \"Atlantique Fortune\" is open to holders of an account at Banque Atlantique and enables the subscriber to build up a saving from 5500 FCFA and to have the quarterly opportunity to win up to 6,000,000 FCFA.</p>\r\n\nlecture_article=>0\nfichier_article=>tirag_atF_bf.jpg\ndateCreated_article=>2018-02-15 17:54:02\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(995,2147484848,'2018-08-01 15:55:40','article','update|all|10|id_article=>10\ntitre_article=>SUNU ASSURANCES VIE BÉNIN HONORÉE\ntitre_article_en=>\ntexte_article=><p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018, dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY </p>\r\n\r\n<p>Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>prix_bnin.jpg\ndateCreated_article=>2018-02-15 12:30:01\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>10\ntitre_article=>SUNU ASSURANCES VIE BÉNIN HONORÉE\ntitre_article_en=>SUNU ASSURANCES VIE BENIN HONOURED\ntexte_article=><p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018, dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY </p>\r\n\r\n<p>Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n\ntexte_article_en=><p>SUNU Assurances Vie Benin received two awards for participating in the decoration of the city of Cotonou. It was on Thursday, February 15, 2018, in the premises of the subsidiary that the managers of the communications company Effet Media, initiator of the project, presented to Mr. Lassina COULIBALY, Managing Director of SUNU Assurances Vie Benin, the Certificate of Recognition for its participation in the illumination of the city and the \"Prize Lumière\" for the best decoration 2017. Note that this distinction was granted after a popular vote and the deliberation of a jury of experts composed of professionals of decoration. Congratulations to SUNU Assurances Vie Benin, leader of Life insurance in the country.</p>\r\n\nlecture_article=>0\nfichier_article=>prix_bnin.jpg\ndateCreated_article=>2018-02-15 17:55:40\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(996,2147484848,'2018-08-01 16:00:02','article','update|all|12|id_article=>12\ntitre_article=>LE GROUPE SUNU À KIGALI POUR LA 42ÈME RENCONTRE ANNUELLE DE LA FANAF\ntitre_article_en=>\ntexte_article=><p>Pour leur 42ème rencontre annuelle, les responsables du secteur de l’assurance des pays africains sont réunis depuis ce lundi 12 février 2018 à Kigali (Rwanda) pour l’assemblée générale annuelle de la FANAF. Les dirigeants du Groupe SUNU ainsi que les acteurs de l’assurance auront jusqu’au 15 février 2018 pour échanger sur le thème : « L’assurance Africaine à l’épreuve de la disruption ». 4 jours de réflexions marqués par des panels et conférences pour trouver des solutions plus adaptées pour le bon fonctionnement de l’assurance en Afrique et pour le bien-être des populations.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>fanaf.jpg\ndateCreated_article=>2018-02-12 12:32:48\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>12\ntitre_article=>LE GROUPE SUNU À KIGALI POUR LA 42ÈME RENCONTRE ANNUELLE DE LA FANAF\ntitre_article_en=>SUNU GROUP IN KIGALI FOR THE 42nd ANNUAL MEETING OF FANAF \ntexte_article=><p>Pour leur 42ème rencontre annuelle, les responsables du secteur de l’assurance des pays africains sont réunis depuis ce lundi 12 février 2018 à Kigali (Rwanda) pour l’assemblée générale annuelle de la FANAF. Les dirigeants du Groupe SUNU ainsi que les acteurs de l’assurance auront jusqu’au 15 février 2018 pour échanger sur le thème : « L’assurance Africaine à l’épreuve de la disruption ». 4 jours de réflexions marqués par des panels et conférences pour trouver des solutions plus adaptées pour le bon fonctionnement de l’assurance en Afrique et pour le bien-être des populations.</p>\r\n\ntexte_article_en=><p>The managers of the insurance sector of African countries are in session since Monday, February 12, 2018, in Kigali (Rwanda) for the 42<sup>nd</sup> annual general meeting of FANAF. The leaders of SUNU Group as well as the actors of insurance have until February 15, 2018 to debate on the topic: \"African insurance sector facing disruption\". These four days of reflections, marked by panels and conferences, are intended to find more suitable solutions for the good functioning of insurance in Africa and for the well-being of the populations.</p>\r\n\nlecture_article=>0\nfichier_article=>fanaf.jpg\ndateCreated_article=>2018-02-12 18:00:02\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(997,2147484848,'2018-08-01 16:02:31','article','update|all|13|id_article=>13\ntitre_article=>3ÈME ÉDITION DU TOURNOI DE GOLF SUNU ASSURANCES AU BURKINA FASO\ntitre_article_en=>\ntexte_article=><p>Pour la 3ème  édition du tournoi de Golf SUNU Assurances du Burkina Faso, amateurs et professionnels de Golf se sont réunis les 10 et 11 Février 2018 sur l’aire de jeux du Golf Club de Ouagadougou. Sponsorisé depuis 3 ans par les sociétés SUNU Assurances du Burkina Faso, la mobilisation était de taille cette année et a permis de resserrer les liens avec les différents partenaires présents. Deux jours de compétitions qui ont permis de déceler de nouveaux talents et de récompenser les meilleurs joueurs parmi lesquels, M. Jean François KAMBOU, Directeur Général de SUNU Assurances Vie Burkina Faso.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>golf_bf.jpg\ndateCreated_article=>2018-02-10 11:09:12\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>13\ntitre_article=>3ÈME ÉDITION DU TOURNOI DE GOLF SUNU ASSURANCES AU BURKINA FASO\ntitre_article_en=>3rd EDITION OF THE GOLF TOURNAMENT OF SUNU ASSURANCES IN BURKINA FASO\ntexte_article=><p>Pour la 3ème  édition du tournoi de Golf SUNU Assurances du Burkina Faso, amateurs et professionnels de Golf se sont réunis les 10 et 11 Février 2018 sur l’aire de jeux du Golf Club de Ouagadougou. Sponsorisé depuis 3 ans par les sociétés SUNU Assurances du Burkina Faso, la mobilisation était de taille cette année et a permis de resserrer les liens avec les différents partenaires présents. Deux jours de compétitions qui ont permis de déceler de nouveaux talents et de récompenser les meilleurs joueurs parmi lesquels, M. Jean François KAMBOU, Directeur Général de SUNU Assurances Vie Burkina Faso.</p>\r\n\ntexte_article_en=><p>For the 3rd edition of SUNU Assurances golf tournament of Burkina Faso, golf amateurs and professionals met on 10<sup>th</sup> and 11<sup>th</sup> February 2018 on the playground of the Golf Club of Ouagadougou. For 3 years, SUNU Assurances companies of Burkina Faso have been sponsoring the tournament. This year, the mobilisation was strong and permitted to strengthen the relations with the participating partners. Two days of competitions have allowed to detect new talents and to reward the best players among which, Mr. Jean François KAMBOU, Managing Director of SUNU Assurances Vie Burkina Faso.</p>\r\n\nlecture_article=>0\nfichier_article=>golf_bf.jpg\ndateCreated_article=>2018-02-10 18:02:31\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(998,2147484848,'2018-08-01 16:03:42','article','update|all|14|id_article=>14\ntitre_article=>LES SOCIÉTÉS SUNU ASSURANCES DU GABON AU SALON DE LA JOURNÉE ECONOMIQUE 2018\ntitre_article_en=>\ntexte_article=><p>Au Gabon, les sociétés SUNU Assurances ont pris part au salon de la journée économique organisée chaque année par le Ministère gabonais de l’économie. Le salon s’est déroulé toute la journée du 7 février 2018 à l’auditorium de l’immeuble Arambo de Libreville.</p>\r\n\r\n<p>Cette année, une attention particulière a été accordée au secteur de l’assurance et avait pour thème : « Restaurer la confiance ». Après les panels, place à la visite des stands où les Ministres de l’économie, du travail et des PME de passage à l’espace SUNU Assurances ont bénéficié de la présentation des filiales du Gabon et des offres qu’elles proposent.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>JE_cam.jpg\ndateCreated_article=>2018-02-07 12:35:33\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>14\ntitre_article=>LES SOCIÉTÉS SUNU ASSURANCES DU GABON AU SALON DE LA JOURNÉE ECONOMIQUE 2018\ntitre_article_en=>THE COMPANIES SUNU ASSURANCES OF GABON WERE AT THE ECONOMIC DAY FAIR\ntexte_article=><p>Au Gabon, les sociétés SUNU Assurances ont pris part au salon de la journée économique organisée chaque année par le Ministère gabonais de l’économie. Le salon s’est déroulé toute la journée du 7 février 2018 à l’auditorium de l’immeuble Arambo de Libreville.</p>\r\n\r\n<p>Cette année, une attention particulière a été accordée au secteur de l’assurance et avait pour thème : « Restaurer la confiance ». Après les panels, place à la visite des stands où les Ministres de l’économie, du travail et des PME de passage à l’espace SUNU Assurances ont bénéficié de la présentation des filiales du Gabon et des offres qu’elles proposent.</p>\r\n\ntexte_article_en=><p>In Gabon, SUNU Assurances companies took part in the Economic Day Fair organised every year by the Gabonese Ministry of Economy. The show was held throughout the day of 7 February 2018 at the auditorium of Arambo building in Libreville.</p>\r\n\r\n<p>This year, special attention was given to the insurance sector and the event dealt with the topic “Restoring trust”. After the panels, the Ministers of Economy, Labor and SMEs visited the stand of SUNU Assurances where they were presented the Gabonese subsidiaries and the services they offer.</p>\r\n\nlecture_article=>0\nfichier_article=>JE_cam.jpg\ndateCreated_article=>2018-02-07 18:03:42\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(999,2147484848,'2018-08-01 16:04:24','article','update|all|16|id_article=>16\ntitre_article=>EQUITY ASSURANCES PLC NIGERIA, LA MARCHE ENGAGÉE CONTRE LE CANCER DU COL DE L\'UTÉRUS\ntitre_article_en=>\ntexte_article=><p>La marche sportive annoncée d’Equity Assurances Plc Nigeria, filiale du Groupe SUNU en soutien à The Optimal Cancer Care Foundation a connu un grand succès. Le samedi 27 janvier dernier, des femmes et des hommes venus des différents quartiers de la capitale Nigériane pour accompagner cette initiative.</p>\r\n\r\n<p>Les rues de la ville étaient bondées de bénévoles aux côtés du personnel d&#39;Equity Assurances pour sensibiliser les populations sur les risques de cette maladie.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>marche_sant_equity.jpg\ndateCreated_article=>2018-01-27 12:42:51\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>16\ntitre_article=>EQUITY ASSURANCES PLC NIGERIA, LA MARCHE ENGAGÉE CONTRE LE CANCER DU COL DE L\'UTÉRUS\ntitre_article_en=>EQUITY ASSURANCES PLC NIGERIA ENGAGED IN THE FIGHT AGAINST CERVICAL CANCER\ntexte_article=><p>La marche sportive annoncée d’Equity Assurances Plc Nigeria, filiale du Groupe SUNU en soutien à The Optimal Cancer Care Foundation a connu un grand succès. Le samedi 27 janvier dernier, des femmes et des hommes venus des différents quartiers de la capitale Nigériane pour accompagner cette initiative.</p>\r\n\r\n<p>Les rues de la ville étaient bondées de bénévoles aux côtés du personnel d&#39;Equity Assurances pour sensibiliser les populations sur les risques de cette maladie.</p>\r\n\ntexte_article_en=><p>The sporting walk organised by Equity Insurance Plc Nigeria, a subsidiary of SUNU Group, in support of The Optimal Cancer Care Foundation, was a great success. On Saturday, January 27, women and men came from different parts of the Nigerian capital to support this initiative.</p>\r\n\r\n<p>The streets of the city were crowded with volunteers alongside Equity Insurance staff to raise awareness of the risks of this disease.</p>\r\n\nlecture_article=>0\nfichier_article=>marche_sant_equity.jpg\ndateCreated_article=>2018-01-27 18:04:24\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1000,2147484848,'2018-08-01 16:04:56','article','update|all|15|id_article=>15\ntitre_article=>LES HOMMES DE SUNU ASSURANCES VIE CI À LEUR TRADITIONNEL KICK OFF\ntitre_article_en=>\ntexte_article=><p>Chaque année, les Hommes de SUNU Assurances Vie CI organisent leur traditionnel kick off. Au cours de la dernière rencontre qui s’est tenue le samedi 27 janvier 2018, le Directeur Général, M. Saliou BAKAYOKO a fait le bilan des activités 2017 et présenté le plan stratégique avec des travaux de réflexions et des ateliers sur différents thèmes.</p>\r\n\r\n<p>Puis dans une chaleureuse ambiance, les équipes motivées et optimistes pour l&#39;atteinte des objectifs, ont partagé un repas convivial et participé à des jeux.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>21474848481526301679.jpg\ndateCreated_article=>2018-01-27 12:41:19\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>15\ntitre_article=>LES HOMMES DE SUNU ASSURANCES VIE CI À LEUR TRADITIONNEL KICK OFF\ntitre_article_en=>THE STAFF OF SUNU ASSURANCE VIE COTE D’IVOIRE HELD THEIR TRADITIONAL KICK-OFF \ntexte_article=><p>Chaque année, les Hommes de SUNU Assurances Vie CI organisent leur traditionnel kick off. Au cours de la dernière rencontre qui s’est tenue le samedi 27 janvier 2018, le Directeur Général, M. Saliou BAKAYOKO a fait le bilan des activités 2017 et présenté le plan stratégique avec des travaux de réflexions et des ateliers sur différents thèmes.</p>\r\n\r\n<p>Puis dans une chaleureuse ambiance, les équipes motivées et optimistes pour l&#39;atteinte des objectifs, ont partagé un repas convivial et participé à des jeux.</p>\r\n\ntexte_article_en=><p>Every year, the employees of SUNU Assurances Vie COTE D’IVOIRE organise their traditional kick off. During the last meeting held on Saturday 27 January 2018, the Managing Director, Mr. Saliou BAKAYOKO made a review of 2017 activities and presented the new strategic plan. This was accompanied by reflections and workshops on various topics.<br>\r\nAfterwards, in a pleasant atmosphere, the teams which were motivated and optimistic about the achievement of their goals, shared a convivial meal and participated in various games.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481526301679.jpg\ndateCreated_article=>2018-01-27 18:04:56\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1001,2147484848,'2018-08-01 16:06:07','article','update|all|18|id_article=>18\ntitre_article=>CÔTE D\'IVOIRE : SUNU ASSURANCES VIE CI À LA CÉRÉMONIE DE PRÉSENTATION DE VŒUX DE L\'ONMCI\ntitre_article_en=>\ntexte_article=><p>Le jeudi 25 janvier 2018, une délégation de SUNU Assurances Vie CI prenait part à la cérémonie de présentation de vœux de l’Ordre National des Médecins de Côte d’Ivoire « ONMCI ». M. Thierry Brou KOUADIO, Directeur Central Fonctionnel de SUNU Assurances Vie CI, après une brève présentation de la compagnie a donné ses motivations à cette cérémonie.</p>\r\n\r\n<p> La cérémonie s’est déroulée en présence du représentant du Ministre de la santé et s’est poursuivie par une visite de stands où les invités ont bénéficié des conseils des commerciaux SUNU pour plus de souscriptions.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>voeux_onmci.jpg\ndateCreated_article=>2018-01-25 12:44:39\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>18\ntitre_article=>CÔTE D\'IVOIRE : SUNU ASSURANCES VIE CI À LA CÉRÉMONIE DE PRÉSENTATION DE VŒUX DE L\'ONMCI\ntitre_article_en=>COTE D’IVOIRE: SUNU ASSURANCE VIE COTE D’IVOIRE ATTENDED THE CEREMONY OF NEW WISHES OF “ONMCI”\ntexte_article=><p>Le jeudi 25 janvier 2018, une délégation de SUNU Assurances Vie CI prenait part à la cérémonie de présentation de vœux de l’Ordre National des Médecins de Côte d’Ivoire « ONMCI ». M. Thierry Brou KOUADIO, Directeur Central Fonctionnel de SUNU Assurances Vie CI, après une brève présentation de la compagnie a donné ses motivations à cette cérémonie.</p>\r\n\r\n<p> La cérémonie s’est déroulée en présence du représentant du Ministre de la santé et s’est poursuivie par une visite de stands où les invités ont bénéficié des conseils des commerciaux SUNU pour plus de souscriptions.</p>\r\n\ntexte_article_en=><p>On Thursday, 25 January 2018, a delegation of SUNU Assurances Vie CI took part in the ceremony of new year wishes presentation of the national medical association of Côte d&#39;Ivoire (ONMCI). </p>\r\n\r\n<p>Mr. Thierry Brou KOUADIO, Central Functional Director of SUNU Assurances Vie CI, after a brief presentation of the company gave the reasons behind the presence of the company at this ceremony.</p>\r\n\r\n<p>The ceremony took place in the presence of the representative of the Minister of Health and was followed by a visit of the stands where guests received advice from SUNU’s sales team for more subscriptions.</p>\r\n\nlecture_article=>0\nfichier_article=>voeux_onmci.jpg\ndateCreated_article=>2018-01-25 18:06:07\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1002,2147484848,'2018-08-01 16:06:51','article','update|all|17|id_article=>17\ntitre_article=>SUNU ASSURANCES VIE CI CONVIE SES GOLDEN COSTUMER À UN DÎNER\ntitre_article_en=>\ntexte_article=><p>Pour témoigner sa reconnaissance envers sa fidèle clientèle, la direction de SUNU Assurances Vie CI a célébré le 25 janvier 2018, ses clients et partenaires à l’Heden Golf Club Abidjan au cours d’un diner dénommé « Golden Customer »</p>\r\n\r\n<p>En présence de M. Saliou BAKAYOKO, Directeur Général de la société et son Directeur Central Opérationnel, M. Gildas NZOUBA, cette soirée a été marquée par des distinctions avec la remise du diplôme d’honneur aux clients présents et celle du « Trophée de la fidélité » aux trois plus fidèles clients de SUNU Assurances Vie CI depuis plus de 20 ans.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>dej_clien_vie1.jpg\ndateCreated_article=>2018-01-25 12:43:49\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>17\ntitre_article=>SUNU ASSURANCES VIE CI CONVIE SES GOLDEN COSTUMER À UN DÎNER\ntitre_article_en=>SUNU ASSURANCES VIE COTE D’IVOIRE INVITED THEIR GOLDEN CUSTOMERS FOR A DINNER\ntexte_article=><p>Pour témoigner sa reconnaissance envers sa fidèle clientèle, la direction de SUNU Assurances Vie CI a célébré le 25 janvier 2018, ses clients et partenaires à l’Heden Golf Club Abidjan au cours d’un diner dénommé « Golden Customer »</p>\r\n\r\n<p>En présence de M. Saliou BAKAYOKO, Directeur Général de la société et son Directeur Central Opérationnel, M. Gildas NZOUBA, cette soirée a été marquée par des distinctions avec la remise du diplôme d’honneur aux clients présents et celle du « Trophée de la fidélité » aux trois plus fidèles clients de SUNU Assurances Vie CI depuis plus de 20 ans.</p>\r\n\ntexte_article_en=><p>To express its gratitude to its loyal customers, the management of SUNU ASSURANCES VIE COTE D’IVOIRE celebrated its customers and partners at the Heden Golf Club in Abidjan on 25 January 2018 during a dinner called \"Golden Customer\".</p>\r\n\r\n<p>In the presence of Mr. Saliou BAKAYOKO, Managing Director of the company and Mr. Gildas NZOUBA, the Central Operational Director, this evening has seen distinctions awarded to customers. The participating customers were awarded with a diploma of honour and the three most loyal customers with more than 20 years subscription were given the “trophy of loyalty\".</p>\r\n\nlecture_article=>0\nfichier_article=>dej_clien_vie1.jpg\ndateCreated_article=>2018-01-25 18:06:51\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1003,2147484848,'2018-08-01 16:07:50','article','update|all|20|id_article=>20\ntitre_article=>L\'EX CAMINSUR DEVENUE SUNU ASSURANCES IARD CAMEROUN\ntitre_article_en=>\ntexte_article=><p>Pour son entrée dans le Groupe SUNU, l\'ex CAMINSUR devenue SUNU Assurances IARD Cameroun a revêtu son siège dans les couleurs du Groupe. A Douala, précisément à la rue Narvik, ne soyez pas déroutés, restez toujours en de bonnes mains dans les locaux de la nouvelle filiale SUNU Assurances.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>sige_sunu_iard_camv2.jpg\ndateCreated_article=>2018-01-04 12:46:50\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>20\ntitre_article=>L\'EX CAMINSUR DEVENUE SUNU ASSURANCES IARD CAMEROUN\ntitre_article_en=>EX-CAMINSUR BECOMES SUNU ASSURANCES IARD CAMEROON\ntexte_article=><p>Pour son entrée dans le Groupe SUNU, l&#39;ex CAMINSUR devenue SUNU Assurances IARD Cameroun a revêtu son siège dans les couleurs du Groupe. A Douala, précisément à la rue Narvik, ne soyez pas déroutés, restez toujours en de bonnes mains dans les locaux de la nouvelle filiale SUNU Assurances.</p>\r\n\ntexte_article_en=><p>Following its entry into SUNU Group, ex-CAMINSUR’s head office has now been rebranded with the colours of the Group. In Douala, precisely on Narvik Street, do not feel confused! you are still in good hands in the premises of the new subsidiary, SUNU Assurances.</p>\r\n\nlecture_article=>0\nfichier_article=>sige_sunu_iard_camv2.jpg\ndateCreated_article=>2018-01-04 18:07:50\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1004,2147484848,'2018-08-01 16:08:35','article','update|all|19|id_article=>19\ntitre_article=>POSE DE LA PREMIÈRE PIERRE DU NOUVEAU SIÈGE SUNU ASSURANCES AU BURKINA FASO\ntitre_article_en=>\ntexte_article=><p>Bientôt un nouveau siège pour SUNU Assurances dans la capitale Burkinabé. Cette information a été rendue officielle le jeudi 4 janvier 2018 lors de la cérémonie de pose de la première pierre qui marque le début des travaux de construction du bâtiment.</p>\r\n\r\n<p>M. Seydou DIAKITE, PCA des sociétés SUNU Assurances du Burkina Faso était accompagné par Messieurs Osée G. QUENUM et François KAMBOU, DG respectifs de SUNU Assurances IARD Burkina Faso et SUNU Assurances Vie Burkina Faso pour le déroulement de cette cérémonie.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>bf_new_sige.jpg\ndateCreated_article=>2018-01-04 12:45:56\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>19\ntitre_article=>POSE DE LA PREMIÈRE PIERRE DU NOUVEAU SIÈGE SUNU ASSURANCES AU BURKINA FASO\ntitre_article_en=>LAYING OF THE FIRST FOUNDATION STONE OF SUNU ASSURANCES BURKINA FASO NEW HEAD OFFICE\ntexte_article=><p>Bientôt un nouveau siège pour SUNU Assurances dans la capitale Burkinabé. Cette information a été rendue officielle le jeudi 4 janvier 2018 lors de la cérémonie de pose de la première pierre qui marque le début des travaux de construction du bâtiment.</p>\r\n\r\n<p>M. Seydou DIAKITE, PCA des sociétés SUNU Assurances du Burkina Faso était accompagné par Messieurs Osée G. QUENUM et François KAMBOU, DG respectifs de SUNU Assurances IARD Burkina Faso et SUNU Assurances Vie Burkina Faso pour le déroulement de cette cérémonie.</p>\r\n\ntexte_article_en=><p>Soon, SUNU Assurances will have a new head office in the capital of Burkina Faso. This information was officially released on Thursday, 4<sup>th</sup> of January 2018 during the ceremony of the laying of the foundation stone which marks the beginning of the construction of the building.</p>\r\n\r\n<p>At this ceremony, Mr. Seydou DIAKITE, Chairman of SUNU Assurances of Burkina Faso was accompanied by Messrs. Osée G. QUENUM and François KAMBOU, respectively Managing Directors of SUNU Assurances IARD Burkina Faso and SUNU Assurances Vie Burkina Faso.</p>\r\n\nlecture_article=>0\nfichier_article=>bf_new_sige.jpg\ndateCreated_article=>2018-01-04 18:08:35\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1005,2147484848,'2018-08-01 16:09:15','article','update|all|21|id_article=>21\ntitre_article=>SUNU ASSURANCES SPONSOR DE LA 39ÈME ÉDITION DU SABRE NATIONAL DU NIGER\ntitre_article_en=>\ntexte_article=><p>Pendant 10 jours, les sociétés SUNU Assurances du Niger étaient à Zinder, à 900 Km de Niamey pour la 39ème édition du sabre national du Niger. Les compétitions à fortes valeurs culturelles et traditionnelles ont débuté le 25 décembre 2017 et ont marqué leur apothéose le mercredi 3 janvier 2018. SUNU Assurances était présente pour échanger, sensibiliser et proposer ses offres aux populations venues des quatre coins du pays.</p>\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>zinder_niger.jpg\ndateCreated_article=>2018-01-03 12:47:41\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>21\ntitre_article=>SUNU ASSURANCES SPONSOR DE LA 39ÈME ÉDITION DU SABRE NATIONAL DU NIGER\ntitre_article_en=>SUNU ASSURANCES, SPONSOR OF THE 39TH EDITION OF “SABRE NATIONAL DU NIGER\ntexte_article=><p>Pendant 10 jours, les sociétés SUNU Assurances du Niger étaient à Zinder, à 900 Km de Niamey pour la 39ème édition du sabre national du Niger. Les compétitions à fortes valeurs culturelles et traditionnelles ont débuté le 25 décembre 2017 et ont marqué leur apothéose le mercredi 3 janvier 2018. SUNU Assurances était présente pour échanger, sensibiliser et proposer ses offres aux populations venues des quatre coins du pays.</p>\r\n\ntexte_article_en=><p>For 10 days, SUNU Assurances companies of Niger were in Zinder, 900 km away from Niamey for the 39th edition of “Sabre National du Niger”. The contests with strong cultural and traditional values began on 25 December 2017 and reached their apotheosis on Wednesday, 3<sup>rd</sup> January 2018. SUNU Assurances was present to discuss, raise awareness and promote its offers to people from all over the country.</p>\r\n\nlecture_article=>0\nfichier_article=>zinder_niger.jpg\ndateCreated_article=>2018-01-03 18:09:15\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1006,2147204895,'2018-08-01 16:12:25','_SESSION','login|all|1533139851|0|__ci_last_regenerate=>1533139851\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-07-31 16:27:30::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1007,2147204895,'2018-08-01 16:15:05','article','update|all|2|id_article=>2\ntitre_article=>GABON : LE GROUPE SUNU DÉVOILE SES AMBITIONS POUR LE GABON\ntitre_article_en=>GABON: SUNU GROUPE SUNU UNVEILS ITS AMBITIONS FOR GABON\ntexte_article=><p>Présents à Libreville dans le cadre des conseils des comptes, les membres du comité de direction du Groupe SUNU : M. Pathé DIONE, PDG, Messieurs Mohamed BAH et Joël AMOUSSOU, Directeurs Généraux Délégués ont rencontré partenaires et clients locaux le 22 mars 2018. Les échanges axés sur les ambitions du Groupe SUNU en Afrique et particulièrement pour le Gabon, ont capté l’attention des invités. Ils étaient accompagnés par l’équipe dirigeante des filiales SUNU Assurances Vie et IARD du Gabon.</p>\r\n\ntexte_article_en=><p>Present in Libreville for an audit council, members of SUNU Group Executive Committee: Mr. Pathé DIONE, CEO, Messrs. Mohamed BAH and Joël AMOUSSOU, Deputy Managing Directors, met partners and local customers on 22 March 2018. The Discussions were focused on SUNU Group&#39;s ambitions in Africa and particularly for Gabon and they captured the attention of the guests. The members of the management committee were accompanied by the management team of SUNU Assurances Vie and IARD Gabon.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525350474.jpg\ndateCreated_article=>2018-03-22 17:50:41\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>2\ntitre_article=>GABON : LE GROUPE SUNU DÉVOILE SES AMBITIONS POUR LE GABON\ntitre_article_en=>GABON: SUNU GROUPE SUNU UNVEILS ITS AMBITIONS FOR GABON\ntexte_article=><p>Présents à Libreville dans le cadre des conseils des comptes, les membres du comité de direction du Groupe SUNU : M. Pathé DIONE, PDG, Messieurs Mohamed BAH et Joël AMOUSSOU, Directeurs Généraux Délégués ont rencontré partenaires et clients locaux le 22 mars 2018. Les échanges axés sur les ambitions du Groupe SUNU en Afrique et particulièrement pour le Gabon, ont capté l’attention des invités. Ils étaient accompagnés par l’équipe dirigeante des filiales SUNU Assurances Vie et IARD du Gabon.</p>\r\n\ntexte_article_en=><p>Present in Libreville for an audit council, members of SUNU Group Executive Committee: Mr. Pathé DIONE, CEO, Messrs. Mohamed BAH and Joël AMOUSSOU, Deputy Managing Directors, met partners and local customers on 22 March 2018. The discussions which were focused on SUNU Group&#39;s ambitions in Africa and particularly for Gabon captured the attention of the guests. The members of the management committee were accompanied by the management team of SUNU Assurances Vie and IARD Gabon.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525350474.jpg\ndateCreated_article=>2018-03-22 18:15:05\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1008,2147204895,'2018-08-01 16:21:31','article','update|all|21|id_article=>21\ntitre_article=>SUNU ASSURANCES SPONSOR DE LA 39ÈME ÉDITION DU SABRE NATIONAL DU NIGER\ntitre_article_en=>SUNU ASSURANCES, SPONSOR OF THE 39TH EDITION OF “SABRE NATIONAL DU NIGER\ntexte_article=><p>Pendant 10 jours, les sociétés SUNU Assurances du Niger étaient à Zinder, à 900 Km de Niamey pour la 39ème édition du sabre national du Niger. Les compétitions à fortes valeurs culturelles et traditionnelles ont débuté le 25 décembre 2017 et ont marqué leur apothéose le mercredi 3 janvier 2018. SUNU Assurances était présente pour échanger, sensibiliser et proposer ses offres aux populations venues des quatre coins du pays.</p>\r\n\ntexte_article_en=><p>For 10 days, SUNU Assurances companies of Niger were in Zinder, 900 km away from Niamey for the 39th edition of “Sabre National du Niger”. The contests with strong cultural and traditional values began on 25 December 2017 and reached their apotheosis on Wednesday, 3<sup>rd</sup> January 2018. SUNU Assurances was present to discuss, raise awareness and promote its offers to people from all over the country.</p>\r\n\nlecture_article=>0\nfichier_article=>zinder_niger.jpg\ndateCreated_article=>2018-01-03 18:09:15\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>21\ntitre_article=>SUNU ASSURANCES SPONSOR DE LA 39ÈME ÉDITION DU SABRE NATIONAL DU NIGER\ntitre_article_en=>SUNU ASSURANCES, SPONSOR OF THE 39TH EDITION OF “SABRE NATIONAL DU NIGER\ntexte_article=><p>Pendant 10 jours, les sociétés SUNU Assurances du Niger étaient à Zinder, à 900 Km de Niamey pour la 39ème édition du sabre national du Niger. Les compétitions à fortes valeurs culturelles et traditionnelles ont débuté le 25 décembre 2017 et ont marqué leur apothéose le mercredi 3 janvier 2018. SUNU Assurances était présente pour échanger, sensibiliser et proposer ses offres aux populations venues des quatre coins du pays.</p>\r\n\ntexte_article_en=><p>For 10 days, SUNU Assurances companies of Niger were in Zinder, 900 km away from Niamey for the 39th edition of “Sabre National du Niger”. The contests with strong cultural and traditional values connotations began on 25 December 2017 and reached their apotheosis on Wednesday, 3<sup>rd</sup> January 2018. SUNU Assurances was present to discuss, raise awareness and promote its offers to people from all over the country.</p>\r\n\nlecture_article=>0\nfichier_article=>zinder_niger.jpg\ndateCreated_article=>2018-01-03 18:21:31\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1009,2147204895,'2018-08-01 16:47:13','article','update|all|25|id_article=>25\ntitre_article=>GROUPE SUNU : Le Groupe au  Brokerslink Africa Forum 2018\ntitre_article_en=>\ntexte_article=><p>Le jeudi 19 juillet 2018, SUNU Assurances a participé au Brokerslink Africa Forum, qui a eu lieu au Sofitel Hôtel Ivoire. M. Faustin ATEBI-ZIRIGA, Directeur Général de SUNU Assurances IARD CI et Mlle Déborah GNAGNE, Directeur du Développement Commercial ont présenté le Groupe SUNU aux courtiers membres du réseau Brokerslink. <br>\r\nPar la suite, SUNU Assurances a offert un diner ethnique. Hôtes et convives ont soufflé ensemble les bougies marquant les 20 ans du Groupe SUNU. Ce fut un moment bien apprécié qui a permis à chacun d’exprimer sa joie à travers des pas de danse et remises de lots cadeaux et goodies.</p>\r\n\ntexte_article_en=>\nlecture_article=>0\nfichier_article=>img1.jpg\ndateCreated_article=>2018-07-19 14:34:24\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>25\ntitre_article=>GROUPE SUNU : Le Groupe au  Brokerslink Africa Forum 2018\ntitre_article_en=>SUNU GROUP AT THE BROKERSLINK AFRICA FORUM 2018\ntexte_article=><p>Le jeudi 19 juillet 2018, SUNU Assurances a participé au Brokerslink Africa Forum, qui a eu lieu au Sofitel Hôtel Ivoire. M. Faustin ATEBI-ZIRIGA, Directeur Général de SUNU Assurances IARD CI et Mlle Déborah GNAGNE, Directeur du Développement Commercial ont présenté le Groupe SUNU aux courtiers membres du réseau Brokerslink. <br>\r\nPar la suite, SUNU Assurances a offert un diner ethnique. Hôtes et convives ont soufflé ensemble les bougies marquant les 20 ans du Groupe SUNU. Ce fut un moment bien apprécié qui a permis à chacun d’exprimer sa joie à travers des pas de danse et remises de lots cadeaux et goodies.</p>\r\n\ntexte_article_en=><p>On Thursday, July 19, 2018, SUNU Assurances participated in the Brokerslink Africa Forum, which took place at Sofitel Hotel Ivoire. Mr. Faustin ATEBI-ZIRIGA, Managing Director of SUNU Assurances IARD CI and Miss Déborah GNAGNE, Director of Business Development presented SUNU Group to brokers who are members of Brokerslink network.<br>\r\nAfterwards, SUNU Insurance offered an ethnic dinner. Hosts and guests together blew out the candles commemorating the 20th anniversary of SUNU Group. It was an enjoyable moment that allowed everyone to express their joy through dance moves, gifts and goodies.</p>\r\n\nlecture_article=>0\nfichier_article=>img1.jpg\ndateCreated_article=>2018-07-19 18:47:13\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1010,2147204895,'2018-08-01 16:59:11','article','update|all|25|id_article=>25\ntitre_article=>GROUPE SUNU : Le Groupe au  Brokerslink Africa Forum 2018\ntitre_article_en=>SUNU GROUP AT THE BROKERSLINK AFRICA FORUM 2018\ntexte_article=><p>Le jeudi 19 juillet 2018, SUNU Assurances a participé au Brokerslink Africa Forum, qui a eu lieu au Sofitel Hôtel Ivoire. M. Faustin ATEBI-ZIRIGA, Directeur Général de SUNU Assurances IARD CI et Mlle Déborah GNAGNE, Directeur du Développement Commercial ont présenté le Groupe SUNU aux courtiers membres du réseau Brokerslink. <br>\r\nPar la suite, SUNU Assurances a offert un diner ethnique. Hôtes et convives ont soufflé ensemble les bougie