U GROUP AT THE BROKERSLINK AFRICA FORUM 2018\ntexte_article=><p>Le jeudi 19 juillet 2018, SUNU Assurances a participé au Brokerslink Africa Forum, qui a eu lieu au Sofitel Hôtel Ivoire. M. Faustin ATEBI-ZIRIGA, Directeur Général de SUNU Assurances IARD CI et Mlle Déborah GNAGNE, Directeur du Développement Commercial ont présenté le Groupe SUNU aux courtiers membres du réseau Brokerslink. <br>\r\nPar la suite, SUNU Assurances a offert un diner ethnique. Hôtes et convives ont soufflé ensemble les bougies marquant les 20 ans du Groupe SUNU. Ce fut un moment bien apprécié qui a permis à chacun d’exprimer sa joie à travers des pas de danse et remises de lots cadeaux et goodies.</p>\r\n\ntexte_article_en=><p>On Thursday, July 19, 2018, SUNU Assurances participated in the Brokerslink Africa Forum, which took place at Sofitel Hotel Ivoire. Mr. Faustin ATEBI-ZIRIGA, Managing Director of SUNU Assurances IARD CI and Miss Déborah GNAGNE, Director of Business Development presented SUNU Group to brokers who are members of Brokerslink network.<br>\r\nAfterwards, SUNU Assurances offered an ethnic dinner. Hosts and guests together blew out the candles commemorating the 20th anniversary of SUNU Group. It was an enjoyable moment that allowed everyone to express their joy through dance moves, gifts and goodies.</p>\r\n\nlecture_article=>0\nfichier_article=>img1.jpg\ndateCreated_article=>2018-07-19 12:36:38\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1014,2147204895,'2018-08-02 10:42:33','article','update|all|23|id_article=>23\ntitre_article=>CÔTE D\'IVOIRE : UN PAS DE PLUS À LA 10 ÈME ÉDITION DU SILA AVEC SUNU ASSURANCES\ntitre_article_en=>COTE D’IVOIRE: AN EXTRA STEP DURING THE 10TH EDITION OF SILA WITH SUNU ASSURANCES\ntexte_article=><p>Pour la 10ème édition du Salon International du Livre d’Abidjan (SILA), les sociétés SUNU Assurances de Côte d’Ivoire ont donné rendez-vous aux écrivains et amoureux du livre du 16 au 20 Mai 2018 au palais de la culture de Treichville. A cette rencontre de l’industrie du livre qui a vu bon nombre d’écrivains primés, M. Saliou BAKAYOKO, DG de SUNU Assurances Vie CI a animé un panel sur le thème : « Livre et Economie ». Il a ensuite entretenu les participants sur la discipline de l’Actuariat et sur des notions propres au métier de l’assurance méconnues du grand public.</p>\r\n\ntexte_article_en=><p>During the 10th edition of the International Book Fair of Abidjan (SILA), SUNU Assurances companies of Cote d’Ivoire met writers and book lovers from 16 to 20 May 2018 at the Palace of Culture (Palais de la culture) located in Treichville. At this meeting of the Book industry, which saw many award-winning writers, Mr. Saliou BAKAYOKO, CEO of SUNU Assurances Vie CI led a panel on the topic: \"Book and Economy\". He then spoke to the participants about the discipline of Actuarial Science and about notions of the insurance profession that are not well known to the general public.</p>\r\n\nlecture_article=>0\nfichier_article=>sila_abj.jpg\ndateCreated_article=>2018-05-16 17:48:11\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>23\ntitre_article=>CÔTE D\'IVOIRE : UN PAS DE PLUS À LA 10 ÈME ÉDITION DU SILA AVEC SUNU ASSURANCES\ntitre_article_en=>COTE D’IVOIRE: AN EXTRA STEP DURING THE 10TH EDITION OF SILA WITH SUNU ASSURANCES\ntexte_article=><p>Pour la 10ème édition du Salon International du Livre d’Abidjan (SILA), les sociétés SUNU Assurances de Côte d’Ivoire ont donné rendez-vous aux écrivains et amoureux du livre du 16 au 20 Mai 2018 au palais de la culture de Treichville. A cette rencontre de l’industrie du livre qui a vu bon nombre d’écrivains primés, M. Saliou BAKAYOKO, DG de SUNU Assurances Vie CI a animé un panel sur le thème : « Livre et Economie ». Il a ensuite entretenu les participants sur la discipline de l’Actuariat et sur des notions propres au métier de l’assurance méconnues du grand public.</p>\r\n\ntexte_article_en=><p>During the 10th edition of the International Book Fair of Abidjan (SILA), SUNU Assurances companies of Cote d’Ivoire met writers and book lovers from 16 to 20 May 2018 at the Palace of Culture (Palais de la culture) located in Treichville. At this meeting of the Book industry, which saw many award-winning writers, Mr. Saliou BAKAYOKO, CEO of SUNU Assurances Vie CI led a panel on the topic \"Book and Economy\". He then spoke to the participants about the discipline of Actuarial Science and about notions of the insurance profession that are not well known to the general public.</p>\r\n\nlecture_article=>0\nfichier_article=>sila_abj.jpg\ndateCreated_article=>2018-05-16 12:42:33\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1015,2147204895,'2018-08-02 10:47:40','article','update|all|7|id_article=>7\ntitre_article=>SUNU ASSURANCES AU SOMMET DU CHOISEUL AFRICA SUMMIT\ntitre_article_en=>SUNU ASSURANCES AT THE CHOISEUL AFRICA SUMMIT\ntexte_article=><p>Le 4 et 5 mai 2018, une délégation de SUNU Assurances était au sommet CHOISEUL SUMMIT AFRICA qui s’est tenu à Abidjan. Une rencontre de jeunes leaders qui a drainé des managers venus de pays d’Afrique et de l’Europe pour faciliter les échanges et partager leurs expériences. La première journée a été marquée par une rencontre avec les autorités gouvernementales en particulier avec son Excellence M. Daniel Kablan DUNCAN, Premier Vice-Président de la République de Côte d’Ivoire. Plus tard, M. Mohamed BAH, Directeur Général Délégué du Groupe SUNU a pris part à un panel où il a fait un bref résumé de la « success story » de SUNU Assurances qui reste un modèle de réussite africaine. Les rencontres se sont ainsi poursuivies au lendemain pour prendre fin avec un diner gala.</p>\r\n\ntexte_article_en=><p>On May 4th and 5th, 2018, a delegation of SUNU Assurances was at the CHOISEUL AFRICA SUMMIT held in Abidjan. A meeting of young leaders that attracted managers from African and European countries in order to facilitate exchanges and experience sharing. The first day was marked by a meeting with the government authorities in particular with his Excellency Mr. Daniel Kablan DUNCAN, First Vice-President of the Republic of Côte d&#39;Ivoire. Later, Mr. Mohamed BAH, Deputy Managing Director of SUNU Group took part in a panel where he made a brief summary of the \"success story\" of SUNU Assurances which remains a model of African success. The meetings continued the next day and ended with a gala dinner.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_choiseul.jpg\ndateCreated_article=>2018-05-04 17:49:57\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>7\ntitre_article=>SUNU ASSURANCES AU SOMMET DU CHOISEUL AFRICA SUMMIT\ntitre_article_en=>SUNU ASSURANCES AT THE CHOISEUL AFRICA SUMMIT\ntexte_article=><p>Le 4 et 5 mai 2018, une délégation de SUNU Assurances était au sommet CHOISEUL SUMMIT AFRICA qui s’est tenu à Abidjan. Une rencontre de jeunes leaders qui a drainé des managers venus de pays d’Afrique et de l’Europe pour faciliter les échanges et partager leurs expériences. La première journée a été marquée par une rencontre avec les autorités gouvernementales en particulier avec son Excellence M. Daniel Kablan DUNCAN, Premier Vice-Président de la République de Côte d’Ivoire. Plus tard, M. Mohamed BAH, Directeur Général Délégué du Groupe SUNU a pris part à un panel où il a fait un bref résumé de la « success story » de SUNU Assurances qui reste un modèle de réussite africaine. Les rencontres se sont ainsi poursuivies au lendemain pour prendre fin avec un diner gala.</p>\r\n\ntexte_article_en=><p>On 4 and 5 May 2018, a delegation of SUNU Assurances was at the CHOISEUL AFRICA SUMMIT held in Abidjan. A meeting of young leaders that attracted managers from African and European countries in order to facilitate exchanges and experience sharing. The first day was marked by a meeting with the government authorities in particular with his Excellency Mr. Daniel Kablan DUNCAN, First Vice-President of the Republic of Côte d&#39;Ivoire. Later, Mr. Mohamed BAH, Deputy Managing Director of SUNU Group took part in a panel where he made a brief summary of the \"success story\" of SUNU Assurances which remains a model of African success. The meetings continued the next day and ended with a gala dinner.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_choiseul.jpg\ndateCreated_article=>2018-05-04 12:47:40\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1016,2147204895,'2018-08-02 10:59:12','article','update|all|5|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntitre_article_en=>TOGO: SUNU ASSURANCES COMPANIES VISITED SURVEYORS\ntexte_article=><p>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé. Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n\ntexte_article_en=><p>In order to forge strong relationships with their partners, SUNU Assurances companies of Togo accompanied the meeting of Togolese surveyors held from the 7th to the 9th of March at Sarakawa Hotel in Lomé. Known as \"The French-speaking Universities of Surveyors\", this meeting was intended to enable exchanges between Togolese surveyors and their colleagues from other French-speaking countries. The discussions mainly focused on the profession and the role of surveyors in sustainable development. This event was an appropriate occasion for SUNU Group’s Life and General Insurance subsidiaries of Togo to present their best insurance offers.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-09 17:52:58\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>5\ntitre_article=>TOGO : LES SOCIÉTÉS SUNU ASSURANCES CHEZ LES GÉOMÈTRES\ntitre_article_en=>TOGO: SUNU ASSURANCES COMPANIES VISITED SURVEYORS\ntexte_article=><p>Dans le but de tisser des relations fortes avec leurs partenaires, les sociétés SUNU Assurances du Togo ont accompagné la rencontre des géomètres du Togo qui s’est tenue du 7 au 9 mars à l’hôtel Sarakawa de Lomé. Dénommée « Les Universités Francophones des Géomètres », cette rencontre avait pour objectif de permettre des échanges entre les géomètres togolais et leurs confrères venus d’autres pays francophones, principalement sur le métier et leur rôle pour un développement durable. Un espace approprié pour les filiales Vie et IARD du Togo qui ont saisi l’occasion pour présenter leurs meilleures offres d’assurances.</p>\r\n\ntexte_article_en=><p>In order to forge strong relationships with their partners, SUNU Assurances companies of Togo accompanied the meeting of Togolese surveyors held from the 7th to the 9th of March at Sarakawa Hotel in Lomé. Known as \"The French-speaking Universities of Surveyors\", this meeting was intended to enable exchanges between Togolese surveyors and their counterparts from other French-speaking countries. The discussions mainly focused on the profession and the role of surveyors in sustainable development. This event was an appropriate occasion for SUNU Group’s Life and General Insurance subsidiaries of Togo to present their best insurance offers.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481525351428.jpg\ndateCreated_article=>2018-03-09 12:59:12\ndateDisabled_article=>\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1017,2147204895,'2018-08-02 11:01:56','article','update|all|8|id_article=>8\ntitre_article=>BURKINA FASO : 12ÈME TIRAGE DE LAFIA AVEC SUNU ASSURANCES VIE BURKINA FASO ET ORABANK\ntitre_article_en=>BURKINA FASO: 12TH PRIZE DRAW OF “LAFIA” WITH SUNU ASSURANCES VIE BURKINA FASO and ORABANK\ntexte_article=><p>Pour Le 12ème tirage du produit d’épargne « LAFIA», SUNU Assurances Vie Burkina Faso et ORABANK ont donné rendez-vous à leurs clients le jeudi 15 mars 2018. Une rencontre qui a fait d’heureux gagnants avec au total 24 numéros tirés. Occasion propice pour les représentants de SUNU Assurances Vie Burkina Faso d’expliquer le fonctionnement du produit qui offre chaque trimestre aux titulaires de comptes ORABANK la possibilité d’être millionnaire.</p>\r\n\ntexte_article_en=><p>For the 12th prize draw of the savings product \"LAFIA\", SUNU Assurances Vie Burkina Faso and ORABANK have met with their clients on Thursday, March 15, 2018. This meeting has made some happy winners with a total of 24 numbers drawn for the prize. This has been a good opportunity for representatives of SUNU Assurances Vie Burkina Faso to explain how the product works. “LAFIA” is a product that offers every quarter to ORABANK account holders the chance to become millionaire.</p>\r\n\nlecture_article=>0\nfichier_article=>lafia1.jpg\ndateCreated_article=>2018-03-15 17:52:14\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>8\ntitre_article=>BURKINA FASO : 12ÈME TIRAGE DE LAFIA AVEC SUNU ASSURANCES VIE BURKINA FASO ET ORABANK\ntitre_article_en=>BURKINA FASO: THE 12TH PRIZE DRAW OF “LAFIA” WITH SUNU ASSURANCES VIE BURKINA FASO and ORABANK\ntexte_article=><p>Pour Le 12ème tirage du produit d’épargne « LAFIA», SUNU Assurances Vie Burkina Faso et ORABANK ont donné rendez-vous à leurs clients le jeudi 15 mars 2018. Une rencontre qui a fait d’heureux gagnants avec au total 24 numéros tirés. Occasion propice pour les représentants de SUNU Assurances Vie Burkina Faso d’expliquer le fonctionnement du produit qui offre chaque trimestre aux titulaires de comptes ORABANK la possibilité d’être millionnaire.</p>\r\n\ntexte_article_en=><p>For the 12th prize draw of the savings product \"LAFIA\", SUNU Assurances Vie Burkina Faso and ORABANK have met with their clients on Thursday, March 15, 2018. This meeting has made some happy winners with a total of 24 numbers drawn for the prize. This has been a good opportunity for representatives of SUNU Assurances Vie Burkina Faso to explain how the product works. “LAFIA” is a product that offers every quarter to ORABANK account holders the chance to become millionaire.</p>\r\n\nlecture_article=>0\nfichier_article=>lafia1.jpg\ndateCreated_article=>2018-03-15 13:01:56\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1018,2147204895,'2018-08-02 11:04:14','article','update|all|9|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntitre_article_en=>SUNU ASSURANCES VIE COTE D’IVOIRE ATTENDED DELOITTE MEETINGS\ntexte_article=><p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018,dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY, Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n\ntexte_article_en=><p>SUNU Assurances Vie Benin received two awards for participating in the decoration of the city of Cotonou. It was on Thursday, February 15, 2018, in the premises of the subsidiary that the managers of the communications company Effet Media, initiator of the project, presented to Mr. Lassina COULIBALY, Managing Director of SUNU Assurances Vie Benin, the Certificate of Recognition for its participation in the illumination of the city and the \"Prize Lumière\" for the best decoration 2017. Note that this distinction was granted after a popular vote and the deliberation of a jury of experts composed of professionals of decoration. Congratulations to SUNU Assurances Vie Benin, leader of Life insurance in the country.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-03-06 17:53:31\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>9\ntitre_article=>SUNU ASSURANCES VIE CI AUX RENCONTRES DU CABINET DELOITTE\ntitre_article_en=>SUNU ASSURANCES VIE COTE D’IVOIRE ATTENDED DELOITTE MEETINGS\ntexte_article=><p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018,dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY, Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n\ntexte_article_en=><p>SUNU Assurances Vie Benin received two awards for participating in the decoration of the city of Cotonou. It was on Thursday, February 15, 2018, in the premises of the subsidiary that the managers of the communication company Effet Media, initiator of the project, presented to Mr. Lassina COULIBALY, Managing Director of SUNU Assurances Vie Benin, the Certificate of Recognition for its participation in the illumination of the city and the \"Prix Lumière\" for the best decoration 2017. Note that this distinction was granted after a popular vote and the deliberation of a jury of experts composed of professionals of decoration. Congratulations to SUNU Assurances Vie Benin, leader of Life insurance in the country.</p>\r\n\nlecture_article=>0\nfichier_article=>sunu_deloitte.jpg\ndateCreated_article=>2018-03-06 13:04:14\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1019,2147204895,'2018-08-02 11:06:12','article','update|all|10|id_article=>10\ntitre_article=>SUNU ASSURANCES VIE BÉNIN HONORÉE\ntitre_article_en=>SUNU ASSURANCES VIE BENIN HONOURED\ntexte_article=><p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018, dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY </p>\r\n\r\n<p>Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n\ntexte_article_en=><p>SUNU Assurances Vie Benin received two awards for participating in the decoration of the city of Cotonou. It was on Thursday, February 15, 2018, in the premises of the subsidiary that the managers of the communications company Effet Media, initiator of the project, presented to Mr. Lassina COULIBALY, Managing Director of SUNU Assurances Vie Benin, the Certificate of Recognition for its participation in the illumination of the city and the \"Prize Lumière\" for the best decoration 2017. Note that this distinction was granted after a popular vote and the deliberation of a jury of experts composed of professionals of decoration. Congratulations to SUNU Assurances Vie Benin, leader of Life insurance in the country.</p>\r\n\nlecture_article=>0\nfichier_article=>prix_bnin.jpg\ndateCreated_article=>2018-02-15 17:55:40\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>10\ntitre_article=>SUNU ASSURANCES VIE BÉNIN HONORÉE\ntitre_article_en=>SUNU ASSURANCES VIE BENIN HONOURED\ntexte_article=><p>Pour avoir participé à la décoration de la ville de Cotonou, SUNU Assurances Vie Bénin s’est vue remettre deux distinctions. C’était le  jeudi 15 Février 2018, dans les locaux de la filiale où les responsables de l’entreprise de communication Effet Media, initiatrice du projet ont remis à M. Lassina COULIBALY </p>\r\n\r\n<p>Directeur Général de SUNU Assurances Vie Bénin, le Certificat de Reconnaissance pour sa participation à l’illumination de la ville et le « Prix Lumière » de la meilleure décoration 2017. Notons que cette distinction fait suite à un vote soumis aux populations puis à un Jury d’experts composé de professionnels de la décoration. Bravo à SUNU Assurances Vie Bénin, leader de l’assurance Vie dans le pays.</p>\r\n\ntexte_article_en=><p>SUNU Assurances Vie Benin received two awards for participating in the decoration of the city of Cotonou. It was on Thursday, February 15, 2018, in the premises of the subsidiary that the managers of the communication company Effet Media, initiator of the project, presented to Mr. Lassina COULIBALY, Managing Director of SUNU Assurances Vie Benin, the Certificate of Recognition for its participation in the illumination of the city and the \"Prix Lumière\" for the best decoration 2017. Note that this distinction was granted after a popular vote and the deliberation of a jury of experts composed of professionals of decoration. Congratulations to SUNU Assurances Vie Benin, leader of Life insurance in the country.</p>\r\n\nlecture_article=>0\nfichier_article=>prix_bnin.jpg\ndateCreated_article=>2018-02-15 13:06:12\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1020,2147204895,'2018-08-02 11:07:23','article','update|all|11|id_article=>11\ntitre_article=>SUNU ASSURANCES VIE BURKINA FASO PROCÈDE AU 13ÈME TIRAGE AU SORT DU PRODUIT \"ATLANTIQUE FORTUNE\"\ntitre_article_en=>SUNU ASSURANCES VIE BURKINA FASO HOLD THE 13TH DRAW FOR “ATLANTIQUE FORTUNE”\ntexte_article=><p>SUNU Assurances Vie Burkina Faso et son partenaire Banque Atlantique ont effectué le 13ème  tirage du produit « Atlantique Fortune » le jeudi 15 février. En présence des responsables des deux entités et de quelques clients, le tirage a permis de récompenser 24 numéros de police. « Atlantique Fortune » est ouvert aux titulaires d’un compte à la Banque Atlantique et permet au souscripteur de se constituer une épargne à partir de 5 500 F CFA et d’avoir la possibilité d’être tiré au sort chaque trimestre pour gagner jusqu’à 6 000 000 F CFA.</p>\r\n\ntexte_article_en=><p>SUNU Assurances Vie Burkina Faso and its partner Banque Atlantique have made the 13th draw of the « Atlantique Fortune » product on Thursday, February 15th. In the presence of officials from both entities and some customers, the draw rewarded 24 police holders. \"Atlantique Fortune\" is open to holders of an account at Banque Atlantique and enables the subscriber to build up a saving from 5500 FCFA and to have the quarterly opportunity to win up to 6,000,000 FCFA.</p>\r\n\nlecture_article=>0\nfichier_article=>tirag_atF_bf.jpg\ndateCreated_article=>2018-02-15 17:54:02\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>11\ntitre_article=>SUNU ASSURANCES VIE BURKINA FASO PROCÈDE AU 13ÈME TIRAGE AU SORT DU PRODUIT \ntitre_article_en=>SUNU ASSURANCES VIE BURKINA FASO HOLD THE 13TH DRAW FOR “ATLANTIQUE FORTUNE”\ntexte_article=><p>SUNU Assurances Vie Burkina Faso et son partenaire Banque Atlantique ont effectué le 13ème  tirage du produit « Atlantique Fortune » le jeudi 15 février. En présence des responsables des deux entités et de quelques clients, le tirage a permis de récompenser 24 numéros de police. « Atlantique Fortune » est ouvert aux titulaires d’un compte à la Banque Atlantique et permet au souscripteur de se constituer une épargne à partir de 5 500 F CFA et d’avoir la possibilité d’être tiré au sort chaque trimestre pour gagner jusqu’à 6 000 000 F CFA.</p>\r\n\ntexte_article_en=><p>SUNU Assurances Vie Burkina Faso and its partner Banque Atlantique have made the 13th draw of the « Atlantique Fortune » product on Thursday, February 15. In the presence of officials from both entities and some customers, the draw rewarded 24 police holders. \"Atlantique Fortune\" is open to holders of an account at Banque Atlantique and enables the subscriber to build up a saving from 5500 FCFA and to have the quarterly opportunity to win up to 6,000,000 FCFA.</p>\r\n\nlecture_article=>0\nfichier_article=>tirag_atF_bf.jpg\ndateCreated_article=>2018-02-15 13:07:23\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1021,2147204895,'2018-08-02 11:26:54','_SESSION','login|all|1533209214|0|__ci_last_regenerate=>1533209214\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-08-02 12:34:51::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1022,2147204895,'2018-08-02 11:27:51','article','update|all|12|id_article=>12\ntitre_article=>LE GROUPE SUNU À KIGALI POUR LA 42ÈME RENCONTRE ANNUELLE DE LA FANAF\ntitre_article_en=>SUNU GROUP IN KIGALI FOR THE 42nd ANNUAL MEETING OF FANAF \ntexte_article=><p>Pour leur 42ème rencontre annuelle, les responsables du secteur de l’assurance des pays africains sont réunis depuis ce lundi 12 février 2018 à Kigali (Rwanda) pour l’assemblée générale annuelle de la FANAF. Les dirigeants du Groupe SUNU ainsi que les acteurs de l’assurance auront jusqu’au 15 février 2018 pour échanger sur le thème : « L’assurance Africaine à l’épreuve de la disruption ». 4 jours de réflexions marqués par des panels et conférences pour trouver des solutions plus adaptées pour le bon fonctionnement de l’assurance en Afrique et pour le bien-être des populations.</p>\r\n\ntexte_article_en=><p>The managers of the insurance sector of African countries are in session since Monday, February 12, 2018, in Kigali (Rwanda) for the 42<sup>nd</sup> annual general meeting of FANAF. The leaders of SUNU Group as well as the actors of insurance have until February 15, 2018 to debate on the topic: \"African insurance sector facing disruption\". These four days of reflections, marked by panels and conferences, are intended to find more suitable solutions for the good functioning of insurance in Africa and for the well-being of the populations.</p>\r\n\nlecture_article=>0\nfichier_article=>fanaf.jpg\ndateCreated_article=>2018-02-12 18:00:02\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>12\ntitre_article=>LE GROUPE SUNU À KIGALI POUR LA 42ÈME RENCONTRE ANNUELLE DE LA FANAF\ntitre_article_en=>SUNU GROUP IN KIGALI FOR THE 42nd ANNUAL MEETING OF FANAF \ntexte_article=><p>Pour leur 42ème rencontre annuelle, les responsables du secteur de l’assurance des pays africains sont réunis depuis ce lundi 12 février 2018 à Kigali (Rwanda) pour l’assemblée générale annuelle de la FANAF. Les dirigeants du Groupe SUNU ainsi que les acteurs de l’assurance auront jusqu’au 15 février 2018 pour échanger sur le thème : « L’assurance Africaine à l’épreuve de la disruption ». 4 jours de réflexions marqués par des panels et conférences pour trouver des solutions plus adaptées pour le bon fonctionnement de l’assurance en Afrique et pour le bien-être des populations.</p>\r\n\ntexte_article_en=><p>The managers of the insurance sector of African countries are in session since Monday, February 12, 2018, in Kigali (Rwanda) for the 42<sup>nd</sup> annual general meeting of FANAF. The leaders of SUNU Group as well as the actors of insurance have until 15 February 2018 to debate on the topic \"African insurance sector facing disruption\". These four days of reflections, marked by panels and conferences, are intended to find more suitable solutions for the good functioning of insurance in Africa and for the well-being of the populations.</p>\r\n\nlecture_article=>0\nfichier_article=>fanaf.jpg\ndateCreated_article=>2018-02-12 13:27:51\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1023,2147204895,'2018-08-02 11:30:23','article','update|all|13|id_article=>13\ntitre_article=>3ÈME ÉDITION DU TOURNOI DE GOLF SUNU ASSURANCES AU BURKINA FASO\ntitre_article_en=>3rd EDITION OF THE GOLF TOURNAMENT OF SUNU ASSURANCES IN BURKINA FASO\ntexte_article=><p>Pour la 3ème  édition du tournoi de Golf SUNU Assurances du Burkina Faso, amateurs et professionnels de Golf se sont réunis les 10 et 11 Février 2018 sur l’aire de jeux du Golf Club de Ouagadougou. Sponsorisé depuis 3 ans par les sociétés SUNU Assurances du Burkina Faso, la mobilisation était de taille cette année et a permis de resserrer les liens avec les différents partenaires présents. Deux jours de compétitions qui ont permis de déceler de nouveaux talents et de récompenser les meilleurs joueurs parmi lesquels, M. Jean François KAMBOU, Directeur Général de SUNU Assurances Vie Burkina Faso.</p>\r\n\ntexte_article_en=><p>For the 3rd edition of SUNU Assurances golf tournament of Burkina Faso, golf amateurs and professionals met on 10<sup>th</sup> and 11<sup>th</sup> February 2018 on the playground of the Golf Club of Ouagadougou. For 3 years, SUNU Assurances companies of Burkina Faso have been sponsoring the tournament. This year, the mobilisation was strong and permitted to strengthen the relations with the participating partners. Two days of competitions have allowed to detect new talents and to reward the best players among which, Mr. Jean François KAMBOU, Managing Director of SUNU Assurances Vie Burkina Faso.</p>\r\n\nlecture_article=>0\nfichier_article=>golf_bf.jpg\ndateCreated_article=>2018-02-10 18:02:31\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>13\ntitre_article=>3ÈME ÉDITION DU TOURNOI DE GOLF SUNU ASSURANCES AU BURKINA FASO\ntitre_article_en=>3rd EDITION OF THE GOLF TOURNAMENT OF SUNU ASSURANCES IN BURKINA FASO\ntexte_article=><p>Pour la 3ème  édition du tournoi de Golf SUNU Assurances du Burkina Faso, amateurs et professionnels de Golf se sont réunis les 10 et 11 Février 2018 sur l’aire de jeux du Golf Club de Ouagadougou. Sponsorisé depuis 3 ans par les sociétés SUNU Assurances du Burkina Faso, la mobilisation était de taille cette année et a permis de resserrer les liens avec les différents partenaires présents. Deux jours de compétitions qui ont permis de déceler de nouveaux talents et de récompenser les meilleurs joueurs parmi lesquels, M. Jean François KAMBOU, Directeur Général de SUNU Assurances Vie Burkina Faso.</p>\r\n\ntexte_article_en=><p>For the 3rd edition of SUNU Assurances golf tournament of Burkina Faso, golf amateurs and professionals met on 10 and 11 February 2018 on the playground of the Golf Club of Ouagadougou. For 3 years, SUNU Assurances companies of Burkina Faso have been sponsoring the tournament. This year, the mobilisation was strong and permitted to strengthen the relations with the participating partners. Two days of competitions have allowed to detect new talents and to reward the best players among which, Mr. Jean François KAMBOU, Managing Director of SUNU Assurances Vie Burkina Faso.</p>\r\n\nlecture_article=>0\nfichier_article=>golf_bf.jpg\ndateCreated_article=>2018-02-10 13:30:23\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1024,2147204895,'2018-08-02 11:35:25','article','update|all|14|id_article=>14\ntitre_article=>LES SOCIÉTÉS SUNU ASSURANCES DU GABON AU SALON DE LA JOURNÉE ECONOMIQUE 2018\ntitre_article_en=>THE COMPANIES SUNU ASSURANCES OF GABON WERE AT THE ECONOMIC DAY FAIR\ntexte_article=><p>Au Gabon, les sociétés SUNU Assurances ont pris part au salon de la journée économique organisée chaque année par le Ministère gabonais de l’économie. Le salon s’est déroulé toute la journée du 7 février 2018 à l’auditorium de l’immeuble Arambo de Libreville.</p>\r\n\r\n<p>Cette année, une attention particulière a été accordée au secteur de l’assurance et avait pour thème : « Restaurer la confiance ». Après les panels, place à la visite des stands où les Ministres de l’économie, du travail et des PME de passage à l’espace SUNU Assurances ont bénéficié de la présentation des filiales du Gabon et des offres qu’elles proposent.</p>\r\n\ntexte_article_en=><p>In Gabon, SUNU Assurances companies took part in the Economic Day Fair organised every year by the Gabonese Ministry of Economy. The show was held throughout the day of 7 February 2018 at the auditorium of Arambo building in Libreville.</p>\r\n\r\n<p>This year, special attention was given to the insurance sector and the event dealt with the topic “Restoring trust”. After the panels, the Ministers of Economy, Labor and SMEs visited the stand of SUNU Assurances where they were presented the Gabonese subsidiaries and the services they offer.</p>\r\n\nlecture_article=>0\nfichier_article=>JE_cam.jpg\ndateCreated_article=>2018-02-07 18:03:42\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>14\ntitre_article=>LES SOCIÉTÉS SUNU ASSURANCES DU GABON AU SALON DE LA JOURNÉE ECONOMIQUE 2018\ntitre_article_en=>THE COMPANIES SUNU ASSURANCES OF GABON WERE AT THE ECONOMIC DAY FAIR\ntexte_article=><p>Au Gabon, les sociétés SUNU Assurances ont pris part au salon de la journée économique organisée chaque année par le Ministère gabonais de l’économie. Le salon s’est déroulé toute la journée du 7 février 2018 à l’auditorium de l’immeuble Arambo de Libreville.</p>\r\n\r\n<p>Cette année, une attention particulière a été accordée au secteur de l’assurance et avait pour thème : « Restaurer la confiance ». Après les panels, place à la visite des stands où les Ministres de l’économie, du travail et des PME de passage à l’espace SUNU Assurances ont bénéficié de la présentation des filiales du Gabon et des offres qu’elles proposent.</p>\r\n\ntexte_article_en=><p>In Gabon, SUNU Assurances companies took part in the Economic Day Fair organised every year by the Gabonese Ministry of Economy. The show was held throughout the day on 7 February 2018 at the auditorium of Arambo building in Libreville.</p>\r\n\r\n<p>This year, special attention was given to the insurance sector and the event dealt with the topic “Restoring trust”. After the panels, the Ministers of Economy, Labor and SMEs visited the stand of SUNU Assurances where they were presented the Gabonese subsidiaries and the services they offer.</p>\r\n\nlecture_article=>0\nfichier_article=>JE_cam.jpg\ndateCreated_article=>2018-02-07 13:35:25\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1025,2147204895,'2018-08-02 11:37:21','article','update|all|15|id_article=>15\ntitre_article=>LES HOMMES DE SUNU ASSURANCES VIE CI À LEUR TRADITIONNEL KICK OFF\ntitre_article_en=>THE STAFF OF SUNU ASSURANCE VIE COTE D’IVOIRE HELD THEIR TRADITIONAL KICK-OFF \ntexte_article=><p>Chaque année, les Hommes de SUNU Assurances Vie CI organisent leur traditionnel kick off. Au cours de la dernière rencontre qui s’est tenue le samedi 27 janvier 2018, le Directeur Général, M. Saliou BAKAYOKO a fait le bilan des activités 2017 et présenté le plan stratégique avec des travaux de réflexions et des ateliers sur différents thèmes.</p>\r\n\r\n<p>Puis dans une chaleureuse ambiance, les équipes motivées et optimistes pour l&#39;atteinte des objectifs, ont partagé un repas convivial et participé à des jeux.</p>\r\n\ntexte_article_en=><p>Every year, the employees of SUNU Assurances Vie COTE D’IVOIRE organise their traditional kick off. During the last meeting held on Saturday 27 January 2018, the Managing Director, Mr. Saliou BAKAYOKO made a review of 2017 activities and presented the new strategic plan. This was accompanied by reflections and workshops on various topics.<br>\r\nAfterwards, in a pleasant atmosphere, the teams which were motivated and optimistic about the achievement of their goals, shared a convivial meal and participated in various games.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481526301679.jpg\ndateCreated_article=>2018-01-27 18:04:56\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>15\ntitre_article=>LES HOMMES DE SUNU ASSURANCES VIE CI À LEUR TRADITIONNEL KICK OFF\ntitre_article_en=>THE STAFF OF SUNU ASSURANCE VIE COTE D’IVOIRE HELD THEIR TRADITIONAL KICK-OFF \ntexte_article=><p>Chaque année, les Hommes de SUNU Assurances Vie CI organisent leur traditionnel kick off. Au cours de la dernière rencontre qui s’est tenue le samedi 27 janvier 2018, le Directeur Général, M. Saliou BAKAYOKO a fait le bilan des activités 2017 et présenté le plan stratégique avec des travaux de réflexions et des ateliers sur différents thèmes.</p>\r\n\r\n<p>Puis dans une chaleureuse ambiance, les équipes motivées et optimistes pour l&#39;atteinte des objectifs, ont partagé un repas convivial et participé à des jeux.</p>\r\n\ntexte_article_en=><p>Every year, the employees of SUNU Assurances Vie COTE D’IVOIRE organise their traditional kick off. During the last meeting held on Saturday, January 27, 2018, the Managing Director, Mr. Saliou BAKAYOKO made a review of 2017 activities and presented the new strategic plan. This was accompanied by reflections and workshops on various topics.<br>\r\nAfterwards, in a pleasant atmosphere, the teams which were motivated and optimistic about the achievement of their goals, shared a convivial meal and participated in various games.</p>\r\n\nlecture_article=>0\nfichier_article=>21474848481526301679.jpg\ndateCreated_article=>2018-01-27 13:37:21\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1026,2147204895,'2018-08-02 11:49:14','article','update|all|19|id_article=>19\ntitre_article=>POSE DE LA PREMIÈRE PIERRE DU NOUVEAU SIÈGE SUNU ASSURANCES AU BURKINA FASO\ntitre_article_en=>LAYING OF THE FIRST FOUNDATION STONE OF SUNU ASSURANCES BURKINA FASO NEW HEAD OFFICE\ntexte_article=><p>Bientôt un nouveau siège pour SUNU Assurances dans la capitale Burkinabé. Cette information a été rendue officielle le jeudi 4 janvier 2018 lors de la cérémonie de pose de la première pierre qui marque le début des travaux de construction du bâtiment.</p>\r\n\r\n<p>M. Seydou DIAKITE, PCA des sociétés SUNU Assurances du Burkina Faso était accompagné par Messieurs Osée G. QUENUM et François KAMBOU, DG respectifs de SUNU Assurances IARD Burkina Faso et SUNU Assurances Vie Burkina Faso pour le déroulement de cette cérémonie.</p>\r\n\ntexte_article_en=><p>Soon, SUNU Assurances will have a new head office in the capital of Burkina Faso. This information was officially released on Thursday, 4<sup>th</sup> of January 2018 during the ceremony of the laying of the foundation stone which marks the beginning of the construction of the building.</p>\r\n\r\n<p>At this ceremony, Mr. Seydou DIAKITE, Chairman of SUNU Assurances of Burkina Faso was accompanied by Messrs. Osée G. QUENUM and François KAMBOU, respectively Managing Directors of SUNU Assurances IARD Burkina Faso and SUNU Assurances Vie Burkina Faso.</p>\r\n\nlecture_article=>0\nfichier_article=>bf_new_sige.jpg\ndateCreated_article=>2018-01-04 18:08:35\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>19\ntitre_article=>POSE DE LA PREMIÈRE PIERRE DU NOUVEAU SIÈGE SUNU ASSURANCES AU BURKINA FASO\ntitre_article_en=>LAYING OF THE FIRST FOUNDATION STONE OF SUNU ASSURANCES BURKINA FASO NEW HEAD OFFICE\ntexte_article=><p>Bientôt un nouveau siège pour SUNU Assurances dans la capitale Burkinabé. Cette information a été rendue officielle le jeudi 4 janvier 2018 lors de la cérémonie de pose de la première pierre qui marque le début des travaux de construction du bâtiment.</p>\r\n\r\n<p>M. Seydou DIAKITE, PCA des sociétés SUNU Assurances du Burkina Faso était accompagné par Messieurs Osée G. QUENUM et François KAMBOU, DG respectifs de SUNU Assurances IARD Burkina Faso et SUNU Assurances Vie Burkina Faso pour le déroulement de cette cérémonie.</p>\r\n\ntexte_article_en=><p>Soon, SUNU Assurances will have a new head office in the capital of Burkina Faso. This information was officially released on Thursday, January 4, 2018 during the ceremony of the laying of the foundation stone which marks the beginning of the construction of the building.</p>\r\n\r\n<p>At this ceremony, Mr. Seydou DIAKITE, Chairman of SUNU Assurances of Burkina Faso was accompanied by Messrs. Osée G. QUENUM and François KAMBOU, respectively Managing Directors of SUNU Assurances IARD Burkina Faso and SUNU Assurances Vie Burkina Faso.</p>\r\n\nlecture_article=>0\nfichier_article=>bf_new_sige.jpg\ndateCreated_article=>2018-01-04 13:49:14\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1027,2147204895,'2018-08-02 11:51:03','article','update|all|21|id_article=>21\ntitre_article=>SUNU ASSURANCES SPONSOR DE LA 39ÈME ÉDITION DU SABRE NATIONAL DU NIGER\ntitre_article_en=>SUNU ASSURANCES, SPONSOR OF THE 39TH EDITION OF “SABRE NATIONAL DU NIGER\ntexte_article=><p>Pendant 10 jours, les sociétés SUNU Assurances du Niger étaient à Zinder, à 900 Km de Niamey pour la 39ème édition du sabre national du Niger. Les compétitions à fortes valeurs culturelles et traditionnelles ont débuté le 25 décembre 2017 et ont marqué leur apothéose le mercredi 3 janvier 2018. SUNU Assurances était présente pour échanger, sensibiliser et proposer ses offres aux populations venues des quatre coins du pays.</p>\r\n\ntexte_article_en=><p>For 10 days, SUNU Assurances companies of Niger were in Zinder, 900 km away from Niamey for the 39th edition of “Sabre National du Niger”. The contests with strong cultural and traditional values connotations began on 25 December 2017 and reached their apotheosis on Wednesday, 3<sup>rd</sup> January 2018. SUNU Assurances was present to discuss, raise awareness and promote its offers to people from all over the country.</p>\r\n\nlecture_article=>0\nfichier_article=>zinder_niger.jpg\ndateCreated_article=>2018-01-03 18:21:31\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n|id_article=>21\ntitre_article=>SUNU ASSURANCES SPONSOR DE LA 39ÈME ÉDITION DU SABRE NATIONAL DU NIGER\ntitre_article_en=>SUNU ASSURANCES, SPONSOR OF THE 39TH EDITION OF “SABRE NATIONAL DU NIGER\ntexte_article=><p>Pendant 10 jours, les sociétés SUNU Assurances du Niger étaient à Zinder, à 900 Km de Niamey pour la 39ème édition du sabre national du Niger. Les compétitions à fortes valeurs culturelles et traditionnelles ont débuté le 25 décembre 2017 et ont marqué leur apothéose le mercredi 3 janvier 2018. SUNU Assurances était présente pour échanger, sensibiliser et proposer ses offres aux populations venues des quatre coins du pays.</p>\r\n\ntexte_article_en=><p>For 10 days, SUNU Assurances companies of Niger were in Zinder, 900 km away from Niamey for the 39th edition of “Sabre National du Niger”. The contests with strong cultural and traditional values connotations began on 25 December 2017 and reached their apotheosis on Wednesday, January 3, 2018. SUNU Assurances was there to discuss, raise awareness and promote its offers to people from all over the country.</p>\r\n\nlecture_article=>0\nfichier_article=>zinder_niger.jpg\ndateCreated_article=>2018-01-03 13:51:03\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_article=>1\n'),(1028,2147204895,'2018-08-02 12:02:02','historique','update|all|14|id_historique=>14\nannee_historique=>2012\nmois_historique=>0\ntexte_historique=><p>Démarrage des activités de SUNU Assurances IARD Mali (ex UA-IARD Mali) et de SUNU Assurances Guinée (ex UA-IARD Guinée).</p>\r\n\ntexte_historique_en=><p>Launch of SUNU Assurances IARD Mali (ex UA-IARD Mali) and SUNU Assurances Guinea (ex UA-IARD Guinée).</p>\r\n\ndateCreated_historique=>2018-06-03 13:24:13\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>14\nannee_historique=>2012\nmois_historique=>0\ntexte_historique=><p>Démarrage des activités de SUNU Assurances IARD Mali (ex UA-IARD Mali) et de SUNU Assurances Guinée (ex UA-IARD Guinée).</p>\r\n\ntexte_historique_en=><p>Launch of SUNU Assurances IARD Mali (ex UA-IARD Mali) and SUNU Assurances Guinée (ex UA-IARD Guinée).</p>\r\n\ndateCreated_historique=>2018-06-03 13:24:13\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(1029,2147204895,'2018-08-02 12:03:38','historique','update|all|11|id_historique=>11\nannee_historique=>2010\nmois_historique=>0\ntexte_historique=><p>Transfert des deux holding SUNU Assurances et SUNU Finances en France. Leurs nouvelles dénominations sociales sont respectivement SUNU Assurances Holding S.A et SUNU Finances Holding S.A.S. Les deux sociétés, qui étaient jusqu’alors des sociétés de droit luxembourgeois, ont changé leur nationalité, respectivement en société anonyme de droit français et en société par actions simplifiée, et transféré leur siège social en France. Cette opération, autorisée par les législations luxembourgeoise et française, s’est opérée, conformément auxdites législations, avec maintien de la personnalité morale desdites sociétés, et a pris effet à la date du 19 août 2010, date de leur immatriculation en France au Registre du Commerce et des Sociétés (« RCS ») du lieu de leur nouveau siège social (RCS de Créteil)</p>\r\n\ntexte_historique_en=><p>SUNU Assurances and SUNU Finances, the two holding companies are transferred to France. Their new corporate names are now respectively SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S. Both companies that were until now incorporated under Luxembourg law, have turned into French law, respectively as a public company and a simplified joint-stock company.<br>\r\nBoth companies moved their head office to France. The operation was allowed by the authorities of France and Luxembourg and took place in accordance with both countries legislations. This process, during which the legal personality of the companies was preserved, came into effect on 19 August 2010 when SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S got registered with the Registry of Companies of Creteil (RCS Creteil) where they are headquartered.</p>\r\n\ndateCreated_historique=>2018-06-03 13:22:25\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>11\nannee_historique=>2010\nmois_historique=>0\ntexte_historique=><p>Transfert des deux holding SUNU Assurances et SUNU Finances en France. Leurs nouvelles dénominations sociales sont respectivement SUNU Assurances Holding S.A et SUNU Finances Holding S.A.S. Les deux sociétés, qui étaient jusqu’alors des sociétés de droit luxembourgeois, ont changé leur nationalité, respectivement en société anonyme de droit français et en société par actions simplifiée, et transféré leur siège social en France. Cette opération, autorisée par les législations luxembourgeoise et française, s’est opérée, conformément auxdites législations, avec maintien de la personnalité morale desdites sociétés, et a pris effet à la date du 19 août 2010, date de leur immatriculation en France au Registre du Commerce et des Sociétés (« RCS ») du lieu de leur nouveau siège social (RCS de Créteil)</p>\r\n\ntexte_historique_en=><p>SUNU Assurances and SUNU Finances, the two holding companies are transferred to France. Their new corporate names are now respectively SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S. Both companies that were until now incorporated under Luxembourg law, have turned into French law, respectively as a public company and a simplified joint-stock company.<br>\r\nBoth companies moved their head offices to France. The operation was allowed by the authorities of France and Luxembourg and took place in accordance with both countries legislations. This process, during which the legal personality of the companies was preserved, came into effect on 19 August 2010 when SUNU Assurances Holding S.A and SUNU Finances Holding S.A.S got registered with the Registry of Companies of Creteil (RCS Creteil) where they are headquartered.</p>\r\n\ndateCreated_historique=>2018-06-03 13:22:25\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(1030,2147204895,'2018-08-02 12:12:51','historique','update|all|3|id_historique=>3\nannee_historique=>1998\nmois_historique=>0\ntexte_historique=><p>Monsieur Pathé DIONE crée avec d’autres partenaires la société SUNU Finances Holding SA, domiciliée à la Banque Bruxelles Lambert Trust (BBL, devenue ING Trust) au Luxembourg et bénéficiant du statut fiscal particulier attaché aux Holding 1929. La société a été créée dans un premier temps par deux structures (LOVETTE Overseas SA et GREBELLE Investments SA) de l’agent domiciliataire (BBL) puis les actions ont été cédées aux actionnaires historiques en septembre 1999. En novembre, la société SUNU Finances signe avec Axa-UAP un protocole d’accord qui l‘autorise à acquérir progressivement les sociétés qu’Axa souhaiterait céder en Afrique.</p>\r\n\ntexte_historique_en=><p>Mr Pathé DIONE and other partners created the company SUNU Finances Holding SA domiciled at Banque Bruxelles Lambert Trust (BBL, now known as ING Trust) in Luxembourg. The company benefits from special tax status and operates under the 1929 holding regime.<br>\r\nFirst the company was created by two firms (LOVETTE Overseas SA et GREBELLE Investments SA) of the domiciliary agent (BBL); then the shares were transferred to the historical shareholders in 1999.<br>\r\nIn November, SUNU Finances and Axa-UAP signed a memorandum of agreement allowing SUNU Finances to gradually acquire the companies in Africa Axa would like to dispose of.</p>\r\n\ndateCreated_historique=>2018-06-03 11:51:40\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>3\nannee_historique=>1998\nmois_historique=>0\ntexte_historique=><p>Monsieur Pathé DIONE crée avec d’autres partenaires la société SUNU Finances Holding SA, domiciliée à la Banque Bruxelles Lambert Trust (BBL, devenue ING Trust) au Luxembourg et bénéficiant du statut fiscal particulier attaché aux Holding 1929. La société a été créée dans un premier temps par deux structures (LOVETTE Overseas SA et GREBELLE Investments SA) de l’agent domiciliataire (BBL) puis les actions ont été cédées aux actionnaires historiques en septembre 1999. En novembre, la société SUNU Finances signe avec AXA-UAP un protocole d’accord qui l‘autorise à acquérir progressivement les sociétés qu’AXA souhaiterait céder en Afrique.</p>\r\n\ntexte_historique_en=><p>Mr Pathé DIONE and other partners created the company SUNU Finances Holding SA domiciled at Banque Bruxelles Lambert Trust (BBL, now known as ING Trust) in Luxembourg. The company benefits from special tax status and operates under the 1929 holding regime.<br>\r\nFirst the company was created by two firms (LOVETTE Overseas SA et GREBELLE Investments SA) of the domiciliary agent (BBL); then the shares were transferred to the historical shareholders in 1999.<br>\r\nIn November, SUNU Finances and AXA-UAP signed a memorandum of agreement allowing SUNU Finances to gradually acquire the companies in Africa AXA would like to dispose of.</p>\r\n\ndateCreated_historique=>2018-06-03 11:51:40\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(1031,2147204895,'2018-08-02 12:16:12','texte','update|all|4|id_texte=>4\nid_type_texte=>3\ncontenu_texte=><p>Présent dans plus de 14 pays d&#39;Afrique subsaharienne et comptant une vingtaine de filiales & sociétés affiliées, le Groupe SUNU est un groupe d&#39;assurances africain créé en 1998 par M. Pathé DIONE avec d&#39;anciens collaborateurs.</p>\r\n\r\n<p>Leader de l&#39;assurance Vie sur toute la zone de la Conférence Interafricaine des Marchés d&#39;Assurances depuis cinq ans, SUNU Assurances a réalisé un chiffre d&#39;affaires de plus de 155 milliards de francs CFA en fin d&#39;exercice 2017 et un résultat net de 6,5 milliards de francs CFA. Le Groupe SUNU gère également 377 milliards de francs CFA d&#39;actifs.</p>\r\n\r\n<p>SUNU Assurances accompagne les populations, les entreprises et les gouvernements dans leur développement et dans la réalisation de leurs projets, suivant ses trois valeurs :</p>\r\n\r\n<ul>\r\n <li>la proximité vis à vis des clients et des Hommes qui font le Groupe</li>\r\n <li>l&#39;innovation dans des offres et des services étudiés</li>\r\n <li>la qualité de service pour une confiance réciproque et pérenne</li>\r\n</ul>\r\n\r\n<p>Aujourd&#39;hui leader en assurance Vie, le Groupe SUNU compte être la référence de l&#39;assurance en Afrique.</p>\r\n\ncontenu_texte_en=><p>Present in 14 countries in West and Central Africa, SUNU Group is an African insurance group created in 1998 by Mr Pathe DIONE  with his former colleagues. SUNU Group comprises about 20 subsidiaries and affiliated companies.</p>\r\n\r\n<p>Leader of Life insurance of <em>the </em>Inter-African Conference on <em>Insurance</em> Markets zone (<em>Conférence Interafricaine des Marchés d&#39;Assurances, CIMA</em>) for more than five years, SUNU Assurances made a turnover of 155 billion francs CFA in 2017 and a net profit of 6.5 billion francs CFA. SUNU Group manages a portfolio of assets of 377 billion francs CFA.</p>\r\n\r\n<p>SUNU Assurances supports populations, companies and governments in their development and in the completion of their projects. All these actions are based on three values:</p>\r\n\r\n<ul>\r\n <li>Proximity with customers and workforce which is the Group’s backbone.</li>\r\n <li>Innovation in ioffers and services.</li>\r\n <li>Quality of service for mutual and continuous trust.</li>\r\n</ul>\r\n\ndateCreated_texte=>2018-07-23 13:35:11\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n|id_texte=>4\nid_type_texte=>3\ncontenu_texte=><p>Présent dans plus de 14 pays d&#39;Afrique subsaharienne et comptant une vingtaine de filiales & sociétés affiliées, le Groupe SUNU est un groupe d&#39;assurances africain créé en 1998 par M. Pathé DIONE avec d&#39;anciens collaborateurs.</p>\r\n\r\n<p>Leader de l&#39;assurance Vie sur toute la zone de la Conférence Interafricaine des Marchés d&#39;Assurances depuis cinq ans, SUNU Assurances a réalisé un chiffre d&#39;affaires de plus de 155 milliards de francs CFA en fin d&#39;exercice 2017 et un résultat net de 6,5 milliards de francs CFA. Le Groupe SUNU gère également 377 milliards de francs CFA d&#39;actifs.</p>\r\n\r\n<p>SUNU Assurances accompagne les populations, les entreprises et les gouvernements dans leur développement et dans la réalisation de leurs projets, suivant ses trois valeurs :</p>\r\n\r\n<ul>\r\n <li>la proximité vis à vis des clients et des Hommes qui font le Groupe</li>\r\n <li>l&#39;innovation dans des offres et des services étudiés</li>\r\n <li>la qualité de service pour une confiance réciproque et pérenne</li>\r\n</ul>\r\n\r\n<p>Aujourd&#39;hui leader en assurance Vie, le Groupe SUNU compte être la référence de l&#39;assurance en Afrique.</p>\r\n\ncontenu_texte_en=><p>Present in 14 countries in West and Central Africa, SUNU Group is an African insurance group created in 1998 by Mr Pathe DIONE  with his former colleagues. SUNU Group comprises about 20 subsidiaries and affiliated companies.</p>\r\n\r\n<p>Leader of Life insurance of <em>the </em>Inter-African Conference on <em>Insurance</em> Markets zone (<em>Conférence Interafricaine des Marchés d&#39;Assurances, CIMA</em>) for more than five years, SUNU Assurances made a turnover of 155 billion francs CFA in 2017 and a net profit of 6.5 billion francs CFA. SUNU Group manages a portfolio of assets of 377 billion francs CFA.</p>\r\n\r\n<p>SUNU Assurances supports populations, companies and governments in their development and in the completion of their projects. All these actions are based on three values:</p>\r\n\r\n<ul>\r\n <li>Proximity with customers and workforce which is the Group’s backbone.</li>\r\n <li>Innovation in offers and services.</li>\r\n <li>Quality of service for mutual and continuous trust.</li>\r\n</ul>\r\n\ndateCreated_texte=>2018-07-23 13:35:11\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(1032,2147204895,'2018-08-02 12:18:09','texte','update|all|5|id_texte=>5\nid_type_texte=>4\ncontenu_texte=><p>Le Groupe SUNU comprend plus de 2200 collaborateurs et 24 sociétés : 9 compagnies d&#39;assurance Vie, 13 compagnies d&#39;assurance IARD, 1 banque, 1 société de microfinance, 1 société de gestion Santé répartis dans quatorze (14) pays africains.</p>\r\n\r\n<p>Dans chacune de ses filiales, le Groupe SUNU a choisi d&#39;assurer la vie, les projets, la santé, l&#39;immobilier et bien plus encore, tout en accompagnant les populations et les entreprises.</p>\r\n\ncontenu_texte_en=><p>SUNU Group is made of 2200 employees and 24 companies: 9 Life insurance companies, 13 general insurance companies, 1 bank, 1 microfinance company and 1 health management company in fourteen (14) African countries.</p>\r\n\r\n<p>Through each of its subsidiaries, SUNU Group opted for insuring Life, projects, Health, properties and more, while supporting populations and companies.</p>\r\n\ndateCreated_texte=>2018-07-23 13:36:15\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n|id_texte=>5\nid_type_texte=>4\ncontenu_texte=><p>Le Groupe SUNU comprend plus de 2200 collaborateurs et 24 sociétés : 9 compagnies d&#39;assurance Vie, 13 compagnies d&#39;assurance IARD, 1 banque, 1 société de microfinance, 1 société de gestion Santé répartis dans quatorze (14) pays africains.</p>\r\n\r\n<p>Dans chacune de ses filiales, le Groupe SUNU a choisi d&#39;assurer la vie, les projets, la santé, l&#39;immobilier et bien plus encore, tout en accompagnant les populations et les entreprises.</p>\r\n\ncontenu_texte_en=><p>SUNU Group is made of 2200 employees and 24 companies: 9 Life insurance companies, 13 general insurance companies, 1 bank, 1 microfinance company and 1 health management company in fourteen (14) African countries.</p>\r\n\r\n<p>In each of its subsidiaries, SUNU Group opted for insuring Life, projects, Health, properties and more, while supporting populations and companies.</p>\r\n\ndateCreated_texte=>2018-07-23 13:36:15\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(1033,2147204895,'2018-08-02 12:19:13','texte','update|all|6|id_texte=>6\nid_type_texte=>5\ncontenu_texte=><p>Le Groupe SUNU ambitionne d&#39;être le groupe panafricain d&#39;assurances de référence par sa solidité financière, par son professionnalisme et par les valeurs qu&#39;il véhicule :</p>\r\n\r\n<ul>\r\n <li>la Proximité vis à vis de nos clients et des Hommes qui font le Groupe</li>\r\n <li>l&#39;Innovation dans les offres et services proposés</li>\r\n <li>la Qualité de service pour une confiance réciproque et pérenne</li>\r\n</ul>\r\n\ncontenu_texte_en=><p>SUNU Group’s ambition is to be the leading Pan-African group of insurance by leaning on its financial solidity, its professionalism and the values it promotes:</p>\r\n\r\n<ul>\r\n <li>proximity with its customers and workforce which is the Group’s bone.</li>\r\n <li>Innovation in its offers and services.</li>\r\n <li>Quality of service for mutual and continuous trust.</li>\r\n</ul>\r\n\ndateCreated_texte=>2018-07-23 13:38:43\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n|id_texte=>6\nid_type_texte=>5\ncontenu_texte=><p>Le Groupe SUNU ambitionne d&#39;être le groupe panafricain d&#39;assurances de référence par sa solidité financière, par son professionnalisme et par les valeurs qu&#39;il véhicule :</p>\r\n\r\n<ul>\r\n <li>la Proximité vis à vis de nos clients et des Hommes qui font le Groupe</li>\r\n <li>l&#39;Innovation dans les offres et services proposés</li>\r\n <li>la Qualité de service pour une confiance réciproque et pérenne</li>\r\n</ul>\r\n\ncontenu_texte_en=><p>SUNU Group’s ambition is to be the leading Pan-African group of insurance by leaning on its financial solidity, its professionalism and the values it promotes:</p>\r\n\r\n<ul>\r\n <li>proximity with its customers and workforce which is the Group’s backbone.</li>\r\n <li>Innovation in its offers and services.</li>\r\n <li>Quality of service for mutual and continuous trust.</li>\r\n</ul>\r\n\ndateCreated_texte=>2018-07-23 13:38:43\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(1034,2147204895,'2018-08-02 12:20:40','texte','update|all|2|id_texte=>2\nid_type_texte=>1\ncontenu_texte=><p><strong>SUNU Participations Holding SA</strong> est administrée par un Conseil d’Administration composé de quatre (04) membres nommés par l’Assemblée Générale des actionnaires.</p>\r\n\r\n<p><strong>Missions et attributions</strong><br>\r\nLe Conseil d’Administration détermine les orientations de l’activité de la société et veille à leur mise en œuvre. Il exerce notamment les pouvoirs suivants :</p>\r\n\r\n<ul>\r\n <li>la nomination du Directeur Général ainsi que des Directeurs Généraux Délégués ;</li>\r\n <li>l’arrêté des comptes annuels</li>\r\n <li>la convocation des assemblées d’actionnaires ;</li>\r\n <li>l’autorisation des conventions « réglementées ».</li>\r\n</ul>\r\n\r\n<p>Certaines opérations ou questions importantes sont également soumises à l’autorisation préalable du Conseil d’Administration (cessions ou acquisitions, opérations de financement significatives ou opérations en dehors de la stratégie annoncée par la société...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nLes membres du Conseil d’Administration de SUNU Participations Holding S.A sont :</p>\r\n\r\n<ul>\r\n <li>Pathé DIONE, Président Directeur Général (Président de SUNU Finances Holding ; Fondateur du Groupe SUNU)</li>\r\n <li>Papa-Demba DIALLO, Administrateur (Président du Conseil d’Administration de la Société Générale de Banque du Sénégal SGBS)</li>\r\n <li>Federico ROMAN, Administrateur (Cadre Supérieur d’Assurances)</li>\r\n</ul>\r\n\ncontenu_texte_en=><p><strong>SUNU Participations Holding SA</strong>’s is administered by a Board of Directors is comprised of four (4) members appointed by the shareholders’ meeting.</p>\r\n\r\n<p><strong>Functions and Responsibilities</strong><br>\r\nThe Board of directors determines the company’s business policies and ensures the implementation thereof. It exercises the following powers:</p>\r\n\r\n<p><strong>•</strong> appointing the Managing Director as well as the Deputy Managing Directors<br>\r\n<strong>•</strong> annual cut-offs<br>\r\n<strong>•</strong> convening shareholders’ meetings<br>\r\n<strong>•</strong> approving related-party agreements.</p>\r\n\r\n<p>Some important operations or issues need prior approval of the Board of Directors (disposals or acquisitions, major financing operations or operations that are not within the company’s strategy ...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nThe members of SUNU Participations Holding SA Board of directors are:</p>\r\n\r\n<p><strong>•</strong> Mr Pathé DIONE, Chairman and Chief Executive Officer (Chairman of SUNU Finances Holding; Founder of SUNU Group)<br>\r\n<strong>•</strong> Mr Papa-Demba DIALLO, Non-Executive Director (former Chairman of Société Générale de Banque of Senegal (SGBS)<br>\r\n<strong>•</strong> Mr Federico ROMAN, Non-Executive Director (Senior Insurance Executive)</p>\r\n\ndateCreated_texte=>2018-06-03 14:36:16\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n|id_texte=>2\nid_type_texte=>1\ncontenu_texte=><p><strong>SUNU Participations Holding SA</strong> est administrée par un Conseil d’Administration composé de quatre (04) membres nommés par l’Assemblée Générale des actionnaires.</p>\r\n\r\n<p><strong>Missions et attributions</strong><br>\r\nLe Conseil d’Administration détermine les orientations de l’activité de la société et veille à leur mise en œuvre. Il exerce notamment les pouvoirs suivants :</p>\r\n\r\n<ul>\r\n <li>la nomination du Directeur Général ainsi que des Directeurs Généraux Délégués ;</li>\r\n <li>l’arrêté des comptes annuels</li>\r\n <li>la convocation des assemblées d’actionnaires ;</li>\r\n <li>l’autorisation des conventions « réglementées ».</li>\r\n</ul>\r\n\r\n<p>Certaines opérations ou questions importantes sont également soumises à l’autorisation préalable du Conseil d’Administration (cessions ou acquisitions, opérations de financement significatives ou opérations en dehors de la stratégie annoncée par la société...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nLes membres du Conseil d’Administration de SUNU Participations Holding S.A sont :</p>\r\n\r\n<ul>\r\n <li>Pathé DIONE, Président Directeur Général (Président de SUNU Finances Holding ; Fondateur du Groupe SUNU)</li>\r\n <li>Papa-Demba DIALLO, Administrateur (Président du Conseil d’Administration de la Société Générale de Banque du Sénégal SGBS)</li>\r\n <li>Federico ROMAN, Administrateur (Cadre Supérieur d’Assurances)</li>\r\n</ul>\r\n\ncontenu_texte_en=><p><strong>SUNU Participations Holding SA</strong>’s is administered by a Board of Directors comprised of four (4) members appointed by the shareholders’ meeting.</p>\r\n\r\n<p><strong>Functions and Responsibilities</strong><br>\r\nThe Board of directors determines the company’s business policies and ensures the implementation thereof. It exercises the following powers:</p>\r\n\r\n<p><strong>•</strong> appointing the Managing Director as well as the Deputy Managing Directors<br>\r\n<strong>•</strong> annual cut-offs<br>\r\n<strong>•</strong> convening shareholders’ meetings<br>\r\n<strong>•</strong> approving related-party agreements.</p>\r\n\r\n<p>Some important operations or issues need prior approval of the Board of Directors (disposals or acquisitions, major financing operations or operations that are not within the company’s strategy ...).</p>\r\n\r\n<p><strong>Composition</strong><br>\r\nThe members of SUNU Participations Holding SA Board of directors are:</p>\r\n\r\n<p><strong>•</strong> Mr Pathé DIONE, Chairman and Chief Executive Officer (Chairman of SUNU Finances Holding; Founder of SUNU Group)<br>\r\n<strong>•</strong> Mr Papa-Demba DIALLO, Non-Executive Director (former Chairman of Société Générale de Banque of Senegal (SGBS)<br>\r\n<strong>•</strong> Mr Federico ROMAN, Non-Executive Director (Senior Insurance Executive)</p>\r\n\ndateCreated_texte=>2018-06-03 14:36:16\ndateDisabled_texte=>\ncreatedBy=>2147483647\nstatut_texte=>1\n'),(1035,2147204895,'2018-08-02 12:25:17','publication','update|all|14|id_publication=>14\ntitre_publication=>Rapport annuel 2015\ntitre_publication_en=>Annual report 2015\ntexte_publication=><p>2015 a été l&#39;année de consécration de notre image avec l&#39;uniformisation de notre identité dans la majorité de nos filiales. La marque SUNU Assurances a su s&#39;imposer dans l&#39;esprit du grand public et donner une signature forte à toutes les entités du Groupe.</p>\r\n\ntexte_publication_en=><p>2015 was the year of consecration of our image with the standardisation of our identity in the majority of our subsidiaries. The SUNU Assurances brand has established itself in the mind of the general public and has given a strong signature to all the entities of the Group.</p>\r\n\nfichier_publication=>RAPPORT_SUNU_2015.pdf\nfichier_publication_en=>RapportAnnuel2015Vanglaise.pdf\ndateCreated_publication=>2018-05-04 11:26:34\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>14\ntitre_publication=>Rapport annuel 2015\ntitre_publication_en=>Annual report 2015\ntexte_publication=><p>2015 a été l&#39;année de consécration de notre image avec l&#39;uniformisation de notre identité dans la majorité de nos filiales. La marque SUNU Assurances a su s&#39;imposer dans l&#39;esprit du grand public et donner une signature forte à toutes les entités du Groupe.</p>\r\n\ntexte_publication_en=><p>2015 was the year of consecration of our image with the standardisation of our identity in the majority of the subsidiaries. The SUNU Assurances brand has established itself in the mind of the general public and has given a strong signature to all the entities of the Group.</p>\r\n\nfichier_publication=>RAPPORT_SUNU_2015.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 14:25:17\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(1036,2147204895,'2018-08-02 12:26:50','publication','update|all|9|id_publication=>9\ntitre_publication=>INTERVIEW DE M. VINCENT MVOLA, DIRECTEUR GÉNÉRAL ADJOINT DE SUNU ASSURANCES IARD GABON\ntitre_publication_en=>INTERVIEW WITH Mr. VINCENT MVOLA, DEPUTY MANAGING DIRECTOR OF SUNU ASSURANCES IARD GABON\ntexte_publication=><p>Interview de M. Vincent MVOLA, Directeur Général Adjoint de SUNU Assurances IARD Gabon :\"L&#39;un des trois principaux produits commercialisés porte sur l&#39;assurance automobile\".</p>\r\n\ntexte_publication_en=><p>Interview Mr.Vincent MVOLA, Deputy Managing Director of SUNU Assurances IARD Gabon :\" One of the top three products sold is car insurance\".</p>\r\n\nfichier_publication=>Interview_M_MVOLA_DGA_SUNU_IARD_GABON.pdf\nfichier_publication_en=>Interview_M_MVOLA_DGA_SUNU_IARD_GABON1.pdf\ndateCreated_publication=>2018-05-04 12:39:20\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>9\ntitre_publication=>INTERVIEW DE M. VINCENT MVOLA, DIRECTEUR GÉNÉRAL ADJOINT DE SUNU ASSURANCES IARD GABON\ntitre_publication_en=>INTERVIEW WITH Mr. VINCENT MVOLA, DEPUTY MANAGING DIRECTOR OF SUNU ASSURANCES IARD GABON\ntexte_publication=><p>Interview de M. Vincent MVOLA, Directeur Général Adjoint de SUNU Assurances IARD Gabon :\"L&#39;un des trois principaux produits commercialisés porte sur l&#39;assurance automobile\".</p>\r\n\ntexte_publication_en=><p>Interview with Mr.Vincent MVOLA, Deputy Managing Director of SUNU Assurances IARD Gabon :\" One of the top three products sold is car insurance\".</p>\r\n\nfichier_publication=>Interview_M_MVOLA_DGA_SUNU_IARD_GABON.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 14:26:50\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(1037,2147484848,'2018-08-03 09:47:47','_SESSION','login|all|1533289633|0|__ci_last_regenerate=>1533289633\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2018-08-01 17:43:15::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n'),(1038,2147484848,'2018-08-03 09:49:50','historique','update|all|6|id_historique=>6\nannee_historique=>2001\nmois_historique=>0\ntexte_historique=><p>SUNU Finances crée SUNU Assurances Holding S.A, une holding 1929 au Luxembourg dans laquelle sont transférées les sociétés d’assurances détenues.</p>\r\n\r\n<p>Elle ouvre le capital de SUNU Assurances à hauteur de 49 à un partenaire, la Société d’Investissement (S.I.). L’arrivée de la S.I. a permis une accélération de la croissance externe du Groupe SUNU. </p>\r\n\r\n<p>Dans la même foulée, acquisition des deux filiales des Mutuelles du Mans en Côte d’Ivoire auparavant dénommées Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) désormais SUNU Assurances IARD Côte d’Ivoire et SUNU Assurances Vie Côte d’Ivoire. </p>\r\n\r\n<p>D’autre part, SUNU Assurances détient 80 du capital de SUNU Gestion après augmentation de capital de cette dernière.</p>\r\n\ntexte_historique_en=><p>SUNU Finances created SUNU Assurances Holding S.A, a 1929 holding company in Luxembourg and transferred all its daughter insurance companies to SUNU Assurances Holding S.A.</p>\r\n\r\n<p>SUNU Finances sold 49 of the shares of SUNU Assurances to its partner Société d’Investissement (S.I.). The entry of S.I in SUNU Assurances capital boosted the external growth of SUNU Group. </p>\r\n\r\n<p>Around the same time, SUNU Group acquired two subsidiaries of Les Mutuelles du Mans in Côte d’Ivoire. The two companies formerly called Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) have been respectively rebranded as SUNU Assurances IARD Côte d’Ivoire and SUNU Assurances Vie Côte d’Ivoire.<br>\r\n<br>\r\nOn the other hand, after the increase of SUNU Gestion capital, SUNU Assurances now holds 80 of its shares.</p>\r\n\ndateCreated_historique=>2018-06-03 13:19:42\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>6\nannee_historique=>2001\nmois_historique=>0\ntexte_historique=><p>SUNU Finances crée SUNU Assurances Holding S.A, une holding 1929 au Luxembourg dans laquelle sont transférées les sociétés d’assurances détenues.</p>\r\n\r\n<p>Elle ouvre le capital de SUNU Assurances à hauteur de 49% à un partenaire, la Société d’Investissement (S.I.). L’arrivée de la S.I. a permis une accélération de la croissance externe du Groupe SUNU. </p>\r\n\r\n<p>Dans la même foulée, acquisition des deux filiales des Mutuelles du Mans en Côte d’Ivoire auparavant dénommées Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) désormais SUNU Assurances IARD Côte d’Ivoire et SUNU Assurances Vie Côte d’Ivoire. </p>\r\n\r\n<p>D’autre part, SUNU Assurances détient 80 du capital de SUNU Gestion après augmentation de capital de cette dernière.</p>\r\n\ntexte_historique_en=><p>SUNU Finances created SUNU Assurances Holding S.A, a 1929 holding company in Luxembourg and transferred all its daughter insurance companies to SUNU Assurances Holding S.A.</p>\r\n\r\n<p>SUNU Finances sold 49% of the shares of SUNU Assurances to its partner Société d’Investissement (S.I.). The entry of S.I in SUNU Assurances capital boosted the external growth of SUNU Group. </p>\r\n\r\n<p>Around the same time, SUNU Group acquired two subsidiaries of Les Mutuelles du Mans in Côte d’Ivoire. The two companies formerly called Le Millénium Assurances Internationales-IARD (LMAI-IARD) et Le Millénium Assurances Internationales-Vie (LMAI-Vie) have been respectively rebranded as SUNU Assurances IARD Côte d’Ivoire and SUNU Assurances Vie Côte d’Ivoire.<br>\r\n<br>\r\nOn the other hand, after the increase of SUNU Gestion capital, SUNU Assurances now holds 80 of its shares.</p>\r\n\ndateCreated_historique=>2018-06-03 13:19:42\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(1039,2147484848,'2018-08-03 10:03:45','historique','update|all|22|id_historique=>22\nannee_historique=>2017\nmois_historique=>0\ntexte_historique=><p>Immatriculation au registre de commerce du Togo de SUNU santé, créée en Décembre 2016. Cette société a pour mission de gérer les contrats d&#39;assurances santé des sociétés IARD du groupe SUNU.</p>\r\n\ntexte_historique_en=><p>SUNU Santé, incorporated in December 2016, is registered in Togo. The mission of SUNU Santé is to manage the Health insurance contracts issued by General insurance companies of SUNU Group.</p>\r\n\ndateCreated_historique=>2018-06-03 13:29:30\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>22\nannee_historique=>2017\nmois_historique=>8\ntexte_historique=><p>Immatriculation au registre de commerce du Togo de SUNU santé, créée en Décembre 2016. Cette société a pour mission de gérer les contrats d\'assurances santé des sociétés IARD du groupe SUNU.</p>\r\n\ntexte_historique_en=><p>SUNU Santé, incorporated in December 2016, is registered in Togo. The mission of SUNU Santé is to manage the Health insurance contracts issued by General insurance companies of SUNU Group.</p>\r\n\ndateCreated_historique=>2018-06-03 13:29:30\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(1040,2147484848,'2018-08-03 10:04:12','historique','update|all|22|id_historique=>22\nannee_historique=>2017\nmois_historique=>8\ntexte_historique=><p>Immatriculation au registre de commerce du Togo de SUNU santé, créée en Décembre 2016. Cette société a pour mission de gérer les contrats d\'assurances santé des sociétés IARD du groupe SUNU.</p>\r\n\ntexte_historique_en=><p>SUNU Santé, incorporated in December 2016, is registered in Togo. The mission of SUNU Santé is to manage the Health insurance contracts issued by General insurance companies of SUNU Group.</p>\r\n\ndateCreated_historique=>2018-06-03 13:29:30\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n|id_historique=>22\nannee_historique=>2017\nmois_historique=>6\ntexte_historique=><p>Immatriculation au registre de commerce du Togo de SUNU santé, créée en Décembre 2016. Cette société a pour mission de gérer les contrats d&#39;assurances santé des sociétés IARD du groupe SUNU.</p>\r\n\ntexte_historique_en=><p>SUNU Santé, incorporated in December 2016, is registered in Togo. The mission of SUNU Santé is to manage the Health insurance contracts issued by General insurance companies of SUNU Group.</p>\r\n\ndateCreated_historique=>2018-06-03 13:29:30\ndateDisabled_historique=>\ncreatedBy=>2147484848\nstatut_historique=>1\n'),(1041,2147484848,'2018-08-03 10:04:40','historique','update|all|23|id_historique=>23\nannee_historique=>2017\nmois_historique=>0\ntexte_historique=><p>Création de SUNU Assurances IARD Cameroun suite à la recapitalisation de la société 