in 1998 by Mr. Pathé DIONE with some colleagues. Former Africa Director of UAP (Union des Assurances de Paris) and AXA, he acquired and created over the years companies in 14 countries of West and Central Africa.</p>\r\n\nfichier_publication=>Plaquette_SUNU_2015web.pdf\nfichier_publication_en=>PlaquetteSUNU2015V_anglaise1.pdf\ndateCreated_publication=>2018-05-04 18:25:13\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(1057,2147204895,'2018-08-10 16:25:58','publication','update|all|9|id_publication=>9\ntitre_publication=>INTERVIEW DE M. VINCENT MVOLA, DIRECTEUR GÉNÉRAL ADJOINT DE SUNU ASSURANCES IARD GABON\ntitre_publication_en=>INTERVIEW WITH Mr. VINCENT MVOLA, DEPUTY MANAGING DIRECTOR OF SUNU ASSURANCES IARD GABON\ntexte_publication=><p>Interview de M. Vincent MVOLA, Directeur Général Adjoint de SUNU Assurances IARD Gabon :\"L&#39;un des trois principaux produits commercialisés porte sur l&#39;assurance automobile\".</p>\r\n\ntexte_publication_en=><p>Interview with Mr.Vincent MVOLA, Deputy Managing Director of SUNU Assurances IARD Gabon :\" One of the top three products sold is car insurance\".</p>\r\n\nfichier_publication=>Interview_M_MVOLA_DGA_SUNU_IARD_GABON.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 14:26:50\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>9\ntitre_publication=>INTERVIEW DE M. VINCENT MVOLA, DIRECTEUR GÉNÉRAL ADJOINT DE SUNU ASSURANCES IARD GABON\ntitre_publication_en=>INTERVIEW WITH Mr. VINCENT MVOLA, DEPUTY MANAGING DIRECTOR OF SUNU ASSURANCES IARD GABON\ntexte_publication=><p>Interview de M. Vincent MVOLA, Directeur Général Adjoint de SUNU Assurances IARD Gabon :\"L\'un des trois principaux produits commercialisés porte sur l\'assurance automobile\".</p>\r\n\ntexte_publication_en=><p>Interview with Mr.Vincent MVOLA, Deputy Managing Director of SUNU Assurances IARD Gabon :\" One of the top three products sold is car insurance\".</p>\r\n\nfichier_publication=>Interview_M_MVOLA_DGA_SUNU_IARD_GABON.pdf\nfichier_publication_en=>Interview_M_MVOLA_DGA_SUNU_IARD_GABON2.pdf\ndateCreated_publication=>2018-05-04 18:25:58\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(1058,2147204895,'2018-08-10 16:30:05','publication','update|all|15|id_publication=>15\ntitre_publication=>Plaquette 2016\ntitre_publication_en=>Brochure 2016\ntexte_publication=><p>Présent dans 14 pays d’Afrique de l’ouest et centrale, le Groupe SUNU est un groupe d’assurances africain créé en 1998 par M. Pathé DIONE avec d’anciens collaborateurs. Le Groupe SUNU, constitué de SUNU Participations Holding SA et de ses 23 filiales et sociétés affiliées.</p>\r\n\ntexte_publication_en=><p>Present in 14 countries in West and Central Africa, SUNU Group is an African insurance group created in 1998 by Mr. Pathé DIONE with former colleagues. SUNU Group consists of SUNU Participations Holding SA and its 23 subsidiaries and affiliated companies.</p>\r\n\nfichier_publication=>Plaquette _SUNU2016_web.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 11:49:24\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>15\ntitre_publication=>Plaquette 2016\ntitre_publication_en=>Brochure 2016\ntexte_publication=><p>Présent dans 14 pays d’Afrique de l’ouest et centrale, le Groupe SUNU est un groupe d’assurances africain créé en 1998 par M. Pathé DIONE avec d’anciens collaborateurs. Le Groupe SUNU, constitué de SUNU Participations Holding SA et de ses 23 filiales et sociétés affiliées.</p>\r\n\ntexte_publication_en=><p>Present in 14 countries in West and Central Africa, SUNU Group is an African insurance group created in 1998 by Mr. Pathé DIONE with former colleagues. SUNU Group consists of SUNU Participations Holding SA and its 23 subsidiaries and affiliated companies.</p>\r\n\nfichier_publication=>Plaquette _SUNU2016_web.pdf\nfichier_publication_en=>Plaquette_Instit__SUNU2016_V_anglaise_web1.pdf\ndateCreated_publication=>2018-05-04 18:30:05\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n'),(1059,2147204895,'2018-08-10 16:32:49','publication','update|all|14|id_publication=>14\ntitre_publication=>Rapport annuel 2015\ntitre_publication_en=>Annual report 2015\ntexte_publication=><p>2015 a été l&#39;année de consécration de notre image avec l&#39;uniformisation de notre identité dans la majorité de nos filiales. La marque SUNU Assurances a su s&#39;imposer dans l&#39;esprit du grand public et donner une signature forte à toutes les entités du Groupe.</p>\r\n\ntexte_publication_en=><p>2015 was the year of consecration of our image with the standardisation of our identity in the majority of the subsidiaries. The SUNU Assurances brand has established itself in the mind of the general public and has given a strong signature to all the entities of the Group.</p>\r\n\nfichier_publication=>RAPPORT_SUNU_2015.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-05-04 14:25:17\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147484848\nstatut_publication=>1\n|id_publication=>14\ntitre_publication=>Rapport annuel 2015\ntitre_publication_en=>Annual report 2015\ntexte_publication=><p>2015 a été l&#39;année de consécration de notre image avec l&#39;uniformisation de notre identité dans la majorité de nos filiales. La marque SUNU Assurances a su s&#39;imposer dans l&#39;esprit du grand public et donner une signature forte à toutes les entités du Groupe.</p>\r\n\ntexte_publication_en=><p>2015 was the year of consecration of our image with the standardisation of our identity in the majority of the subsidiaries. The SUNU Assurances brand has established itself in the mind of the general public and has given a strong signature to all the entities of the Group.</p>\r\n\nfichier_publication=>RAPPORT_SUNU_2015.pdf\nfichier_publication_en