'),(1075,2147204895,'2018-09-19 09:04:52','article','insert|all|27|0|id_article=>27\ntitre_article=>Côte d\'Ivoire : Campagne produit VISA ETUDES PLUS\ntitre_article_en=>Côte d\'Ivoire : Product Campaign VISA ETUDES PLUS\ntexte_article=><p>Du 01 au 09 Septembre 2018, s’est tenue la campagne du produit « VISA ETUDES PLUS ».<br>\r\nComme tous les ans, en période de pré-rentrée scolaire, SUNU Assurances Vie Côte d’Ivoire organise une promotion de son produit VISA ETUDES PLUS qui garantit les études de votre enfant même si vous n’êtes plus là.<br>\r\nCette campagne s’est déroulée sous forme d’activation dans plusieurs centres commerciaux et librairies de renom à Abidjan.</p>\r\n\ntexte_article_en=><p>From 01 to 09 September 2018, the campaign of the product \"VISA ETUDES PLUS\" was held. As every year, in the period of pre-school, SUNU Assurances Vie Côte d’Ivoire organizes a promotion of its product VISA ETUDES PLUS which guarantees the studies of your child even if you are not there any more. This campaign took place in the form of activation in several shopping malls and renowned bookshops in Abidjan.</p>\r\n\nlecture_article=>0\nfichier_article=>campvep20180.jpg\ndateCreated_article=>2018-09-19 11:04:52\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1076,2147204895,'2018-09-19 09:06:49','photo','insert|all|264|0|id_photo=>264\nid_article=>27\nfichier_photo=>campvep20181.jpg\ndateCreated_photo=>2018-09-19 11:06:49\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1077,2147204895,'2018-09-19 09:06:49','photo','insert|all|265|0|id_photo=>265\nid_article=>27\nfichier_photo=>campvep2018.jpg\ndateCreated_photo=>2018-09-19 11:06:49\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1078,2147204895,'2018-09-19 09:06:51','photo','insert|all|266|0|id_photo=>266\nid_article=>27\nfichier_photo=>campvep20182.jpg\ndateCreated_photo=>2018-09-19 11:06:51\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1079,2147204895,'2018-09-19 09:06:52','photo','insert|all|267|0|id_photo=>267\nid_article=>27\nfichier_photo=>campvep20183.jpg\ndateCreated_photo=>2018-09-19 11:06:52\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1080,2147204895,'2018-09-19 09:06:54','photo','insert|all|268|0|id_photo=>268\nid_article=>27\nfichier_photo=>campvep20184.jpg\ndateCreated_photo=>2018-09-19 11:06:54\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1081,2147204895,'2018-09-20 16:25:14','_SESSION','login|all|1537460637|0|__ci_last_regenerate=>1537460637\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-09-19 10:24:18::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1082,2147204895,'2018-09-20 16:48:05','article','insert|all|28|0|id_article=>28\ntitre_article=>Equity Assurance Liberia Ltd. devient SUNU Assurances\ntitre_article_en=>Equity Assurance Liberia Ltd. becomes SUNU Assurances\ntexte_article=><p>Equity Assurance Liberia Ltd., filiale libérienne du Groupe SUNU, a officiellement changé de nom au cours de la cérémonie de rebranding qui a eu lieu le mercredi 19 septembre 2018 au City Hall. C’est en présence de nombreuses personnalités comme les Sénateurs, Représentants des Ministères des Finances et du Commerce, de la Chambre de Commerce, de l’association des chefs d’entreprise, des hommes d’affaires et DG de sociétés bancaires et d’assurance, tous les courtiers du marché, la police, les chefs religieux, le président de la presse et tous les médias que Equity Assurance Liberia Ltd. est devenue SUNU Assurances Liberia Ltd.</p>\r\n\ntexte_article_en=><p>Equity Assurance Liberia Ltd., a Liberian subsidiary of the SUNU Group, officially changed its name during the rebranding ceremony held on Wednesday, September 19, 2018 at City Hall. This is in the presence of many personalities such as Senators, Representatives of the Ministries of Finance and Commerce, the Chamber of Commerce, the Association of Business Leaders, businessmen and CEO of banking companies and insurance, all market brokers, police, religious leaders, the president of the press and all media that Equity Assurance Liberia Ltd. became SUNU Insurance Liberia Ltd.</p>\r\n\nlecture_article=>0\nfichier_article=>1.jpg\ndateCreated_article=>2018-09-20 18:48:05\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1083,2147204895,'2018-09-20 16:50:08','photo','insert|all|269|0|id_photo=>269\nid_article=>28\nfichier_photo=>rebrandingliberia.jpg\ndateCreated_photo=>2018-09-20 18:50:08\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1084,2147204895,'2018-09-20 16:50:08','photo','insert|all|270|0|id_photo=>270\nid_article=>28\nfichier_photo=>rebrandingliberia0.jpg\ndateCreated_photo=>2018-09-20 18:50:08\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1085,2147204895,'2018-09-20 16:50:18','photo','insert|all|271|0|id_photo=>271\nid_article=>28\nfichier_photo=>rebrandingliberia2.jpg\ndateCreated_photo=>2018-09-20 18:50:18\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1086,2147204895,'2018-09-20 18:51:13','article','insert|all|29|0|id_article=>29\ntitre_article=>Célébration du 20ème client\ntitre_article_en=>Celebration of the 20th customer\ntexte_article=><p>Pour célébrer son 20ème anniversaire, les différentes filiales du Groupe SUNU ont décidé de récompenser leurs 20èmes clients tous les 20 du mois dans les sièges et agences. C’est ainsi qu’ils ont bénéficié de bilans de santé gratuits, de complets de pagnes, de moutons (à l’occasion de la Tabaski) et de cadeaux lors de coupures et dégustations surprises de gâteaux dans les sociétés SUNU Assurances du Niger, de la Côte d’Ivoire, du Togo et du Sénégal. Les 20 de chaque mois, célébrons ensemble nos 20 ans d’assurance.</p>\r\n\ntexte_article_en=><p>To celebrate its 20th anniversary, the various subsidiaries of the SUNU Group have decided to reward their 20th customers every 20 months in the offices and agencies. This is how they benefited from free health check-ups, complete pagnes, sheep (on the occasion of the Tabaski) and gifts during cuts and surprise cake tastings in the SUNU Assurances of Niger companies, from Côte d&#39;Ivoire, Togo and Senegal. The 20th of each month, let&#39;s celebrate together our 20 years of insurance.</p>\r\n\nlecture_article=>0\nfichier_article=>20ans.jpg\ndateCreated_article=>2018-09-20 20:51:13\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1087,2147204895,'2018-09-20 18:51:36','photo','insert|all|272|0|id_photo=>272\nid_article=>29\nfichier_photo=>20ans1.jpg\ndateCreated_photo=>2018-09-20 20:51:36\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1088,2147204895,'2018-09-20 18:51:36','photo','insert|all|273|0|id_photo=>273\nid_article=>29\nfichier_photo=>20ans0.jpg\ndateCreated_photo=>2018-09-20 20:51:36\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1089,2147204895,'2018-09-20 18:51:37','photo','insert|all|274|0|id_photo=>274\nid_article=>29\nfichier_photo=>20ans2.jpg\ndateCreated_photo=>2018-09-20 20:51:37\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1090,2147204895,'2018-09-20 18:51:40','photo','insert|all|275|0|id_photo=>275\nid_article=>29\nfichier_photo=>20ans5.jpg\ndateCreated_photo=>2018-09-20 20:51:40\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1091,2147204895,'2018-09-20 18:51:41','photo','insert|all|276|0|id_photo=>276\nid_article=>29\nfichier_photo=>20ans6.jpg\ndateCreated_photo=>2018-09-20 20:51:41\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1092,2147204895,'2018-09-20 18:51:41','photo','insert|all|277|0|id_photo=>277\nid_article=>29\nfichier_photo=>20ans7.jpg\ndateCreated_photo=>2018-09-20 20:51:41\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1093,2147204