r objectives with a turnover 17% higher than a year ago ; about 150 million euro. A net profit of 2.3 million euro with 366 million euro assets under management.</p>\r\n\nfichier_publication=>RA_SUNU_2017_V_web.pdf\nfichier_publication_en=>RA_SUNU_2017_V_anglaise_web.pdf\ndateCreated_publication=>2018-09-06 12:18:44\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_publication=>1\n'),(1096,2147204895,'2018-10-02 10:35:20','publication','update|all|24|id_publication=>24\ntitre_publication=>Plaquette Institutionnelle 2017\ntitre_publication_en=>Plaquette Institutionnelle 2017\ntexte_publication=><p>Nos valeurs et nos hommes nous permettent de maintenir notre position de leader sur le marché Africain des Assurances. </p>\r\n\ntexte_publication_en=><p>Nos valeurs et nos hommes nous permettent de maintenir notre position de leader sur le marché Africain des Assurances. </p>\r\n\nfichier_publication=>Plaquette_Instit__SUNU2017_vdef.pdf\nfichier_publication_en=>\ndateCreated_publication=>2018-09-06 11:47:16\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_publication=>1\n|id_publication=>24\ntitre_publication=>Plaquette Institutionnelle 2017\ntitre_publication_en=>Institutional brochure 2017\ntexte_publication=><p>Nos valeurs et nos hommes nous permettent de maintenir notre position de leader sur le marché Africain des Assurances. </p>\r\n\ntexte_publication_en=><p>Our values and our men allow us to maintain our LEADERSHIP position in the market African Insurance.</p>\r\n\nfichier_publication=>Plaquette_Instit__SUNU2017_vdef.pdf\nfichier_publication_en=>Plaquette_Instit__SUNU2017_VA_web.pdf\ndateCreated_publication=>2018-09-06 12:35:20\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_publication=>1\n'),(1097,2147204895,'2018-10-09 09:27:34','_SESSION','login|all|1539077253|0|__ci_last_regenerate=>1539077253\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-10-02 11:39:54::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1098,2147204895,'2018-10-09 09:36:08','article','insert|all|30|0|id_article=>30\ntitre_article=>SUNU Assurances sponsor de la 2ème édition du SADA\ntitre_article_en=>SUNU Assurances sponsor of the 2nd edition of the SADA\ntexte_article=><p>SUNU Assurances a participé à la 2ème édition du SADA (Salon Africain des Assurances) qui s’est tenue les 27, 28 et 29 septembre 2018. Les sociétés d’assurances et les représentants des consommateurs présents à cet évènement, ont animé des panels autour du thème « Qu’est-ce que l’assurance ? » M. ATEBI-ZIRIGA, DG de SUNU Assurances IARD CI et M. Saliou BAKAYOKO, DG de SUNU Assurances Vie CI ont présenté le Groupe SUNU à l’assemblée tout en l’invitant à visiter le stand de SUNU Assurances et encouragé les initiateurs du SADA à la pérennisation du salon. Le prix SADA 2018 de la 1ère Compagnie en Assurance Vie a été décerné à SUNU Assurances Vie CI.</p>\r\n\ntexte_article_en=><p>SUNU Assurances took part in the 2nd edition of the SADA (Salon Africain des Assurances) held on 27, 28 and 29 September 2018. Insurance companies and consumer representatives present at this event, led panels around of the theme \"What is insurance? Mr. ATEBI-ZIRIGA, CEO of SUNU Assurances IARD CI and Mr. Saliou BAKAYOKO, CEO of SUNU Assurances Vie CI presented the SUNU Group to the assembly while inviting him to visit the stand of SUNU Assurances and encouraged the initiators from SADA to the sustainability of the show. The SADA 2018 Award of the 1st Life Assurance Company was awarded to SUNU Assurances Vie CI.</p>\r\n\nlecture_article=>0\nfichier_article=>sada.jpg\ndateCreated_article=>2018-10-09 11:36:08\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1099,2147204895,'2018-10-09 09:38:14','article','update|all|30|id_article=>30\ntitre_article=>SUNU Assurances sponsor de la 2ème éditi