rs présents à cet évènement, ont animé des panels autour du thème « Qu’est-ce que l’assurance ? » M. ATEBI-ZIRIGA, DG de SUNU Assurances IARD CI et M. Saliou BAKAYOKO, DG de SUNU Assurances Vie CI ont présenté le Groupe SUNU à l’assemblée tout en l’invitant à visiter le stand de SUNU Assurances et encouragé les initiateurs du SADA à la pérennisation du salon. Le prix SADA 2018 de la 1ère Compagnie en Assurance Vie a été décerné à SUNU Assurances Vie CI.</p>\r\n\ntexte_article_en=><p>SUNU Assurances took part in the 2nd edition of the SADA (Salon Africain des Assurances) held on 27, 28 and 29 September 2018. Insurance companies and consumer representatives present at this event, led panels around of the theme \"What is insurance? Mr. ATEBI-ZIRIGA, CEO of SUNU Assurances IARD CI and Mr. Saliou BAKAYOKO, CEO of SUNU Assurances Vie CI presented the SUNU Group to the assembly while inviting him to visit the stand of SUNU Assurances and encouraged the initiators from SADA to the sustainability of the show. The SADA 2018 Award of the 1st Life Assurance Company was awarded to SUNU Assurances Vie CI.</p>\r\n\nlecture_article=>0\nfichier_article=>sada.jpg\ndateCreated_article=>2018-10-09 11:38:14\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1100,2147204895,'2018-10-09 09:40:28','photo','insert|all|278|0|id_photo=>278\nid_article=>30\nfichier_photo=>sada1.jpg\ndateCreated_photo=>2018-10-09 11:40:28\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1101,2147204895,'2018-10-09 09:40:31','photo','insert|all|279|0|id_photo=>279\nid_article=>30\nfichier_photo=>sada2.jpg\ndateCreated_photo=>2018-10-09 11:40:31\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1102,2147204895,'2018-10-09 09:40:32','photo','insert|all|280|0|id_photo=>280\nid_article=>30\nfichier_photo=>sada3.jpg\ndateCreated_photo=>2018-10-09 11:40:32\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1103,2147204895,'2018-10-09 09:40:35','photo','insert|all|281|0|id_photo=>281\nid_article=>30\nfichier_photo=>sada4.jpg\ndateCreated_photo=>2018-10-09 11:40:35\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1104,2147204895,'2018-10-09 09:40:39','photo','insert|all|282|0|id_photo=>282\nid_article=>30\nfichier_photo=>sada5.jpg\ndateCreated_photo=>2018-10-09 11:40:39\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1105,2147204895,'2018-10-09 09:40:41','photo','insert|all|283|0|id_photo=>283\nid_article=>30\nfichier_photo=>sada6.jpg\ndateCreated_photo=>2018-10-09 11:40:41\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1106,2147204895,'2018-10-09 09:40:45','photo','insert|all|284|0|id_photo=>284\nid_article=>30\nfichier_photo=>sada7.jpg\ndateCreated_photo=>2018-10-09 11:40:45\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1107,2147204895,'2018-10-09 09:40:48','photo','insert|all|285|0|id_photo=>285\nid_article=>30\nfichier_photo=>sada8.jpg\ndateCreated_photo=>2018-10-09 11:40:48\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1108,2147204895,'2018-10-09 09:40:48','photo','insert|all|286|0|id_photo=>286\nid_article=>30\nfichier_photo=>sada9.jpg\ndateCreated_photo=>2018-10-09 11:40:48\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1109,2147204895,'2018-10-09 10:46:52','article','insert|all|31|0|id_article=>31\ntitre_article=>Côte d\'Ivoire : Campagne Produit BELEMI Scolarité\ntitre_article_en=>Campaign Product BELEMI Scolarité\ntexte_article=><p><span xss=removed>Le mercredi 19 septembre 2018, SUNU Assurances Vie CI en partenariat avec CMAC Assurances (Cabinet Moaye de Courtage d&#39;Assurance) a entamé la campagne du produit BELEMI Scolarité Assurances, au sein de plusieurs établissements scolaires du district d’Abidjan. Ce produit permet de couvrir les frais de scolarité restant à payer pour un ou plusieurs enfant(s) scolarisé(s) en cas de décès du parent. Par cette campagne de proximité, SUNU Assurances vise avant tout à se rapprocher des parents d’élèves et aussi à mieux faire connaître BELEMI Scolarité Assurance. Ces activités achèveront le mercredi 03 octobre 2018. </span></p>\r\n\ntexte_article_en=><p><span xss=removed>On Wednesday, September 19, 2018, SUNU Assurances Vie CI in partnership with CMAC Assurances (Cabinet Moaye de Coutarge d&#39;Assurance) began the campaign BELEMI Scolarité Assurances, in several schools in the district of Abidjan. This product covers the tuition fees still to be paid for one or more child (ren) enrolled in the event of the death of the parent. Through this local campaign, SUNU Assurances aims above all to get closer to the parents of students and also to raise awareness of BELEMI Scolarité Assurance. These activities will end on Wednesday 03 October 2018.</span></p>\r\n\nlecture_article=>0\nfichier_article=>belemi2018.jpg\ndateCreated_article=>2018-10-09 12:46:52\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1110,2147204895,'2018-10-09 10:50:25','photo','insert|all|287|0|id_photo=>287\nid_article=>31\nfichier_photo=>belemi20184.jpg\ndateCreated_photo=>2018-10-09 12:50:25\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1111,2147204895,'2018-10-09 10:50:26','photo','insert|all|288|0|id_photo=>288\nid_article=>31\nfichier_photo=>belemi20180.jpg\ndateCreated_photo=>2018-10-09 12:50:26\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1112,2147204895,'2018-10-09 10:50:28','photo','insert|all|289|0|id_photo=>289\nid_article=>31\nfichier_photo=>belemi20181.jpg\ndateCreated_photo=>2018-10-09 12:50:28\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1113,2147204895,'2018-10-09 10:50:31','photo','insert|all|290|0|id_photo=>290\nid_article=>31\nfichier_photo=>belemi20182.jpg\ndateCreated_photo=>2018-10-09 12:50:31\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1114,2147204895,'2018-10-09 10:50:33','photo','insert|all|291|0|id_photo=>291\nid_article=>31\nfichier_photo=>belemi20183.jpg\ndateCreated_photo=>2018-10-09 12:50:33\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1115,2147204895,'2018-10-12 16:27:42','_SESSION','login|all|1539361504|0|__ci_last_regenerate=>1539361504\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-10-09 11:27:34::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1116,2147204895,'2018-10-12 16:58:57','article','insert|all|32|0|id_article=>32\ntitre_article=>Participation au Brokerslink\'s Risk Management Forum\ntitre_article_en=>Participation in the Brokerslink\'s Risk Management Forum\ntexte_article=><p>SUNU Assurances a pris part au forum du Brokerslink&#39;s Risk Management Forum en tant que sponsor Or. Cette édition qui se déroule à Hong Kong, depuis le jeudi 11 octobre 2018 a réuni les gestionnaires de risques du monde entier pour discuter des tendances clés de la gestion des risques et partager leurs connaissances.</p>\r\n\r\n<p>M. Mohamed BAH, Directeur Général Délégué à SUNU Participations Holding SA, M. Osée QUENUM Directeur Général de SUNU Assurances IARD Burkina Faso et Mme Déborah GNAGNE, Directeur du Développement Commercial du Groupe SUNU ont participé à ce forum pour trouver les meilleurs moyens d’offrir aux organisations et aux populations africaines sécurité et protection dans la réalisation de leurs projets.</p>\r\n\ntexte_article_en=><p>SUNU Assurances took part in the Brokerslink&#39;s Risk Management Forum as a Gold Sponsor. This edition, which has been taking place in Hong Kong since Thursday, October 11, 2018, brought together risk managers from around the world to discuss key risk management trends. and share their knowledge. Mr. Mohamed BAH, Deputy Managing Director at SUNU Participations Holding SA, Mr. Osée QUENUM General Manager of SUNU Assurances IARD Burkina Faso and Mrs. Déborah GNAGNE, Director of Business Development of SUNU Group participated in this forum to find the best ways to to offer African organizations and populations security and protection in carrying out their projects.</p>\r\n\nlecture_article=>0\nfichier_article=>brokersforum.jpg\ndateCreated_article=>2018-10-12 18:58:57\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1117,2147204895,'2018-10-12 17:04:01','article','update|all|32|id_article=>32\ntitre_article=>Participation au Brokerslink\'s Risk Management Forum\ntitre_article_en=>Participation in the Brokerslink\'s Risk Management Forum\ntexte_article=><p>SUNU Assurances a pris part au forum du Brokerslink&#39;s Risk Management Forum en tant que sponsor Or. Cette édition qui se déroule à Hong Kong, depuis le jeudi 11 octobre 2018 a réuni les gestionnaires de risques du monde entier pour discuter des tendances clés de la gestion des risques et partager leurs connaissances.</p>\r\n\r\n<p>M. Mohamed BAH, Directeur Général Délégué à SUNU Participations Holding SA, M. Osée QUENUM Directeur Général de SUNU Assurances IARD Burkina Faso et Mme Déborah GNAGNE, Directeur du Développement Commercial du Groupe SUNU ont participé à ce forum pour trouver les meilleurs moyens d’offrir aux organisations et aux populations africaines sécurité et protection dans la réalisation de leurs projets.</p>\r\n\ntexte_article_en=><p>SUNU Assurances took part in the Brokerslink&#39;s Risk Management Forum as a Gold Sponsor. This edition, which has been taking place in Hong Kong since Thursday, October 11, 2018, brought together risk managers from around the world to discuss key risk management trends. and share their knowledge. Mr. Mohamed BAH, Deputy Managing Director at SUNU Participations Holding SA, Mr. Osée QUENUM General Manager of SUNU Assurances IARD Burkina Faso and Mrs. Déborah GNAGNE, Director of Business Development of SUNU Group participated in this forum to find the best ways to to offer African organizations and populations security and protection in carrying out their projects.</p>\r\n\nlecture_article=>0\nfichier_article=>brokersforum.jpg\ndateCreated_article=>2018-10-12 18:58:57\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>32\ntitre_article=>Groupe SUNU : Participation au Brokerslink\'s Risk Management Forum\ntitre_article_en=>SUNU Group : Participation in the Brokerslink\'s Risk Management Forum\ntexte_article=><p>SUNU Assurances a pris part au forum du Brokerslink&#39;s Risk Management Forum en tant que sponsor Or. Cette édition qui se déroule à Hong Kong, depuis le jeudi 11 octobre 2018 a réuni les gestionnaires de risques du monde entier pour discuter des tendances clés de la gestion des risques et partager leurs connaissances.</p>\r\n\r\n<p>M. Mohamed BAH, Directeur Général Délégué à SUNU Participations Holding SA, M. Osée QUENUM Directeur Général de SUNU Assurances IARD Burkina Faso et Mme Déborah GNAGNE, Directeur du Développement Commercial du Groupe SUNU ont participé à ce forum pour trouver les meilleurs moyens d’offrir aux organisations et aux populations africaines sécurité et protection dans la réalisation de leurs projets.</p>\r\n\ntexte_article_en=><p>SUNU Assurances took part in the Brokerslink&#39;s Risk Management Forum as a Gold Sponsor. This edition, which has been taking place in Hong Kong since Thursday, October 11, 2018, brought together risk managers from around the world to discuss key risk management trends. and share their knowledge. Mr. Mohamed BAH, Deputy Managing Director at SUNU Participations Holding SA, Mr. Osée QUENUM General Manager of SUNU Assurances IARD Burkina Faso and Mrs. Déborah GNAGNE, Director of Business Development of SUNU Group participated in this forum to find the best ways to to offer African organizations and populations security and protection in carrying out their projects.</p>\r\n\nlecture_article=>0\nfichier_article=>brokersforum.jpg\ndateCreated_article=>2018-10-12 19:04:01\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1118,2147204895,'2018-10-12 17:05:15','photo','insert|all|292|0|id_photo=>292\nid_article=>32\nfichier_photo=>brokersforum0.jpg\ndateCreated_photo=>2018-10-12 19:05:15\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1119,2147204895,'2018-10-12 17:05:16','photo','insert|all|293|0|id_photo=>293\nid_article=>32\nfichier_photo=>brokersforum1.jpg\ndateCreated_photo=>2018-10-12 19:05:16\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1120,2147204895,'2018-10-12 17:05:17','photo','insert|all|294|0|id_photo=>294\nid_article=>32\nfichier_photo=>brokersforum3.jpg\ndateCreated_photo=>2018-10-12 19:05:17\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1121,2147204895,'2018-10-12 17:05:18','photo','insert|all|295|0|id_photo=>295\nid_article=>32\nfichier_photo=>brokersforum4.jpg\ndateCreated_photo=>2018-10-12 19:05:18\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1122,2147204895,'2018-10-12 17:05:19','photo','insert|all|296|0|id_photo=>296\nid_article=>32\nfichier_photo=>brokersforum5.jpg\ndateCreated_photo=>2018-10-12 19:05:19\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1123,2147204895,'2018-10-12 17:05:21','photo','insert|all|297|0|id_photo=>297\nid_article=>32\nfichier_photo=>brokersforum6.jpg\ndateCreated_photo=>2018-10-12 19:05:21\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1124,2147204895,'2018-10-12 17:05:25','photo','insert|all|298|0|id_photo=>298\nid_article=>32\nfichier_photo=>brokersforum8.jpg\ndateCreated_photo=>2018-10-12 19:05:25\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1125,2147204895,'2018-10-18 11:23:46','_SESSION','login|all|1539861786|0|__ci_last_regenerate=>1539861786\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-10-12 18:27:42::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1126,2147204895,'2018-10-18 11:41:23','article','insert|all|33|0|id_article=>33\ntitre_article=> Côte d\'Ivoire : Afterwork balade lagunaire de SUNU Assurances Vie CI\ntitre_article_en=>Côte d\'Ivoire : Afterwork lagoon ride of SUNU Assurances Vie CI\ntexte_article=><p>Le traditionnel Business Afterwork de SUNU Assurances Vie CI, a eu lieu le vendredi 12 Octobre 2018 au cours d’une balade lagunaire. Le thème de cette soirée : « Quelle protection sociale pour votre Capital humain ? » a été animé par M. Gildas NZOUBA, Directeur Général Adjoint de SUNU Assurances Vie CI. Cet événement a été le cadre pour SUNU Assurances de présenter aux entreprises, les meilleurs produits d&#39;assurance vie pour fidéliser leur personnel en investissant dans leurs projets de vie. La cérémonie s’est déroulée dans un cadre amical et festif.</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>The traditional Business Afterwork of SUNU Aassurances Vie CI, took place on Friday, October 12, 2018 during a lagoon ride. The theme of this evening : \"What social protection for your Human Capital?\" was led by Mr. Gildas NZOUBA, Deputy General Manager of SUNU Assurances Vie CI. This event was the framework for SUNU Assurances to present companies with the best life insurance products to retain their staff by investing in their life projects. The ceremony was held in a friendly and festive setting.</p>\r\n\nlecture_article=>0\nfichier_article=>44155145_1106152752892994_3926221439987875840_n.jpg\ndateCreated_article=>2018-10-18 13:41:23\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1127,2147204895,'2018-10-18 11:44:06','photo','insert|all|299|0|id_photo=>299\nid_article=>33\nfichier_photo=>44094720_1106152842892985_8177796363568807936_n.jpg\ndateCreated_photo=>2018-10-18 13:44:06\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1128,2147204895,'201