\"COEUR DE STAR\" web-broadcast\ntexte_article=><p>Le mercredi 17 Octobre 2018, SUNU Assurances en Côte d’Ivoire participait au lancement de la web-émission \"CŒUR DE STAR\" de l’ONG Smile. Cette belle soirée a vu la participation de nombreuses stars, influenceurs web et de plusieurs ONG et associations. Au cours de l’évènement, Mme Awa Ba, Présidente de l’ONG Smile, a procédé à la remise de gros lots surprises des sponsors aux différentes ONG et associations par des défis que des bénévoles ont relevé sur place. SUNU Assurances a offert une assurance Individuelle Accidents d’une valeur de 10.500.000 F. CŒUR DE STAR avec comme sponsor SUNU Assurances pour soutenir cette chaîne de solidarité pérenne.</p>\r\n\ntexte_article_en=><p>On Wednesday, October 17, 2018, SUNU Assurances in Côte d&#39;Ivoire participated in the launch of the web-show CŒUR DE STAR of the NGO Smile. This beautiful evening saw the participation of many stars, web influencers and several NGOs and associations. During the event, Mrs. Awa Ba, President of the NGO Smile, proceeded to the delivery of large surprise prizes from the sponsors to the various NGOs and associations by challenges that volunteers identified on the spot. SUNU Assurances has offered an Individual Accident Insurance worth 10,500,000 F. HEART OF STAR with as sponsor SUNU Assurances to support this sustainable chain of solidarity.</p>\r\n\nlecture_article=>0\nfichier_article=>coeurdestar.jpg\ndateCreated_article=>2018-10-22 13:00:15\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1143,2147204895,'2018-10-22 11:01:20','photo','insert|all|313|0|id_photo=>313\nid_article=>34\nfichier_photo=>coeurdestar0.jpg\ndateCreated_photo=>2018-10-22 13:01:20\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1144,2147204895,'2018-10-22 11:01:21','photo','insert|all|314|0|id_photo=>314\nid_article=>34\nfichier_photo=>coeurdestar1.jpg\ndateCreated_photo=>2018-10-22 13:01:21\ndateDisabled_phot