 09:29:11','_SESSION','login|all|1540459741|0|__ci_last_regenerate=>1540459741\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-10-23 11:47:08::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1162,2147204895,'2018-10-25 09:29:13','_SESSION','login|all|1540459741|0|__ci_last_regenerate=>1540459741\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-10-25 11:29:11::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1163,2147204895,'2018-10-31 12:05:25','_SESSION','login|all|1540987519|0|__ci_last_regenerate=>1540987519\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-10-25 11:29:13::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1164,2147204895,'2018-10-31 12:05:26','_SESSION','login|all|1540987519|0|__ci_last_regenerate=>1540987519\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-10-31 13:05:25::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1165,2147204895,'2018-11-06 15:42:39','_SESSION','login|all|1541518940|0|__ci_last_regenerate=>1541518940\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-10-31 13:05:26::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1166,2147204895,'2018-11-06 17:54:47','article','insert|all|35|0|id_article=>35\ntitre_article=>Côte d\'ivoire : SUNU Assurances Vie CI sponsor de la 1ère édition du salon de l’épargne\ntitre_article_en=>Côte d\'Ivoire  : SUNU Assurances Vie CI sponsor of the first edition of the savings exhibition\ntexte_article=><p>La première édition du Salon de l&#39;Epargne, de l&#39;Investissement et du Patrimoine (SEIP 2018) s’est déroulée le mercredi 31 octobre 2018 au Sofitel Hôtel Ivoire à Abidjan.</p>\r\n\r\n<p>SUNU Assurances Vie CI sponsor de l’évènement a été représentée par M. Saliou BAKAYOKO (Directeur Général de SUNU Assurances Vie CI) et M. Gildas N’ZOUBA (Directeur Général Adjoint de SUNU Assurances Vie CI) qui ont animé respectivement un panel sur l&#39;importance de l&#39;épargne dans l&#39;émergence économique et une master class sur l&#39;assurance vie par capitalisation.</p>\r\n\r\n<p>Les participants ont pu échanger sur la planification financière afin de mieux gérer leur épargne dans les établissements classiques.</p>\r\n\ntexte_article_en=><p>The first edition of the Salon de l&#39;Epargne, Investment and Patrimoine (SEIP 2018) took place on Wednesday, October 31, 2018 at the Sofitel Hotel Ivoire in Abidjan.</p>\r\n\r\n<p>SUNU Assurances Vie CI sponsor of the event was represented by Mr. Saliou BAKAYOKO (General Manager of SUNU Assurances Vie CI) and Mr. Gildas N&#39;ZOUBA (Deputy General Manager of SUNU Assurances Vie CI) who respectively led a panel on the importance of savings in economic emergence and a master class on life insurance by capitalization.</p>\r\n\r\n<p>Participants were able to discuss financial planning to better manage their savings in conventional institutions.</p>\r\n\nlecture_article=>0\nfichier_article=>seip2018.jpg\ndateCreated_article=>2018-11-06 18:54:47\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1167,2147204895,'2018-11-06 17:58:42','article','insert|all|36|0|id_article=>36\ntitre_article=>Sénégal :  Journée \"don de sang\"\ntitre_article_en=>Senegal :  Day \"blood donation\"\ntexte_article=><p>SUNU Assurances au Sénégal, en partenariat avec le Centre National de Transfusion Sanguine (CNTS), a organisé une journée « Don de Sang » le jeudi 25 Octobre 2018 dans ses locaux, à Dakar. Un geste volontaire, gratuit et anonyme, le don de sang reste nécessaire aujourd’hui encore plus qu’hier, pour sauver des vies.</p>\r\n\ntexte_article_en=><p>SUNU Assurances in Senegal, in partnership with the National Blood Transfusion Center (CNTS), organized a \"blood donation\" day on Thursday, October 25, 2018 at its premises in Dakar. A voluntary gesture, free and anonymous, the donation of blood remains necessary today even more than yesterday, to save lives.</p>\r\n\nlecture_article=>0\nfichier_article=>don2sang.jpg\ndateCreated_article=>2018-11-06 18:58:42\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1168,2147204895,'2018-11-06 18:04:11','article','insert|all|37|0|id_article=>37\ntitre_article=>Togo :  Event 20 ans\ntitre_article_en=>Togo :   Event 20 years \ntexte_article=><p>Le vendredi 02 novembre 2018, SUNU Assurances et SUNU Santé ont célébré ensemble le 20ème anniversaire du Groupe SUNU. Les clients, partenaires et les personnels des différentes sociétés du Groupe SUNU ainsi que le comité de Direction de la Banque Populaire récemment membre du Groupe SUNU étaient présents.</p>\r\n\r\n<p>Pr. Etienne AYITE (Président du Conseil d’Administration de SUNU Assurances Vie Togo, Directeur Général de SUNU Santé) a donné le ton de cette ambiance chaleureuse au cours de laquelle les pionniers du groupe SUNU au Togo ont été célébrés. La cérémonie a été le lieu de présenter aux différents partenaires et clients, M. Yannick GOTTA (Nouveau Directeur Général Adjoint de SUNU Assurances IARD Togo) ainsi que Mme Myriam ADOTEVI (Nouvelle Directrice Générale de la BPEC).</p>\r\n\ntexte_article_en=><p>On Friday, November 2nd, 2018, SUNU Assurances and SUNU Santé celebrated together the 20th anniversary of the SUNU Group. The clients, partners and staff of the various companies of the SUNU Group as well as the Management Committee of the Banque Populaire recently member of the SUNU Group were present. Pr. Etienne AYITE (Chairman of the Board of Directors of SUNU Assurances Vie Togo, Director General of SUNU Santé) set the tone for this warm atmosphere during which the pioneers of the SUNU group in Togo were celebrated. The ceremony was the place to present to the various partners and customers, Mr. Yannick GOTTA (New Deputy Director General of SUNU Assurances IARD Togo) as well as Mrs. Myriam ADOTEVI (New Director General of BPEC).</p>\r\n\nlecture_article=>0\nfichier_article=>11.jpg\ndateCreated_article=>2018-11-06 19:04:11\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1169,2147204895,'2018-11-06 18:06:54','photo','insert|all|329|0|id_photo=>329\nid_article=>37\nfichier_photo=>eventtogo6.jpg\ndateCreated_photo=>2018-11-06 19:06:54\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1170,2147204895,'2018-11-06 18:06:57','photo','insert|all|330|0|id_photo=>330\nid_article=>37\nfichier_photo=>eventtogo8.jpg\ndateCreated_photo=>2018-11-06 19:06:57\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1171,2147204895,'2018-11-06 18:07:09','photo','insert|all|331|0|id_photo=>331\nid_article=>37\nfichier_photo=>eventtogo10.jpg\ndateCreated_photo=>2018-11-06 19:07:09\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1172,2147204895,'2018-11-06 18:07:10','photo','insert|all|332|0|id_photo=>332\nid_article=>37\nfichier_photo=>eventtogo14.jpg\ndateCreated_photo=>2018-11-06 19:07:10\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1173,2147204895,'2018-11-06 18:07:11','photo','insert|all|333|0|id_photo=>333\nid_article=>37\nfichier_photo=>eventtogo16.jpg\ndateCreated_photo=>2018-11-06 19:07:11\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1174,2147204895,'2018-11-06 18:07:49','photo','insert|all|334|0|id_photo=>334\nid_article=>36\nfichier_photo=>don2sang0.jpg\ndateCreated_photo=>2018-11-06 19:07:49\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1175,2147204895,'2018-11-06 18:07:50','photo','insert|all|335|0|id_photo=>335\nid_article=>36\nfichier_photo=>don2sang1.jpg\ndat