r_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1184,2147204895,'2018-11-22 15:21:01','_SESSION','login|all|1542900061|0|__ci_last_regenerate=>1542900061\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-11-21 12:21:08::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1185,2147204895,'2018-11-22 15:36:50','article','insert|all|38|0|id_article=>38\ntitre_article=>Centrafrique : Célébration des 20 ans du Groupe SUNU\ntitre_article_en=>Centrafrique :  Celebration of the 20th anniversary of the SUNU Group\ntexte_article=><p>SUNU Assurances IARD Centrafrique et SUNU Assurances Vie Cameroun Succursale Centrafrique ont célébré les 20 ans du Groupe SUNU, le samedi 10 novembre 2018. L’évènement s’est déroulé autour de deux actions majeures : un don composé de différents produits pharmaceutiques a été offert à la maternité de l’hôpital Communautaire de Bangui pour remédier aux récurrents décès des suites de césarienne et un hommage a été rendu à 6 employés qui ont totalisé plus de 20 ans de service (Mme Bengonda, M. Bangué, M. Konga, Mme Koyaweda, M. Kitambo et Mme Bada). Les Perroquets de Bangui (deuxième lauréat de la Saison 2 de l’émission «L’Afrique a un Incroyable Talent») ont présenté un spectacle teinté de beaucoup d’humour sur la nécessité de souscrire à une police d’assurance. Le partage du gâteau des 20 ans a marqué la fin de la célébration.</p>\r\n\ntexte_article_en=><p>SUNU Assurances IARD Centrafrique and SUNU Assurances Vie Cameroon Centrafrique branch celebrated the 20th anniversary of the SUNU Group on Saturday, November 10, 2018. The event was organized around two major actions: a donation made up of various pharmaceutical products was offered to the maternity ward of the Bangui Community Hospital to rectify the recurring deaths from cesarean section and a tribute was paid to 6 employees who had more than 20 years of service (Ms. Bengonda, Mr. Bangué, Mr. Konga, Ms. Koyaweda Mr. Kitambo and Ms. Bada). The Parrots of Bangui (second winner of Season 2 of the show \"L’Afrique a un Incroyable Talent\") presented a show tinged with a lot of humor on the need to subscribe to an insurance policy. The sharing of the cake of 20 years marked the end of the celebration.</p>\r\n\nlecture_article=>0\nfichier_article=>1event20ansrca.jpg\ndateCreated_article=>2018-11-22 16:36:50\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1186,2147204895,'2018-11-22 15:36:51','article','insert|all|39|0|id_article=>39\ntitre_article=>Centrafrique : Célébration des 20 ans du Groupe SUNU\ntitre_article_en=>Centrafrique :  Celebration of the 20th anniversary of the SUNU Group\ntexte_article=><p>SUNU Assurances IARD Centrafrique et SUNU Assurances Vie Cameroun Succursale Centrafrique ont célébré les 20 ans du Groupe SUNU, le samedi 10 novembre 2018. L’évènement s’est déroulé autour de deux actions majeures : un don composé de différents produits pharmaceutiques a été offert à la maternité de l’hôpital Communautaire de Bangui pour remédier aux récurrents décès des suites de césarienne et un hommage a été rendu à 6 employés qui ont totalisé plus de 20 ans de service (Mme Bengonda, M. Bangué, M. Konga, Mme Koyaweda, M. Kitambo et Mme Bada). Les Perroquets de Bangui (deuxième lauréat de la Saison 2 de l’émission «L’Afrique a un Incroyable Talent») ont présenté un spectacle teinté de beaucoup d’humour sur la nécessité de souscrire à une police d’assurance. Le partage du gâteau des 20 ans a marqué la fin de la célébration.</p>\r\n\ntexte_article_en=><p>SUNU Assurances IARD Centrafrique and SUNU Assurances Vie Cameroon Centrafrique branch celebrated the 20th anniversary of the SUNU Group on Saturday, November 10, 2018. The event was organized around two major actions: a donation made up of various pharmaceutical products was offered to the maternity ward of the Bangui Community Hospital to rectify the recurring deaths from cesarean section and a tribute was paid to 6 employees who had more than 20 years of service (Ms. Bengonda, Mr. Bangué, Mr. Konga, Ms. Koyaweda Mr. Kitambo and Ms. Bada). The Parrots of Bangui (second winner of Season 2 of the show \"L’Afrique a un Incroyable Talent\") presented a show tinged with a lot of humor on the need to subscribe to an insurance policy. The sharing of the cake of 20 years marked the end of the celebration.</p>\r\n\nlecture_article=>0\nfichier_article=>1event20ansrca1.jpg\ndateCreated_article=>2018-11-22 16:36:51\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1187,2147204895,'2018-11-22 15:39:08','article','disable|statut_article|38|0,1,2|3'),(1188,2147204895,'2018-11-22 15:41:50','photo','insert|all|342|0|id_photo=>342\nid_article=>39\nfichier_photo=>2event20ansrca.jpg\ndateCreated_photo=>2018-11-22 16:41:50\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1189,2147204895,'2018-11-22 15:41:53','photo','insert|all|343|0|id_photo=>343\nid_article=>39\nfichier_photo=>7event20ansrca.jpg\ndateCreated_photo=>2018-11-22 16:41:53\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1190,2147204895,'2018-11-22 15:41:54','photo','insert|all|344|0|id_photo=>344\nid_article=>39\nfichier_photo=>3event20ansrca.jpg\ndateCreated_photo=>2018-11-22 16:41:54\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1191,2147204895,'2018-11-22 15:41:55','photo','insert|all|345|0|id_photo=>345\nid_article=>39\nfichier_photo=>4event20ansrca.jpg\ndateCreated_photo=>2018-11-22 16:41:55\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1192,2147204895,'2018-11-22 15:41:57','photo','insert|all|346|0|id_photo=>346\nid_article=>39\nfichier_photo=>5event20ansrca.jpg\ndateCreated_photo=>2018-11-22 16:41:57\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1193,2147204895,'2018-11-22 15:41:58','photo','insert|all|347|0|id_photo=>347\nid_article=>39\nfichier_photo=>6event20ansrca.jpg\ndateCreated_photo=>2018-11-22 16:41:58\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1194,2147204895,'2018-11-22 15:46:27','article','insert|all|40|0|id_article=>40\ntitre_article=>Côte d\'ivoire : Célébration des 20 ans du Groupe SUNU\ntitre_article_en=>Côte d\'Ivoire :  Celebration of the 20th anniversary of the SUNU Group\ntexte_article=><p>Dans la soirée du vendredi 16 novembre 2018, les sociétés SUNU Assurances de Côte d’Ivoire ont célébré les 20 ans du Groupe SUNU à l’Espace Latrille Event d’Abidjan. L’évènement s’est déroulé en présence de M. Pathé DIONE (PDG du Groupe SUNU) et des différents DG et DGA des sociétés SUNU Assurances et autres entités. Après l’allocution de M. Saliou BAKAYOKO (DG de SUNU Assurances Vie CI), les récipiendaires ont reçu des médailles du ministère de l’Emploi et de la Protection sociale en guise de reconnaissance pour le dévouement dans l’exercice de leur fonction. La soirée a été égayée par des artistes de 2 générations (nouvelle génération et ancienne génération) qui ont permis aux participants de se défouler sur la piste de danse. La coupure du gâteau des 20 ans s’est faite autour d’un cocktail avant de laisser place au bal poussière au cours duquel plusieurs talents ont été découverts.</p>\r\n\ntexte_article_en=><p>During the retro evening of Friday, November 16, 2018, employees of the SUNU group in Côte d&#39;Ivoire celebrated its 20th anniversary at Espace Latrille Event. The event took place in the presence of Mr Pathé DIONE (CEO of the SUNU Group) who gave a moving and motivating testimony, and the various DGs and DGAs of the SUNU companies. Following the presentation by Mr. Saliou BAKAYOKO (CEO of SUNU Assurances Vie CI), the recipients received medals from the Ministry of Employment and Social Protection in recognition of dedication in the performance of their duties. The evening was enlivened by artists of different generations (Bailly Spinto, LeMagnific, Kérozène, Mulukuku Dj) who allowed the participants to let off steam on the dance floor. The cut of the cake of the 20 years was made around a cocktail before giving way to the dust ball during which several talents were discovered.</p>\r\n\nlecture_article=>0\nfichier_article=>1event20ansci.jpg\ndateCreated_article=>2018-11-22 16:46:27\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1195,2147204895,'2018-11-22 15:47:12','photo','insert|all|348|0|id_photo=>348\nid_article=>40\nfichier_photo=>2event20ansci.jpg\ndateCreated_photo=>2018-11-22 16:47:12\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1196,2147204895,'2018-11-22 15:47:12','photo','insert|all|349|0|id_photo=>349\nid_article=>40\nfichier_photo=>22event20ansci.jpg\ndateCreated_photo=>2018-11-22 16:47:12\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1197,2147204895,'2018-11-22 15:47:18','photo','insert|all|350|0|id_photo=>350\nid_article=>40\nfichier_photo=>3event20ansci.jpg\ndateCreated_photo=>2018-11-22 16:47:18\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1198,2147204895,'2018-11-22 15:47:19','photo','insert|all|351|0|id_photo=>351\nid_article=>40\nfichier_photo=>4event20ansci.jpg\ndateCreated_photo=>2018-11-22 16:47:19\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1199,2147204895,'2018-11-22 15:47:22','photo','insert|all|352|0|id_photo=>352\nid_article=>40\nfichier_photo=>5event20ansci.jpg\ndateCreated_photo=>2018-11-22 16:47:22\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1200,2147204895,'2018-11-22 15:47:29','photo','insert|all|353|0|id_photo=>353\nid_article=>40\nfichier_photo=>6event20ansci.jpg\ndateCreated_photo=>2018-11-22 16:47:29\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1201,2147204895,'2018-11-22 15:47:29','photo','insert|all|354|0|id_photo=>354\nid_article=