last_regenerate=>1543237787\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-11-22 16:21:01::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1219,2147204895,'2018-11-29 12:36:23','_SESSION','login|all|1543494983|0|__ci_last_regenerate=>1543494983\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-11-26 14:10:54::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1220,2147204895,'2018-11-29 14:02:15','article','insert|all|41|0|id_article=>41\ntitre_article=>Côte d\'ivoire : SUNU Assurances Vie CI sponsor d\'Africa Fintech Forum 2018\ntitre_article_en=>Côte d\'Ivoire : SUNU Assurances Vie CI sponsor of Africa Fintech Forum\ntexte_article=><p>M. Gildas N’ZOUBA, Directeur Général Adjoint de SUNU Assurances Vie CI a animé le thème : \"Comment le numérique peut transformer/perturber le secteur de l&#39;assurance en Afrique et quels seront les segments en croissance ?\" à l&#39;Africa Fintech Forum qui s&#39;est déroulé à Azalaï Hôtel Abidjan les 26 et 27 novembre 2018. Le thème de cette année est « Fintech en Afrique : au-delà du paiement ». <br>\r\nL’objectif de l’événement est de promouvoir l’industrie de la Finance Digitale et de participer au positionnement de la Fintech (technologies financières) au cœur des stratégies de développement en Afrique car elles sont un outil formidable pour développer nos économies.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>Mr. Gildas N&#39;ZOUBA, Deputy General Manager of SUNU Assurances Vie CI led the theme: \"How can the digital sector transform / disrupt the insurance sector in Africa and which segments will be growing?\" at the Africa Fintech Forum which took place in Azalaï Hotel Abidjan on November 26 and 27, 2018. The theme of this year is \"Fintech in Africa: beyond payment\".<br>\r\nThe objective of the event is to promote the Digital Finance industry and to participate in the positioning of Fintech (financial technologies) at the heart of development strategies in Africa as they are a great tool for developing our economies.</p>\r\n\nlecture_article=>0\nfichier_article=>1africafintech.jpg\ndateCreated_article=>2018-11-29 15:02:15\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1221,2147204895,'2018-11-29 14:04:50','article','insert|all|42|0|id_article=>42\ntitre_article=>Côte d\'Ivoire : SUNU Assurances à la 3ème édition de la Finance s’engage\ntitre_article_en=>Côte d\'Ivoire : SUNU Assurances, at the 3rd edition of Finance commits\ntexte_article=><p>La plateforme d’échanges entre Entrepreneurs et acteurs de l’écosystème financier ivoirien, « La Finance S’engage », s’est ouverte ce jeudi 22 novembre Maison de l’Entreprise à Abidjan en présence du gotha du monde des affaires, des financiers et du gouvernement. La Finance S’Engage a pour objet de mobiliser les acteurs du système financier afin de mener la réflexion sur l’accompagnement des Petites et moyennes entreprises (PME). Partenaire privilégié de ce forum de réflexion, SUNU Assurances Vie CI a réitéré son engagement à apporter sa pierre à la construction d’une économie prospère. L’enjeu majeur de cette 3e édition était de renforcer la crédibilité déjà créée, en présentant les résultats concrets de cette forte mobilisation aux membres de l’écosystème financier.</p>\r\n\ntexte_article_en=><p>The platform for exchanges between entrepreneurs and actors of the Ivorian financial ecosystem, \"La Finance S&#39;engage\", opened this Thursday, November 22, Maison de l&#39;Entreprise in Abidjan in the presence of the business elite, financiers and the government. The purpose of the S&#39;Engage Finance is to mobilize the players in the financial system to lead the reflection on the support of Small and Medium Enterprises (SMEs). Privileged partner of this forum for reflection, SUNU Assurances Vie CI has reiterated its commitment to contribute to building a prosperous economy. The major challenge of this third edition was to strengthen the credibility already created by presenting the concrete results of this strong mobilization to the members of the financial ecosystem.</p>\r\n\nlecture_article=>0\nfichier_article=>0lafinancesengage.jpg\ndateCreated_article=>2018-11-29 15:04:50\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1222,2147204895,'2018-11-29 14:30:10','article','insert|all|43|0|id_article=>43\ntitre_article=>Côte d\'ivoire : SUNU Assurances Vie CI invité de la 20ème édition du Business Connexion\ntitre_article_en=>Côte d\'Ivoire : SUNU Assurances Vie CI invited to the 20th edition of Business Connection\ntexte_article=><p>Ce vendredi 23 novembre 2018 à Azalai Hôtel Abidjan, Business Connexion était à sa 20ème édition avec pour speaker du jour M. Gildas N’ZOUBA, Directeur Général Adjoint de SUNU Assurances Vie CI. Business Connexion est un évènement d’affaires et de networking direct pour les entreprises et leurs dirigeants. Au cours des échanges sur le thème : « L’économie ivoirienne à l’heure de la transformation digitale : Défis et Opportunités » M. Gildas N’ZOUBA a démontré que la transformation de l’économie digitale est centrée sur les humains. Cette rencontre fructueuse a pris fin par un cocktail et a permis aux participants de partager leurs expériences et d’échanger les contacts professionnels.</p>\r\n\ntexte_article_en=><p>his Friday, November 23, 2018, at Azalai Hotel Abidjan, Business Connection was at its 20th edition with the daily speaker Mr. Gildas N&#39;ZOUBA, Assistant General Manager of SUNU Assurances Vie CI. Business Connection is a business and direct networking event for businesses and their leaders. During exchanges on the subject: \"The Ivorian Economy at Digital Time: Challenges and Opportunities\" Mr Gildas N&#39;ZOUBA has shown that the transformation of the digital economy is centered on humans. This successful meeting ended with a cocktail and allowed participants to share their experiences and trade professional contacts.</p>\r\n\nlecture_article=>0\nfichier_article=>0businessconnect.jpg\ndateCreated_article=>2018-11-29 15:30:10\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1223,2147204895,'2018-11-29 14:32:37','photo','insert|all|371|0|id_photo=>371\nid_article=>43\nfichier_photo=>5businessconnect.jpg\ndateCreated_photo=>2018-11-29 15:32:37\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1224,2147204895,'2018-11-29 14:32:39','photo','insert|all|372|0|id_photo=>372\nid_article=>43\nfichier_photo=>1businessconnect.jpg\ndateCreated_photo=>2018-11-29 15:32:39\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1225,2147204895,'2018-11-29 14:32:50','photo','insert|all|373|0|id_photo=>373\nid_article=>43\nfichier_photo=>2businessconnect.jpg\ndateCreated_photo=>2018-11-29 15:32:50\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1226,2147204895,'2018-11-29 14:32:52','photo','insert|all|374|0|id_photo=>374\nid_article=>43\nfichier_photo=>3businessconnect.jpg\ndateCreated_photo=>2018-11-29 15:32:52\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1227,2147204895,'2018-11-29 14:32:57','photo','insert|all|375|0|id_photo=>375\nid_article=>43\nfichier_photo=>4businessconnect.jpg\ndateCreated_photo=>2018-11-29 15:32:57\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1228,2147204895,'2018-11-29 14:35:06','photo','insert|all|376|0|id_photo=>376\nid_article=>42\nfichier_photo=>1lafinancesengage.jpg\ndateCreated_photo=>2018-11-29 15:35:06\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1229,2147204895,'2018-11-29 14:35:07','photo','insert|all|377|0|id_photo=>377\nid_article=>42\nfichier_photo=>2lafinancesengage.jpg\ndateCreated_photo=>2018-11-29 15:35:07\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1230,2147204895,'2018-11-29 14:35:15','photo','insert|all|378|0|id_photo=>378\nid_article=>42\nfichier_photo=>3lafinancesengage.jpg\ndateCreated_photo=>2018-11-29 15:35:15\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1231,2147204895,'2018-11-29 14:36:07','photo','insert|all|379|0|id_photo=>379\nid_article=>41\nfichier_photo=>2africafintech.jpg\ndateCreated_photo=>2018-11-29 15:36:07\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1232,2147204895,'2018-11-29 14:36:13','photo','insert|all|380|0|id_photo=>380\nid_article=>41\nfichier_photo=>3africafintech.jpg\ndateCreated_photo=>2018-11-29 15:36:13\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1233,2147204895,'2018-11-29 14:36:17','photo','insert|all|381|0|id_photo=>381\nid_article=>41\nfichier_photo=>4africafintech.jpg\ndateCreated_photo=>2018-11-29 15:36:17\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1234,2147204895,'2018-12-12 12:26:22','_SESSION','login|all|1544617423|0|__ci_last_regenerate=>1544617423\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-11-29 13:36:23::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1235,2147204895,'2018-12-12 12:28:32','_SESSION','login|all|1544617423|0|__ci_last_regenerate=>1544617423\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-12-12 13:26:22::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1236,2147204895,'2018-12-12 12:38:34','article','insert|all|44|0|id_article=>44\ntitre_article=>Gabon : SUNU Assurances sponsor de la 6ème édition du \"Marathon du Gabon\" \ntitre_article_en=>Gabon : SUNU Assurances sponsor of 6th edition of \"Gabon Marathon\"\ntexte_article=><p>Les sociétés SUNU Assurances au Gabon participent à la 6ème édition du « Marathon du Gabon » qui se tiendra du samedi 1er au dimanche 2 décembre à Libreville. Le « Marathon du Gabon » est une course de marathon qui se déroule tous les ans, dans les rues de Libreville, au Gabon. L&#39;épreuve fait partie depuis 2015 du circuit international des IAAF Road Race Bronze (circuit regroupant les meilleures compétitions mondiales hors-stade). A cet effet, un village marathon a été installé le jeudi 29 novembre 2018 dans la ville pour accueillir les différents coureurs. SUNU Assurances sponsor de l’évènement a tenu un stand au village marathon pour faire la promotion des produits SUNU Assurances.</p>\r\n\ntexte_article_en=><p>SUNU Assurances companies in Gabon are taking part in the 6th edition of the \"Gabon Marathon\" which will be held from Saturday 1st to Sunday 2nd December in Libreville. The \"Gabon Marathon\" is a marathon race that takes place every year in the streets of Libreville, Gabon. Since 2015, the event has been part of the IAAF Road Race Bronze International Circuit (circuit bringing together the best non-stadium world competitions). To this end, a marathon village was installed on Thursday, November 29, 2018 in the city to accommodate the different runners. SUNU Assurances sponsor of the event held a booth at the marathon village to promote SUNU Assurances products.</p>\r\n\nlecture_article=>0\nfichier_article=>1marathong2018.jpg\ndateCreated_article=>2018-12-12 13:38:34\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1237,2147204895,'2018-12-12 12:39:25','photo','insert|all|382|0|id_photo=>382\nid_article=>44\nfichier_photo=>3marathong2018.jpg\ndateCreated_photo=>2018-12-12 13:39:25\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1238,2147204895,'2018-12-12 12:39:26','photo','insert|all|383|0|id_photo=>383\nid_article=>44\nfichier_photo=>2marathong2018.jpg\ndateCreated_photo=>2018-12-12 13:39:26\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1239,2147204895,'2018-12-12 12:39:29','photo','insert|all|384|0|id_photo=>384\nid_article=>44\nfichier_photo=>4marathong2018.jpg\ndateCreated_photo=>2018-12-12 13:39:29\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1240,2147204895,'2018-12-12 12:39:32','photo','insert|all|385|0|id_photo=>385\nid_article=>44\nfichier_photo=>5marathong2018.jpg\ndateCreated_photo=>2018-12-12 13:39:32\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1241,2147204895,'2018-12-12 12:39:34','photo','insert|all|386|0|id_photo=>386\nid_article=>44\nfichier_photo=>6marathong2018.jpg\ndateCreated_photo=>2018-12-12 13:39:34\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1242,2147204895,'2018-12-12 12:39:35','photo','insert|all|387|0|id_photo=>387\nid_article=>44\nfichier_photo=>7marathong2018.jpg\ndateCreated_photo=>2018-12-12 13:39:35\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1243,2147204895,'2018-12-12 12:42:38','article','insert|all|45|0|id_article=>45\ntitre_article=>Groupe SUNU : Diner Gala de la célébration des 20 ans du groupe\ntitre_article_en=>SUNU Group: Gala dinner celebrating 20 years of the Group\ntexte_article=><p>Le Groupe SUNU a célébré ses 20 ans lors d’un Diner Gala qui a eu lieu le samedi 01 décembre 2018 au King Fahd Palace à Dakar au Sénégal. Cette soirée qui réunissait plus de 400 invités du Groupe s’est déroulée avec la participation de M. Pathé DIONE (Président Directeur Général du Groupe SUNU), les principaux actionnaires du Groupe, les Administrateurs et Directeurs Généraux des filiales, les employés et clients qui nous font confiance depuis le début de l’aventure. Mme Awa BA Directrice Communication de Groupe SUNU a ouvert la série des allocutions en annonçant les couleurs de cette cérémonie qui se voulait « Panafricaine et Digitale » avant de laisser la place à M. Pathé DIONE qui a fait la genèse du Groupe SUNU et remercié les différents partenaires et clients du groupe. La célèbre artiste sénégalaise Viviane CHIDID et l’orchestre Aragon ont permis aux invités de se défouler sur la piste de danse.</p>\r\n\ntexte_article_en=><p>The SUNU Group celebrated its 20th anniversary at a Gala Dinner on Saturday, December 01, 2018 at the King Fahd Palace in Dakar, Senegal. This evening, which brought together more than 400 guests of the Group, took place with the participation of Mr. Pathé DIONE (Chairman and CEO of the SUNU Group), the main shareholders of the Group, the Directors and Managing Directors of the subsidiaries, the employees and customers who trust us from the beginning of the adventure. Ms. Awa BA Communication Director of Groupe SUNU opened the series of speeches by announcing the colors of this ceremony which was intended \"Panafricaine and Digitale\" before giving way to Mr. Pathé DIONE who made the genesis of the SUNU Group and thanked the different partners and customers of the group. The famous Senegalese artist Viviane CHIDID and the Aragon orchestra allowed guests to let off steam on the dance floor.</p>\r\n\nlecture_article=>0\nfichier_article=>01apothéose20ans.jpg\ndateCreated_article=>2018-12-12 13:42:37\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1244,2147204895,'2018-12-12 12:44:09','photo','insert|all|388|0|id_photo=>388\nid_article=>45\nfichier_photo=>2apothose20ans.jpg\ndateCreated_photo=>2018-12-12 13:44:09\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1245,2147204895,'2018-12-12 12:44:10','photo','insert|all|389|0|id_photo=>389\nid_article=>45\nfichier_photo=>3apothose20ans.jpg\ndateCreated_photo=>2018-12-12 13:44:10\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1246,2147204895,'2018-12-12 12:44:11','photo','insert|all|390|0|id_photo=>390\nid_article=>45\nfichier_photo=>01apothose20ans.jpg\ndateCreated_photo=>2018-12-12 13:44:11\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1247,2147204895,'2018-12-12 12:44:12','photo','insert|all|391|0|id_photo=>391\nid_article=>45\nfic