47204895\nstatut_photo=>1\n'),(1256,2147204895,'2018-12-12 12:44:31','photo','insert|all|400|0|id_photo=>400\nid_article=>45\nfichier_photo=>15apothose20ans.jpg\ndateCreated_photo=>2018-12-12 13:44:31\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1257,2147204895,'2018-12-12 12:53:49','article','insert|all|46|0|id_article=>46\ntitre_article=>Bénin : Signature de convention entre SUNU Assurances Vie Bénin et ASMA GROUP S.A\ntitre_article_en=>Benin: Signature of an agreement between SUNU Assurances Vie Benin and ASMA GROUP S.A\ntexte_article=><p>Le mercredi 05 décembre 2018, SUNU Assurances Vie Bénin a signé une convention de partenariat sur l’assurance décès sur le crédit avec l’Agence du Système Monétique Appliqué (ASMA GROUP S.A) qui est une structure de digitalisation monétique en microassurance. Cette convention de partenariat est le résultat du travail des équipes de SUNU Assurances Vie Bénin menée par M. Landry DJETE, Directeur du Développement Commercial et Mme Amina BABA IBRAHIM, Responsable Micro & Mobile Assurance de la filiale. Cette plateforme digitale regroupera 10 SFD (Systèmes Financiers Décentralisés), financés par des banques partenaires, qui auront chacun leur plateforme de connexion et de gestion des contrats. SUNU Assurances Vie Bénin gère ainsi, via le portail web dédié à l’assurance, les polices générées par les 10 SFD. La gestion des sinistres et prestations sera entièrement digitalisée. Par ailleurs, SUNU Assurances bénéficiera du réseau de l’ASMAB pour commercialiser ses produits d’assurances. Le lancement de la plateforme de gestion de crédit aura lieu en 2019.</p>\r\n\ntexte_article_en=><p>On Wednesday, December 05, 2018, SUNU Assurances Vie Benin signed a partnership agreement on life insurance on credit with the Agency of the Applied Monetics System &#40;ASMA GROUP S.A&#41; which is a microinsurance electronic payment structure. This partnership agreement is the result of the work of the SUNU Assurances Vie Benin teams led by Mr. Landry DJETE, Director of Business Development and Mrs. Amina BABA IBRAHIM, Head of Micro & Mobile Insurance of the subsidiary. This digital platform will bring together 10 SFD (Decentralized Financial Systems), financed by partner banks, each of which will have their connection and contract management platform. SUNU Assurances Vie Benin manages the policies generated by the 10 SFDs via the insurance web portal. Claims and benefits management will be fully digitalized. In addition, SUNU Assurances will benefit from the ASMAB network to market its insurance products. The launch of the credit management platform will take place in 2019.</p>\r\n\nlecture_article=>0\nfichier_article=>01conventionbénin.jpg\ndateCreated_article=>2018-12-12 13:53:49\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1258,2147204895,'2018-12-12 12:54:30','photo','insert|all|401|0|id_photo=>401\nid_article=>46\nfichier_photo=>2conventionbnin.jpg\ndateCreated_photo=>2018-12-12 13:54:30\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1259,2147204895,'2018-12-12 12:54:31','photo','insert|all|402|0|id_photo=>402\nid_article=>46\nfichier_photo=>3conventionbnin.jpg\ndateCreated_photo=>2018-12-12 13:54:31\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1260,2147204895,'2018-12-13 08:12:05','_SESSION','login|all|1544688462|0|__ci_last_regenerate=>1544688462\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-12-12 13:28:32::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1261,2147204895,'2018-12-13 11:49:43','_SESSION','login|all|1544701783|0|__ci_last_regenerate=>1544701783\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2018-12-13 09:12:05::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1262,2147204895,'2018-12-13 1