3643\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-02-06 12:51:54::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1269,2147204895,'2019-02-19 09:29:36','_SESSION','login|all|1550568423|0|__ci_last_regenerate=>1550568423\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-02-06 18:21:10::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1270,2147204895,'2019-02-19 09:39:32','article','insert|all|47|0|id_article=>47\ntitre_article=>GROUPE SUNU : Caravane du Bonheur 2019/CI\ntitre_article_en=>SUNU GROUP : Caravan of Happiness 2019 / CI\ntexte_article=><p>Les sociétés SUNU Assurances de Côte d’Ivoire en partenariat avec l’ONG Les Zinzins du Bonheur ont offert ce samedi 12 janvier 2019 aux enfants souffrant d’insuffisance rénale et ceux en pédiatrie du CHU de Yopougon à Abidjan des cadeaux à travers « la caravane du bonheur ».<br>\r\nCes cadeaux ont permis d’apporter de la joie et du réconfort aux enfants, et permis aux parents d’oublier un tant soit peu leur présence en ces lieux. <br>\r\nC’est dans une atmosphère de joie et de réconfort qu’a pris fin cette donation.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>The companies SUNU Assurances of Côte d&#39;Ivoire in partnership with the NGO Les Zinzins du Bonheur offered this Saturday, January 12, 2019 to children suffering from kidney failure and those pediatric hospital Yopougon to Abidjan gifts through \"the caravan happiness \".<br>\r\nThese gifts have brought joy and comfort to the children, and allowed parents to forget their presence in these places.<br>\r\nIt was in an atmosphere of joy and comfort that this donation ended.</p>\r\n\nlecture_article=>0\nfichier_article=>caravanedubonheur0.jpg\ndateCreated_article=>2019-02-19 10:39:32\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1271,2147204895,'2019-02-19 09:41:06','photo','insert|all|403|0|id_photo=>403\nid_article=>47\nfichier_photo=>caravanedubonheur01.jpg\ndateCreated_photo=>2019-02-19 10:41:06\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1272,2147204895,'2019-02-19 09:41:09','photo','insert|all|404|0|id_photo=>404\nid_article=>47\nfichier_photo=>caravanedubonheur0.jpg\ndateCreated_photo=>2019-02-19 10:41:09\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1273,2147204895,'2019-02-19 09:41:13','photo','insert|all|405|0|id_photo=>405\nid_article=>47\nfichier_photo=>caravanedubonheur2.jpg\ndateCreated_photo=>2019-02-19 10:41:13\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1274,2147204895,'2019-02-19 09:41:15','photo','insert|all|406|0|id_photo=>406\nid_article=>47\nfichier_photo=>caravanedubonheur1.jpg\ndateCreated_photo=>2019-02-19 10:41:15\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1275,2147204895,'2019-02-19 09:41:18','photo','insert|all|407|0|id_photo=>407\nid_article=>47\nfichier_photo=>caravanedubonheur3.jpg\ndateCreated_photo=>2019-02-19 10:41:18\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1276,2147204895,'2019-02-19 09:41:21','photo','insert|all|408|0|id_photo=>408\nid_article=>47\nfichier_photo=>caravanedubonheur4.jpg\ndateCreated_photo=>2019-02-19 10:41:21\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1277,2147204895,'2019-02-19 09:41:30','photo','insert|all|409|0|id_photo=>409\nid_article=>47\nfichier_photo=>caravanedubonheur6.jpg\ndateCreated_photo=>2019-02-19 10:41:30\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1278,2147204895,'2019-02-19 09:41:31','photo','insert|all|410|0|id_photo=>410\nid_article=>47\nfichier_photo=>caravanedubonheur5.jpg\ndateCreated_photo=>2019-02-19 10:41:31\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1279,2147204895,'2019-02-19 09:41:39','photo','insert|all|411|0|id_photo=>411\nid_article=>47\nfichier_photo=>caravanedubonheur7.jpg\ndateCreated_photo=>2019-02-19 10:41:39\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1280,2147204895,'2019-02-19 09:41:40','photo','insert|all|412|0|id_photo=>412\nid_article=>47\nfichier_photo=>caravanedubonheur8.jpg\ndateCreated_photo=>2019-02-19 10:41:40\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1281,2147204895,'2019-02-19 10:01:41','article','insert|all|48|0|id_article=>48\ntitre_article=>Côte d\'Ivoire : SUNU Assurances IARD 2ème prix « LES PÉPITES DE L’ACCUEIL »\ntitre_article_en=>Côte d\'Ivoire : SUNU Assurances IARD, 2nd prize \"THE PEPITES OF HOSPITALITY\"\ntexte_article=><p>Le jeudi 10 janvier, le ministre du Plan et du Développement, Mme KABA NIALE, recevait à son cabinet au Plateau, les lauréats de la deuxième édition du trophée “ les pépites de l’accueil” organisé par le cabinet Académie du service CI. <br>\r\nC’est au total, une vingtaine d&#39;entreprises issues de vingt-cinq secteurs d&#39;activités qui ont été distinguées dont SUNU Assurances IARD Côte d’Ivoire.  <br>\r\nCette compétition annuelle se veut être un baromètre de la qualité de l’accueil, visant à promouvoir l’excellence dans les administrations publiques et privées du pays.</p>\r\n\ntexte_article_en=><p>On Thursday, January 10, the Minister of Planning and Development, Mrs. KABA NIALE, received at her office at the Plateau, the winners of the second edition of the trophy \"the nuggets of hospitality\" organized by the firm Academy of CI service.<br>\r\nIn total, about twenty companies from twenty-five business sectors were distinguished including SUNU Assurances IARD Côte d&#39;Ivoire.<br>\r\nThis annual competition is intended to be a barometer of the quality of the welcome, aiming to promote excellence in the public and private administrations of the country.</p>\r\n\nlecture_article=>0\nfichier_article=>pepitesdelaccueilsunuiardci0_2019.jpg\ndateCreated_article=>2019-02-19 11:01:41\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1282,2147204895,'2019-02-19 10:31:42','photo','insert|all|413|0|id_photo=>413\nid_article=>48\nfichier_photo=>pepitesdelaccueilsunuiardci0_2019.jpg\ndateCreated_photo=>2019-02-19 11:31:42\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1283,2147204895,'2019-02-19 10:31:42','photo','insert|all|414|0|id_photo=>414\nid_article=>48\nfichier_photo=>pepitesdelaccueilsunuiardci1_2019.jpg\ndateCreated_photo=>2019-02-19 11:31:42\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1284,2147204895,'2019-02-19 10:31:44','photo','insert|all|415|0|id_photo=>415\nid_article=>48\nfichier_photo=>pepitesdelaccueilsunuiardci2_2019.jpg\ndateCreated_photo=>2019-02-19 11:31:44\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1285,2147204895,'2019-02-19 10:31:49','photo','insert|all|416|0|id_photo=>416\nid_article=>48\nfichier_photo=>pepitesdelaccueilsunuiardci3_2019.jpg\ndateCreated_photo=>2019-02-19 11:31:49\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1286,2147204895,'2019-02-21 15:00:19','_SESSION','login|all|1550761154|0|__ci_last_regenerate=>1550761154\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-02-19 10:29:36::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1287,2147204895,'2019-02-21 15:12:18','article','insert|all|49|0|id_article=>49\ntitre_article=>LE GROUPE SUNU A LA 43ème EDITION DE LA FANAF\ntitre_article_en=>THE SUNU GROUP AT THE 43rd EDITION OF FANAF\ntexte_article=><p>Comme chaque année, se tiennent les rencontres annuelles de la FANAF (Fédération des Sociétés d&#39;Assurances de Droit National Africaines).<br>\r\nPour sa 43ème édition, la FANAF se déroule à Tunis du 18 au 22 février 2019 avec pour thème : « Quelle structure de marché pour promouvoir le développement de l’assurance africaine ? ».<br>\r\nLe PDG M. Pathé DIONE accompagné des Directeurs Généraux du Groupe et de quelques filiales ont représenté le Groupe SUNU à cette rencontre incontournable du secteur de l’assurance.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>As every year, the annual meetings of FANAF (Federation of African National Insurance Companies) are held.<br>\r\nFor its 43rd edition, FANAF is taking place in Tunis from 18 to 22 February 2019 with the theme: \"What market structure to promote the development of African insurance? \".<br>\r\nThe CEO Mr. Pathé DIONE accompanied by the Group&#39;s General Managers and some subsidiaries represented the SUNU Group at this essential meeting of the insurance sector.</p>\r\n\nlecture_article=>0\nfichier_article=>fanaf0_2019.jpg\ndateCreated_article=>2019-02-18 16:12:18\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1288,2147204895,'2019-02-21 15:14:47','photo','insert|all|417|0|id_photo=>417\nid_article=>49\nfichier_photo=>fanaf3_2019.jpg\ndateCreated_photo=>2019-02-21 16:14:47\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1289,2147204895,'2019-02-21 15:14:48','photo','insert|all|418|0|id_photo=>418\nid_article=>49\nfichier_photo=>fanaf1_2019.jpg\ndateCreated_photo=>2019-02-21 16:14:48\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1290,2147204895,'2019-02-21 15:14:59','photo','insert|all|419|0|id_photo=>419\nid_article=>49\nfichier_photo=>fanaf4_2019.jpg\ndateCreated_photo=>2019-02-21 16:14:59\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1291,2147204895,'2019-02-21 15:15:01','photo','insert|all|420|0|id_photo=>420\nid_article=>49\nfichier_photo=>fanaf5-2019.jpg\ndateCreated_photo=>2019-02-21 16:15:01\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1292,2147204895,'2019-02-21 15:16:28','article','update|all|48|id_article=>48\ntitre_article=>Côte d\'Ivoire : SUNU Assurances IARD 2ème prix « LES PÉPITES DE L’ACCUEIL »\ntitre