de vingt-cinq secteurs d&#39;activités qui ont été distinguées dont SUNU Assurances IARD Côte d’Ivoire.  <br>\r\nCette compétition annuelle se veut être un baromètre de la qualité de l’accueil, visant à promouvoir l’excellence dans les administrations publiques et privées du pays.</p>\r\n\ntexte_article_en=><p>On Thursday, January 10, the Minister of Planning and Development, Mrs. KABA NIALE, received at her office at the Plateau, the winners of the second edition of the trophy \"the nuggets of hospitality\" organized by the firm Academy of CI service.<br>\r\nIn total, about twenty companies from twenty-five business sectors were distinguished including SUNU Assurances IARD Côte d&#39;Ivoire.<br>\r\nThis annual competition is intended to be a barometer of the quality of the welcome, aiming to promote excellence in the public and private administrations of the country.</p>\r\n\nlecture_article=>0\nfichier_article=>pepitesdelaccueilsunuiardci0_2019.jpg\ndateCreated_article=>2019-01-10 16:16:28\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1293,2147204895,'2019-02-21 15:21:25','article','update|all|47|id_article=>47\ntitre_article=>GROUPE SUNU : Caravane du Bonheur 2019/CI\ntitre_article_en=>SUNU GROUP : Caravan of Happiness 2019 / CI\ntexte_article=><p>Les sociétés SUNU Assurances de Côte d’Ivoire en partenariat avec l’ONG Les Zinzins du Bonheur ont offert ce samedi 12 janvier 2019 aux enfants souffrant d’insuffisance rénale et ceux en pédiatrie du CHU de Yopougon à Abidjan des cadeaux à travers « la caravane du bonheur ».<br>\r\nCes cadeaux ont permis d’apporter de la joie et du réconfort aux enfants, et permis aux parents d’oublier un tant soit peu leur présence en ces lieux. <br>\r\nC’est dans une atmosphère de joie et de réconfort qu’a pris fin cette donation.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>The companies SUNU Assurances of Côte d&#39;Ivoire in partnership with the NGO Les Zinzins du Bonheur offered this Saturday, January 12, 2019 to children suffering from kidney failure and those pediatric hospital Yopougon to Abidjan gifts through \"the caravan happiness \".<br>\r\nThese gifts have brought joy and comfort to the children, and allowed parents to forget their presence in these places.<br>\r\nIt was in an atmosphere of joy and comfort that this donation ended.</p>\r\n\nlecture_article=>0\nfichier_article=>caravanedubonheur0.jpg\ndateCreated_article=>2019-02-19 10:39:32\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>47\ntitre_article=>GROUPE SUNU : Caravane du Bonheur 2019/CI\ntitre_article_en=>SUNU GROUP : Caravan of Happiness 2019 / CI\ntexte_article=><p>Les sociétés SUNU Assurances de Côte d’Ivoire en partenariat avec l’ONG Les Zinzins du Bonheur ont offert ce samedi 12 janvier 2019 aux enfants souffrant d’insuffisance rénale et ceux en pédiatrie du CHU de Yopougon à Abidjan des cadeaux à travers « la caravane du bonheur ».<br>\r\nCes cadeaux ont permis d’apporter de la joie et du réconfort aux enfants, et permis aux parents d’oublier un tant soit peu leur présence en ces lieux. <br>\r\nC’est dans une atmosphère de joie et de réconfort qu’a pris fin cette donation.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>The companies SUNU Assurances of Côte d&#39;Ivoire in partnership with the NGO Les Zinzins du Bonheur offered this Saturday, January 12, 2019 to children suffering from kidney failure and those pediatric hospital Yopougon to Abidjan gifts through \"the caravan happiness \".<br>\r\nThese gifts have brought joy and comfort to the children, and allowed parents to forget their presence in these places.<br>\r\nIt was in an atmosphere of joy and comfort that this donation ended.</p>\r\n\nlecture_article=>0\nfichier_article=>caravanedubonheur0.jpg\ndateCreated_article=>2019-02-12 16:21:25\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1294,2147204895,'2019-02-21 15:31:22','article','insert|all|50|0|id_article=>50\ntitre_article=>Côte d\'Ivoire : 1er tirage au sort du produit \"Top Epargne\"\ntitre_article_en=>Côte d\'Ivoire : 1st draw of the product \"Top Epargne\"\ntexte_article=><p>SUNU Assurances Vie CI en partenariat avec BAOBAB (ex MICROCRED) a procédé au 1er tirage du produit Top Epargne. Le tirage a eu lieu au siège de BAOBAB aux Vallons à Abidjan, le vendredi 14 décembre 2018. Me HYKPO, huissier de justice, a procédé au tirage avec la participation du public venu pour la circonstance. Pour ce tirage, deux clientes issues de l’agence de San-Pédro ont été les heureuses gagnantes. Les numéros tirés au sort sont : 368 et 665 Tous les numéros de police qui se terminent par 368 et 665 sont gagnants de 1 000 000 FCFA si le client est à jour de cotisation.<o></o></p>\r\n\ntexte_article_en=><p>SUNU Assurances Vie CI in partnership with BAOBAB (formerly MICROCRED) has made the first draw of the Top Epargne product. The draw took place at BAOBAB&#39;s headquarters in Vallons, Abidjan, on Friday, December 14, 2018. Mr. HYKPO, bailiff, proceeded to the draw with the participation of the public who came for the occasion. For this draw, two clients from the San-Pédro agency were the lucky winners. The numbers drawn are: 368 and 665 All the police numbers that end with 368 and 665 are winners of 1,000,000 FCFA if the client is up to date.</p>\r\n\nlecture_article=>0\nfichier_article=>0topépargne.jpg\ndateCreated_article=>2018-12-14 16:31:22\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1295,2147204895,'2019-02-21 15:34:37','article','insert|all|51|0|id_article=>51\ntitre_article=>Côte d\'Ivoire : SUNU Assurances aux Mining Olympiades\ntitre_article_en=>Côte d\'Ivoire : SUNU Assurances at the Mining Olympiades\ntexte_article=><p>Le Samedi 15 décembre à l’INP-HB de Yamoussoukro, le Groupement Professionnel des Miniers de Côte d’Ivoire (GPMCI) a convié les acteurs du secteur minier à la 3e édition de ses activités sportives dénommée les « Mining Olympiades ». Sponsors de l’évènement, les sociétés SUNU Assurances de Côte d’Ivoire ont matérialisé l’une des valeurs chères du groupe : la proximité clients. A cet effet, Monsieur Ramsès Kouakou, Chef du Département Marketing de SUNU Assurances Vie CI, a présenté brièvement le Groupe et réitéré le partenariat avec le GPMCI. Après l’allocution de M. IBRAHIMA DANSO, président dudit groupement, place a été donnée à l’ouverture des jeux. Un somptueux dîner fut offert, au cours duquel les gagnants des différentes disciplines ont été récompensés. Ce fut également l’occasion de célébrer les 10 ans du GPMCI.</p>\r\n\ntexte_article_en=><p>On Saturday, December 15 at the INP-HB Yamoussoukro, the Professional Mining Group of Côte d&#39;Ivoire (GPMCI) invited the mining sector to the third edition of its sports activities called the \"Mining Olympiads\". Sponsor of the event, the SUNU Assurances companies of Côte d&#39;Ivoire have materialized one of the group&#39;s cherished values: customer proximity. To this end, Mr. Ramsès Kouakou, Head of Marketing Department of SUNU Life Insurance CI, briefly introduced the Group and reiterated the partnership with the GPMCI. After the speech of Mr. IBRAHIMA DANSO, president of the grouping, place was given to the opening of the games. A sumptuous dinner was offered, during which the winners of the various disciplines were rewarded. It was also an opportunity to celebrate the 10 years of GPMCI.</p>\r\n\nlecture_article=>0\nfichier_article=>0miningolymp.jpg\ndateCreated_article=>2018-12-15 16:34:37\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1296,2147204895,'2019-02-21 15:36:13','photo','insert|all|421|0|id_photo=>421\nid_article=>51\nfichier_photo=>1miningolymp.jpg\ndateCreated_photo=>2019-02-21 16:36:13\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1297,2147204895,'2019-02-21 15:36:14','photo','insert|all|422|0|id_photo=>422\