nstatut_photo=>1\n'),(1306,2147204895,'2019-02-21 15:37:22','photo','insert|all|431|0|id_photo=>431\nid_article=>50\nfichier_photo=>4toppargne.jpg\ndateCreated_photo=>2019-02-21 16:37:22\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1307,2147204895,'2019-02-21 15:37:24','photo','insert|all|432|0|id_photo=>432\nid_article=>50\nfichier_photo=>5toppargne.jpg\ndateCreated_photo=>2019-02-21 16:37:24\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1308,2147204895,'2019-02-21 15:37:26','photo','insert|all|433|0|id_photo=>433\nid_article=>50\nfichier_photo=>6toppargne.jpg\ndateCreated_photo=>2019-02-21 16:37:26\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1309,2147204895,'2019-02-21 15:46:49','article','insert|all|52|0|id_article=>52\ntitre_article=>Côte d\'Ivoire : SUNU Assurances en partenariat avec la Chambre Nationale d\'Agriculture\ntitre_article_en=>Côte d\'Ivoire : SUNU Assurances in partnership with the National Chamber of Agriculture\ntexte_article=><p>SUNU Assurances et la Chambre Nationale d’Agriculture de Côte d’Ivoire (CNA-CI) ont scellé leur partenariat par une signature de convention qui s’est déroulée ce jeudi 13 décembre 2018, au siège de SUNU Assurances Vie CI à Abidjan. Engagés dans la promotion de l’inclusion financière, SUNU Assurances et la CNA-CI ont décidé de concevoir et de proposer des offres adaptées des produits de micro assurance à fort  potentiel d’inclusion financière dans le secteur agricole. Au cours de cette cérémonie, M. Saliou BAKAYOKO représentant des sociétés de SUNU Assurances  a présenté brièvement sa structure tout en rassurant l’assemblée pour le règlement rapide des sinistres.</p>\r\n\ntexte_article_en=><p>SUNU Assurances and the Côte d&#39;Ivoire National Chamber of Agriculture (CNA-CI) sealed their partnership with a convention signed on Thursday, December 13, 2018, at the headquarters of SUNU Assurances Vie CI in Abidjan. Committed to promoting financial inclusion, SUNU Assurances and CNA-CI have decided to design and offer tailored offers for microinsurance products with high potential for financial inclusion in the agricultural sector. During this ceremony, Mr. Saliou BAKAYOKO representing companies of SUNU Assurances briefly presented its structure while reassuring the assembly for the rapid settlement of claims.</p>\r\n\nlecture_article=>0\nfichier_article=>1convention_cna.jpg\ndateCreated_article=>2018-12-13 16:46:49\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1310,2147204895,'2019-02-21 15:49:53','photo','insert|all|434|0|id_photo=>434\nid_article=>52\nfichier_photo=>3convention_cna.jpg\ndateCreated_photo=>2019-02-21 16:49:53\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1311,2147204895,'2019-02-21 15:49:58','photo','insert|all|435|0|id_photo=>435\nid_article=>52\nfichier_photo=>2convention_cna.jpg\ndateCreated_photo=>2019-02-21 16:49:58\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1312,2147204895,'2019-02-21 15:50:05','photo','insert|all|436|0|id_photo=>436\nid_article=>52\nfichier_photo=>4convention_cna.jpg\ndateCreated_photo=>2019-02-21 16:50:05\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1313,2147204895,'2019-02-21 15:50:07','photo','insert|all|437|0|id_photo=>437\nid_article=>52\nfichier_photo=>5convention_cna.jpg\ndateCreated_photo=>2019-02-21 16:50:07\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1314,2147204895,'2019-02-21 15:50:23','photo','insert|all|438|0|id_photo=>438\nid_article=>52\nfichier_photo=>6convention_cna.jpg\ndateCreated_photo=>2019-02-21 16:50:23\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1315,2147204895,'2019-03-04 07:49:18','_SESSION','login|all|1551685642|0|__ci_last_regenerate=>1551685642\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-02-21 16:00:19::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1316,2147204895,'2019-03-04 07:57:46','article','insert|all|53|0|id_article=>53\ntitre_article=>Le Groupe SUNU au FESPACO 2019\ntitre_article_en=>The SUNU Group At FESPACO 2019\ntexte_article=><p>Le Groupe SUNU a pris part au FESPACO (Le Festival panafricain du cinéma et de la télévision de Ouagadougou) du 24 Février au 1er Mars 2019 en tant que sponsor du film DESRANCES de la réalisatrice Burkinabé Apolline TRAORE avec comme acteur principal le célèbre Jimmy jean louis. <br>\r\nPour la première du film au Ciné Burkina, il y a eu la présence de la première dame du Burkina Faso, les Directeurs Généraux des sociétés SUNU Assurances au Burkina Faso... .<br>\r\nVu le monde qu’a drainé cette première du film, le Groupe SUNU espère que pour ce cinquantenaire du FESPACO le « yennega », l’étalon d’or soit remporté par une femme.  Ce qui sera une grande première dans le monde du cinéma africain. </p>\r\n\ntexte_article_en=><p>The SUNU Group took part in FESPACO (The Panafrican Film and Television Festival of Ouagadougou) this <span xss=removed>February 24 to March 01, </span>2019 as sponsor of the film DESRANCES by the Burkinabé director Apolline TRAORE, with the famous actor Jimmy jean louis as main actor.<br>\r\nFor the premiere of the film at Ciné Burkina, there was the presence of the first lady of Burkina Faso, the Directors General of SUNU Assurances companies in Burkina Faso ....<br>\r\nGiven the world this film premiered, the SUNU Group hopes that for this fiftieth anniversary of FESPACO the \"yennega\", the gold standard will be won by a woman. This will be a great first in the world of African cinema.</p>\r\n\nlecture_article=>0\nfichier_article=>projectiondesrances001.jpg\ndateCreated_article=>2019-02-24 08:57:46\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1317,2147204895,'2019-03-04 07:58:30','photo','insert|all|439|0|id_photo=>439\nid_article=>53\nfichier_photo=>projectiondesrances002.jpg\ndateCreated_photo=>2019-03-04 08:58:30\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1318,2147204895,'2019-03-04 07:58:31','photo','insert|all|440|0|id_photo=>440\nid_article=>53\nfichier_photo=>projectiondesrances003.jpg\ndateCreated_photo=>2019-03-04 08:58:31\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1319,2147204895,'2019-03-04 07:58:32','photo','insert|all|441|0|id_photo=>441\nid_article=>53\nfichier_photo=>projectiondesrances004.jpg\ndateCreated_photo=>2019-03-04 08:58:32\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1320,2147204895,'2019-03-04 07:58:33','photo','insert|all|442|0|id_photo=>442\nid_article=>53\nfichier_photo=>projectiondesrances005.jpg\ndateCreated_photo=>2019-03-04 08:58:33\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1321,2147204895,'2019-03-25 17:42:02','_SESSION','login|all|1553535684|0|__ci_last_regenerate=>1553535684\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-03-04 08:49:18::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1322,2147484848,'2019-03-27 11:05:23','_SESSION','login|all|1553684691|0|__ci_last_regenerate=>1553684691\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2018-08-03 11:47:47::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n'),(1323,2147484848,'2019-03-27 11:05:31','_SESSION','logout|all|1553684691|__ci_last_regenerate=>1553684691\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2018-08-03 11:47:47::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n|0'),(1324,2147484848,'2019-03-27 11:05:47','_SESSION','login|all|1553684733|0|__ci_last_regenerate=>1553684733\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2019-03-27 12:05:2