_article=>Caravane SUNU Assurances au Burkina\ntitre_article_en=>SUNU Assurances in Burkina Faso Caravan\ntexte_article=><p>La caravane SUNU Assurances Ya Paalé a débuté le 30 mars 2019 à Bobo Dioulasso. La parade et les activations en matinée ont été suivies du concert en soirée à la place TIEFFO AMORO en présence du Haut-commissaire représentant le Gouverneur de la région des Hauts Bassins, du Directeur Général de SUNU Assurances Vie Burkina Faso, des Directeurs régionaux et des maires de communes. Cap sur la prochaine étape qui sera la ville de Dédougou.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>The caravan SUNU Assurances Ya Paalé started on March 30, 2019 in Bobo Dioulasso. The morning parade and activations were followed by an evening concert at TIEFFO AMORO Square in the presence of the High Commissioner representing the Governor of the Hauts Bassins Region, the Director General of SUNU Assurances Vie Burkina Faso, Regional Directors and Mayors common. Head to the next step which will be the city of Dédougou.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>caravanesunuassurancesyapaalébf0_2019.jpg\ndateCreated_article=>2019-03-30 21:01:32\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1338,2147204895,'2019-04-04 19:04:15','article','update|all|54|id_article=>54\ntitre_article=>Caravane SUNU Assurances au Burkina\ntitre_article_en=>SUNU Assurances in Burkina Faso Caravan\ntexte_article=><p>La caravane SUNU Assurances Ya Paalé a débuté le 30 mars 2019 à Bobo Dioulasso. La parade et les activations en matinée ont été suivies du concert en soirée à la place TIEFFO AMORO en présence du Haut-commissaire représentant le Gouverneur de la région des Hauts Bassins, du Directeur Général de SUNU Assurances Vie Burkina Faso, des Directeurs régionaux et des maires de communes. Cap sur la prochaine étape qui sera la ville de Dédougou.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>The caravan SUNU Assurances Ya Paalé started on March 30, 2019 in Bobo Dioulasso. The morning parade and activations were followed by an evening concert at TIEFFO AMORO Square in the presence of the High Commissioner representing the Governor of the Hauts Bassins Region, the Director General of SUNU Assurances Vie Burkina Faso, Regional Directors and Mayors common. Head to the next step which will be the city of Dédougou.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>caravanesunuassurancesyapaalébf0_2019.jpg\ndateCreated_article=>2019-03-30 21:01:32\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>54\ntitre_article=>Caravane SUNU Assurances au Burkina Faso\ntitre_article_en=>SUNU Assurances in Burkina Faso Caravan\ntexte_article=><p>La caravane SUNU Assurances Ya Paalé a débuté le 30 mars 2019 à Bobo Dioulasso. La parade et les activations en matinée ont été suivies du concert en soirée à la place TIEFFO AMORO en présence du Haut-commissaire représentant le Gouverneur de la région des Hauts Bassins, du Directeur Général de SUNU Assurances Vie Burkina Faso, des Directeurs régionaux et des maires de communes. Cap sur la prochaine étape qui sera la ville de Dédougou.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>The caravan SUNU Assurances Ya Paalé started on March 30, 2019 in Bobo Dioulasso. The morning parade and activations were followed by an evening concert at TIEFFO AMORO Square in the presence of the High Commissioner representing the Governor of the Hauts Bassins Region, the Director General of SUNU Assurances Vie Burkina Faso, Regional Directors and Mayors common. Head to the next step which will be the city of Dédougou.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>caravanesunuassurancesyapaalébf0_2019.jpg\ndateCreated_article=>2019-03-30 21:04:15\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1339,2147204895,'2019-04-04 19:05:18','photo','insert|all|443|0|id_photo=>443