95,'2019-04-04 19:05:48','photo','insert|all|451|0|id_photo=>451\nid_article=>54\nfichier_photo=>caravanesunuassurancesyapaalbf9_2019.jpg\ndateCreated_photo=>2019-04-04 21:05:48\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1348,2147204895,'2019-04-04 19:11:12','article','insert|all|55|0|id_article=>55\ntitre_article=>SUNU Assurances Vie Côte d\'Ivoire participe aux activités sportives de la JCI Abidjan Elite\ntitre_article_en=>SUNU Assurances Vie Côte d\'Ivoire participates in sports activities of JCI Abidjan Elite\ntexte_article=><p>L’équipe de football de SUNU Assurances Vie Côte d’Ivoire a pris part le samedi 09 mars 2019 aux activités sportives et de l’amitié initiée par la JCI (Jeunes Chambre Internationale) Abidjan Elite. Ces activités se sont déroulées au Lycée Classique d’Abidjan avec la participation de plusieurs équipes comme la BNETD FC, CGRAE FC, JUMIA, CIMCI, ELITE FC et SUNU FC). SUNU Assurances s’est fait remarquer grâce à l’équipe féminine qui a remporté la coupe face à l’ELITE FC par un score de deux buts à zéro (2-0). C’est dans cette ambiance conviviale qu’a pris fin ce tournoi.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>The football team of SUNU Assurances Vie Côte d&#39;Ivoire took part on Saturday, March 09, 2019 in sports activities and friendship initiated by JCI (Young Chamber International) Abidjan Elite.<br>\r\nThese activities took place at the Abidjan Classic High School with the participation of several teams such as BNETD FC, CGRAE FC, JUMIA, CIMCI, ELITE FC and SUNU FC).<br>\r\nSUNU Assurances stood out thanks to the women&#39;s team that won the Cup against ELITE FC by scoring two goals to zero (2-0). It was in this friendly atmosphere that this tournament ended.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>tournoijci0_2019.jpg\ndateCreated_article=>2019-03-09 21:11:12\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1349,2147204895,'2019-04-04 19:15:30','photo','insert|all|452|0|id_photo=>452\nid_article=>55\nfichier_photo=>tournoijci1_2019.jpg\ndateCreated_photo=>2019-04-04 21:15:30\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1350,2147204895,'2019-04-04 19:15:31','photo','insert|all|453|0|id_photo=>453\nid_article=>55\nfichier_photo=>tournoijci2_2019.jpg\ndateCreated_photo=>2019-04-04 21:15:31\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1351,2147204895,'2019-04-04 19:15:35','photo','insert|all|454|0|id_photo=>454\nid_article=>55\nfichier_photo=>tournoijci3_2019.jpg\ndateCreated_photo=>2019-04-04 21:15:35\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1352,2147204895,'2019-04-04 19:21:29','article','insert|all|56|0|id_article=>56\ntitre_article=>Tirage du produit \"ça Gagne\" avec SUNU Assurances Vie Burkina Faso\ntitre_article_en=> Draw of the product \"That wins\" with SUNU Assurances Vie Burkina Faso\ntexte_article=><p>Le vendredi 15 mars 2019, SUNU Assurances Vie Burkina Faso en partenariat avec UBA a procédé au 8ème tirage du produit «Ça Gagne » dans les locaux de UBA.<br>\r\n« Ça gagne » est un produit bancassurance qui permet d’obtenir un gros capital à partir de petites cotisations. 6 numéros qui sont respectivement 0855, 5280, 9489, 4871, 6425 et le 0611 ont été tirés par les clients de la banque UBA en présence d’un huissier de justice, afin d’attester de la crédibilité du tirage. Lorsque le numéro d’un client est tiré, le capital prévu à la fin du contrat est versé de manière anticipée. </p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>On Friday March 15, 2019, SUNU Assurances Vie Burkina Faso, in partnership with UBA, proceeded with the 8th draw of the \"Ça Gagne\" product at UBA&#39;s premises.<br>\r\n\"It wins\" is a bancassurance product that allows you to obtain large capital from small contributions. Six numbers are respectively 0855, 5280, 9489, 4871, 6425 and 0611 were drawn by the customers of the UBA bank in the presence of a bailiff, to attest to the credibility of the draw. When the number of a customer is drawn, the capital provided at the end of the contract is paid in advance.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>Ca_gagnebfvie0_2019.jpg\ndateCreated_article=>2019-03-15 21:21:29\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1353,2147204895,'2019-04-04 19:23:37','photo','insert|all|455|0|id_photo=>455\nid_article=>56\nfichier_photo=>Ca_gagnebfvie1_2019.jpg\ndateCreated_photo=>2019-04-04 21:23:37\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1354,2147204895,'2019-04-04 19:23:38','photo','insert|all|456|0|id_photo=>456\nid_article=>56\nfichier_photo=>Ca_gagnebfvie2_2019.jpg\ndateCreated_photo=>2019-04-04 21:23:38\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1355,2147204895,'2019-04-04 19:23:43','photo','insert|all|457|0|id_photo=>457\nid_article=>56\nfichier_photo=>Ca_gagnebfvie3_2019.jpg\ndateCreated_photo=>2019-04-04 21:23:43\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1356,2147204895,'2019-04-10 13:03:23','_SESSION','login|all|1554901340|0|__ci_last_regenerate=>1554901340\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-04-04 20:50:07::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1357,2147204895,'2019-04-10 13:03:25','_SESSION','login|all|1554901340|0|__ci_last_regenerate=>1554901340\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-04-10 15:03:23::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1358,2147204895,'2019-04-10 13:11:21','_SESSION','login|all|1554901611|0|__ci_last_regenerate=>1554901611\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-04-10 15:03:25::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>000