_last_regenerate=>1556020763\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2019-04-23 13:30:27::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n|0'),(1382,2147204895,'2019-04-24 09:03:02','_SESSION','login|all|1556096439|0|__ci_last_regenerate=>1556096439\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-04-18 18:31:55::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1383,2147204895,'2019-04-24 09:03:04','_SESSION','login|all|1556096439|0|__ci_last_regenerate=>1556096439\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-04-24 11:03:02::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1384,2147204895,'2019-05-03 07:37:21','_SESSION','login|all|1556869023|0|__ci_last_regenerate=>1556869023\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-04-24 11:03:04::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1385,2147204895,'2019-05-03 07:59:59','article','insert|all|57|0|id_article=>57\ntitre_article=>Allianz au Bénin, Burkina, Mali et Togo font désormais partie du Groupe SUNU\ntitre_article_en=>Allianz in Benin, Burkina Faso, Mali and Togo are now part of the SUNU Group\ntexte_article=><p>Les filiales du groupe Allianz au Bénin, Burkina Faso, Mali et Togo font désormais partie du Groupe SUNU et changeront bientôt de nom pour devenir SUNU Assurances.<br>\r\nAvec cette opération, le Groupe SUNU confirme sa position de Leader en Assurance Vie dans les 14 pays de la zone CIMA et renforce son offre en Assurance IARD.<br>\r\nTous les engagements pris par Allianz auprès de ses collaborateurs, clients, courtiers et partenaires seront respectés par le Groupe SUNU, avec l’objectif de garantir une qualité de service optimale et une offre d’assurance parmi les meilleures du marché.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>The subsidiaries of the Allianz group in Benin, Burkina Faso, Mali and Togo are now part of the SUNU Group and will soon change their name to SUNU Assurances.<br>\r\nWith this transaction, the SUNU Group confirms its position as Life Insurance Leader in the 14 countries of the CIMA zone and strengthens its P & C insurance offering.<br>\r\nAll commitments made by Allianz to its employees, customers, brokers and partners will be respected by the SUNU Group, with the aim of guaranteeing the highest quality of service and the best insurance offer on the market.</p>\r\n\nlecture_article=>0\nfichier_article=>signature_bas_de_mail_Groupe_FR.jpg\ndateCreated_article=>2019-05-03 09:59:59\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1386,2147204895,'2019-05-03 18:28:33','_SESSION','login|all|1556908093|0|__ci_last_regenerate=>1556908093\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-05-03 09:37:21::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1387,2147484848,'2019-05-08 08:37:37','_SESSION','login|all|1557304418|0|__ci_last_regenerate=>1557304418\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2019-04-23 13:36:59::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n'),(1388,2147484848,'2019-05-08 08:50:40','_SESSION','logout|all|1557305440|__ci_last_regenerate=>1557305440\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2019-04-23 13:36:59::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n|0'),(1389,2147204895,'2019-05-23 15:07:13','_SESSION','login|all|1558624027|0|__ci_last_regenerate=>1558624027\n{email=>admin@sunugroup.com::name=>A