_contact=>1\ncreatedBy=>2147204895\nid_pays=>10\nid_assurable=>4|5|7|1|2|3|6|\nid_user=>1746592204\n'),(1486,2147204895,'2019-07-09 15:05:22','_SESSION','login|all|1562684500|0|__ci_last_regenerate=>1562684500\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-07-05 18:47:06::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1487,2147204895,'2019-07-09 15:42:32','article','insert|all|58|0|id_article=>58\ntitre_article=>SUNU Assurances Vie CI – BICICI : Lancement des ASSUR’ DAYS\ntitre_article_en=>SUNU Assurances Vie CI - BICICI : Launch of Assur\' DAYS\ntexte_article=><p>Le vendredi 07 juin 2019, la BICICI en collaboration avec ses partenaires dont SUNU Assurances Vie Côte d’Ivoire ont procédé au lancement d’un nouveau programme d’animation destiné à la bancassurance. Ce Programme a pour objectif de former et accompagner les équipes commerciales dans la prise en main des produits en vue de booster les ventes.<br>\r\n À cette occasion, Monsieur Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie Côte d’Ivoire a eu à animer un panel portant sur « Les enjeux de la Bancassurance pour la BICICI ».<br>\r\n À la suite de celui-ci, un somptueux déjeuner fut offert aux participants avant l’entame des différents ateliers.</p>\r\n\ntexte_article_en=><p>On Friday 07 June 2019, BICICI, in collaboration with its partners, including SUNU Assurances Vie Côte d&#39;Ivoire, launched a new animation program for bancassurance.<br>\r\nThis program aims to train and support sales teams in the grip of products to boost sales.<br>\r\n On this occasion, Mr. Saliou BAKAYOKO, General Manager of SUNU Assurances Vie Côte d&#39;Ivoire had to animate a panel on \"The stakes of Bancassurance for BICICI\".<br>\r\n Following this, a sumptuous lunch was offered to participants before the start of the various workshops.</p>\r\n\nlecture_article=>0\nfichier_article=>Assurdays1_2019.jpg\ndateCreated_article=>2019-06-07 17:42:32\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1488,2147204895,'2019-07-09 15:44:08','article','update|all|58|id_article=>58\ntitre_article=>SUNU Assurances Vie CI – BICICI : Lancement des ASSUR’ DAYS\ntitre_article_en=>SUNU Assurances Vie CI - BICICI : Launch of Assur\' DAYS\ntexte_article=><p>Le vendredi 07 juin 2019, la BICICI en collaboration avec ses partenaires dont SUNU Assurances Vie Côte d’Ivoire ont procédé au lancement d’un nouveau programme d’animation destiné à la bancassurance. Ce Programme a pour objectif de former et accompagner les équipes commerciales dans la prise en main des produits en vue de booster les ventes.<br>\r\n À cette occasion, Monsieur Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie Côte d’Ivoire a eu à animer un panel portant sur « Les enjeux de la Bancassurance pour la BICICI ».<br>\r\n À la suite de celui-ci, un somptueux déjeuner fut offert aux participants avant l’entame des différents ateliers.</p>\r\n\ntexte_article_en=><p>On Friday 07 June 2019, BICICI, in collaboration with its partners, including SUNU Assurances Vie Côte d&#39;Ivoire, launched a new animation program for bancassurance.<br>\r\nThis program aims to train and support sales teams in the grip of products to boost sales.<br>\r\n On this occasion, Mr. Saliou BAKAYOKO, General Manager of SUNU Assurances Vie Côte d&#39;Ivoire had to animate a panel on \"The stakes of Bancassurance for BICICI\".<br>\r\n Following this, a sumptuous lunch was offered to participants before the start of the various workshops.</p>\r\n\nlecture_article=>0\nfichier_article=>Assurdays1_2019.jpg\ndateCreated_article=>2019-06-07 17:42:32\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>58\ntitre_article=>SUNU Assurances Vie CI – BICICI : Lancement des ASSUR’ DAYS\ntitre_article_en=>SUNU Assurances Vie CI - BICICI : Launch of Assur\' DAYS\ntexte_article=><p>Le vendredi 07 juin 2019, la BICICI en collaboration avec ses partenaires dont SUNU Assurances Vie Côte d’Ivoire ont procédé au lancement d’un nouveau programme d’animation destiné à la bancassurance. Ce Programme a pour objectif de former et accompagner les équipes commerciales dans la prise en main des produits en vue de booster les ventes.<br>\r\nÀ cette occasion, Monsieur Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie Côte d’Ivoire a eu à animer un panel portant sur « Les enjeux de la Bancassurance pour la BICICI ».<br>\r\nÀ la suite de celui-ci, un somptueux déjeuner fut offert aux participants avant l’entame des différents ateliers.</p>\r\n\ntexte_article_en=><p>On Friday 07 June 2019, BICICI, in collaboration with its partners, including SUNU Assurances Vie Côte d&#39;Ivoire, launched a new animation program for bancassurance.<br>\r\nThis program aims to train and support sales teams in the grip of products to boost sales.<br>\r\nOn this occasion, Mr. Saliou BAKAYOKO, General Manager of SUNU Assurances Vie Côte d&#39;Ivoire had to animate a panel on \"The stakes of Bancassurance for BICICI\".<br>\r\nFollowing this, a sumptuous lunch was offered to participants before the start of the various workshops.</p>\r\n\nlecture_article=>0\nfichier_article=>Assurdays1_2019.jpg\ndateCreated_article=>2019-06-07 17:44:08\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1489,2147204895,'2019-07-09 15:55:56','article','insert|all|59|0|id_article=>59\ntitre_article=>Burkina Faso : Caravane SUNU Assurances Ya Paalé à Banfora\ntitre_article_en=> Burkina Faso: Caravan SUNU Assurances Ya Paalé in Banfora\ntexte_article=><p>Pour la 4e étape de la caravane SUNU Assurances Ya Paalé, SUNU Assurances Vie Burkina Faso a posé ses valises dans la ville de Banfora le 31 mai.<br>\r\nAprès la visite de courtoisie aux autorités de ladite ville, s’en ai suivi une parade, des activations, le dépistage et la vaccination contre l’hépatite B.<br>\r\nUn concert avec des artistes locaux et en Guest star Fush Alpha venu de Ouagadougou a été offert en soirée à la population.</p>\r\n\ntexte_article_en=><p><br>\r\nFor the 4th stage of the SUNU Assurances Ya Paalé caravan, SUNU Assurances Vie Burkina Faso settled in the city of Banfora on May 31st.<br>\r\nAfter the courtesy visit to the authorities of the said city, there followed a parade, activations, screening and vaccination against hepatitis B.<br>\r\nA concert with local artists and guest star Fush Alpha from Ouagadougou was offered in the evening to the population.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>caravanbanfora0_2019.jpg\ndateCreated_article=>2019-05-31 17:55:56\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1490,2147204895,'2019-07-09 15:58:34','photo','insert|all|458|0|id_photo=>458\nid_article=>59\nfichier_photo=>caravanbanfora1_2019.jpg\ndateCreated_photo=>2019-07-09 17:58:34\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1491,2147204895,'2019-07-09 15:58:39','photo','insert|all|459|0|id_photo=>459\nid_article=>59\nfichier_photo=>caravanbanfora2_2019.jpg\ndateCreated_photo=>2019-07-09 17:58:39\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1492,2147204895,'2019-07-09 15:58:41','photo','insert|all|460|0|id_photo=>460\nid_article=>59\nfichier_photo=>caravanbanfora3_2019.jpg\ndateCreated_photo=>2019-07-09 17:58:41\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1493,2147204895,'2019-07-09 15:58:43','photo','insert|all|461|0|id_photo=>461\nid_article=>59\nfichier_photo=>caravanbanfora4_2019.jpg\ndateCreated_photo=>2019-07-09 17:58:43\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1494,2147204895,'2019-07-09 15:58:45','photo','insert|all|462|0|id_photo=>462\nid_article=>59\nfichier_photo=>caravanbanfora6_2019.jpg\ndateCreated_photo=>2019-07-09 17:58:45\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1495,2147204895,'2019-07-09 16:07:04','article','insert|all|60|0|id_article=>60\ntitre_article=>3e étape de la marche sportive SUNU Assurances - FIDRA\ntitre_article_en=>3rd stage of the sports walk SUNU ASSURANCES - FIDRA\ntexte_article=><p>Après les étapes de Yamoussoukro et Dabou, SUNU Assurances Vie CI et son partenaire de la retraite active le FIDRA étaient présents le 25 Mai 2019 dans la commune de Yopougon, pour la 3éme étape de la traditionnelle marche sportive organisée en faveur des personnes du 3ème âge.  <br>\r\nCe sont plus de 1000 retraités qui ont eu à parcourir les 4 Km du circuit dans une ambiance conviviale.</p>\r\n\ntexte_article_en=><p>After the stages of Yamoussoukro and Dabou, SUNU Life Insurance CI and its active retirement partner FIDRA were present on May 25, 2019 in Yopougon commune, for the 3rd stage of the traditional sports walk organized for the benefit of the elderly. More than 1000 retirees had to travel the 4 km circuit in a friendly atmosphere.</p>\r\n\nlecture_article=>0\nfichier_article=>fidra3etape_2019.jpg\ndateCreated_article=>2019-05-25 18:07:04\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1496,2147204895,'2019-07-09 16:07:44','photo','insert|all|463|0|id_photo=>463\nid_article=>60\nfichier_photo=>fidra3etape1_2019.jpg\ndateCreated_photo=>2019-07-09 18:07:44\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1497,2147204895,'2019-07-09 16:07:45','photo','insert|all|464|0|id_photo=>464\nid_article=>60\nfichier_photo=>fidra3etape2_2019.jpg\ndateCreated_photo=>2019-07-09 18:07:45\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1498,2147204895,'2019-07-09 16:07:48','photo','insert|all|465|0|id_photo=>465\nid_article=>60\nfichier_photo=>fidra3etape3_2019.jpg\ndateCreated_photo=>2019-07-09 18:07:48\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1499,2147204895,'2019-07-09 16:15:39','article','insert|all|61|0|id_article=>61\ntitre_article=>Les sociétés SUNU Assurances du TOGO à la 5ème édition du FESTIMMO\ntitre_article_en=>SUNU Assurances of TOGO at the 5th edition of FESTIMMO\ntexte_article=><p>Du 10 au 12 mai 2019 les sociétés SUNU Assurances au Togo ont participé à la 5ème édition de la foire de l’immobilier du Togo (FESTIMMO).<br>\r\nCe fut l’occasion pour SUNU Assurances IARD et Vie TOGO de mieux faire comprendre aux visiteurs et exposants le secteur de l’assurance, avoir plus d’informations sur les contrats et faire directement des souscriptions.</p>\r\n\ntexte_article_en=><p>From May 10 to 12, 2019 SUNU Assurances companies in Togo participated in the 5th edition of the real estate fair of Togo (FESTIMMO).<br>\r\nIt was an opportunity for SUNU Assurances IARD and Vie TOGO to make visitors and exhibitors better understand the insurance sector, to have more information on contracts and to make direct subscriptions.</p>\r\n\nlecture_article=>0\nfichier_article=>festimmo0_2019.jpg\ndateCreated_article=>2019-05-10 18:15:39\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1500,2147204895,'2019-07-09 16:17:52','photo','insert|all|466|0|id_photo=>466\nid_article=>61\nfichier_photo=>festimmo3_2019.jpg\ndateCreated_photo=>2019-07-09 18:17:52\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1501,2147204895,'2019-07-09 16:17:53','photo','insert|all|467|0|id_photo=>467\nid_article=>61\nfichier_photo=>festimmo1_2019.jpg\ndateCreated_photo=>2019-07-09 18:17:53\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1502,2147204895,'2019-07-09 16:17:56','photo','insert|all|468|0|id_photo=>468\nid_article=>61\nfichier_photo=>festimmo2_2019.jpg\ndateCreated_photo=>2019-07-09 18:17:56\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1503,2147204895,'2019-07-09 16:22:50','article','insert|all|62|0|id_article=>62\ntitre_article=>Tirage du produit SAYE\ntitre_article_en=>Draw of SAYE product\ntexte_article=><p>Le vendredi 3 mai 2019, SUNU Assurances Vie Niger a procédé au tirage du produit SAYE au siège de SUNU Assurances Vie Niger.<br>\r\nSAYE est un produit d’assurance épargne avec un volet tirage au sort  qui offre aux adhérents une cagnotte d’un million (1 000 000) de francs CFA par trimestre.<br>\r\nLa gagnante de ce mois Mme Razak RABAHA a reçu son chèque des mains de Mme Binta TINI Directeur Général de la filiale.</p>\r\n\ntexte_article_en=><p>On Friday, May 3, 2019, SUNU Assurances Vie Niger proceeded with the draw of the SAYE product at the headquarters of SUNU Assurances Vie Niger.<br>\r\nSAYE is a savings insurance product with a component that offers members a pool of one million (1,000,000) CFA francs per quarter.<br>\r\nThis month&#39;s winner Mrs. Razak RABAHA received her check from Mrs. Binta TINI General Manager of the subsidiary.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>SAYE.jpg\ndateCreated_article=>2019-05-03 18:22:50\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1504,2147204895,'2019-07-09 16:29:00','article','insert|all|63|0|id_article=>63\ntitre_article=>Les sociétés SUNU Assurances de Côte d’Ivoire à la 11ème édition du SILA\ntitre_article_en=> SUNU Assurances companies of Côte d\'Ivoire at the 11th edition of SILA\ntexte_article=><p>Le mercredi 15 mai 2019, les sociétés SUNU Assurances de Côte d’Ivoire ont pris part à la 11ème édition du salon international du livre d’Abidjan (SILA).<br>\r\nIl s’est tenu au palais de la culture de Treichville avec pour pays invité la France.<br>\r\nCette année l’association des éditeurs et les passionnés du livre se sont fixé comme objectif de rendre le livre plus facile et accessible à tous les lecteurs d’où le thème : « le livre, mon compagnon au quotidien ». <br>\r\nPour ce rendez-vous littéraire, l’auteur Véronique TADJO était l’invitée d’honneur et la lauréate du prix littéraire d’éditeur.</p>\r\n\ntexte_article_en=><p>On Wednesday, May 15, 2019, SUNU Assurances of Côte d&#39;Ivoire took part in the 11th edition of the International Book Fair of Abidjan (SILA).<br>\r\nIt was held at the Palace of Culture of Treichville with France as a guest country.<br>\r\nThis year, the association of publishers and book lovers have set themselves the goal of making the book easier and accessible to all readers, hence the theme: \"the book, my everyday companion\".<br>\r\nFor this literary event, the author Véronique TADJO was the guest of honor and laureate of the publisher&#39;s literary prize.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>sila5_2019.jpg\ndateCreated_article=>2019-07-09 18:29:00\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1505,2147204895,'2019-07-09 16:29:49','photo','insert|all|469|0|id_photo=>469\nid_article=>63\nfichier_photo=>sila2_2019.jpg\ndateCreated_photo=>2019-07-09 18:29:49\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1506,2147204895,'2019-07-09 16:29:51','photo','insert|all|470|0|id_photo=>470\nid_article=>63\nfichier_photo=>sila1_2019.jpg\ndateCreated_photo=>2019-07-09 18:29:51\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1507,2147204895,'2019-07-09 16:29:55','photo','insert|all|471|0|id_photo=>471\nid_article=>63\nfichier_photo=>sila4_2019.jpg\ndateCreated_photo=>2019-07-09 18:29:55\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1508,2147204895,'2019-07-09 16:29:56','photo','insert|all|472|0|id_photo=>472\nid_article=>63\nfichier_photo=>sila0_2019.jpg\ndateCreated_photo=>2019-07-09 18:29:56\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1509,2147204895,'2019-07-09 16:32:24','article','update|all|63|id_article=>63\ntitre_article=>Les sociétés SUNU Assurances de Côte d’Ivoire à la 11ème édition du SILA\ntitre_article_en=> SUNU Assurances companies of Côte d\'Ivoire at the 11th edition of SILA\ntexte_article=><p>Le mercredi 15 mai 2019, les sociétés SUNU Assurances de Côte d’Ivoire ont pris part à la 11ème édition du salon international du livre d’Abidjan (SILA).<br>\r\nIl s’est tenu au palais de la culture de Treichville avec pour pays invité la France.<br>\r\nCette année l’association des éditeurs et les passionnés du livre se sont fixé comme objectif de rendre le livre plus facile et accessible à tous les lecteurs d’où le thème : « le livre, mon compagnon au quotidien ». <br>\r\nPour ce rendez-vous littéraire, l’auteur Véronique TADJO était l’invitée d’honneur et la lauréate du prix littéraire d’éditeur.</p>\r\n\ntexte_article_en=><p>On Wednesday, May 15, 2019, SUNU Assurances of Côte d&#39;Ivoire took part in the 11th edition of the International Book Fair of Abidjan (SILA).<br>\r\nIt was held at the Palace of Culture of Treichville with France as a guest country.<br>\r\nThis year, the association of publishers and book lovers have set themselves the goal of making the book easier and accessible to all readers, hence the theme: \"the book, my everyday companion\".<br>\r\nFor this literary event, the author Véronique TADJO was the guest of honor and laureate of the publisher&#39;s literary prize.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>sila5_2019.jpg\ndateCreated_article=>2019-07-09 18:29:00\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>63\ntitre_article=>Les sociétés SUNU Assurances de Côte d’Ivoire à la 11ème édition du SILA\ntitre_article_en=> SUNU Assurances companies of Côte d\'Ivoire at the 11th edition of SILA\ntexte_article=><p>Le mercredi 15 mai 2019, les sociétés SUNU Assurances de Côte d’Ivoire ont pris part à la 11ème édition du salon international du livre d’Abidjan (SILA).<br>\r\nIl s’est tenu au palais de la culture de Treichville avec pour pays invité la France.<br>\r\nCette année l’association des éditeurs et les passionnés du livre se sont fixé comme objectif de rendre le livre plus facile et accessible à tous les lecteurs d’où le thème : « le livre, mon compagnon au quotidien ». <br>\r\nPour ce rendez-vous littéraire, l’auteur Véronique TADJO était l’invitée d’honneur et la lauréate du prix littéraire d’éditeur.</p>\r\n\ntexte_article_en=><p>On Wednesday, May 15, 2019, SUNU Assurances of Côte d&#39;Ivoire took part in the 11th edition of the International Book Fair of Abidjan (SILA).<br>\r\nIt was held at the Palace of Culture of Treichville with France as a guest country.<br>\r\nThis year, the association of publishers and book lovers have set themselves the goal of making the book easier and accessible to all readers, hence the theme: \"the book, my everyday companion\".<br>\r\nFor this literary event, the author Véronique TADJO was the guest of honor and laureate of the publisher&#39;s literary prize.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>sila5_2019.jpg\ndateCreated_article=>2019-05-15 18:32:24\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1510,2147204895,'2019-07-09 16:41:52','article','insert|all|64|0|id_article=>64\ntitre_article=>SUNU Assurances Vie CI participe au développement de l\'inclusion financière\ntitre_article_en=> SUNU Assurances Vie participates in the development of financial inclusion\ntexte_article=><p>Le vendredi 7 juin 2019, SUNU Assurances Vie Côte d’Ivoire a participé à la 1ère édition du forum Africa Fintech Tour 2019 qui a eu lieu à Orange Fab.<br>\r\nÉtaient présents à ce forum les acteurs de l&#39;industrie financière, de télécom et les communautés d&#39;innovation de plus de dix (10) pays africains pour échanger sur la digitalisation de l&#39;inclusion financière en zone rurale.<br>\r\nSUNU Assurances Vie Côte d’Ivoire, promoteur de l’assurance inclusive, a présenté ses offres digitales aux coopératives agricoles venues assister au forum.</p>\r\n\ntexte_article_en=><p>On Friday, June 7, 2019, SUNU Assurances Vie Côte d&#39;Ivoire participated in the 1st edition of the Africa Fintech Tour 2019 forum which took place at Orange Fab.<br>\r\nPresent at this forum were the actors of the financial, telecom and innovation communities from more than ten (10) African countries to discuss the digitization of financial inclusion in rural areas.<br>\r\nSUNU Life Insurance Ivory Coast, promoter of inclusive insurance, presented its digital offers to agricultural cooperatives attending the forum.</p>\r\n\nlecture_article=>0\nfichier_article=>fintech0-2019.jpg\ndateCreated_article=>2019-06-07 18:41:52\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1511,2147204895,'2019-07-09 16:42:48','photo','insert|all|473|0|id_photo=>473\nid_article=>64\nfichier_photo=>fintech2-2019.jpg\ndateCreated_photo=>2019-07-09 18:42:48\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1512,2147204895,'2019-07-09 16:42:50','photo','insert|all|474|0|id_photo=>474\nid_article=>64\nfichier_photo=>fintech3-2019.jpg\ndateCreated_photo=>2019-07-09 18:42:50\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1513,2147204895,'2019-07-09 16:42:52','photo','insert|all|475|0|id_photo=>475\nid_article=>64\nfichier_photo=>fintech1-2019.jpg\ndateCreated_photo=>2019-07-09 18:42:52\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1514,2147204895,'2019-07-09 16:55:07','article','insert|all|65|0|id_article=>65\ntitre_article=>Cérémonie de distinction des agents de SUNU Assurances Vie Bénin \ntitre_article_en=>Ceremony of distinction of agents of SUNU Assurances Vie Benin\ntexte_article=><p>En prélude à la célébration de la fête du personnel, la direction Générale de SUNU Assurances Vie Bénin a décidé de distinguer les membres du personnel ayant plus de 10 années d’ancienneté dans la Société.<br>\r\nCette cérémonie s’est déroulée le jeudi 13 juin 2019 où huit (08) membres du personnel ont reçu un diplôme d’ancienneté signé par le Directeur Général M. Lassina COULIBALY ainsi qu’une prime.</p>\r\n\ntexte_article_en=><p>As a prelude to the celebration of the staff party, the General Management of SUNU Assurances Vie Benin decided to distinguish the staff members with more than 10 years of seniority in the Society.<br>\r\nThis ceremony took place on Thursday, June 13, 2019 when eight (08) staff members received a seniority diploma signed by the Director General Mr. Lassina COULIBALY and a bonus.</p>\r\n\nlecture_article=>0\nfichier_article=>cérémoniedistinctionSAVB2_2019.jpg\ndateCreated_article=>2019-06-13 18:55:07\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1515,2147204895,'2019-07-09 16:57:18','photo','insert|all|476|0|id_photo=>476\nid_article=>65\nfichier_photo=>crmoniedistinctionSAVB1_2019.jpg\ndateCreated_photo=>2019-07-09 18:57:18\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1516,2147204895,'2019-07-09 16:57:24','photo','insert|all|477|0|id_photo=>477\nid_article=>65\nfichier_photo=>crmoniedistinctionSAVB3_2019.jpg\ndateCreated_photo=>2019-07-09 18:57:24\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1517,2147204895,'2019-07-09 17:05:06','article','insert|all|66|0|id_article=>66\ntitre_article=>Groupe SUNU : Les nouvelles filiales (EX-ALLIANZ) à SUNU Services\ntitre_article_en=>SUNU Group : New Subsidiaries (Ex-ALLIANZ) at SUNU Services\ntexte_article=><p>SUNU Services a initié deux jours d&#39;échanges et d&#39;ateliers avec les sociétés Allianz acquises. <br>\r\nL&#39;objectif de cette rencontre réunissant les directeurs généraux et techniques est de mieux connaître les missions et activités de chaque département de SUNU Services mais aussi les filiales de SUNU Assurances de Côte d’Ivoire et d&#39;Allianz.<br>\r\nM. DIONE a introduit avec un mot de bienvenue motivant à plus de synergie pour plus de développement.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>SUNU Services initiated two days of exchanges and workshops with the acquired Allianz companies.<br>\r\nThe objective of this meeting bringing together the general and technical directors is to better know the missions and activities of each department of SUNU Services but also the subsidiaries of SUNU Assurances of Côte d&#39;Ivoire and Allianz.<br>\r\nMr. DIONE introduced with a motivating welcome to more synergy for further development.</p>\r\n\nlecture_article=>0\nfichier_article=>allianzàsunuservices0_2019.jpg\ndateCreated_article=>2019-06-17 19:05:06\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1518,2147204895,'2019-07-09 17:06:33','photo','insert|all|478|0|id_photo=>478\nid_article=>66\nfichier_photo=>allianzsunuservices6_2019.jpg\ndateCreated_photo=>2019-07-09 19:06:33\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1519,2147204895,'2019-07-09 17:06:44','photo','insert|all|479|0|id_photo=>479\nid_article=>66\nfichier_photo=>allianzsunuservices1_2019.jpg\ndateCreated_photo=>2019-07-09 19:06:44\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1520,2147204895,'2019-07-09 17:06:51','photo','insert|all|480|0|id_photo=>480\nid_article=>66\nfichier_photo=>allianzsunuservices2_2019.jpg\ndateCreated_photo=>2019-07-09 19:06:51\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1521,2147204895,'2019-07-09 19:01:03','article','insert|all|67|0|id_article=>67\ntitre_article=> SUNU assurances Vie Côte d\'Ivoire à la 10ème édition du MEET UP BUSINESS\ntitre_article_en=> SUNU assurances Vie Côte d\'Ivoire at the 10th edition of MEET UP BUSINESS\ntexte_article=><p>Le vendredi 28 juin 2019, le Directeur Général adjoint de SUNU Assurances Vie Côte d’Ivoire, M. Gildas NZOUBA était l’invité de la 10ème édition du MEET UP BUSINESS qui s’est déroulé au siège de la CGECI Academy.<br>\r\nLors de ce Meet Up, son parcours, son expérience professionnelle et ses ambitions pour SUNU Assurances Vie Côte d’Ivoire ont été dévoilés au public invité pour l’occasion.</p>\r\n\ntexte_article_en=><p>On Friday, June 28, 2019, the Deputy Director General of SUNU Assurances Vie Côte d&#39;Ivoire, Mr Gildas NZOUBA was the guest of the 10th edition of the MEET UP BUSINESS which took place at the headquarters of the CGECI Academy.<br>\r\nDuring this Meet Up, his career, his professional experience and his ambitions for SUNU Assurances Vie Côte d&#39;Ivoire were unveiled to the public invited for the occasion</p>\r\n\nlecture_article=>0\nfichier_article=>65872434_1288500864658181_309636493154975744_n.jpg\ndateCreated_article=>2019-06-28 21:01:03\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1522,2147204895,'2019-07-09 19:01:45','photo','insert|all|481|0|id_photo=>481\nid_article=>67\nfichier_photo=>62533852_1288500904658177_3840058310061457408_n.jpg\ndateCreated_photo=>2019-07-09 21:01:45\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1523,2147204895,'2019-07-09 19:01:46','photo','insert|all|482|0|id_photo=>482\nid_article=>67\nfichier_photo=>65717623_1288501061324828_7030061517303185408_n.jpg\ndateCreated_photo=>2019-07-09 21:01:46\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1524,2147204895,'2019-07-10 13:08:18','_SESSION','login|all|1562763914|0|__ci_last_regenerate=>1562763914\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-07-09 17:05:22::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1525,2147204895,'2019-07-10 13:09:40','article','update|all|53|id_contact=>53\nnom_contact=>Huguette DJE \nemail_contact=>huguette.dje@sunu-group.com\ndateCreated_contact=>2019-07-05 18:56:20\nstatut_contact=>1\ncreatedBy=>2147204895\nid_pays=>10\nid_assurable=>4|5|7|1|2|3|6|\nid_user=>1746592204\n|id_contact=>53\nnom_contact=>Huguette DJE \nemail_contact=>huguette.dje@sunu-group.com\ndateCreated_contact=>2019-07-10 15:09:40\nstatut_contact=>1\ncreatedBy=>2147204895\nid_pays=>10\nid_assurable=>4|5|7|1|2|3|6|\nid_user=>1746592204\n'),(1526,2147204895,'2019-07-29 16:16:45','_SESSION','login|all|1564416935|0|__ci_last_regenerate=>1564416935\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-07-10 15:08:18::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1527,2147204895,'2019-07-29 16:40:07','article','insert|all|68|0|id_article=>68\ntitre_article=>Groupe SUNU : Réunion des dirigeants des filiales francophones de SUNU Assurances.\ntitre_article_en=>SUNU Group: Meeting of the managers of the French-speaking subsidiaries of SUNU Assurances.\ntexte_article=><p>Du 16 au 18 Juillet 2019 s’est tenue à l’hôtel AZALAI la réunion des dirigeants des filiales Francophones de SUNU Assurances.<br>\r\nEtaient invités à ces réunions les dirigeants des filiales Allianz nouvellement acquises. <br>\r\nCette réunion a permis de faire la revue à mi-parcours des objectifs et chiffres d’affaires 2019 de chaque société.<br>\r\nAussi, les dirigeants ont bénéficié d’une formation sur le Lean Management (système d’amélioration des processus de gestion) et d’une présentation du test de la plateforme DIGITASS par SUPERNET.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>The debate dinner of the Association of Ambassadors of Côte d&#39;Ivoire at retirement (AACIR) was at its 4th edition on Thursday, June 27, 2019 at Espace Latrille Event. At this meeting, several panelists were invited to develop the theme chosen for the occasion, \"the secrets of a happy longevity\".<br>\r\nMr. Saliou BAKAYOKO, General Manager of SUNU Assurances Vie Côte d&#39;Ivoire made a brilliant presentation on capitalization products that could allow everyone to ensure a decent retirement.<br>\r\nIn addition, the ambassador AMON TANOH Lambert, 93 years old, shared his life experience and afterwards, gave wise advice to the youngest, curious to know the secrets of his longevity.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>réuniondirigeants0.jpg\ndateCreated_article=>2019-07-19 18:40:07\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1528,2147204895,'2019-07-29 16:42:08','photo','insert|all|483|0|id_photo=>483\nid_article=>68\nfichier_photo=>runiondirigeants2.jpg\ndateCreated_photo=>2019-07-29 18:42:08\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1529,2147204895,'2019-07-29 16:42:11','photo','insert|all|484|0|id_photo=>484\nid_article=>68\nfichier_photo=>runiondirigeants3.jpg\ndateCreated_photo=>2019-07-29 18:42:11\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1530,2147204895,'2019-07-29 16:42:14','photo','insert|all|485|0|id_photo=>485\nid_article=>68\nfichier_photo=>runiondirigeants1.jpg\ndateCreated_photo=>2019-07-29 18:42:14\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1531,2147204895,'2019-07-29 16:46:04','article','insert|all|69|0|id_article=>69\ntitre_article=> Les Matinales de SUNU Assurances IARD Cameroun\ntitre_article_en=> The Matinales of SUNU Assurances IARD Cameroon\ntexte_article=><p><br>\r\nDu 02 au 05 juillet derniers à l’espace Méridien au Pullman de DOUALA, SUNU Assurances IARD Cameroun a organisé des rencontres avec des professionnels de différents secteurs, baptisées les « Matinales de SUNU Assurances ». </p>\r\n\r\n<p>Ainsi, tout au long de la semaine, l’équipe de la Direction du Développement Commercial a rencontré tour à tour des professionnels du Transport (Transitaires et Transporteurs), du Voyage (Agences de voyage) et du Logement (SCI). <br>\r\nCes rencontres ont permis de présenter les solutions d’assurances innovantes, de discuter d’opportunités d’affaires et de nouer de nouveaux partenariats.</p>\r\n\ntexte_article_en=><p>From the 2nd to the 5th of July at the Meridien space at Pullman de DOUALA, SUNU Assurances IARD Cameroon organized meetings with professionals from different sectors, called \"Matinales de SUNU Assurances\".<br>\r\nThus, throughout the week, the team of the Direction of the Commercial Development met in turn professionals of Transport (Freight Forwarders and Transporters), Travel (Travel Agencies) and Housing (SCI).<br>\r\nThese meetings allowed us to present innovative insurance solutions, discuss business opportunities and forge new partnerships.</p>\r\n\nlecture_article=>0\nfichier_article=>lesmatinales0cameroun_2019.jpg\ndateCreated_article=>2019-07-05 18:46:04\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1532,2147204895,'2019-07-29 16:47:25','photo','insert|all|486|0|id_photo=>486\nid_article=>69\nfichier_photo=>lesmatinales3cameroun_2019.jpg\ndateCreated_photo=>2019-07-29 18:47:25\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1533,2147204895,'2019-07-29 16:47:26','photo','insert|all|487|0|id_photo=>487\nid_article=>69\nfichier_photo=>lesmatinales2cameroun_2019.jpg\ndateCreated_photo=>2019-07-29 18:47:26\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1534,2147204895,'2019-07-29 16:47:34','photo','insert|all|488|0|id_photo=>488\nid_article=>69\nfichier_photo=>lesmatinales1cameroun_2019.jpg\ndateCreated_photo=>2019-07-29 18:47:34\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1535,2147204895,'2019-07-29 16:57:17','article','insert|all|70|0|id_article=>70\ntitre_article=>SUNU Assurances aux côtés des ambassadeurs de Côte d’Ivoire à la retraite\ntitre_article_en=>SUNU Assurances alongside retired Côte d\'Ivoire ambassadors\ntexte_article=><p>Le dîner débat de l’Association des Ambassadeurs de Côte d’Ivoire à la retraite (AACIR) était à sa 4ème édition le jeudi 27 juin 2019 à l’espace Latrille Event.</p>\r\n\r\n<p>A cette rencontre, plusieurs panélistes avaient été invités à développer le thème choisi pour l’occasion, « les secrets d’une longévité heureuse ».<br>\r\nM. Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie Côte d’Ivoire a fait une brillante présentation sur les produits de capitalisation qui pourraient permettre à tous de s’assurer une retraite décente. <br>\r\nPar ailleurs, l’ambassadeur AMON TANOH Lambert, âgé de 93 ans a partagé son expérience de vie et a par la suite, prodigué de sages conseils aux plus jeunes, curieux de connaitre les secrets de sa longévité.</p>\r\n\ntexte_article_en=><p>The debate dinner of the Association of Ambassadors of Côte d&#39;Ivoire at retirement (AACIR) was at its 4th edition on Thursday, June 27, 2019 at Espace Latrille Event. At this meeting, several panelists were invited to develop the theme chosen for the occasion, \"the secrets of a happy longevity\".<br>\r\nMr. Saliou BAKAYOKO, General Manager of SUNU Assurances Vie Côte d&#39;Ivoire made a brilliant presentation on capitalization products that could allow everyone to ensure a decent retirement.<br>\r\nIn addition, the ambassador AMON TANOH Lambert, 93 years old, shared his life experience and afterwards, gave wise advice to the youngest, curious to know the secrets of his longevity.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>AACIR0_2019.jpg\ndateCreated_article=>2019-07-27 18:57:17\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1536,2147204895,'2019-07-29 16:57:49','photo','insert|all|489|0|id_photo=>489\nid_article=>70\nfichier_photo=>AACIR3_2019.jpg\ndateCreated_photo=>2019-07-29 18:57:49\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1537,2147204895,'2019-07-29 16:57:51','photo','insert|all|490|0|id_photo=>490\nid_article=>70\nfichier_photo=>AACIR2_2019.jpg\ndateCreated_photo=>2019-07-29 18:57:51\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1538,2147204895,'2019-07-29 16:57:52','photo','insert|all|491|0|id_photo=>491\nid_article=>70\nfichier_photo=>AACIR1_2019.jpg\ndateCreated_photo=>2019-07-29 18:57:52\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1539,2147204895,'2019-07-29 17:01:14','article','insert|all|71|0|id_article=>71\ntitre_article=>SUNU ASSURANCES Vie Côte d\'Ivoire partenaire d\'Afrique Consciente\ntitre_article_en=>SUNU Assurances Vie Côte d\'Ivoire partner of Africa Conscious\ntexte_article=><p>Les 2èmes Universités ouvertes de la société civique en Afrique, se sont déroulées le samedi 29 juin 2019 à l’hôtel Sofitel Ivoire d’Abidjan. Au cours de cette journée, plusieurs personnalités venues d’ici et d’ailleurs, ont développé les valeurs africaines telles que la solidarité, le respect, la dignité. S’appuyant sur ces valeurs, des hommes et des femmes œuvrent tous les jours, chacun à leur niveau pour rendre la vie de milliers de personnes meilleure. Ils ont partagé avec le public venu nombreux pour l’occasion leurs expériences au niveau de la santé, l’éducation et l’environnement. Parmi les panélistes, un invité spécial venu du Burkina Faso, M. Yacouba SAWADOGO surnommé « l’homme qui a arrêté le désert », s’est vu décerner le prix Afrique consciente.<br>\r\nSUNU Assurances en tant qu’entreprise panafricaine qui épouse pleinement les valeurs d’Afrique Consciente (Solidarité, Respect, Dignité) n’a pas voulu rester en marge de cette belle initiative.</p>\r\n\ntexte_article_en=><p>The 2nd Open Universities of the civic society in Africa, took place on Saturday, June 29, 2019 at the Sofitel Ivoire hotel in Abidjan. During this day, many personalities from here and elsewhere, have developed African values ​​such as solidarity, respect, dignity. Based on these values, men and women work every day, each at their level to make the lives of thousands of people better. They shared with the public come numerous for the occasion their experiences in health, education and the environment. Among the panellists, a special guest from Burkina Faso, Mr. Yacouba SAWADOGO nicknamed \"the man who stopped the desert\", was awarded the Africa conscious prize.<br>\r\nSUNU Assurances as a pan-African company that fully embraces the values ​​of Africa Consciente (Solidarity, Respect, Dignity) did not want to stay on the sidelines of this great initiative.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>afriqueconsciente0_2019.jpg\ndateCreated_article=>2019-06-29 19:01:14\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1540,2147204895,'2019-07-29 17:01:52','photo','insert|all|492|0|id_photo=>492\nid_article=>71\nfichier_photo=>afriqueconsciente2_2019.jpg\ndateCreated_photo=>2019-07-29 19:01:52\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1541,2147204895,'2019-07-29 17:01:54','photo','insert|all|493|0|id_photo=>493\nid_article=>71\nfichier_photo=>afriqueconsciente3_2019.jpg\ndateCreated_photo=>2019-07-29 19:01:54\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1542,2147204895,'2019-07-29 17:01:56','photo','insert|all|494|0|id_photo=>494\nid_article=>71\nfichier_photo=>afriqueconsciente1_2019.jpg\ndateCreated_photo=>2019-07-29 19:01:56\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1543,2147204895,'2019-07-29 17:04:28','article','update|all|70|id_article=>70\ntitre_article=>SUNU Assurances aux côtés des ambassadeurs de Côte d’Ivoire à la retraite\ntitre_article_en=>SUNU Assurances alongside retired Côte d\'Ivoire ambassadors\ntexte_article=><p>Le dîner débat de l’Association des Ambassadeurs de Côte d’Ivoire à la retraite (AACIR) était à sa 4ème édition le jeudi 27 juin 2019 à l’espace Latrille Event.</p>\r\n\r\n<p>A cette rencontre, plusieurs panélistes avaient été invités à développer le thème choisi pour l’occasion, « les secrets d’une longévité heureuse ».<br>\r\nM. Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie Côte d’Ivoire a fait une brillante présentation sur les produits de capitalisation qui pourraient permettre à tous de s’assurer une retraite décente. <br>\r\nPar ailleurs, l’ambassadeur AMON TANOH Lambert, âgé de 93 ans a partagé son expérience de vie et a par la suite, prodigué de sages conseils aux plus jeunes, curieux de connaitre les secrets de sa longévité.</p>\r\n\ntexte_article_en=><p>The debate dinner of the Association of Ambassadors of Côte d&#39;Ivoire at retirement (AACIR) was at its 4th edition on Thursday, June 27, 2019 at Espace Latrille Event. At this meeting, several panelists were invited to develop the theme chosen for the occasion, \"the secrets of a happy longevity\".<br>\r\nMr. Saliou BAKAYOKO, General Manager of SUNU Assurances Vie Côte d&#39;Ivoire made a brilliant presentation on capitalization products that could allow everyone to ensure a decent retirement.<br>\r\nIn addition, the ambassador AMON TANOH Lambert, 93 years old, shared his life experience and afterwards, gave wise advice to the youngest, curious to know the secrets of his longevity.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>AACIR0_2019.jpg\ndateCreated_article=>2019-07-27 18:57:17\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>70\ntitre_article=>SUNU Assurances aux côtés des ambassadeurs de Côte d’Ivoire à la retraite\ntitre_article_en=>SUNU Assurances alongside retired Côte d\'Ivoire ambassadors\ntexte_article=><p>Le dîner débat de l’Association des Ambassadeurs de Côte d’Ivoire à la retraite (AACIR) était à sa 4ème édition le jeudi 27 juin 2019 à l’espace Latrille Event.</p>\r\n\r\n<p>A cette rencontre, plusieurs panélistes avaient été invités à développer le thème choisi pour l’occasion, « les secrets d’une longévité heureuse ».<br>\r\nM. Saliou BAKAYOKO, Directeur Général de SUNU Assurances Vie Côte d’Ivoire a fait une brillante présentation sur les produits de capitalisation qui pourraient permettre à tous de s’assurer une retraite décente. <br>\r\nPar ailleurs, l’ambassadeur AMON TANOH Lambert, âgé de 93 ans a partagé son expérience de vie et a par la suite, prodigué de sages conseils aux plus jeunes, curieux de connaitre les secrets de sa longévité.</p>\r\n\ntexte_article_en=><p>The debate dinner of the Association of Ambassadors of Côte d&#39;Ivoire at retirement (AACIR) was at its 4th edition on Thursday, June 27, 2019 at Espace Latrille Event. At this meeting, several panelists were invited to develop the theme chosen for the occasion, \"the secrets of a happy longevity\".<br>\r\nMr. Saliou BAKAYOKO, General Manager of SUNU Assurances Vie Côte d&#39;Ivoire made a brilliant presentation on capitalization products that could allow everyone to ensure a decent retirement.<br>\r\nIn addition, the ambassador AMON TANOH Lambert, 93 years old, shared his life experience and afterwards, gave wise advice to the youngest, curious to know the secrets of his longevity.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>AACIR0_2019.jpg\ndateCreated_article=>2019-06-27 19:04:28\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1544,2147204895,'2019-07-29 17:22:28','article','insert|all|72|0|id_article=>72\ntitre_article=>Le TEAM BUILDING de SUNU Assurances Vie TOGO \ntitre_article_en=>TEAM BUILDING by SUNU Assurances Vie TOGO\ntexte_article=><p><br>\r\nLe samedi 29 juin dernier a eu lieu le team building de SUNU Assurances Vie TOGO au complexe balnéaire le BLUE TURTLE BAE.<br>\r\nL’objectif de cette activité était de resserrer les liens des employés autour de plusieurs sujets, activités et formations. </p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>On Saturday the 29th of June took place the team building of SUNU Assurances Vie TOGO at the seaside resort BLUE TURTLE BAE.<br>\r\nThe objective of this activity was to strengthen the links of the employees around several subjects, activities and trainings.</p>\r\n\nlecture_article=>0\nfichier_article=>teambuild0togo-2019.jpg\ndateCreated_article=>2019-06-06 19:22:28\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1545,2147204895,'2019-07-29 17:24:31','photo','insert|all|495|0|id_photo=>495\nid_article=>72\nfichier_photo=>teambuild2togo-2019.jpg\ndateCreated_photo=>2019-07-29 19:24:31\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1546,2147204895,'2019-07-29 17:24:44','photo','insert|all|496|0|id_photo=>496\nid_article=>72\nfichier_photo=>teambuild3togo-2019.jpg\ndateCreated_photo=>2019-07-29 19:24:44\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1547,2147204895,'2019-07-29 17:24:47','photo','insert|all|497|0|id_photo=>497\nid_article=>72\nfichier_photo=>teambuild1togo-2019.jpg\ndateCreated_photo=>2019-07-29 19:24:47\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1548,2147204895,'2019-07-29 17:38:11','article','insert|all|73|0|id_article=>73\ntitre_article=> LES SOCIETES SUNU Assurances au Togo au FESTIVAL EVALA 2019\ntitre_article_en=>SOCIETES SUNU Assurances in Togo at the EVALA 2019 FESTIVAL\ntexte_article=><p>Comme chaque année, SUNU Assurances proche des populations a apporté son soutien aux organisateurs des luttes traditionnelles dénommées EVALA.<br>\r\nCe festival qui a eu lieu du 15 au 21 Juillet en pays Kabyè au nord du Togo, est un rite initiatique qui fait entrer les jeunes dans le rang des hommes.<br>\r\nCet évènement a un programme d’activités culturelles (soirées culturelles, concerts, chants, danses, contes traditionnels, soirées théâtrales...) très engageant et draine énormément de personne.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>As every year, SUNU Assurances close to the population has supported the organizers of the traditional struggles called EVALA.<br>\r\nThis festival, which took place from July 15th to 21st in Kabyè country in the north of Togo, is an initiation ritual that brings young people into the ranks of men.<br>\r\nThis event has a program of cultural activities (cultural evenings, concerts, songs, dances, traditional tales, theatrical nights ...) very engaging and drains a lot of people.</p>\r\n\nlecture_article=>0\nfichier_article=>EVALA0-2019.jpg\ndateCreated_article=>2019-07-21 19:38:11\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1549,2147204895,'2019-07-29 17:41:59','photo','insert|all|498|0|id_photo=>498\nid_article=>73\nfichier_photo=>EVALA1-2019.jpg\ndateCreated_photo=>2019-07-29 19:41:59\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1550,2147204895,'2019-07-29 17:42:05','photo','insert|all|499|0|id_photo=>499\nid_article=>73\nfichier_photo=>EVALA2-2019.jpg\ndateCreated_photo=>2019-07-29 19:42:05\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1551,2147204895,'2019-07-29 17:42:17','photo','insert|all|500|0|id_photo=>500\nid_article=>73\nfichier_photo=>EVALA4-2019.jpg\ndateCreated_photo=>2019-07-29 19:42:17\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1552,2147204895,'2019-07-29 17:53:38','article','insert|all|74|0|id_article=>74\ntitre_article=>SUNU ASSURANCES Vie Bénin à la FIAC 2019\ntitre_article_en=> SUNU Assurances Vie Benin at FIAC 2019\ntexte_article=><p>Du 17 au 19 juin 2019, s’est tenu la 13e Assemblée Générale de la Fédération Interafricaine des Assureurs-Conseils (FIAC) à AZALAI hôtel Cotonou.  <br>\r\nM. Landry DJETE, Directeur du Développement Commercial de SUNU Assurances Vie Bénin est intervenu sur l’un des panels de la deuxième (2e) journée dont le thème était : « Quelle passerelle entre l’intermédiation financière et le courtage d’assurance à l’ère du numérique ? ». <br>\r\nL’objectif de ce panel étais de faire savoir que l’intermédiation financière ne peut être ignorée, et qu’elle sert à optimiser les offres d’assurance sur les rémunérations différées (IFC retraite, épargne salariale).</p>\r\n\ntexte_article_en=><p>From June 17 to 19, 2019, it was held at the 13th General Assembly of the Interafrican Association of Insurance Providers (FIAC) at the AZALAI Cotonou Hotel.<br>\r\n <br>\r\nMr. Landry DJETE, Business Development Director of SUNU Assurances Vie Benin spoke on one of the panels of the second (2nd) day whose theme was: \"What is the financial interaction and the insurance broker? the digital age? \"<br>\r\nThe purpose of this panel is to know that financial intermediation can not be ignored, and that it optimizes the insurance offers on deferred remuneration (IFC retirement, employee savings).</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>Fiac0_2019.jpg\ndateCreated_article=>2019-06-17 19:53:38\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1553,2147204895,'2019-07-29 17:54:38','photo','insert|all|501|0|id_photo=>501\nid_article=>74\nfichier_photo=>Fiac2_2019.jpg\ndateCreated_photo=>2019-07-29 19:54:38\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1554,2147204895,'2019-07-29 17:54:47','photo','insert|all|502|0|id_photo=>502\nid_article=>74\nfichier_photo=>fintech0-2019.jpg\ndateCreated_photo=>2019-07-29 19:54:47\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1555,2147204895,'2019-07-29 17:54:48','photo','insert|all|503|0|id_photo=>503\nid_article=>74\nfichier_photo=>Fiac1_2019.jpg\ndateCreated_photo=>2019-07-29 19:54:48\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1556,2147204895,'2019-07-30 10:31:39','_SESSION','login|all|1564482578|0|__ci_last_regenerate=>1564482578\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-07-29 18:16:45::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1557,2147204895,'2019-07-30 10:35:53','article','insert|all|75|0|id_article=>75\ntitre_article=>SUNU Assurances Vie Côte d’Ivoire assure la mutuelle INPHB (MUPI)\ntitre_article_en=>SUNU Assurances Vie Côte d\'Ivoire insures Mutual INPHB (MUPI)\ntexte_article=><p><br>\r\nLe Jeudi 18 juillet 2019, la mutuelle du personnel de L’INPHB (MUPI) Institut National Polytechnique Houphouët Boigny, a accordé leur confiance à SUNU Assurances Vie pour la couverture d’assurance collective. Cet accord s’est matérialisé par une signature de convention au siège de ladite société d’assurance. Dans ce partenariat, Le produit décès proposé par SUNU Assurances dénommé Bokamin, apporte une assistance financière à la famille de l’assuré en cas de décès de celui-ci par le paiement d’une prime mensuelle.</p>\r\n\r\n<p>Mme KOUONON Olivia, Directeur Production et Encaissement de SUNU Assurances Vie et M. KONAN Jean-Claude, président de la MUPI ont échangé les parapheurs sous la supervision des participants venus pour l’occasion. </p>\r\n\ntexte_article_en=><p>On Thursday, July 18, 2019, the INPHB (MUPI) National Houphouët Boigny National Institute of Polytechnic Institute, placed their trust in SUNU Life Insurance for the group insurance coverage . This agreement was materialized by a signature of agreement at the headquarters of the said insurance company. In this partnership, the death product offered by SUNU Assurances called Bokamin, provides financial assistance to the family of the insured in case of death of the latter by the payment of a monthly premium.<br>\r\n <br>\r\nMrs Kouonon Olivia, Production and Collection Director of SUNU Assurances Vie and Mr KONAN Jean-Claude, President of MUPI exchanged the paraphors under the supervision of the participants who came for the occasion.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>signatureconvention0_2019.jpg\ndateCreated_article=>2019-07-18 12:35:53\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1558,2147204895,'2019-07-30 10:36:25','photo','insert|all|504|0|id_photo=>504\nid_article=>75\nfichier_photo=>signatureconvention2_2019.jpg\ndateCreated_photo=>2019-07-30 12:36:25\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1559,2147204895,'2019-07-30 10:36:29','photo','insert|all|505|0|id_photo=>505\nid_article=>75\nfichier_photo=>signatureconvention3_2019.jpg\ndateCreated_photo=>2019-07-30 12:36:29\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1560,2147204895,'2019-07-30 10:36:30','photo','insert|all|506|0|id_photo=>506\nid_article=>75\nfichier_photo=>signatureconvention1_2019.jpg\ndateCreated_photo=>2019-07-30 12:36:30\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1561,2147204895,'2019-07-30 10:38:07','article','insert|all|76|0|id_article=>76\ntitre_article=>SUNU Assurances Côte d’Ivoire accompagne les PME\ntitre_article_en=>SUNU Assurances Côte d\'Ivoire supports PME\ntexte_article=><p>SUNU Assurances Côte d’Ivoire et son partenaire SINCA-RE (Société Internationale de Conseil en Assurances et Réassurances) ont convié les chefs d’entreprises des PME à une présentation des offres d’assurances. Cette rencontre a eu lieu à la Chambre de Commerce et d’Industrie de Côte d’Ivoire le vendredi 12 juillet 2019.</p>\r\n\r\n<p>Le thème abordé à cette formation était : Comment l’assurance peut-elle contribuer à la performance des PME ?<br>\r\nM. Ramses KOUAKOU, Chef de Département Marketing et Business Development, et son collègue M. AKA Responsable Bureau Direct IARD ont entretenu les chefs d’entreprises sur la discipline financière par la suite, ils ont proposé des produits adaptés aux petites moyennes entreprises (PME). </p>\r\n\ntexte_article_en=><p>SUNU Assurances Côte d&#39;Ivoire and its partner SINCA-RE (International Insurance and Reinsurance Advisory Society) have invited PME entrepreneurs to present insurance offers. This meeting took place at the Chamber of Commerce and Industry of Côte d&#39;Ivoire on Friday, July 12, 2019.<br>\r\nThe theme of this training was: How can insurance contribute to the performance of  PME?<br>\r\nMr. Ramses Kouakou, Head of Marketing and Business Development Department, and his colleague Mr. AKA Head of the IARD Direct Office spoke with business leaders about financial discipline afterwards, they proposed products adapted to small and medium-sized enterprises (PME).</p>\r\n\nlecture_article=>0\nfichier_article=>SINCARE0_2019.jpg\ndateCreated_article=>2019-07-30 12:38:07\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1562,2147204895,'2019-07-30 10:39:28','article','update|all|76|id_article=>76\ntitre_article=>SUNU Assurances Côte d’Ivoire accompagne les PME\ntitre_article_en=>SUNU Assurances Côte d\'Ivoire supports PME\ntexte_article=><p>SUNU Assurances Côte d’Ivoire et son partenaire SINCA-RE (Société Internationale de Conseil en Assurances et Réassurances) ont convié les chefs d’entreprises des PME à une présentation des offres d’assurances. Cette rencontre a eu lieu à la Chambre de Commerce et d’Industrie de Côte d’Ivoire le vendredi 12 juillet 2019.</p>\r\n\r\n<p>Le thème abordé à cette formation était : Comment l’assurance peut-elle contribuer à la performance des PME ?<br>\r\nM. Ramses KOUAKOU, Chef de Département Marketing et Business Development, et son collègue M. AKA Responsable Bureau Direct IARD ont entretenu les chefs d’entreprises sur la discipline financière par la suite, ils ont proposé des produits adaptés aux petites moyennes entreprises (PME). </p>\r\n\ntexte_article_en=><p>SUNU Assurances Côte d&#39;Ivoire and its partner SINCA-RE (International Insurance and Reinsurance Advisory Society) have invited PME entrepreneurs to present insurance offers. This meeting took place at the Chamber of Commerce and Industry of Côte d&#39;Ivoire on Friday, July 12, 2019.<br>\r\nThe theme of this training was: How can insurance contribute to the performance of  PME?<br>\r\nMr. Ramses Kouakou, Head of Marketing and Business Development Department, and his colleague Mr. AKA Head of the IARD Direct Office spoke with business leaders about financial discipline afterwards, they proposed products adapted to small and medium-sized enterprises (PME).</p>\r\n\nlecture_article=>0\nfichier_article=>SINCARE0_2019.jpg\ndateCreated_article=>2019-07-30 12:38:07\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>76\ntitre_article=>SUNU Assurances Côte d’Ivoire accompagne les PME\ntitre_article_en=>SUNU Assurances Côte d\'Ivoire supports PME\ntexte_article=><p>SUNU Assurances Côte d’Ivoire et son partenaire SINCA-RE (Société Internationale de Conseil en Assurances et Réassurances) ont convié les chefs d’entreprises des PME à une présentation des offres d’assurances. Cette rencontre a eu lieu à la Chambre de Commerce et d’Industrie de Côte d’Ivoire le vendredi 12 juillet 2019.</p>\r\n\r\n<p>Le thème abordé à cette formation était : Comment l’assurance peut-elle contribuer à la performance des PME ?<br>\r\nM. Ramses KOUAKOU, Chef de Département Marketing et Business Development, et son collègue M. AKA Responsable Bureau Direct IARD ont entretenu les chefs d’entreprises sur la discipline financière par la suite, ils ont proposé des produits adaptés aux petites moyennes entreprises (PME). </p>\r\n\ntexte_article_en=><p>SUNU Assurances Côte d&#39;Ivoire and its partner SINCA-RE (International Insurance and Reinsurance Advisory Society) have invited PME entrepreneurs to present insurance offers. This meeting took place at the Chamber of Commerce and Industry of Côte d&#39;Ivoire on Friday, July 12, 2019.<br>\r\nThe theme of this training was: How can insurance contribute to the performance of  PME?<br>\r\nMr. Ramses Kouakou, Head of Marketing and Business Development Department, and his colleague Mr. AKA Head of the IARD Direct Office spoke with business leaders about financial discipline afterwards, they proposed products adapted to small and medium-sized enterprises (PME).</p>\r\n\nlecture_article=>0\nfichier_article=>SINCARE0_2019.jpg\ndateCreated_article=>2019-07-12 12:39:28\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1563,2147204895,'2019-07-30 10:39:57','photo','insert|all|507|0|id_photo=>507\nid_article=>76\nfichier_photo=>SINCARE2_2019.jpg\ndateCreated_photo=>2019-07-30 12:39:57\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1564