,'2019-08-19 08:31:33','_SESSION','login|all|1566203493|0|__ci_last_regenerate=>1566203493\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-08-09 18:49:52::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1572,2147204895,'2019-08-22 17:31:11','_SESSION','login|all|1566495061|0|__ci_last_regenerate=>1566495061\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-08-19 10:31:33::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1573,2147204895,'2019-08-26 18:10:03','_SESSION','login|all|1566842943|0|__ci_last_regenerate=>1566842943\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-08-22 19:31:11::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1574,2147204895,'2019-09-02 09:49:28','_SESSION','login|all|1567417660|0|__ci_last_regenerate=>1567417660\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-08-26 20:10:03::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1575,2147204895,'2019-09-02 10:08:16','article','insert|all|77|0|id_article=>77\ntitre_article=>SUNU Assurances Vie Partenaire de la 2ème édition de la Grande Soirée Retro\ntitre_article_en=>SUNU Assurances Vie Partner of the 2nd edition of the Great Retro Party\ntexte_article=>Le samedi 3 août, les mélomanes des musiques rétro se sont donné rendez-vous à la 2ème édition de la grande soirée Rétro organisée en partenariat avec SUNU Assurances Vie Côte d’Ivoire. \r\nCet évènement a vu la participation de certains pionniers, de la musique ivoirienne dont : Daouda le Sentimental, Antoinette KONAN, Bailly SPINTO, les Woody et bien d’autres gloires qui ont enflammé le public venu revivre en émotion leur plus belle jeunesse. \r\nCeux-ci, n’ont pas boudé leur plaisir en esquissant des pas de danse au rythme de la musique distillée. Ce fut une soirée forte appréciée.\ntexte_article_en=>On Saturday, August 3rd, retro music lovers will meet at the 2nd edition of the Retro evening organized in partnership with SUNU Assurances Vie Côte d\'Ivoire.\r\nThis event saw the participation of some pioneers, of Ivorian music including: Daouda the Sentimental, Antoinette KONAN, Bailly SPINTO, the Woody and many other glories that ignited the public came relive in emotion their most beautiful youth.\r\nThese, have not shunned their pleasure by sketching dance steps to the rhythm of distilled music. It was a very popular evening.\nlecture_article=>0\nfichier_article=>soiréeintranet01.jpg\ndateCreated_article=>2019-08-27 12:08:16\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1576,2147204895,'2019-09-02 10:11:06','photo','insert|all|511|0|id_photo=>511\nid_article=>77\nfichier_photo=>soireintranet03.jpg\ndateCreated_photo=>2019-09-02 12:11:06\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1577,2147204895,'2019-09-02 10:11:22','photo','insert|all|512|0|id_photo=>512\nid_article=>77\nfichier_photo=>soireintranet04.jpg\ndateCreated_photo=>2019-09-02 12:11:22\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1578,2147204895,'2019-09-02 10:11:30','photo','insert|all|513|0|id_photo=>513\nid_article=>77\nfichier_photo=>soireintranet02.jpg\ndateCreated_photo=>2019-09-02 12:11:30\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1579,2147204895,'2019-09-02 10:11:45','photo','insert|all|514|0|id_photo=>514\nid_article=>77\nfichier_photo=>soireintranet06.jpg\ndateCreated_photo=>2019-09-02 12:11:45\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1580,2147204895,'2019-09-02 10:11:46','photo','insert|all|515|0|id_photo=>515\nid_article=>77\nfichier_photo=>soireintranet05.jpg\ndateCreated_photo=>2019-09-02 12:11:46\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1581,2147204895,'2019-09-02 10:11:58','photo','insert|all|516|0|id_photo=>516\nid_article=>77\nfichier_photo=>soireintranet07.jpg\ndateCreated_photo=>2019-09-02 12:11:58\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1582,2147204895,'2019-09-02 10:12:00','photo','insert|all|517|0|id_photo=>517\nid_article=>77\nfichier_photo=>soireintranet12.jpg\ndateCreated_photo=>2019-09-02 12:12:00\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1583,2147204895,'2019-09-02 15:51:47','_SESSION','login|all|1567439507|0|__ci_last_regenerate=>1567439507\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-09-02 11:49:28::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1584,2147204895,'2019-09-03 14:07:42','_SESSION','login|all|1567519655|0|__ci_last_regenerate=>1567519655\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-09-02 17:51:47::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1585,2147204895,'2019-09-06 18:57:18','_SESSION','login|all|1567796189|0|__ci_last_regenerate=>1567796189\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-09-03 16:07:42::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1586,2147204895,'2019-09-06 18:59:16','contact','insert|all|54|0|id_contact=>54\nnom_contact=>Moustapha BALDE\nemail_contact=>moustapha.balde@sunu-group.com\ndateCreated_contact=>2019-09-06 20:59:16\nstatut_contact=>1\ncreatedBy=>2147204895\nid_pays=>11\nid_assurable=>4|5|7|1|2|3|6|\nid_user=>1854804137\n'),(1587,2147204895,'2019-09-06 19:04:56','contact','insert|all|55|0|id_contact=>55\nnom_contact=>Soona N\'DIAYE\nemail_contact=>soona.ndiaye@sunu-group.com\ndateCreated_contact=>2019-09-06 21:04:56\nstatut_contact=>1\ncreatedBy=>2147204895\nid_pays=>11\nid_assurable=>4|5|7|1|2|3|6|\nid_user=>681261383\n'),(1588,2147204895,'2019-09-16 08:50:34','_SESSION','login|all|1568623818|0|__ci_last_regenerate=>1568623818\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-09-06 20:57:18::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1589,2147204895,'2019-09-16 08:55:27','article','insert|all|78|0|id_article=>78\ntitre_article=>Sponsoring ELS\ntitre_article_en=> ELS Sponsorship\ntexte_article=><p>Cette année, les sociétés SUNU Assurances au Cameroun font partie des sponsors de la Fondation Elessa Lothin Sen (Fondation lancée l’année dernière par l’un des principaux courtiers du marché), dont les activités s’articulent autour de 03 thèmes : l’Education, l’Economie et le Sport.</p>\r\n\r\n<div xss=removed>Pour cette seconde édition, la Fondation a choisi de s’investir dans l’éducation, en accompagnant des élèves, à travers :</div>\r\n\r\n<div xss=removed>-Le don de 300 bourses scolaires d’une valeur totale de 5.000.000 F CFA à des écoliers des villes de Mouanko et Edéa, les 16 et 18 Août 2019 ;</div>\r\n\r\n<div xss=removed>-Et ce 27 septembre, le don d’une bibliothèque de 1 000 livres à une école de la ville de Yaoundé.</div>\r\n\r\n<div xss=removed>Ces remises de bourses ont également été l’occasion pour SUNU Assurances de présenter ses solutions d’assurance Education aux personnes présentes, et de se positionner comme un acteur majeur de l’Education au Cameroun.</div>\r\n\r\n<div xss=removed>Les activités de la Fondation se poursuivent jusqu’en décembre.</div>\r\n\ntexte_article_en=><div xss=removed>This year, the SUNU Assurances companies in Cameroon are part of the sponsors of the Elessa Lothin Sen Foundation (Foundation launched last year by one of the main brokers of the market), whose activities revolve around 03 themes: the Education, Economy and Sport.</div>\r\n\r\n<div xss=removed>For this second edition, the Foundation has chosen to invest in education, accompanying students, through:</div>\r\n\r\n<div xss=removed>- The donation of 300 scholarships worth a total of 5,000,000 CFA francs to schoolchildren in the cities of Mouanko and Edea on 16 and 18 August 2019;</div>\r\n\r\n<div xss=removed>- And this 27th of September, the donation of a library of 1,000 books to a school in the city of Yaounde.</div>\r\n\r\n<div xss=removed>These scholarship awards were also an opportunity for SUNU Assurances to present its education insurance solutions to those present, and to position itself as a major player in education in Cameroon.</div>\r\n\r\n<div xss=removed>The activities of the Foundation continue until December.</div>\r\n\nlecture_article=>0\nfichier_article=>sponsoringels0-2019.jpg\ndateCreated_article=>2019-08-16 10:55:27\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1590,2147204895,'2019-09-16 08:56:35','photo','insert|all|518|0|id_photo=>518\nid_article=>78\nfichier_photo=>sponsoringels1-2019.jpg\ndateCreated_photo=>2019-09-16 10:56:35\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1591,2147204895,'2019-09-16 08:56:37','photo','insert|all|519|0|id_photo=>519\nid_article=>78\nfichier_photo=>sponsoringels2-2019.jpg\ndateCreated_photo=>2019-09-16 10:56:37\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1592,2147204895,'2019-09-16 08:56:46','photo','insert|all|520|0|id_photo=>520\nid_article=>78\nfichier_photo=>sponsoringels4-2019.jpg\ndateCreated_photo=>2019-09-16 10:56:46\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1593,2147204895,'2019-09-16 08:56:47','photo','insert|all|521|0|id_photo=>521\nid_article=>78\nfichier_photo=>sponsoringels3-2019.jpg\ndateCreated_photo=>2019-09-16 10:56:47\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1594,2147204895,'2019-09-16 08:56:51','photo','insert|a