UNU est présent dans 14 pays d&#39;Afrique subsaharienne avec 27 sociétés d’assurances et autres sociétés affiliées.</p>\r\n\ntexte_publication_en=><p>The SUNU Group is present in 14 countries in sub-Saharan Africa with 27 insurance companies and other affiliated companies.</p>\r\n\nfichier_publication=>Plaquette_Instit_2018_wweb1.pdf\nfichier_publication_en=>Plaquette_Instit__SUNU2018_web.pdf\ndateCreated_publication=>2019-09-17 17:20:36\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_publication=>1\n|id_publication=>27\ntitre_publication=>Plaquette Institutionnelle 2018\ntitre_publication_en=>Institutional brochure 2018\ntexte_publication=><p>Le Groupe SUNU est présent dans 14 pays d&#39;Afrique subsaharienne avec 27 sociétés d’assurances et autres sociétés affiliées.</p>\r\n\ntexte_publication_en=><p>The SUNU Group is present in 14 countries in sub-Saharan Africa with 27 insurance companies and other affiliated companies.</p>\r\n\nfichier_publication=>Plaquette_Instit_2018_wweb1.pdf\nfichier_publication_en=>Plaquette_Instit__SUNU2018VA_web.pdf\ndateCreated_publication=>2019-09-17 17:54:36\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_publication=>1\n'),(1647,2147204895,'2019-10-11 17:50:44','publication','update|all|26|id_publication=>26\ntitre_publication=>Rapport Annuel 2018\ntitre_publication_en=>Annual Report 2018\ntexte_publication=><p>Marquant la célébration des 20 ans du Groupe SUNU, 2018 aura été une année de challenges. L’augmentation de capital, exigeant aux sociétés d’assurance agrées en zone CIMA de passer de 1 à 3 Milliards F CFA avant le 31 mai 2019, a été un levier majeur dans la refonte du secteur de l’assurance.</p>\r\n\ntexte_publication_en=><p>Marking the 20th anniversary celebration of the SUNU Group, 2018 will have been a year of year of challenges. The increase of capital, requiring insurance companies to approved in CIMA zone to go from 1 to 3 Billions of CFA francs before May 31, 2019, has been a major lever in the redesign of the insurance sector.</p>\r\n\nfichier_publication=>RA_SUNU_18_wweb1.pdf\nfichier_publication_en=>\ndateCreated_publication=>2019-09-18 19:16:31\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_publication=>1\n|id_publication=>26\ntitre_publication=>Rapport Annuel 2018\ntitre_publication_en=>Annual Report 2018\ntexte_publication=><p>Marquant la célébration des 20 ans du Groupe SUNU, 2018 aura été une année de challenges. L’augmentation de capital, exigeant aux sociétés d’assurance agrées en zone CIMA de passer de 1 à 3 Milliards F CFA avant le 31 mai 2019, a été un levier majeur dans la refonte du secteur de l’assurance.</p>\r\n\ntexte_publication_en=><p>Marking the 20th anniversary celebration of the SUNU Group, 2018 will have been a year of year of challenges. The increase of capital, requiring insurance companies to approved in CIMA zone to go from 1 to 3 Billions of CFA francs before May 31, 2019, has been a major lever in the redesign of the insurance sector.</p>\r\n\nfichier_publication=>RA_SUNU_18_wweb1.pdf\nfichier_publication_en=>RA_SUNU18_VAweb.pdf\ndateCreated_publication=>2019-09-18 19:50:44\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_publication=>1\n'),(1648,2147204895,'2019-10-17 09:16:47','_SESSION','login|all|1571303793|0|__ci_last_regenerate=>1571303793\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-10-11 16:22:47::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1649,2147204895,'2019-10-21 07:53:49','_SESSION','login|all|1571644376|0|__ci_last_regenerate=>1571644376\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-10-17 11:16:47::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1650,2147204895,'2019-10-21 08:00:35','article','insert|all|81|0|id_article=>81\ntitre_article=>GROUPE SUNU : DESRANCES à Abidjan\ntitre_article_en=>SUNU GROUP: DESRANCES in Abidjan\ntexte_article=><p>Après le prix du meilleur décor, le prix spécial de l&#39;Assemblée Nationale du Burkina et le prix spécial de la ville de Ouagadougou au FESPACO 2019.<br>\r\nLe Film DESRANCES sponsorisé par SUNU Assurances a reçu le grand prix BUSTE D’OR du meilleur film au Bénin. Il est nominé au ZAFAA Global Awards (Les Zulu African Film Academy Awards) dans les catégories meilleur Film, meilleur scénario, meilleure réalisation.<br>\r\nEn marge de ces différentes nominations les acteurs du film ont été nominés :<br>\r\n- Mike DANON et Missa N’DRY au ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 du NIGERIA qui se tiendra en novembre à Abuja Dans la catégorie Meilleure Performance Masculine pour le Film DESRANCES<br>\r\n </p>\r\n\ntexte_article_en=><p>After the prize for the best decoration, the special prize of the National Assembly of Burkina Faso and the special prize of the city of Ouagadougou at FESPACO 2019.<br>\r\nThe DESRANCES film sponsored by SUNU Insurance received the BUSTE D&#39;OR Grand Prize for the best film in Benin. He is nominated for the ZAFAA Global Awards (Les Zulu African Film Academy Awards) in the categories of Best Film, Best Screenplay, Best Director.<br>\r\nIn addition to these various nominations, the actors of the film were nominated:<br>\r\n- Mike DANON and Missa N&#39;DRY at the ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 NIGERIA in November in Abuja In the Best Male Performance category for the DESRANCES Film<br>\r\n </p>\r\n\nlecture_article=>0\nfichier_article=>desrances_abj0.jpg\ndateCreated_article=>2019-09-26 10:00:35\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1651,2147204895,'2019-10-21 08:32:39','photo','insert|all|533|0|id_photo=>533\nid_article=>81\nfichier_photo=>desrances_abj3.jpg\ndateCreated_photo=>2019-10-21 10:32:39\ndateDisabled_photo=>\ncreatedBy=>214