=>542\nid_article=>59\nfichier_photo=>yapalekoudougou2.jpg\ndateCreated_photo=>2019-10-21 10:33:26\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1661,2147204895,'2019-10-21 08:34:12','article','disable|statut_article|81|0,1,2|3'),(1662,2147204895,'2019-10-21 08:36:15','article','insert|all|82|0|id_article=>82\ntitre_article=>GROUPE SUNU : DESRANCES à Abidjan\ntitre_article_en=>SUNU GROUP: DESRANCES in Abidjan\ntexte_article=><p>Après le prix du meilleur décor, le prix spécial de l&#39;Assemblée Nationale du Burkina et le prix spécial de la ville de Ouagadougou au FESPACO 2019.<br>\r\nLe Film DESRANCES sponsorisé par SUNU Assurances a reçu le grand prix BUSTE D’OR du meilleur film au Bénin. Il est nominé au ZAFAA Global Awards (Les Zulu African Film Academy Awards) dans les catégories meilleur Film, meilleur scénario, meilleure réalisation.<br>\r\nEn marge de ces différentes nominations les acteurs du film ont été nominés :<br>\r\n- Mike DANON et Missa N’DRY au ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 du NIGERIA qui se tiendra en novembre à Abuja Dans la catégorie Meilleure Performance Masculine pour le Film DESRANCES</p>\r\n\ntexte_article_en=><p>After the prize for the best decoration, the special prize of the National Assembly of Burkina Faso and the special prize of the city of Ouagadougou at FESPACO 2019.<br>\r\nThe DESRANCES film sponsored by SUNU Insurance received the BUSTE D&#39;OR Grand Prize for the best film in Benin. He is nominated for the ZAFAA Global Awards (Les Zulu African Film Academy Awards) in the categories of Best Film, Best Screenplay, Best Director.<br>\r\nIn addition to these various nominations, the actors of the film were nominated:<br>\r\n- Mike DANON and Missa N&#39;DRY at the ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 NIGERIA in November in Abuja In the Best Male Performance category for the DESRANCES Film</p>\r\n\nlecture_article=>0\nfichier_article=>desrances_abj01.jpg\ndateCreated_article=>2019-09-26 10:36:15\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1663,2147204895,'2019-10-21 08:36:35','photo','insert|all|543|0|id_photo=>543\nid_article=>82\nfichier_photo=>desrances_abj3.jpg\ndateCreated_photo=>2019-10-21 10:36:35\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1664,2147204895,'2019-10-21 08:36:36','photo','insert|all|544|0|id_photo=>544\nid_article=>82\nfichier_photo=>desrances_abj4.jpg\ndateCreated_photo=>2019-10-21 10:36:36\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1665,2147204895,'2019-10-21 08:36:38','photo','insert|all|545|0|id_photo=>545\nid_article=>82\nfichier_photo=>desrances_abj1.jpg\ndateCreated_photo=>2019-10-21 10:36:38\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1666,2147204895,'2019-10-21 08:36:40','photo','insert|all|546|0|id_photo=>546\nid_article=>82\nfichier_photo=>desrances_abj2.jpg\ndateCreated_photo=>2019-10-21 10:36:40\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1667,2147204895,'2019-10-21 08:40:30','article','insert|all|83|0|id_article=>83\ntitre_article=>SUNU FC vainqueur de la coupe du tournoi « MAO Maman AASO » \ntitre_article_en=>SUNU FC winner of the \"MAO Maman AASO\" tournament cup\ntexte_article=><p>Le samedi 21 septembre 2019, l’équipe de SUNU Assurances Vie Côte d&#39;Ivoire a pris part à la 2ème édition du tournoi de maracana dénommé : la coupe de ‘’MAO MAMAN AASO’’. A cette 2 ème édition six équipes ont discuté la phase éliminatoire au stade du Complexe de YOPOUGON. Après les matches éliminatoires, la troupe de M. MONET André (président de FC SUNU) a battu en final au score de 2 buts à 1, l’équipe Gaulem de Port-bouët et remporta la 2 ème coupe de ‘’MAO MAMAN AASO’’.</p>\r\n\ntexte_article_en=><p>On Saturday, September 21, 2019, the SUNU Assurances Vie Côte d&#39;Ivoire team took part in the 2nd edition of the maracana tournament called: the&#39;&#39;MAO MAMAN AASO&#39;&#39; cup. At this 2nd edition six teams discussed the elimination phase at the YOPOUGON Complex stadium. After the qualifying matches, the troop of Mr. MONET André (president of FC SUNU) defeated in the final (2-1) the Gaulem team of Port-bouët and won the 2nd cup of&#39;&#39;MAO MAMAN AASO&#39;&#39;. </p>\r\n\nlecture_article=>0\nfichier_article=>sunufcoct0-2019.jpg\ndateCreated_article=>2019-10-10 10:40:30\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1668,2147204895,'2019-10-21 08:41:35','photo','insert|all|547|0|id_photo=>547\nid_article=>83\nfichier_photo=>sunufcoct2-2019.jpg\ndateCreated_photo=>2019-10-21 10:41:35\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1669,2147204895,'2019-10-21 08:41:36','photo','insert|all|548|0|id_photo=>548\nid_article=>83\nfichier_photo=>sunufcoct1-2019.jpg\ndateCreated_photo=>2019-10-21 10:41:36\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1670,2147204895,'2019-10-21 08:41:38','photo','insert|all|549|0|id_photo=>549\nid_article=>83\nfichier_photo=>sunufcoct3-2019.jpg\ndateCreated_photo=>2019-10-21 10:41:38\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1671,2147204895,'2019-10-21 08:43:40','article','insert|all|84|0|id_article=>84\ntitre_article=>Les Sociétés SUNU Assurances en Côte d\'Ivoire au rendez-vous des rencontres africaines\ntitre_article_en=>SUNU Assurances Companies in Côte d\'Ivoire to attend African meetings\ntexte_article=><p>Les sociétés SUNU Assurances en Côte d’Ivoire ont pris part à la 1ère rencontre Africaine du Risk Management organisé par le RIMRAE (Réseau Ivoirien du Management des Risques des Assurances de l’Entreprise) qui s’est tenue le 03 octobre 2019 au Sofitel Hôtel Ivoire. Au cours de ces assises, plusieurs thématiques ont été abordées dont le thème central était : « La gouvernance au cœur de la transformation. ».  <br>\r\nM. Saliou BAKAYOKO, Président de l’Association des Sociétés d’Assurance de Côte d’Ivoire (ASACI) a encouragé l’initiative du panel qui concernait le secteur de l’assurance.</p>\r\n\ntexte_article_en=><p>SUNU Assurances companies in Côte d&#39;Ivoire took part in the 1st African Risk Management Meeting organised by RIMRAE (Réseau Ivoirien du Gestion des Risques des Assurances de l&#39;Entreprise) which was held on 03 October 2019 at Sofitel Hôtel Ivoire. During these meetings, several themes were discussed, the central theme of which was: \"Governance at the heart of transformation. ».  <br>\r\nMr Saliou BAKAYOKO, President of the Association of Insurance Companies of Côte d&#39;Ivoire (ASACI), encouraged the panel&#39;s initiative concerning the insurance sector.</p>\r\n\nlecture_article=>0\nfichier_article=>RIMRAE0-2019.jpg\ndateCreated_article=>2019-10-18 10:43:40\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1672,2147204895,'2019-10-21 08:46:19','photo','insert|all|550|0|id_photo=>550\nid_article=>84\nfichier_photo=>RIMRAE3-2019.jpg\ndateCreated_photo=>2019-10-21 10:46:19\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1673,2147204895,'2019-10-21 08:46:21','photo','insert|all|551|0|id_photo=>551\nid_article=>84\nfichier_photo=>RIMRAE1-2019.jpg\ndateCreated_photo=>2019-10-21 10:46:21\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1674,2147204895,'2019-10-21 08:46:22','photo','insert|all|552|0|id_photo=>552\nid_article=>84\nfichier_photo=>RIMRAE2-2019.jpg\ndateCreated_photo=>2019-10-21 10:46:22\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1675,2147204895,'2019-10-21 08:46:24','_SESSION','login|all|1571647510|0|__ci_last_regenerate=>1571647510\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-10-21 09:53:49::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1676,2147204895,'2019-10-21 08:49:09','contact','insert|all|66|0|id_contact=>66\nnom_contact=>Claudio ADA\nemail_contact=>claudia.ada@sunu-group.com\ndateCreated_contact=>2019-10-21 10:49:08\nstatut_contact=>1\ncreatedBy=>2147204895\nid_pays=>10\nid_assurable=>4|5|7|1|2|3|6|\nid_user=>1698046551\n'),(1677,2147204895,'2019-10-21 08:50:12','article','insert|all|85|0|id_article=>85\ntitre_article=>GROUPE SUNU : BROKERSLINK 2019\ntitre_article_en=>SUNU GROUP: BROKERSLINK 2019\ntexte_article=><p>Du 17 au 18 Octobre 2019 SUNU Assurances prend part au Brokerslink&#39;s Risk Management Forum en tant que sponsor Platinum.<br>\r\nCette édition qui se déroule à Bordeaux réunit les plus grands courtiers du monde entier pour discuter des tendances clés de la gestion des risques et partager leurs connaissances.<br>\r\nM. Mohamed BAH Directeur Général Délégué du Groupe SUNU et M. Mohamed COMPAORE Directeur Général de la filiale IARD au Burkina participent à cette grande rencontre de l’Assurance.</p>\r\n\ntexte_article_en=><p>From 17 to 18 October 2019 SUNU Insurance is participating in Brokerslink&#39;s Risk Management Forum as a Platinum sponsor.<br>\r\nThis edition, which takes place in Bordeaux, brings together the world&#39;s leading brokers to discuss key risk management trends and share their knowledge.<br>\r\nMr. Mohamed BAH, Deputy Chief Executive Officer of the SUNU Group and Mr. Mohamed COMPAORE, Chief Executive Officer of the IARD subsidiary in Burkina Faso, are participating in this major insurance meeting.</p>\r\n\nlecture_article=>0\nfichier_article=>BROKESRLINK_2019_0.jpg\ndateCreated_article=>2019-10-18 10:50:12\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1678,2147204895,'2019-10-21 08:50:45','photo','insert|all|553|0|id_photo=>553\nid_article=>85\nfichier_photo=>BROKESRLINK_2019_3.jpg\ndateCreated_photo=>2019-10-21 10:50:45\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1679,2147204895,'2019-10-21 08:50:48','photo','insert|all|554|0|id_photo=>554\nid_article=>85\nfichier_photo=>BROKESRLINK_2019_4.jpg\ndateCreated_photo=>2019-10-21 10:50:48\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1680,2147204895,'2019-10-21 08:50:49','photo','insert|all|555|0|id_photo=>555\nid_article=>85\nfichier_photo=>BROKESRLINK_2019_5.jpg\ndateCreated_photo=>2019-10-21 10:50:49\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1681,2147204895,'2019-10-21 08:50:51','photo','insert|all|556|0|id_photo=>556\nid_article=>85\nfichier_photo=>BROKESRLINK_2019_1.jpg\ndateCreated_photo=>2019-10-21 10:50:51\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1682,2147204895,'2019-10-21 08:53:47','article','insert|all|86|0|id_article=>86\ntitre_article=>GROUPE SUNU : Allianz Bénin Assurances devient SUNU Assurances IARD Bénin\ntitre_article_en=>SUNU GROUP: Allianz Benin becomes SUNU Assurances Benin\ntexte_article=><p>Dès ce  Vendredi 18 Octobre 2019 Allianz Bénin Assurances devient SUNU Assurances IARD Bénin, la filiale IARD du Groupe dans le pays.</p>\r\n\ntexte_article_en=><p>As of this Friday, October 18, 2019 Allianz Benin Assurances becomes SUNU Assurances IARD Benin, the Group&#39;s property and casualty subsidiary in the country.</p>\r\n\nlecture_article=>0\nfichier_article=>SUNU_Assurancesiardbénin0-2019.jpg\ndateCreated_article=>2019-10-18 10:53:47\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1683,2147204895,'2019-10-21 08:54:31','photo','insert|all|557|0|id_photo=>557\nid_article=>86\nfichier_photo=>SUNU_Assurancesiardbnin4-2019.jpg\ndateCreated_photo=>2019-10-21 10:54:31\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1684,2147204895,'2019-10-21 08:54:33','photo','insert|all|558|0|id_photo=>558\nid_article=>86\nfichier_photo=>SUNU_Assurancesiardbnin1-2019.jpg\ndateCreated_photo=>2019-10-21 10:54:33\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1685,2147204895,'2019-10-21 08:54:35','photo','insert|all|559|0|id_photo=>559\nid_article=>86\nfichier_photo=>SUNU