573747990\n{email=>admin@test.com::name=>SUNU Admin::last_login=>2019-11-14 13:33:39::user_id=>2147484848::photo=>profile.jpg}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147484848\n|0'),(1730,2147204895,'2019-11-14 18:21:19','article','update|all|85|id_article=>85\ntitre_article=>GROUPE SUNU : BROKERSLINK 2019\ntitre_article_en=>SUNU GROUP: BROKERSLINK 2019\ntexte_article=><p>Du 17 au 18 Octobre 2019 SUNU Assurances prend part au Brokerslink&#39;s Risk Management Forum en tant que sponsor Platinum.<br>\r\nCette édition qui se déroule à Bordeaux réunit les plus grands courtiers du monde entier pour discuter des tendances clés de la gestion des risques et partager leurs connaissances.<br>\r\nM. Mohamed BAH Directeur Général Délégué du Groupe SUNU et M. Mohamed COMPAORE Directeur Général de la filiale IARD au Burkina participent à cette grande rencontre de l’Assurance.</p>\r\n\ntexte_article_en=><p>From 17 to 18 October 2019 SUNU Insurance is participating in Brokerslink&#39;s Risk Management Forum as a Platinum sponsor.<br>\r\nThis edition, which takes place in Bordeaux, brings together the world&#39;s leading brokers to discuss key risk management trends and share their knowledge.<br>\r\nMr. Mohamed BAH, Deputy Chief Executive Officer of the SUNU Group and Mr. Mohamed COMPAORE, Chief Executive Officer of the IARD subsidiary in Burkina Faso, are participating in this major insurance meeting.</p>\r\n\nlecture_article=>0\nfichier_article=>BROKESRLINK_2019_0.jpg\ndateCreated_article=>2019-10-18 10:50:12\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>85\ntitre_article=>GROUPE SUNU : BROKERSLINK 2019\ntitre_article_en=>SUNU GROUP: BROKERSLINK 2019\ntexte_article=><p>Du 17 au 18 Octobre 2019 SUNU Assurances prend part au Brokerslink&#39;s Risk Management Forum en tant que sponsor Platinum.<br>\r\nCette édition qui se déroule à Bordeaux réunit les plus grands courtiers du monde entier pour discuter des tendances clés de la gestion des risques et partager leurs connaissances.<br>\r\nM. Mohamed BAH Directeur Général Délégué du Groupe SUNU et M. Mohamed COMPAORE Directeur Général de la filiale IARD au Burkina participent à cette grande rencontre de l’Assurance.</p>\r\n\ntexte_article_en=><p>From 17 to 18 October 2019 SUNU Insurance is participating in Brokerslink&#39;s Risk Management Forum as a Platinum sponsor.<br>\r\nThis edition, which takes place in Bordeaux, brings together the world&#39;s leading brokers to discuss key risk management trends and share their knowledge.<br>\r\nMr. Mohamed BAH, Deputy Chief Executive Officer of the SUNU Group and Mr. Mohamed COMPAORE, Chief Executive Officer of the IARD subsidiary in Burkina Faso, are participating in this major insurance meeting.</p>\r\n\nlecture_article=>0\nfichier_article=>BROKESRLINK_2019_0.jpg\ndateCreated_article=>2019-10-18 18:21:19\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1731,2147204895,'2019-11-14 18:23:30','photo','insert|all|567|0|id_photo=>567\nid_article=>85\nfichier_photo=>BROKESRLINK_2019_6.jpg\ndateCreated_photo=>2019-11-14 19:23:30\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1732,2147204895,'2019-11-14 18:23:35','photo','insert|all|568|0|id_photo=>568\nid_article=>85\nfichier_photo=>BROKESRLINK_2019_1.jpg\ndateCreated_photo=>2019-11-14 19:23:35\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1733,2147204895,'2019-11-14 18:23:41','photo','insert|all|569|0|id_photo=>569\nid_article=>85\nfichier_photo=>BROKESRLINK_2019_3.jpg\ndateCreated_photo=>2019-11-14 19:23:41\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1734,2147204895,'2019-11-14 18:23:49','photo','insert|all|570|0|id_photo=>570\nid_article=>85\nfichier_photo=>BROKESRLINK_2019_4.jpg\ndateCreated_photo=>2019-11-14 19:23:49\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1735,2147204895,'2019-11-14 18:23:52','photo','insert|all|571|0|id_photo=>571\nid_article=>85\nfichier_photo=>BROKESRLINK_2019_5.jpg\ndateCreated_photo=>2019-11-14 19:23:52\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1736,2147204895,'2019-11-14 18:31:46','article','update|all|83|id_article=>83\ntitre_article=>SUNU FC vainqueur de la coupe du tournoi « MAO Maman AASO » \ntitre_article_en=>SUNU FC winner of the \"MAO Maman AASO\" tournament cup\ntexte_article=><p>Le samedi 21 septembre 2019, l’équipe de SUNU Assurances Vie Côte d&#39;Ivoire a pris part à la 2ème édition du tournoi de maracana dénommé : la coupe de ‘’MAO MAMAN AASO’’. A cette 2 ème édition six équipes ont discuté la phase éliminatoire au stade du Complexe de YOPOUGON. Après les matches éliminatoires, la troupe de M. MONET André (président de FC SUNU) a battu en final au score de 2 buts à 1, l’équipe Gaulem de Port-bouët et remporta la 2 ème coupe de ‘’MAO MAMAN AASO’’.</p>\r\n\ntexte_article_en=><p>On Saturday, September 21, 2019, the SUNU Assurances Vie Côte d&#39;Ivoire team took part in the 2nd edition of the maracana tournament called: the&#39;&#39;MAO MAMAN AASO&#39;&#39; cup. At this 2nd edition six teams discussed the elimination phase at the YOPOUGON Complex stadium. After the qualifying matches, the troop of Mr. MONET André (president of FC SUNU) defeated in the final (2-1) the Gaulem team of Port-bouët and won the 2nd cup of&#39;&#39;MAO MAMAN AASO&#39;&#39;. </p>\r\n\nlecture_article=>0\nfichier_article=>sunufcoct0-2019.jpg\ndateCreated_article=>2019-10-10 10:40:30\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>83\ntitre_article=>SUNU FC vainqueur de la coupe du tournoi « MAO Maman AASO » \ntitre_article_en=>SUNU FC winner of the \ntexte_article=><p>Le samedi 21 septembre 2019, l’équipe de SUNU Assurances Vie Côte d&#39;Ivoire a pris part à la 2ème édition du tournoi de maracana dénommé : la coupe de ‘’MAO MAMAN AASO’’. A cette 2 ème édition six équipes ont discuté la phase éliminatoire au stade du Complexe de YOPOUGON. Après les matches éliminatoires, la troupe de M. MONET André (président de FC SUNU) a battu en final au score de 2 buts à 1, l’équipe Gaulem de Port-bouët et remporta la 2 ème coupe de ‘’MAO MAMAN AASO’’.</p>\r\n\ntexte_article_en=><p>On Saturday, September 21, 2019, the SUNU Assurances Vie Côte d&#39;Ivoire team took part in the 2nd edition of the maracana tournament called: the&#39;&#39;MAO MAMAN AASO&#39;&#39; cup. At this 2nd edition six teams discussed the elimination phase at the YOPOUGON Complex stadium. After the qualifying matches, the troop of Mr. MONET André (president of FC SUNU) defeated in the final (2-1) the Gaulem team of Port-bouët and won the 2nd cup of&#39;&#39;MAO MAMAN AASO&#39;&#39;. </p>\r\n\nlecture_article=>0\nfichier_article=>sunufcoct0-2019.jpg\ndateCreated_article=>2019-10-10 18:31:46\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1737,2147204895,'2019-11-14 18:39:41','article','update|all|83|id_article=>83\ntitre_article=>SUNU FC vainqueur de la coupe du tournoi « MAO Maman AASO » \ntitre_article_en=>SUNU FC winner of the \ntexte_article=><p>Le samedi 21 septembre 2019, l’équipe de SUNU Assurances Vie Côte d&#39;Ivoire a pris part à la 2ème édition du tournoi de maracana dénommé : la coupe de ‘’MAO MAMAN AASO’’. A cette 2 ème édition six équipes ont discuté la phase éliminatoire au stade du Complexe de YOPOUGON. Après les matches éliminatoires, la troupe de M. MONET André (président de FC SUNU) a battu en final au score de 2 buts à 1, l’équipe Gaulem de Port-bouët et remporta la 2 ème coupe de ‘’MAO MAMAN AASO’’.</p>\r\n\ntexte_article_en=><p>On Saturday, September 21, 2019, the SUNU Assurances Vie Côte d&#39;Ivoire team took part in the 2nd edition of the maracana tournament called: the&#39;&#39;MAO MAMAN AASO&#39;&#39; cup. At this 2nd edition six teams discussed the elimination phase at the YOPOUGON Complex stadium. Afte