RD Benin, the Group&#39;s property and casualty subsidiary in the country.</p>\r\n\nlecture_article=>0\nfichier_article=>SUNU_Assurancesiardbénin0-2019.jpg\ndateCreated_article=>2019-10-18 18:48:40\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1743,2147204895,'2019-11-14 18:51:04','photo','insert|all|575|0|id_photo=>575\nid_article=>86\nfichier_photo=>REBRANDINGSUNUIARDBENIN.jpg\ndateCreated_photo=>2019-11-14 19:51:04\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1744,2147204895,'2019-11-14 18:51:07','photo','insert|all|576|0|id_photo=>576\nid_article=>86\nfichier_photo=>REBRANDINGSUNUIARDBENIN1.jpg\ndateCreated_photo=>2019-11-14 19:51:07\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1745,2147204895,'2019-11-14 18:51:22','photo','insert|all|577|0|id_photo=>577\nid_article=>86\nfichier_photo=>REBRANDINGSUNUIARDBENIN2.jpg\ndateCreated_photo=>2019-11-14 19:51:22\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1746,2147204895,'2019-11-14 18:51:32','photo','insert|all|578|0|id_photo=>578\nid_article=>86\nfichier_photo=>REBRANDINGSUNUIARDBENIN4.jpg\ndateCreated_photo=>2019-11-14 19:51:32\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1747,2147204895,'2019-11-14 18:51:39','photo','insert|all|579|0|id_photo=>579\nid_article=>86\nfichier_photo=>REBRANDINGSUNUIARDBENIN3.jpg\ndateCreated_photo=>2019-11-14 19:51:39\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1748,2147204895,'2019-11-14 18:51:53','photo','insert|all|580|0|id_photo=>580\nid_article=>86\nfichier_photo=>REBRANDINGSUNUIARDBENIN5.jpg\ndateCreated_photo=>2019-11-14 19:51:53\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1749,2147204895,'2019-11-14 18:52:05','photo','insert|all|581|0|id_photo=>581\nid_article=>86\nfichier_photo=>REBRANDINGSUNUIARDBENIN6.jpg\ndateCreated_photo=>2019-11-14 19:52:05\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1750,2147204895,'2019-11-14 19:16:42','photo','disable|statut_photo|563|0,1,2|3'),(1751,2147204895,'2019-11-14 19:16:48','photo','disable|statut_photo|566|0,1,2|3'),(1752,2147204895,'2019-11-14 19:17:06','photo','disable|statut_photo|562|0,1,2|3'),(1753,2147204895,'2019-11-14 19:17:13','photo','disable|statut_photo|564|0,1,2|3'),(1754,2147204895,'2019-11-14 19:17:21','photo','disable|statut_photo|565|0,1,2|3'),(1755,2147204895,'2019-11-14 19:17:31','photo','disable|statut_photo|561|0,1,2|3'),(1756,2147204895,'2019-11-14 19:18:17','photo','disable|statut_photo|556|0,1,2|3'),(1757,2147204895,'2019-11-14 19:18:20','photo','disable|statut_photo|554|0,1,2|3'),(1758,2147204895,'2019-11-14 19:18:31','photo','disable|statut_photo|553|0,1,2|3'),(1759,2147204895,'2019-11-14 19:18:36','photo','disable|statut_photo|555|0,1,2|3'),(1760,2147204895,'2019-11-14 19:19:40','photo','disable|statut_photo|547|0,1,2|3'),(1761,2147204895,'2019-11-14 19:19:46','photo','disable|statut_photo|548|0,1,2|3'),(1762,2147204895,'2019-11-14 19:19:50','photo','disable|statut_photo|549|0,1,2|3'),(1763,2147204895,'2019-11-14 19:21:29','article','update|all|82|id_article=>82\ntitre_article=>GROUPE SUNU : DESRANCES à Abidjan\ntitre_article_en=>SUNU GROUP: DESRANCES in Abidjan\ntexte_article=><p>Après le prix du meilleur décor, le prix spécial de l&#39;Assemblée Nationale du Burkina et le prix spécial de la ville de Ouagadougou au FESPACO 2019.<br>\r\nLe Film DESRANCES sponsorisé par SUNU Assurances a reçu le grand prix BUSTE D’OR du meilleur film au Bénin. Il est nominé au ZAFAA Global Awards (Les Zulu African Film Academy Awards) dans les catégories meilleur Film, meilleur scénario, meilleure réalisation.<br>\r\nEn marge de ces différentes nominations les acteurs du film ont été nominés :<br>\r\n- Mike DANON et Missa N’DRY au ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 du NIGERIA qui se tiendra en novembre à Abuja Dans la catégorie Meilleure Performance Masculine pour le Film DESRANCES</p>\r\n\ntexte_article_en=><p>After the prize for the best decoration, the special prize of the National Assembly of Burkina Faso and the special prize of the city of Ouagadougou at FESPACO 2019.<br>\r\nThe DESRANCES film sponsored by SUNU Insurance received the BUSTE D&#39;OR Grand Prize for the best film in Benin. He is nominated for the ZAFAA Global Awards (Les Zulu African Film Academy Awards) in the categories of Best Film, Best Screenplay, Best Director.<br>\r\nIn addition to these various nominations, the actors of the film were nominated:<br>\r\n- Mike DANON and Missa N&#39;DRY at the ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 NIGERIA in November in Abuja In the Best Male Performance category for the DESRANCES Film</p>\r\n\nlecture_article=>0\nfichier_article=>desrances_abj01.jpg\ndateCreated_article=>2019-09-26 10:36:15\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>82\ntitre_article=>GROUPE SUNU : DESRANCES à Abidjan\ntitre_article_en=>SUNU GROUP: DESRANCES in Abidjan\ntexte_article=><p>Après le prix du meilleur décor, le prix spécial de l&#39;Assemblée Nationale du Burkina et le prix spécial de la ville de Ouagadougou au FESPACO 2019.<br>\r\nLe Film DESRANCES sponsorisé par SUNU Assurances a reçu le grand prix BUSTE D’OR du meilleur film au Bénin. Il est nominé au ZAFAA Global Awards (Les Zulu African Film Academy Awards) dans les catégories meilleur Film, meilleur scénario, meilleure réalisation.<br>\r\nEn marge de ces différentes nominations les acteurs du film ont été nominés :<br>\r\n- Mike DANON et Missa N’DRY au ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 du NIGERIA qui se tiendra en novembre à Abuja Dans la catégorie Meilleure Performance Masculine pour le Film DESRANCES</p>\r\n\ntexte_article_en=><p>After the prize for the best decoration, the special prize of the National Assembly of Burkina Faso and the special prize of the city of Ouagadougou at FESPACO 2019.<br>\r\nThe DESRANCES film sponsored by SUNU Assurances received the BUSTE D&#39;OR Grand Prize for the best film in Benin. He is nominated for the ZAFAA Global Awards (Les Zulu African Film Academy Awards) in the categories of Best Film, Best Screenplay, Best Director.<br>\r\nIn addition to these various nominations, the actors of the film were nominated:<br>\r\n- Mike DANON and Missa N&#39;DRY at the ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 NIGERIA in November in Abuja In the Best Male Performance category for the DESRANCES Film</p>\r\n\nlecture_article=>0\nfichier_article=>desrances_abj0.jpg\ndateCreated_article=>2019-09-26 19:21:29\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1764,2147204895,'2019-11-14 19:25:23','photo','insert|all|582|0|id_photo=>582\nid_article=>82\nfichier_photo=>desrances_abj1.jpg\ndateCreated_photo=>2019-11-14 20:25:23\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1765,2147204895,'2019-11-14 19:25:24','photo','insert|all|583|0|id_photo=>583\nid_article=>82\nfichier_photo=>desrances_abj4.jpg\ndateCreated_photo=>2019-11-14 20:25:24\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1766,2147204895,'2019-11-14 19:25:32','photo','insert|all|584|0|id_photo=>584\nid_article=>82\nfichier_photo=>desrances_abj2.jpg\ndateCreated_photo=>2019-11-14 20:25:32\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1767,2147204895,'2019-11-14 19:25:35','photo','insert|all|585|0|id_photo=>585\nid_article=>82\nfichier_photo=>desrances_abj3.jpg\ndateCreated_photo=>2019-11-14 20:25:35\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1768,2147204895,'2019-11-14 19:27:43','_SESSION','login|all|1573759543|0|__ci_last_regenerate=>1573759543\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-11-14 16:09:03::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1769,2147204895,'2019-11-14 19:31:33','article','update|all|84|id_article=>84\ntitre_article=>Les Sociétés SUNU Assurances en Côte d\'Ivoire au rendez-vous des rencontres africaines\ntitre_article_en=>SUNU Assurances Companies in Côte d\'Ivoire to attend African meetings\ntexte_article=><p>Les sociétés SUNU Assurances en Côte d’Ivoire ont pris part à la 1ère rencontre Africaine du Risk Management organisé par le RIMRAE (Réseau Ivoirien du Management des Risques des Assurances de l’Entreprise) qui s’est tenue le 03 octobre 2019 au Sofitel Hôtel Ivoire. Au cours de ces assises, plusieurs thématiques ont été abordées dont le thème central était : « La gouvernance au cœur de la transformation. ».  <br>\r\nM. Saliou BAKAYOKO, Président de l’Association des Sociétés d’Assurance de Côte d’Ivoire (ASACI) a encouragé l’initiative du panel qui concernait le secteur de l’assurance.</p>\r\n\ntexte_article_en=><p>SUNU Assurances companies in Côte d&#39;Ivoire took part in the 1st African Risk Management Meeting organised by RIMRAE (Réseau Ivoirien du Gestion des Risques des Assurances de l&#39;Entreprise) which was held on 03 October 2019 at Sofitel Hôtel Ivoire. During these meetings, several themes were discussed, the central theme of which was: \"Governance at the heart of transformation. ».  <br>\r\nMr Saliou BAKAYOKO, President of the Association of Insurance Companies of Côte d&#39;Ivoire (ASACI), encouraged the panel&#39;s initiative concerning the insurance sector.</p>\r\n\nlecture_article=>0\nfichier_article=>RIMRAE0-2019.jpg\ndateCreated_article=>2019-10-18 10:43:40\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>84\ntitre_article=>Les Sociétés SUNU Assurances en Côte d\'Ivoire au rendez-vous des rencontres africaines\ntitre_article_en=>SUNU Assurances Companies in Côte d\'Ivoire to attend African meetings\ntexte_article=><p>Les sociétés SUNU Assurances en Côte d’Ivoire ont pris part à la 1ère rencontre Africaine du Risk Management organisé par le RIMRAE (Réseau Ivoirien du Management des Risques des Assurances de l’Entreprise) qui s’est tenue le 03 octobre 2019 au Sofitel Hôtel Ivoire. Au cours de ces assises, plusieurs thématiques ont été abordées dont le thème central était : « La gouvernance au cœur de la transformation. ».  <br>\r\nM. Saliou BAKAYOKO, Président de l’Association des Sociétés d’Assurance de Côte d’Ivoire (ASACI) a encouragé l’initiative du panel qui concernait le secteur de l’assurance.</p>\r\n\ntexte_article_en=><p>SUNU Assurances companies in Côte d&#39;Ivoire took part in the 1st African Risk Management Meeting organised by RIMRAE (Réseau Ivoirien du Gestion des Risques des Assurances de l&#39;Entreprise) which was held on 03 October 2019 at Sofitel Hôtel Ivoire. During these meetings, several themes were discussed, the central theme of which was: \"Governance at the heart of transformation. ».  <br>\r\nMr Saliou BAKAYOKO, President of the Association of Insurance Companies of Côte d&#39;Ivoire (ASACI), encouraged the panel&#39;s initiative concerning the insurance sector.</p>\r\n\nlecture_article=>0\nfichier_article=>RIMRAE4-2019.jpg\ndateCreated_article=>2019-10-18 19:31:33\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1770,2147204895,'2019-11-14 19:32:58','article','update|all|84|id_article=>84\ntitre_article=>Les Sociétés SUNU Assurances en Côte d\'Ivoire au rendez-vous des rencontres africaines\ntitre_article_en=>SUNU Assurances Companies in Côte d\'Ivoire to attend African meetings\ntexte_article=><p>Les sociétés SUNU Assurances en Côte d’Ivoire ont pris part à la 1ère rencontre Africaine du Risk Management organisé par le RIMRAE (Réseau Ivoirien du Management des Risques des Assurances de l’Entreprise) qui s’est tenue le 03 octobre 2019 au Sofitel Hôtel Ivoire. Au cours de ces assises, plusieurs thématiques ont été abordées dont le thème central était : « La gouvernance au cœur de la transformation. ».  <br>\r\nM. Saliou BAKAYOKO, Président de l’Ass