ber 2019 at Sofitel Hôtel Ivoire. During these meetings, several themes were discussed, the central theme of which was: \"Governance at the heart of transformation. ».  <br>\r\nMr Saliou BAKAYOKO, President of the Association of Insurance Companies of Côte d&#39;Ivoire (ASACI), encouraged the panel&#39;s initiative concerning the insurance sector.</p>\r\n\nlecture_article=>0\nfichier_article=>RIMRAE0-2019.jpg\ndateCreated_article=>2019-10-18 19:32:58\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1771,2147204895,'2019-11-14 19:33:58','photo','insert|all|586|0|id_photo=>586\nid_article=>84\nfichier_photo=>RIMRAE4-2019.jpg\ndateCreated_photo=>2019-11-14 20:33:58\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1772,2147204895,'2019-11-14 19:34:04','photo','insert|all|587|0|id_photo=>587\nid_article=>84\nfichier_photo=>RIMRAE1-2019.jpg\ndateCreated_photo=>2019-11-14 20:34:04\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1773,2147204895,'2019-11-14 19:34:08','photo','insert|all|588|0|id_photo=>588\nid_article=>84\nfichier_photo=>RIMRAE2-2019.jpg\ndateCreated_photo=>2019-11-14 20:34:08\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1774,2147204895,'2019-11-14 19:34:11','photo','insert|all|589|0|id_photo=>589\nid_article=>84\nfichier_photo=>RIMRAE3-2019.jpg\ndateCreated_photo=>2019-11-14 20:34:11\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1775,2147204895,'2019-11-14 19:35:15','article','update|all|86|id_article=>86\ntitre_article=>GROUPE SUNU : Allianz Bénin Assurances devient SUNU Assurances IARD Bénin\ntitre_article_en=>SUNU GROUP: Allianz Benin becomes SUNU Assurances Benin\ntexte_article=><p>Dès ce Vendredi 18 Octobre 2019, Allianz Bénin Assurances devient SUNU Assurances IARD Bénin, la filiale IARD du Groupe dans le pays.</p>\r\n\ntexte_article_en=><p>As of this Friday, October 18, 2019 Allianz Benin Assurances becomes SUNU Assurances IARD Benin, the Group&#39;s property and casualty subsidiary in the country.</p>\r\n\nlecture_article=>0\nfichier_article=>SUNU_Assurancesiardbénin0-2019.jpg\ndateCreated_article=>2019-10-18 18:48:40\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>86\ntitre_article=>GROUPE SUNU : Allianz Bénin Assurances devient SUNU Assurances IARD Bénin\ntitre_article_en=>SUNU GROUP: Allianz Benin becomes SUNU Assurances Benin\ntexte_article=><p>Dès ce Vendredi 18 Octobre 2019, Allianz Bénin Assurances devient SUNU Assurances IARD Bénin, la filiale IARD du Groupe dans le pays.</p>\r\n\ntexte_article_en=><p>As of this Friday, October 18, 2019 Allianz Benin Assurances becomes SUNU Assurances IARD Benin, the Group&#39;s property and casualty subsidiary in the country.</p>\r\n\nlecture_article=>0\nfichier_article=>SUNU_Assurancesiardbénin0-20191.jpg\ndateCreated_article=>2019-10-18 19:35:15\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1776,2147204895,'2019-11-14 19:40:26','article','update|all|83|id_article=>83\ntitre_article=>SUNU FC vainqueur de la coupe du tournoi « MAO Maman AASO » \ntitre_article_en=>SUNU FC winner of the \ntexte_article=><p>Le samedi 21 septembre 2019, l’équipe de SUNU Assurances Vie Côte d&#39;Ivoire a pris part à la 2ème édition du tournoi de maracana dénommé : la coupe de ‘’MAO MAMAN AASO’’. A cette 2 ème édition six équipes ont discuté la phase éliminatoire au stade du Complexe de YOPOUGON. Après les matches éliminatoires, la troupe de M. MONET André (président de FC SUNU) a battu en final au score de 2 buts à 1, l’équipe Gaulem de Port-bouët et remporta la 2 ème coupe de ‘’MAO MAMAN AASO’’.</p>\r\n\ntexte_article_en=><p>On Saturday, September 21, 2019, the SUNU Assurances Vie Côte d&#39;Ivoire team took part in the 2nd edition of the maracana tournament called: the&#39;&#39;MAO MAMAN AASO&#39;&#39; cup. At this 2nd edition six teams discussed the elimination phase at the YOPOUGON Complex stadium. After the qualifying matches, the troop of Mr. MONET André (president of FC SUNU) defeated in the final (2-1) the Gaulem team of Port-bouët and won the 2nd cup of&#39;&#39;MAO MAMAN AASO&#39;&#39;. </p>\r\n\nlecture_article=>0\nfichier_article=>sunufcoct0-20191.jpg\ndateCreated_article=>2019-10-10 18:39:41\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>83\ntitre_article=>SUNU FC vainqueur de la coupe du tournoi « MAO Maman AASO » \ntitre_article_en=>SUNU FC winner of the \ntexte_article=><p>Le samedi 21 septembre 2019, l’équipe de SUNU Assurances Vie Côte d&#39;Ivoire a pris part à la 2ème édition du tournoi de maracana dénommé : la coupe de ‘’MAO MAMAN AASO’’. A cette 2 ème édition six équipes ont discuté la phase éliminatoire au stade du Complexe de YOPOUGON. Après les matches éliminatoires, la troupe de M. MONET André (président de FC SUNU) a battu en final au score de 2 buts à 1, l’équipe Gaulem de Port-bouët et remporta la 2 ème coupe de ‘’MAO MAMAN AASO’’.</p>\r\n\ntexte_article_en=><p>On Saturday, September 21, 2019, the SUNU Assurances Vie Côte d&#39;Ivoire team took part in the 2nd edition of the maracana tournament called: the&#39;&#39;MAO MAMAN AASO&#39;&#39; cup. At this 2nd edition six teams discussed the elimination phase at the YOPOUGON Complex stadium. After the qualifying matches, the troop of Mr. MONET André (president of FC SUNU) defeated in the final (2-1) the Gaulem team of Port-bouët and won the 2nd cup of&#39;&#39;MAO MAMAN AASO&#39;&#39;. </p>\r\n\nlecture_article=>0\nfichier_article=>sunufcoct0-20192.jpg\ndateCreated_article=>2019-10-10 19:40:26\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1777,2147204895,'2019-11-14 19:41:23','photo','disable|statut_photo|544|0,1,2|3'),(1778,2147204895,'2019-11-14 19:41:30','photo','disable|statut_photo|545|0,1,2|3'),(1779,2147204895,'2019-11-14 19:41:37','photo','disable|statut_photo|543|0,1,2|3'),(1780,2147204895,'2019-11-14 19:41:43','photo','disable|statut_photo|546|0,1,2|3'),(1781,2147204895,'2019-11-14 19:42:16','article','update|all|82|id_article=>82\ntitre_article=>GROUPE SUNU : DESRANCES à Abidjan\ntitre_article_en=>SUNU GROUP: DESRANCES in Abidjan\ntexte_article=><p>Après le prix du meilleur décor, le prix spécial de l&#39;Assemblée Nationale du Burkina et le prix spécial de la ville de Ouagadougou au FESPACO 2019.<br>\r\nLe Film DESRANCES sponsorisé par SUNU Assurances a reçu le grand prix BUSTE D’OR du meilleur film au Bénin. Il est nominé au ZAFAA Global Awards (Les Zulu African Film Academy Awards) dans les catégories meilleur Film, meilleur scénario, meilleure réalisation.<br>\r\nEn marge de ces différentes nominations les acteurs du film ont été nominés :<br>\r\n- Mike DANON et Missa N’DRY au ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 du NIGERIA qui se tiendra en novembre à Abuja Dans la catégorie Meilleure Performance Masculine pour le Film DESRANCES</p>\r\n\ntexte_article_en=><p>After the prize for the best decoration, the special prize of the National Assembly of Burkina Faso and the special prize of the city of Ouagadougou at FESPACO 2019.<br>\r\nThe DESRANCES film sponsored by SUNU Assurances received the BUSTE D&#39;OR Grand Prize for the best film in Benin. He is nominated for the ZAFAA Global Awards (Les Zulu African Film Academy Awards) in the categories of Best Film, Best Screenplay, Best Director.<br>\r\nIn addition to these various nominations, the actors of the film were nominated:<br>\r\n- Mike DANON and Missa N&#39;DRY at the ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 NIGERIA in November in Abuja In the Best Male Performance category for the DESRANCES Film</p>\r\n\nlecture_article=>0\nfichier_article=>desrances_abj0.jpg\ndateCreated_article=>2019-09-26 19:21:29\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>82\ntitre_article=>GROUPE SUNU : DESRANCES à Abidjan\ntitre_article_en=>SUNU GROUP: DESRANCES in Abidjan\ntexte_article=><p>Après le prix du meilleur décor, le prix spécial de l&#39;Assemblée Nationale du Burkina et le prix spécial de la ville de Ouagadougou au FESPACO 2019.<br>\r\nLe Film DESRANCES sponsorisé par SUNU Assurances a reçu le grand prix BUSTE D’OR du meilleur film au Bénin. Il est nominé au ZAFAA Global Awards (Les Zulu African Film Academy Awards) dans les catégories meilleur Film, meilleur scénario, meilleure réalisation.<br>\r\nEn marge de ces différentes nominations les acteurs du film ont été nominés :<br>\r\n- Mike DANON et Missa N’DRY au ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 du NIGERIA qui se tiendra en novembre à Abuja Dans la catégorie Meilleure Performance Masculine pour le Film DESRANCES</p>\r\n\ntexte_article_en=><p>After the prize for the best decoration, the special prize of the National Assembly of Burkina Faso and the special prize of the city of Ouagadougou at FESPACO 2019.<br>\r\nThe DESRANCES film sponsored by SUNU Assurances received the BUSTE D&#39;OR Grand Prize for the best film in Benin. He is nominated for the ZAFAA Global Awards (Les Zulu African Film Academy Awards) in the categories of Best Film, Best Screenplay, Best Director.<br>\r\nIn addition to these various nominations, the actors of the film were nominated:<br>\r\n- Mike DANON and Missa N&#39;DRY at the ZAFAA AFRICAN FILM and ACADEMY AWARDS 2019 NIGERIA in November in Abuja In the Best Male Performance category for the DESRANCES Film</p>\r\n\nlecture_article=>0\nfichier_article=>desrances_abj01.jpg\ndateCreated_article=>2019-09-26 19:42:16\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1782,2147204895,'2019-11-15 09:43:32','_SESSION','login|all|1573810946|0|__ci_last_regenerate=>1573810946\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-11-14 19:27:43::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1783,2147204895,'2019-11-15 09:46:57','article','update|all|79|id_article=>79\ntitre_article=>Les sociétés SUNU Assurances en Côte d\'Ivoire à la 3ème édition du salon africain des assurances\ntitre_article_en=>SUNU Assurances at the 3rd edition of the African Insurance Exhibition\ntexte_article=><p>Pour la 3e édition du Salon Africain des Assurances (SADA), tous les acteurs du secteur de l’assurance se sont donnés rendez-vous les 12 et 13 septembre 2019 à Abidjan précisément à la CAISTAB au Plateau.« La digitalisation des assurances au profit des populations » a été la thématique abordée au cours de ces deux (02) journées. Les sociétés SUNU Assurances en Côte d’Ivoire en tant que sponsor, ont présenté leurs offres d’assurance digitale au grand public présent. Les visiteurs présents à leur stand sont repartis très satisfaits par le service reçu.<br>\r\n </p>\r\n\ntexte_article_en=><div xss=removed>For the 3rd edition of the African Insurance Fair (SADA), all players in the insurance sector have met on September 12 and 13, 2019 in Abidjan specifically at CAISTAB Plateau.</div>\r\n\r\n<div xss=removed>\"The digitalization of insurance for the benefit of the population\" was the theme addressed during these two (02) days. The SUNU Assurances companies in Côte d&#39;Ivoire as a sponsor, presented their digital insurance offers to the general public present.</div>\r\n\r\n<div xss=removed>The visitors present at their booth left very satisfied with the service received.</div>\r\n\nlecture_article=>0\nfichier_article=>sada0-2019.jpg\ndateCreated_article=>2019-09-24 17:49:45\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>79\ntitre_article=>Les sociétés SUNU Assurances en Côte d\'Ivoire à la 3ème édition du salon africain des assurances\ntitre_article_en=>SUNU Assurances at the 3rd edition of the African Insurance Exhibition\ntexte_article=><p>Pour la 3e édition du Salon Africain des Assurances (SADA), tous les acteurs du secteur de l’assurance se sont donnés rendez-vous les 12 et 13 septembre 2019 à Abidjan précisément à la CAISTAB au Plateau.« La digitalisation des assurances au profit des populations » a été la thématique abordée au cours de ces deux (02) journées. Les sociétés SUNU Assurances en Côte d’Ivoire en tant que sponsor, ont présenté leurs offres d’assurance digitale au grand public présent. Les visiteurs présents à leur stand sont repartis très satisfaits par le service reçu.<br>\r\n </p>\r\n\ntexte_article_en=><div>For the 3rd edition of the African Insurance Fair (SADA), all players in the insurance sector have met on September 12 and 13, 2019 in Abidjan specifically at CAISTAB Plateau.</div>\r\n\r\n<div>\"The digitalization of insurance for the benefit of the population\" was the theme addressed during these two (02) days. SUNU Assurances companies in Côte d&#39;Ivoire as a sponsor, presented their digital insurance offers to the general public present.</div>\r\n\r\n<div>The visitors present at their booth left very satisfied with the service received.</div>\r\n\nlecture_article=>0\nfichier_article=>sada0-2019.jpg\ndateCreated_article=>2019-09-24 09:46:57\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1784,2147204895,'2019-11-15 09:48:07','photo','insert|all|590|0|id_photo=>590\nid_article=>79\nfichier_photo=>sada2-2019.jpg\ndateCreated_photo=>2019-11-15 10:48:07\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1785,2147204895,'2019-11-15 09:48:15','photo','insert|all|591|0|id_photo=>591\nid_article=>79\nfichier_photo=>sada1-2019.jpg\ndateCreated_photo=>2019-11-15 10:48:15\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1786,2147204895,'2019-11-15 09:48:26','photo','insert|all|592|0|id_photo=>592\nid_article=>79\nfichier_photo=>sada3-2019.jpg\ndateCreated_photo=>2019-11-15 10:48:26\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1787,2147204895,'2019-11-15 09:48:27','photo','insert|all|593|0|id_photo=>593\nid_article=>79\nfichier_photo=>sada4-2019.jpg\ndateCreated_photo=>2019-11-15 10:48:27\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1788,2147204895,'2019-11-15 09:48:45','photo','insert|all|594|0|id_photo=>594\nid_article=>79\nfichier_photo=>sada5-2019.jpg\ndateCreated_photo=>2019-11-15 10:48:45\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1789,2147204895,'2019-11-15 09:51:13','article','update|all|80|id_article=>80\ntitre_article=>SUNU Assurances Vie Burkina Faso : premier tirage Kunadia O\'\ntitre_article_en=>SUNU Assurances Vie Burkina Faso : first print Kunadia O \'\ntexte_article=><p>Le jeudi 12 septembre 2019, SUNU Assurances Vie Burkina Faso et Orange Money ont procédé au premier tirage au sort de leur produit d’épargne dénommé « Kunadia O’ » à l’agence principale de Sunu Assurances Vie Burkina Faso.<br>\r\nLe but du tirage est de permettre aux clients d’avoir la chance de disposer de l’épargne qui aurait dû être acquise en 25 ans avant échéance.<br>\r\nKunadia O’ conçu par SUNU Assurances Vie et mis en œuvre avec Orange Money Burkina Faso permet au souscripteur de se constituer une épargne de 500 000 FCFA ou 1 000 000 FCFA selon la formule choisie pour laquelle un prélèvement sera fait via Orange money. Le client tiré au sort repartira avec 500 000 ou 1 millions FCFA qu’il percevra dans un délai de 72 heures après réception du rapport de l’huissier.<br>\r\nCe premier tirage a fait deux heureux gagnants. Le prochain tirage aura lieu au mois de décembre 2019.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p><span xss=removed>On Thursday, September 12, 2019, SUNU Assurances Vie Burkina Faso and Orange Money conducted the first draw of their savings product called \"Kunadia O &#39;\" at the main agency of Sunu Assurances Life Burkina Faso.</span><br>\r\n<span xss=removed>The purpose of the draw is to give customers the chance to have the savings that should have been earned in 25 years before maturity.</span><br>\r\n<span xss=removed>Kunadia O &#39;designed by SUNU Assurances Vie and implemented with Orange Money Burkina Faso allows subscribers to build up savings of 500,000 FCFA or 1,000,000 FCFA depending on the formula chosen for which a levy will be made via Orange money. The lucky customer will leave with 500,000 or 1 million FCFA that he will receive within 72 hours after receiving the bailiff&#39;s report.</span><br>\r\n<span xss=removed>This first draw made two happy winners. The next draw will take place in December 2019.</span></p>\r\n\nlecture_article=>0\nfichier_article=>kunadja_o0_2019.jpg\ndateCreated_article=>2019-09-12 17:59:23\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>80\ntitre_article=>SUNU Assurances Vie Burkina Faso : premier tirage Kunadia O\'\ntitre_article_en=>SUNU Assurances Vie Burkina Faso : first print Kunadia O \'\ntexte_article=><p>Le jeudi 12 septembre 2019, SUNU Assurances Vie Burkina Faso et Orange Money ont procédé au premier tirage au sort de leur produit d’épargne dénommé « Kunadia O’ » à l’agence principale de Sunu Assurances Vie Burkina Faso.<br>\r\nLe but du tirage est de permettre aux clients d’avoir la chance de disposer de l’épargne qui aurait dû être acquise en 25 ans avant échéance.<br>\r\nKunadia O’ conçu par SUNU Assurances Vie et mis en œuvre avec Orange Money Burkina Faso permet au souscripteur de se constituer une épargne de 500 000 FCFA ou 1 000 000 FCFA selon la formule choisie pour laquelle un prélèvement sera fait via Orange money. Le client tiré au sort repartira avec 500 000 ou 1 millions FCFA qu’il percevra dans un délai de 72 heures après réception du rapport de l’huissier.<br>\r\nCe premier tirage a fait deux heureux gagnants. Le prochain tirage aura lieu au mois de décembre 2019.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>On Thursday, September 12, 2019, SUNU Assurances Vie Burkina Faso and Orange Money conducted the first draw of their savings product called \"Kunadia O &#39;\" at the main agency of SUNU Assurances Vie Burkina Faso.<br>\r\nThe purpose of the draw is to give customers the chance to have the savings that should have been earned in 25 years before maturity.<br>\r\nKunadia O &#39;designed by SUNU Assurances and implemented with Orange Money Burkina Faso allows subscribers to build up savings of 500,000 FCFA or 1,000,000 FCFA depending on the formula chosen for which a levy will be made via Orange money. The lucky customer will leave with 500,000 or 1 million FCFA that he will receive within 72 hours after receiving the bailiff&#39;s report.<br>\r\nThis first draw made two happy winners. The next draw will take place in December 2019.</p>\r\n\nlecture_article=>0\nfichier_article=>kunadja_o0_2019.jpg\ndateCreated_article=>2019-09-12 09:51:13\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1790,2147204895,'2019-11-15 09:54:10','photo','insert|all|595|0|id_photo=>595\nid_article=>80\nfichier_photo=>kunadja_o2_2019.jpg\ndateCreated_photo=>2019-11-15 10:54:10\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1791,2147204895,'2019-11-15 09:54:12','photo','insert|all|596|0|id_photo=>596\nid_article=>80\nfichier_photo=>kunadja_o1_2019.jpg\ndateCreated_photo=>2019-11-15 10:54:12\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1792,2147204895,'2019-11-15 09:54:17','photo','insert|all|597|0|id_photo=>597\nid_article=>80\nfichier_photo=>kunadja_o4_2019.jpg\ndateCreated_photo=>2019-11-15 10:54:17\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1793,2147204895,'2019-11-15 09:54:28','photo','insert|all|598|0|id_photo=>598\nid_article=>80\nfichier_photo=>kunadja_o3_2019.jpg\ndateCreated_photo=>2019-11-15 10:54:28\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1794,2147204895,'2019-11-15 09:55:31','_SESSION','login|all|1573811682|0|__ci_last_regenerate=>1573811682\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2019-11-15 09:43:32::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(1795,2147204895,'2019-11-15 09:57:49','article','update|all|77|id_article=>77\ntitre_article=>SUNU Assurances Vie Partenaire de la 2ème édition de la Grande Soirée Retro\ntitre_article_en=>SUNU Assurances Vie Partner of the 2nd edition of the Great Retro Party\ntexte_article=>Le samedi 3 août, les mélomanes des musiques rétro se sont donné rendez-vous à la 2ème édition de la grande soirée Rétro organisée en partenariat avec SUNU Assurances Vie Côte d’Ivoire. \r\nCet évènement a vu la participation de certains pionniers, de la musique ivoirienne dont : Daouda le Sentimental, Antoinette KONAN, Bailly SPINTO, les Woody et bien d’autres gloires qui ont enflammé le public venu revivre en émotion leur plus belle jeunesse. \r\nCeux-ci, n’ont pas boudé leur plaisir en esquissant des pas de danse au rythme de la musique distillée. Ce fut une soirée forte appréciée.\ntexte_article_en=>On Saturday, August 3rd, retro music lovers will meet at the 2nd edition of the Retro evening organized in partnership with SUNU Assurances Vie Côte d\'Ivoire.\r\nThis event saw the participation of some pioneers, of Ivorian music including: Daouda the Sentimental, Antoinette KONAN, Bailly SPINTO, the Woody and many other glories that ignited the public came relive in emotion their most beautiful youth.\r\nThese, have not shunned their pleasure by sketching dance steps to the rhythm of distilled music. It was a very popular evening.\nlecture_article=>0\nfichier_article=>soiréeintranet01.jpg\ndateCreated_article=>2019-08-27 12:08:16\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>77\ntitre_article=>SUNU Assurances Vie Partenaire de la 2ème édition de la Grande Soirée Retro\ntitre_article_en=>SUNU Assurances Vie Partner of the 2nd edition of the Great Retro Party\ntexte_article=><p>Le samedi 3 août, les mélomanes des musiques rétro se sont donné rendez-vous à la 2ème édition de la grande soirée Rétro organisée en partenariat avec SUNU Assurances Vie Côte d’Ivoire. Cet évènement a vu la participation de certains pionniers, de la musique ivoirienne dont : Daouda le Sentimental, Antoinette KONAN, Bailly SPINTO, les Woody et bien d’autres gloires qui ont enflammé le public venu revivre en émotion leur plus belle jeunesse. Ceux-ci, n’ont pas boudé leur plaisir en esquissant des pas de danse au rythme de la musique distillée. Ce fut une soirée forte appréciée.</p>\r\n\ntexte_article_en=><p>On Saturday, August 3rd, retro music lovers will meet at the 2nd edition of the Retro evening organized in partnership with SUNU Assurances Vie Côte d&#39;Ivoire. This event saw the participation of some pioneers, of Ivorian music including: Daouda the Sentimental, Antoinette KONAN, Bailly SPINTO, the Woody and many other glories that ignited the public came relive in emotion their most beautiful youth. These, have not shunned their pleasure by sketching dance steps to the rhythm of distilled music. It was a very popular evening.</p>\r\n\nlecture_article=>0\nfichier_article=>kunadja_o0_20191.jpg\ndateCreated_article=>2019-08-27 09:57:49\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1796,2147204895,'2019-11-15 09:59:33','photo','insert|all|599|0|id_photo=>599\nid_article=>77\nfichier_photo=>soireintranet02.jpg\ndateCreated_photo=>2019-11-15 10:59:33\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1797,2147204895,'2019-11-15 09:59:33','photo','insert|all|600|0|id_photo=>600\nid_article=>77\nfichier_photo=>soireintranet03.jpg\ndateCreated_photo=>2019-11-15 10:59:33\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1798,2147204895,'2019-11-15 09:59:34','photo','insert|all|601|0|id_photo=>601\nid_article=>77\nfichier_photo=>soireintranet04.jpg\ndateCreated_photo=>2019-11-15 10:59:34\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1799,2147204895,'2019-11-15 09:59:38','photo','insert|all|602|0|id_photo=>602\nid_article=>77\nfichier_photo=>soireintranet06.jpg\ndateCreated_photo=>2019-11-15 10:59:38\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1800,2147204895,'2019-11-15 09:59:40','photo','insert|all|603|0|id_photo=>603\nid_article=>77\nfichier_photo=>soireintranet05.jpg\ndateCreated_photo=>2019-11-15 10:59:40\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1801,2147204895,'2019-11-15 09:59:41','photo','insert|all|604|0|id_photo=>604\nid_article=>77\nfichier_photo=>soireintranet07.jpg\ndateCreated_photo=>2019-11-15 10:59:41\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1802,2147204895,'2019-11-15 09:59:43','photo','insert|all|605|0|id_photo=>605\nid_article=>77\nfichier_photo=>soireintranet08.jpg\ndateCreated_photo=>2019-11-15 10:59:43\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1803,2147204895,'2019-11-15 09:59:45','photo','insert|all|606|0|id_photo=>606\nid_article=>77\nfichier_photo=>soireintranet10.jpg\ndateCreated_photo=>2019-11-15 10:59:45\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1804,2147204895,'2019-11-15 09:59:46','photo','insert|all|607|0|id_photo=>607\nid_article=>77\nfichier_photo=>soireintranet09.jpg\ndateCreated_photo=>2019-11-15 10:59:46\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1805,2147204895,'2019-11-15 09:59:47','photo','insert|all|608|0|id_photo=>608\nid_article=>77\nfichier_photo=>soireintranet11.jpg\ndateCreated_photo=>2019-11-15 10:59:47\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1806,2147204895,'2019-11-15 09:59:48','photo','insert|all|609|0|id_photo=>609\nid_article=>77\nfichier_photo=>soireintranet12.jpg\ndateCreated_photo=>2019-11-15 10:59:48\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1807,2147204895,'2019-11-15 10:01:30','article','update|all|77|id_article=>77\ntitre_article=>SUNU Assurances Vie Partenaire de la 2ème édition de la Grande Soirée Retro\ntitre_article_en=>SUNU Assurances Vie Partner of the 2nd edition of the Great Retro Party\ntexte_article=><p>Le samedi 3 août, les mélomanes des musiques rétro se sont donné rendez-vous à la 2ème édition de la grande soirée Rétro organisée en partenariat avec SUNU Assurances Vie Côte d’Ivoire. Cet évènement a vu la participation de certains pionniers, de la musique ivoirienne dont : Daouda le Sentimental, Antoinette KONAN, Bailly SPINTO, les Woody et bien d’autres gloires qui ont enflammé le public venu revivre en émotion leur plus belle jeunesse. Ceux-ci, n’ont pas boudé leur plaisir en esquissant des pas de danse au rythme de la musique distillée. Ce fut une soirée forte appréciée.</p>\r\n\ntexte_article_en=><p>On Saturday, August 3rd, retro music lovers will meet at the 2nd edition of the Retro evening organized in partnership with SUNU Assurances Vie Côte d&#39;Ivoire. This event saw the participation of some pioneers, of Ivorian music including: Daouda the Sentimental, Antoinette KONAN, Bailly SPINTO, the Woody and many other glories that ignited the public came relive in emotion their most beautiful youth. These, have not shunned their pleasure by sketching dance steps to the rhythm of distilled music. It was a very popular evening.</p>\r\n\nlecture_article=>0\nfichier_article=>kunadja_o0_20191.jpg\ndateCreated_article=>2019-08-27 09:57:49\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>77\ntitre_article=>SUNU Assurances Vie Partenaire de la 2ème édition de la Grande Soirée Retro\ntitre_article_en=>SUNU Assurances Vie Partner of the 2nd edition of the Great Retro Party\ntexte_article=><p>Le samedi 3 août, les mélomanes des musiques rétro se sont donné rendez-vous à la 2ème édition de la grande soirée Rétro organisée en partenariat avec SUNU Assurances Vie Côte d’Ivoire. Cet évènement a vu la participation de certains pionniers, de la musique ivoirienne dont : Daouda le Sentimental, Antoinette KONAN, Bailly SPINTO, les Woody et bien d’autres gloires qui ont enflammé le public venu revivre en émotion leur plus belle jeunesse. Ceux-ci, n’ont pas boudé leur plaisir en esquissant des pas de danse au rythme de la musique distillée. Ce fut une soirée forte appréciée.</p>\r\n\ntexte_article_en=><p>On Saturday, August 3rd, retro music lovers will meet at the 2nd edition of the Retro evening organized in partnership with SUNU Assurances Vie Côte d&#39;Ivoire. This event saw the participation of some pioneers, of Ivorian music including: Daouda the Sentimental, Antoinette KONAN, Bailly SPINTO, the Woody and many other glories that ignited the public came relive in emotion their most beautiful youth. These, have not shunned their pleasure by sketching dance steps to the rhythm of distilled music. It was a very popular evening.</p>\r\n\nlecture_article=>0\nfichier_article=>soiréeintranet01.jpg\ndateCreated_article=>2019-08-27 10:01:30\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1808,2147204895,'2019-11-15 10:05:29','article','update|all|78|id_article=>78\ntitre_article=>Sponsoring ELS\ntitre_article_en=> ELS Sponsorship\ntexte_article=><p>Cette année, les sociétés SUNU Assurances au Cameroun font partie des sponsors de la Fondation Elessa Lothin Sen (Fondation lancée l’année dernière par l’un des principaux courtiers du marché), dont les activités s’articulent autour de 03 thèmes : l’Education, l’Economie et le Sport.</p>\r\n\r\n<div xss=removed>Pour cette seconde édition, la Fondation a choisi de s’investir dans l’éducation, en accompagnant des élèves, à travers :</div>\r\n\r\n<div xss=removed>-Le don de 300 bourses scolaires d’une valeur totale de 5.000.000 F CFA à des écoliers des villes de Mouanko et Edéa, les 16 et 18 Août 2019 ;</div>\r\n\r\n<div xss=removed>-Et ce 27 septembre, le don d’une bibliothèque de 1 000 livres à une école de la ville de Yaoundé.</div>\r\n\r\n<div xss=removed>Ces remises de bourses ont également été l’occasion pour SUNU Assurances de présenter ses solutions d’assurance Education aux personnes présentes, et de se positionner comme un acteur majeur de l’Education au Cameroun.</div>\r\n\r\n<div xss=removed>Les activités de la Fondation se poursuivent jusqu’en décembre.</div>\r\n\ntexte_article_en=><div xss=removed>This year, the SUNU Assurances companies in Cameroon are part of the sponsors of the Elessa Lothin Sen Foundation (Foundation launched last year by one of the main brokers of the market), whose activities revolve around 03 themes: the Education, Economy and Sport.</div>\r\n\r\n<div xss=removed>For this second edition, the Foundation has chosen to invest in education, accompanying students, through:</div>\r\n\r\n<div xss=removed>- The donation of 300 scholarships worth a total of 5,000,000 CFA francs to schoolchildren in the cities of Mouanko and Edea on 16 and 18 August 2019;</div>\r\n\r\n<div xss=removed>- And this 27th of September, the donation of a library of 1,000 books to a school in the city of Yaounde.</div>\r\n\r\n<div xss=removed>These scholarship awards were also an opportunity for SUNU Assurances to present its education insurance solutions to those present, and to position itself as a major player in education in Cameroon.</div>\r\n\r\n<div xss=removed>The activities of the Foundation continue until December.</div>\r\n\nlecture_article=>0\nfichier_article=>sponsoringels0-2019.jpg\ndateCreated_article=>2019-08-16 10:55:27\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>78\ntitre_article=>Sponsoring ELS\ntitre_article_en=> ELS Sponsorship\ntexte_article=><p>Cette année, les sociétés SUNU Assurances au Cameroun font partie des sponsors de la Fondation Elessa Lothin Sen (Fondation lancée l’année dernière par l’un des principaux courtiers du marché), dont les activités s’articulent autour de 03 thèmes : l’Education, l’Economie et le Sport.</p>\r\n\r\n<div>Pour cette seconde édition, la Fondation a choisi de s’investir dans l’éducation, en accompagnant des élèves, à travers :</div>\r\n\r\n<div>-Le don de 300 bourses scolaires d’une valeur totale de 5.000.000 F CFA à des écoliers des villes de Mouanko et Edéa, les 16 et 18 Août 2019 ;</div>\r\n\r\n<div>-Et ce 27 septembre, le don d’une bibliothèque de 1 000 livres à une école de la ville de Yaoundé.</div>\r\n\r\n<div>Ces remises de bourses ont également été l’occasion pour SUNU Assurances de présenter ses solutions d’assurance Education aux personnes présentes, et de se positionner comme un acteur majeur de l’Education au Cameroun.</div>\r\n\r\n<div>Les activités de la Fondation se poursuivent jusqu’en décembre.</div>\r\n\ntexte_article_en=><div>This year, the SUNU Assurances companies in Cameroon are part of the sponsors of the Elessa Lothin Sen Foundation (Foundation launched last year by one of the main brokers of the market), whose activities revolve around 03 themes: the Education, Economy and Sport.</div>\r\n\r\n<div>For this second edition, the Foundation has chosen to invest in education, accompanying students, through:</div>\r\n\r\n<div>- The donation of 300 scholarships worth a total of 5,000,000 CFA francs to schoolchildren in the cities of Mouanko and Edea on 16 and 18 August 2019;</div>\r\n\r\n<div>- And this 27th of September, the donation of a library of 1,000 books to a school in the city of Yaounde.</div>\r\n\r\n<div>These scholarship awards were also an opportunity for SUNU Assurances to present its education insurance solutions to those present, and to position itself as a major player in education in Cameroon.</div>\r\n\r\n<div>The activities of the Foundation continue until December.</div>\r\n\nlecture_article=>0\nfichier_article=>sponsoringels0-2019.jpg\ndateCreated_article=>2019-08-16 10:05:29\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1809,2147204895,'2019-11-15 10:06:00','photo','insert|all|610|0|id_photo=>610\nid_article=>78\nfichier_photo=>sponsoringels2-2019.jpg\ndateCreated_photo=>2019-11-15 11:06:00\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1810,2147204895,'2019-11-15 10:06:03','photo','insert|all|611|0|id_photo=>611\nid_article=>78\nfichier_photo=>sponsoringels1-2019.jpg\ndateCreated_photo=>2019-11-15 11:06:03\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1811,2147204895,'2019-11-15 10:06:04','photo','insert|all|612|0|id_photo=>612\nid_article=>78\nfichier_photo=>sponsoringels3-2019.jpg\ndateCreated_photo=>2019-11-15 11:06:04\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1812,2147204895,'2019-11-15 10:06:06','photo','insert|all|613|0|id_photo=>613\nid_article=>78\nfichier_photo=>sponsoringels4-2019.jpg\ndateCreated_photo=>2019-11-15 11:06:06\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1813,2147204895,'2019-11-15 10:06:07','photo','insert|all|614|0|id_photo=>614\nid_article=>78\nfichier_photo=>sponsoringels5-2019.jpg\ndateCreated_photo=>2019-11-15 11:06:07\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1814,2147204895,'2019-11-15 10:08:51','article','update|all|73|id_article=>73\ntitre_article=> LES SOCIETES SUNU Assurances au Togo au FESTIVAL EVALA 2019\ntitre_article_en=>SOCIETES SUNU Assurances in Togo at the EVALA 2019 FESTIVAL\ntexte_article=><p>Comme chaque année, SUNU Assurances proche des populations a apporté son soutien aux organisateurs des luttes traditionnelles dénommées EVALA.<br>\r\nCe festival qui a eu lieu du 15 au 21 Juillet en pays Kabyè au nord du Togo, est un rite initiatique qui fait entrer les jeunes dans le rang des hommes.<br>\r\nCet évènement a un programme d’activités culturelles (soirées culturelles, concerts, chants, danses, contes traditionnels, soirées théâtrales...) très engageant et draine énormément de personne.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>As every year, SUNU Assurances close to the population has supported the organizers of the traditional struggles called EVALA.<br>\r\nThis festival, which took place from July 15th to 21st in Kabyè country in the north of Togo, is an initiation ritual that brings young people into the ranks of men.<br>\r\nThis event has a program of cultural activities (cultural evenings, concerts, songs, dances, traditional tales, theatrical nights ...) very engaging and drains a lot of people.</p>\r\n\nlecture_article=>0\nfichier_article=>EVALA0-2019.jpg\ndateCreated_article=>2019-07-21 19:38:11\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>73\ntitre_article=> LES SOCIETES SUNU Assurances au Togo au FESTIVAL EVALA 2019\ntitre_article_en=>SOCIETES SUNU Assurances in Togo at the EVALA 2019 FESTIVAL\ntexte_article=><p>Comme chaque année, SUNU Assurances proche des populations a apporté son soutien aux organisateurs des luttes traditionnelles dénommées EVALA.<br>\r\nCe festival qui a eu lieu du 15 au 21 Juillet en pays Kabyè au nord du Togo, est un rite initiatique qui fait entrer les jeunes dans le rang des hommes.<br>\r\nCet évènement a un programme d’activités culturelles (soirées culturelles, concerts, chants, danses, contes traditionnels, soirées théâtrales...) très engageant et draine énormément de personne.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>As every year, SUNU Assurances close to the population has supported the organizers of the traditional struggles called EVALA.<br>\r\nThis festival, which took place from July 15th to 21st in Kabyè country in the north of Togo, is an initiation ritual that brings young people into the ranks of men.<br>\r\nThis event has a program of cultural activities (cultural evenings, concerts, songs, dances, traditional tales, theatrical nights ...) very engaging and drains a lot of people.</p>\r\n\nlecture_article=>0\nfichier_article=>EVALA0-2019.jpg\ndateCreated_article=>2019-07-21 10:08:51\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1815,2147204895,'2019-11-15 10:09:29','photo','insert|all|615|0|id_photo=>615\nid_article=>73\nfichier_photo=>EVALA1-2019.jpg\ndateCreated_photo=>2019-11-15 11:09:29\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1816,2147204895,'2019-11-15 10:09:32','photo','insert|all|616|0|id_photo=>616\nid_article=>73\nfichier_photo=>EVALA4-2019.jpg\ndateCreated_photo=>2019-11-15 11:09:32\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1817,2147204895,'2019-11-15 10:09:33','photo','insert|all|617|0|id_photo=>617\nid_article=>73\nfichier_photo=>EVALA2-2019.jpg\ndateCreated_photo=>2019-11-15 11:09:33\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1818,2147204895,'2019-11-15 10:09:57','article','disable|statut_article|68|1|2'),(1819,2147204895,'2019-11-15 10:13:14','article','update|all|75|id_article=>75\ntitre_article=>SUNU Assurances Vie Côte d’Ivoire assure la mutuelle INPHB (MUPI)\ntitre_article_en=>SUNU Assurances Vie Côte d\'Ivoire insures Mutual INPHB (MUPI)\ntexte_article=><p><br>\r\nLe Jeudi 18 juillet 2019, la mutuelle du personnel de L’INPHB (MUPI) Institut National Polytechnique Houphouët Boigny, a accordé leur confiance à SUNU Assurances Vie pour la couverture d’assurance collective. Cet accord s’est matérialisé par une signature de convention au siège de ladite société d’assurance. Dans ce partenariat, Le produit décès proposé par SUNU Assurances dénommé Bokamin, apporte une assistance financière à la famille de l’assuré en cas de décès de celui-ci par le paiement d’une prime mensuelle.</p>\r\n\r\n<p>Mme KOUONON Olivia, Directeur Production et Encaissement de SUNU Assurances Vie et M. KONAN Jean-Claude, président de la MUPI ont échangé les parapheurs sous la supervision des participants venus pour l’occasion. </p>\r\n\ntexte_article_en=><p>On Thursday, July 18, 2019, the INPHB (MUPI) National Houphouët Boigny National Institute of Polytechnic Institute, placed their trust in SUNU Life Insurance for the group insurance coverage . This agreement was materialized by a signature of agreement at the headquarters of the said insurance company. In this partnership, the death product offered by SUNU Assurances called Bokamin, provides financial assistance to the family of the insured in case of death of the latter by the payment of a monthly premium.<br>\r\n <br>\r\nMrs Kouonon Olivia, Production and Collection Director of SUNU Assurances Vie and Mr KONAN Jean-Claude, President of MUPI exchanged the paraphors under the supervision of the participants who came for the occasion.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>signatureconvention0_2019.jpg\ndateCreated_article=>2019-07-18 12:35:53\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>75\ntitre_article=>SUNU Assurances Vie Côte d’Ivoire assure la mutuelle INPHB (MUPI)\ntitre_article_en=>SUNU Assurances Vie Côte d\'Ivoire insures Mutual INPHB (MUPI)\ntexte_article=><p><br>\r\nLe Jeudi 18 juillet 2019, la mutuelle du personnel de L’INPHB (MUPI) Institut National Polytechnique Houphouët Boigny, a accordé leur confiance à SUNU Assurances Vie Côte d&#39;Ivoire pour la couverture d’assurance collective. Cet accord s’est matérialisé par une signature de convention au siège de ladite société d’assurance. Dans ce partenariat, Le produit décès proposé par SUNU Assurances dénommé Bokamin, apporte une assistance financière à la famille de l’assuré en cas de décès de celui-ci par le paiement d’une prime mensuelle.</p>\r\n\r\n<p>Mme KOUONON Olivia, Directeur Production et Encaissement de SUNU Assurances Vie et M. KONAN Jean-Claude, président de la MUPI ont échangé les parapheurs sous la supervision des participants venus pour l’occasion. </p>\r\n\ntexte_article_en=><p>On Thursday, July 18, 2019, the INPHB (MUPI) National Houphouët Boigny National Institute of Polytechnic Institute, placed their trust in SUNU Assurances Vie Côte d&#39;Ivoire for the group insurance coverage . This agreement was materialized by a signature of agreement at the headquarters of the said insurance company. In this partnership, the death product offered by SUNU Assurances called Bokamin, provides financial assistance to the family of the insured in case of death of the latter by the payment of a monthly premium.<br>\r\n <br>\r\nMrs Kouonon Olivia, Production and Collection Director of SUNU Assurances Vie and Mr KONAN Jean-Claude, President of MUPI exchanged the paraphors under the supervision of the participants who came for the occasion.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>signatureconvention0_2019.jpg\ndateCreated_article=>2019-07-18 10:13:14\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1820,2147204895,'2019-11-15 10:13:52','photo','insert|all|618|0|id_photo=>618\nid_article=>75\nfichier_photo=>signatureconvention3_2019.jpg\ndateCreated_photo=>2019-11-15 11:13:52\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1821,2147204895,'2019-11-15 10:13:52','photo','insert|all|619|0|id_photo=>619\nid_article=>75\nfichier_photo=>signatureconvention1_2019.jpg\ndateCreated_photo=>2019-11-15 11:13:52\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1822,2147204895,'2019-11-15 10:13:53','photo','insert|all|620|0|id_photo=>620\nid_article=>75\nfichier_photo=>signatureconvention2_2019.jpg\ndateCreated_photo=>2019-11-15 11:13:53\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1823,2147204895,'2019-11-15 10:16:00','article','disable|statut_article|76|1|2'),(1824,2147204895,'2019-11-15 10:16:55','article','update|all|69|id_article=>69\ntitre_article=> Les Matinales de SUNU Assurances IARD Cameroun\ntitre_article_en=> The Matinales of SUNU Assurances IARD Cameroon\ntexte_article=><p><br>\r\nDu 02 au 05 juillet derniers à l’espace Méridien au Pullman de DOUALA, SUNU Assurances IARD Cameroun a organisé des rencontres avec des professionnels de différents secteurs, baptisées les « Matinales de SUNU Assurances ». </p>\r\n\r\n<p>Ainsi, tout au long de la semaine, l’équipe de la Direction du Développement Commercial a rencontré tour à tour des professionnels du Transport (Transitaires et Transporteurs), du Voyage (Agences de voyage) et du Logement (SCI). <br>\r\nCes rencontres ont permis de présenter les solutions d’assurances innovantes, de discuter d’opportunités d’affaires et de nouer de nouveaux partenariats.</p>\r\n\ntexte_article_en=><p>From the 2nd to the 5th of July at the Meridien space at Pullman de DOUALA, SUNU Assurances IARD Cameroon organized meetings with professionals from different sectors, called \"Matinales de SUNU Assurances\".<br>\r\nThus, throughout the week, the team of the Direction of the Commercial Development met in turn professionals of Transport (Freight Forwarders and Transporters), Travel (Travel Agencies) and Housing (SCI).<br>\r\nThese meetings allowed us to present innovative insurance solutions, discuss business opportunities and forge new partnerships.</p>\r\n\nlecture_article=>0\nfichier_article=>lesmatinales0cameroun_2019.jpg\ndateCreated_article=>2019-07-05 18:46:04\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>69\ntitre_article=> Les Matinales de SUNU Assurances IARD Cameroun\ntitre_article_en=> The Matinales of SUNU Assurances IARD Cameroon\ntexte_article=><p>Du 02 au 05 juillet derniers à l’espace Méridien au Pullman de DOUALA, SUNU Assurances IARD Cameroun a organisé des rencontres avec des professionnels de différents secteurs, baptisées les « Matinales de SUNU Assurances ».  Ainsi, tout au long de la semaine, l’équipe de la Direction du Développement Commercial a rencontré tour à tour des professionnels du Transport (Transitaires et Transporteurs), du Voyage (Agences de voyage) et du Logement (SCI). <br>\r\nCes rencontres ont permis de présenter les solutions d’assurances innovantes, de discuter d’opportunités d’affaires et de nouer de nouveaux partenariats.</p>\r\n\ntexte_article_en=><p>From the 2nd to the 5th of July at the Meridien space at Pullman de DOUALA, SUNU Assurances IARD Cameroun organized meetings with professionals from different sectors, called \"Matinales de SUNU Assurances\".<br>\r\nThus, throughout the week, the team of the Direction of the Commercial Development met in turn professionals of Transport (Freight Forwarders and Transporters), Travel (Travel Agencies) and Housing (SCI).<br>\r\nThese meetings allowed us to present innovative insurance solutions, discuss business opportunities and forge new partnerships.</p>\r\n\nlecture_article=>0\nfichier_article=>lesmatinales0cameroun_2019.jpg\ndateCreated_article=>2019-07-05 10:16:55\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1825,2147204895,'2019-11-15 10:17:42','photo','insert|all|621|0|id_photo=>621\nid_article=>69\nfichier_photo=>lesmatinales2cameroun_2019.jpg\ndateCreated_photo=>2019-11-15 11:17:42\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1826,2147204895,'2019-11-15 10:17:44','photo','insert|all|622|0|id_photo=>622\nid_article=>69\nfichier_photo=>lesmatinales3cameroun_2019.jpg\ndateCreated_photo=>2019-11-15 11:17:44\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1827,2147204895,'2019-11-15 10:17:46','photo','insert|all|623|0|id_photo=>623\nid_article=>69\nfichier_photo=>lesmatinales1cameroun_2019.jpg\ndateCreated_photo=>2019-11-15 11:17:46\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1828,2147204895,'2019-11-15 10:17:47','photo','insert|all|624|0|id_photo=>624\nid_article=>69\nfichier_photo=>lesmatinales4cameroun_2019.jpg\ndateCreated_photo=>2019-11-15 11:17:47\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1829,2147204895,'2019-11-15 10:17:47','photo','insert|all|625|0|id_photo=>625\nid_article=>69\nfichier_photo=>lesmatinales5cameroun_2019.jpg\ndateCreated_photo=>2019-11-15 11:17:47\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1830,2147204895,'2019-11-15 10:20:42','article','update|all|71|id_article=>71\ntitre_article=>SUNU ASSURANCES Vie Côte d\'Ivoire partenaire d\'Afrique Consciente\ntitre_article_en=>SUNU Assurances Vie Côte d\'Ivoire partner of Africa Conscious\ntexte_article=><p>Les 2èmes Universités ouvertes de la société civique en Afrique, se sont déroulées le samedi 29 juin 2019 à l’hôtel Sofitel Ivoire d’Abidjan. Au cours de cette journée, plusieurs personnalités venues d’ici et d’ailleurs, ont développé les valeurs africaines telles que la solidarité, le respect, la dignité. S’appuyant sur ces valeurs, des hommes et des femmes œuvrent tous les jours, chacun à leur niveau pour rendre la vie de milliers de personnes meilleure. Ils ont partagé avec le public venu nombreux pour l’occasion leurs expériences au niveau de la santé, l’éducation et l’environnement. Parmi les panélistes, un invité spécial venu du Burkina Faso, M. Yacouba SAWADOGO surnommé « l’homme qui a arrêté le désert », s’est vu décerner le prix Afrique consciente.<br>\r\nSUNU Assurances en tant qu’entreprise panafricaine qui épouse pleinement les valeurs d’Afrique Consciente (Solidarité, Respect, Dignité) n’a pas voulu rester en marge de cette belle initiative.</p>\r\n\ntexte_article_en=><p>The 2nd Open Universities of the civic society in Africa, took place on Saturday, June 29, 2019 at the Sofitel Ivoire hotel in Abidjan. During this day, many personalities from here and elsewhere, have developed African values ​​such as solidarity, respect, dignity. Based on these values, men and women work every day, each at their level to make the lives of thousands of people better. They shared with the public come numerous for the occasion their experiences in health, education and the environment. Among the panellists, a special guest from Burkina Faso, Mr. Yacouba SAWADOGO nicknamed \"the man who stopped the desert\", was awarded the Africa conscious prize.<br>\r\nSUNU Assurances as a pan-African company that fully embraces the values ​​of Africa Consciente (Solidarity, Respect, Dignity) did not want to stay on the sidelines of this great initiative.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>afriqueconsciente0_2019.jpg\ndateCreated_article=>2019-06-29 19:01:14\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>71\ntitre_article=>SUNU ASSURANCES Vie Côte d\'Ivoire partenaire d\'Afrique Consciente\ntitre_article_en=>SUNU Assurances Vie Côte d\'Ivoire partner of Africa Conscious\ntexte_article=><p>Les 2èmes Universités ouvertes de la société civique en Afrique, se sont déroulées le samedi 29 juin 2019 à l’hôtel Sofitel Ivoire d’Abidjan. Au cours de cette journée, plusieurs personnalités venues d’ici et d’ailleurs, ont développé les valeurs africaines telles que la solidarité, le respect, la dignité. S’appuyant sur ces valeurs, des hommes et des femmes œuvrent tous les jours, chacun à leur niveau pour rendre la vie de milliers de personnes meilleure. Ils ont partagé avec le public venu nombreux pour l’occasion leurs expériences au niveau de la santé, l’éducation et l’environnement. Parmi les panélistes, un invité spécial venu du Burkina Faso, M. Yacouba SAWADOGO surnommé « l’homme qui a arrêté le désert », s’est vu décerner le prix Afrique consciente.<br>\r\nSUNU Assurances en tant qu’entreprise panafricaine qui épouse pleinement les valeurs d’Afrique Consciente (Solidarité, Respect, Dignité) n’a pas voulu rester en marge de cette belle initiative.</p>\r\n\ntexte_article_en=><p>The 2nd Open Universities of the civic society in Africa, took place on Saturday, June 29, 2019 at the Sofitel Ivoire hotel in Abidjan. During this day, many personalities from here and elsewhere, have developed African values ​​such as solidarity, respect, dignity. Based on these values, men and women work every day, each at their level to make the lives of thousands of people better. They shared with the public come numerous for the occasion their experiences in health, education and the environment. Among the panellists, a special guest from Burkina Faso, Mr. Yacouba SAWADOGO nicknamed \"the man who stopped the desert\", was awarded the Africa conscious prize.<br>\r\nSUNU Assurances as a pan-African company that fully embraces the values ​​of Africa Consciente (Solidarity, Respect, Dignity) did not want to stay on the sidelines of this great initiative.</p>\r\n\r\n<p> </p>\r\n\nlecture_article=>0\nfichier_article=>afriqueconsciente0_2019.jpg\ndateCreated_article=>2019-06-29 10:20:42\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1831,2147204895,'2019-11-15 10:21:18','photo','insert|all|626|0|id_photo=>626\nid_article=>71\nfichier_photo=>afriqueconsciente1_2019.jpg\ndateCreated_photo=>2019-11-15 11:21:18\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1832,2147204895,'2019-11-15 10:21:20','photo','insert|all|627|0|id_photo=>627\nid_article=>71\nfichier_photo=>afriqueconsciente2_2019.jpg\ndateCreated_photo=>2019-11-15 11:21:20\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1833,2147204895,'2019-11-15 10:21:21','photo','insert|all|628|0|id_photo=>628\nid_article=>71\nfichier_photo=>afriqueconsciente4_2019.jpg\ndateCreated_photo=>2019-11-15 11:21:21\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1834,2147204895,'2019-11-15 10:21:22','photo','insert|all|629|0|id_photo=>629\nid_article=>71\nfichier_photo=>afriqueconsciente5_2019.jpg\ndateCreated_photo=>2019-11-15 11:21:22\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1835,2147204895,'2019-11-15 10:21:24','photo','insert|all|630|0|id_photo=>630\nid_article=>71\nfichier_photo=>afriqueconsciente3_2019.jpg\ndateCreated_photo=>2019-11-15 11:21:24\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1836,2147204895,'2019-11-15 10:22:40','article','update|all|67|id_article=>67\ntitre_article=> SUNU assurances Vie Côte d\'Ivoire à la 10ème édition du MEET UP BUSINESS\ntitre_article_en=> SUNU assurances Vie Côte d\'Ivoire at the 10th edition of MEET UP BUSINESS\ntexte_article=><p>Le vendredi 28 juin 2019, le Directeur Général adjoint de SUNU Assurances Vie Côte d’Ivoire, M. Gildas NZOUBA était l’invité de la 10ème édition du MEET UP BUSINESS qui s’est déroulé au siège de la CGECI Academy.<br>\r\nLors de ce Meet Up, son parcours, son expérience professionnelle et ses ambitions pour SUNU Assurances Vie Côte d’Ivoire ont été dévoilés au public invité pour l’occasion.</p>\r\n\ntexte_article_en=><p>On Friday, June 28, 2019, the Deputy Director General of SUNU Assurances Vie Côte d&#39;Ivoire, Mr Gildas NZOUBA was the guest of the 10th edition of the MEET UP BUSINESS which took place at the headquarters of the CGECI Academy.<br>\r\nDuring this Meet Up, his career, his professional experience and his ambitions for SUNU Assurances Vie Côte d&#39;Ivoire were unveiled to the public invited for the occasion</p>\r\n\nlecture_article=>0\nfichier_article=>65872434_1288500864658181_309636493154975744_n.jpg\ndateCreated_article=>2019-06-28 21:01:03\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>67\ntitre_article=> SUNU assurances Vie Côte d\'Ivoire à la 10ème édition du MEET UP BUSINESS\ntitre_article_en=> SUNU assurances Vie Côte d\'Ivoire at the 10th edition of MEET UP BUSINESS\ntexte_article=><p>Le vendredi 28 juin 2019, le Directeur Général adjoint de SUNU Assurances Vie Côte d’Ivoire, M. Gildas NZOUBA était l’invité de la 10ème édition du MEET UP BUSINESS qui s’est déroulé au siège de la CGECI Academy.<br>\r\nLors de ce Meet Up, son parcours, son expérience professionnelle et ses ambitions pour SUNU Assurances Vie Côte d’Ivoire ont été dévoilés au public invité pour l’occasion.</p>\r\n\ntexte_article_en=><p>On Friday, June 28, 2019, the Deputy Director General of SUNU Assurances Vie Côte d&#39;Ivoire, Mr Gildas NZOUBA was the guest of the 10th edition of the MEET UP BUSINESS which took place at the headquarters of the CGECI Academy.<br>\r\nDuring this Meet Up, his career, his professional experience and his ambitions for SUNU Assurances Vie Côte d&#39;Ivoire were unveiled to the public invited for the occasion</p>\r\n\nlecture_article=>0\nfichier_article=>meetup0_2019.jpg\ndateCreated_article=>2019-06-28 10:22:40\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(1837,2147204895,'2019-11-15 10:23:59','photo','insert|all|631|0|id_photo=>631\nid_article=>67\nfichier_photo=>meetup1_2019.jpg\ndateCreated_photo=>2019-11-15 11:23:59\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1838,2147204895,'2019-11-15 10:23:59','photo','insert|all|632|0|id_photo=>632\nid_article=>67\nfichier_photo=>meetup2_2019.jpg\ndateCreated_photo=>2019-11-15 11:23:59\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(1839,2147204895,'2019-11-15 10:25:36','article','disable|statut_article|66|1|2'),(1840,2147204895,'2019-11-15 10:26:18','article','disable|statut_article|74|1|2'),(1841,2147204895,'2019-11-15 10:26:43','article','disable|statut_article|75|1|2'),(1842,2147204895,'2019-11-15 10:27:00','article','disable|statut_article|69|1|2'),(1843,2147204895,'2019-11-15 10:27:08','article','disable|statut_article|71|1|2'),(1844,2147204895,'2019-11-15 10:27:13','article','disable|statut_article|67|1|2'),(1845,2147204895,'2019-11-15 10:27:34','article','disable|statut_article|21|1|2'),(1846,2147204895,'2019-11-15 10:27:42','article','disable|statut_article|19|1|2'),(1847,2147204895,'2019-11-15 10:28:00','article','disable|statut_article|72|1|2'),(1848,2147204895,'2019-11-15 10:28:06','article','disable|statut_article|59|1|2'),(1849,2147204