texte_publication_en=><p>Marking the 20th anniversary celebration of the SUNU Group, 2018 will have been a year of year of challenges. The increase of capital, requiring insurance companies to approved in CIMA zone to go from 1 to 3 Billions of CFA francs before May 31, 2019, has been a major lever in the redesign of the insurance sector.</p>\r\n\nfichier_publication=>RA_SUNU_18_wweb.pdf\nfichier_publication_en=>\ndateCreated_publication=>2019-09-18 17:10:26\ndateDisabled_publication=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_publication=>1\n'),(2400,2147204895,'2020-02-06 15:02:12','_SESSION','login|all|1581001320|0|__ci_last_regenerate=>1581001320\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2020-02-05 16:50:59::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(2401,2147204895,'2020-02-06 17:14:17','_SESSION','login|all|1581009179|0|__ci_last_regenerate=>1581009179\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2020-02-06 15:02:12::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(2402,2147204895,'2020-02-25 17:37:23','_SESSION','login|all|1582652235|0|__ci_last_regenerate=>1582652235\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2020-02-06 17:14:17::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(2403,2147204895,'2020-02-25 18:37:34','article','insert|all|87|0|id_article=>87\ntitre_article=>Prix Fanaf DIONE\ntitre_article_en=>Prix Fanaf DIONE\ntexte_article=><p>C’est en présence de tous les barons de l’assurance que M. Pathé DIONE, PDG et fondateur du Groupe SUNU a reçu des mains de M. Jean KACOU DIAGOU, fondateur du Groupe NSIA un prix spécial décerné au Groupe SUNU. Cette remise de prix a eu lieu ce 18 février 2020, lors d&#39;un dîner offert par NSIA pendant la FANAF 2020. Ces deux géants de l&#39;assurance sont un exemple de réussite de groupes africains qui reconnaissent mutuellement leur expertise et leur constance dans la satisfaction des clients depuis plus de 20 ans.</p>\r\n\ntexte_article_en=><p>It was in the presence of all the insurance barons that Mr Pathé DIONE, CEO and founder of the SUNU Group received from the hands of Mr Jean KACOU DIAGOU, founder of the NSIA Group, a special prize awarded to the SUNU Group. This award ceremony took place on February 18, 2020, during a dinner offered by NSIA during the FANAF 2020. These two insurance giants are an example of success stories of African groups that have mutually recognized their expertise and consistency in customer satisfaction for more than 20 years.</p>\r\n\nlecture_article=>0\nfichier_article=>prixfanafdione_00.jpg\ndateCreated_article=>2020-02-18 18:37:34\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(2404,2147204895,'2020-02-25 18:39:24','article','update|all|87|id_article=>87\ntitre_article=>Prix Fanaf DIONE\ntitre_article_en=>Prix Fanaf DIONE\ntexte_article=><p>C’est en présence de tous les barons de l’assurance que M. Pathé DIONE, PDG et fondateur du Groupe SUNU a reçu des mains de M. Jean KACOU DIAGOU, fondateur du Groupe NSIA un prix spécial décerné au Groupe SUNU. Cette remise de prix a eu lieu ce 18 février 2020, lors d&#39;un dîner offert par NSIA pendant la FANAF 2020. Ces deux géants de l&#39;assurance sont un exemple de réussite de groupes africains qui reconnaissent mutuellement leur expertise et leur constance dans la satisfaction des clients depuis plus de 20 ans.</p>\r\n\ntexte_article_en=><p>It was in the presence of all the insurance barons that Mr Pathé DIONE, CEO and founder of the SUNU Group received from the hands of Mr Jean KACOU DIAGOU, founder of the NSIA Group, a special prize awarded to the SUNU Group. This award ceremony took place on February 18, 2020, during a dinner offered by NSIA