U Group received from the hands of Mr Jean KACOU DIAGOU, founder of the NSIA Group, a special prize awarded to the SUNU Group. This award ceremony took place on February 18, 2020, during a dinner offered by NSIA during the FANAF 2020. These two insurance giants are an example of success stories of African groups that have mutually recognized their expertise and consistency in customer satisfaction for more than 20 years.</p>\r\n\nlecture_article=>0\nfichier_article=>prixfanafdione_001.jpg\ndateCreated_article=>2020-02-18 18:45:56\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n|id_article=>87\ntitre_article=>Le Groupe SUNU honoré par le Groupe NSIA\ntitre_article_en=>The SUNU Group honoured by the NSIA Group\ntexte_article=><p>C’est en présence de tous les barons de l’assurance que M. Pathé DIONE, PDG et fondateur du Groupe SUNU a reçu des mains de M. Jean KACOU DIAGOU, fondateur du Groupe NSIA un prix spécial décerné au Groupe SUNU. Cette remise de prix a eu lieu ce 18 février 2020, lors d&#39;un dîner offert par NSIA pendant la FANAF 2020. Ces deux géants de l&#39;assurance sont un exemple de réussite de groupes africains qui reconnaissent mutuellement leur expertise et leur constance dans la satisfaction des clients depuis plus de 20 ans.</p>\r\n\ntexte_article_en=><p>It was in the presence of all the insurance barons that Mr Pathé DIONE, CEO and founder of the SUNU Group received from the hands of Mr Jean KACOU DIAGOU, founder of the NSIA Group, a special prize awarded to the SUNU Group. This award ceremony took place on February 18, 2020, during a dinner offered by NSIA during the FANAF 2020. These two insurance giants are an example of success stories of African groups that have mutually recognized their expertise and consistency in customer satisfaction for more than 20 years.</p>\r\n\nlecture_article=>0\nfichier_article=>prixfanafdione_001.jpg\ndateCreated_article=>2020-02-18 18:53:45\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(2409,2147204895,'2020-02-25 20:18:06','article','insert|all|88|0|id_article=>88\ntitre_article=>Le Groupe SUNU à la 44ème Assemblée de la FANAF\ntitre_article_en=>SUNU Group at the 44th FANAF Assembly\ntexte_article=><p>Les travaux de la 44ème Assemblée Générale de la Fédération des Sociétés d&#39;Assurances de Droit National Africaines (FANAF) ont débuté avec un cocktail de bienvenue et une marche solidaire. Après Tunis l’an dernier, Libreville accueille tous les acteurs du secteur de l’assurance du 16 au 20 février 2020 autour du thème général : « La Donnée et l’Innovation au cœur de l’Assurance ». Le moment culminant de cette AG sera sûrement les élections du nouveau président de la FANAF, du secrétaire général et des membres du bureau. Le Groupe y est, comme d’habitude, bien représenté avec notamment la présence du PDG M. Pathé Dione.</p>\r\n\ntexte_article_en=><p>The proceedings of the 44th General Assembly of the Federation of African National Insurance Companies (FANAF) started with a welcome cocktail and a solidarity march. After Tunis last year, Libreville welcomes all the actors of the insurance sector from 16 to 20 February 2020 around the general theme: \"Data and Innovation at the heart of Insurance\". The high point of this GA will surely be the elections of the new FANAF president, the general secretary and the members of the board. The Group is, as usual, well represented with the presence of the CEO Mr. Pathé Dione.</p>\r\n\nlecture_article=>0\nfichier_article=>fanaf0020.jpg\ndateCreated_article=>2020-02-16 20:18:06\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n');
INSERT INTO `log` VALUES (2410,2147204895,'2020-02-25 20:20:44','photo','insert|all|635|0|id_photo=>635\nid_article=>87\nfichier_photo=>fanaf0120.jpg\ndateCreated_photo=>2020-02-25 21:20:44\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2411,2147204895,'2020-02-25 20:20:45','photo','insert|all|636|0|id_photo=>636\nid_article=>87\nfichier_photo=>fanaf0220.jpg\ndateCreated_photo=>2020-02-25 21:20:45\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2412,2147204895,'2020-02-25 20:20:47','photo','insert|all|637|0|id_photo=>637\nid_article=>87\nfichier_photo=>fanaf0320.jpg\ndateCreated_photo=>2020-02-25 21:20:47\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2413,2147204895,'2020-02-25 20:34:26','article','insert|all|89|0|id_article=>89\ntitre_article=>SUNU Assurances en Côte d’Ivoire sponsor du concert de YVIDERO\ntitre_article_en=>SUNU Assurances in Côte d\'Ivoire sponsor of the YVIDERO concert\ntexte_article=><p>Le vendredi 14 février 2020, fut marqué par le one man show de l’artiste-comédienne YVIDERO à L’Hôtel Sofitel Ivoire auquel ont pris part les sociétés SUNU Assurances en Côte d’Ivoire en qualité de sponsor. Un événement vivement attendu qui a vu la participation de plusieurs entreprises exerçant dans divers domaines d’activité.<br>\r\nPour matérialiser l’une de ses valeurs qui est de mettre « LE CLIENT AU CENTRE DE TOUT », les sociétés SUNU Assurances en Côte d&#39;Ivoire ont offert gracieusement des tickets VIP à leurs clients qui ont apprécié la marque d’attention. Une animation a permis au public de gagner des lots SUNU Assurances. La soirée s’est achevée par un bal poussière qui a permis au public d’esquisser des pas de danse avec la star.</p>\r\n\r\n<p> </p>\r\n\ntexte_article_en=><p>Friday, February 14, 2020, was marked by the one man show of the artist-comedian YVIDERO at the Hotel Sofitel Ivoire in which took part the companies SUNU Assurances in Côte d&#39;Ivoire as a sponsor. An event eagerly awaited which saw the participation of several companies operating in various fields of activity.<br>\r\nTo materialize one of its values which is to put \"THE CUSTOMER AT THE CENTER OF EVERYTHING\", the SUNU Assurances companies in Côte d&#39;Ivoire offered free VIP tickets to their customers who appreciated the mark of attention. An animation allowed the public to win SUNU Assurances prizes. The evening ended with a dust ball that allowed the public to sketch out dance steps with the star.</p>\r\n\nlecture_article=>0\nfichier_article=>yvideroshow20-00.jpg\ndateCreated_article=>2020-02-14 20:34:26\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(2414,2147204895,'2020-02-25 20:35:28','photo','insert|all|638|0|id_photo=>638\nid_article=>87\nfichier_photo=>yvideroshow20-01.jpg\ndateCreated_photo=>2020-02-25 21:35:28\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2415,2147204895,'2020-02-25 20:35:29','photo','insert|all|639|0|id_photo=>639\nid_article=>87\nfichier_photo=>yvideroshow20-03.jpg\ndateCreated_photo=>2020-02-25 21:35:29\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2416,2147204895,'2020-02-25 20:35:30','photo','insert|all|640|0|id_photo=>640\nid_article=>87\nfichier_photo=>yvideroshow20-02.jpg\ndateCreated_photo=>2020-02-25 21:35:30\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2417,2147204895,'2020-02-25 20:35:30','photo','insert|all|641|0|id_photo=>641\nid_article=>87\nfichier_photo=>yvideroshow20-04.jpg\ndateCreated_photo=>2020-02-25 21:35:30\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2418,2147204895,'2020-02-25 20:35:30','photo','insert|all|642|0|id_photo=>642\nid_article=>87\nfichier_photo=>yvideroshow20-05.jpg\ndateCreated_photo=>2020-02-25 21:35:30\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2419,2147204895,'2020-02-25 20:55:26','_SESSION','login|all|1582664063|0|__ci_last_regenerate=>1582664063\n{email=>