,'2020-05-29 10:36:40','_SESSION','login|all|1590748559|0|__ci_last_regenerate=>1590748559\n{email=>admin@sunugroup.com::name=>Admin SUNU::last_login=>2020-05-29 10:36:14::user_id=>2147204895::photo=>profile-M.png}\n{accessMenu=>111::accessS=>0000::accessNA=>1111::accessU=>1111}\nuser_id=>2147204895\n'),(2439,2147204895,'2020-05-29 10:41:15','article','insert|all|90|0|id_article=>90\ntitre_article=>SUNU ASSURANCES VIE BURKINA FASO : OPERATION DON DE SANG DANS LE CADRE DE LA LUTTE CONTRE LA COVID-19\ntitre_article_en=>SUNU ASSURANCES VIE BURKINA FASO : OPERATION BLOOD DONATION AS PART OF THE FIGHT AGAINST COVID-19\ntexte_article=><p xss=removed>SUNU Assurances Vie Burkina Faso s’est récemment mobilisée aux côtés du Centre National de Transfusion Sanguine du Burkina Faso (CNTS). En effet, la lutte contre le COVID-19 a fortement bouleversé le système sanitaire du Burkina Faso entrainant, entre autres, la réduction drastique du stock de la banque de sang et des difficultés de ravitaillement. Le CNTS a lancé un appel à travers les médias nationaux auquel SUNU Assurances Vie Burkina Faso a répondu favorablement. Une opération don de sang a donc été organisée le mercredi 22 avril 2020 dans ses locaux avec le personnel de SUNU Assurances et des sociétés riveraines. Ce sont au total 52 poches de sang qui ont été collectées. Le Directeur Général de SUNU Assurances Vie Burkina Faso, M. Jean-François KAMBOU, n’a pas manqué de rappeler que sa société ne pouvait pas rester insensible à cette situation. Il a ensuite remercié l’ensemble des collaborateurs des filiales du Groupe SUNU au Burkina Faso et les riverains pour avoir donné un peu de leur personne pour sauver des vies.</p>\r\n\ntexte_article_en=><p xss=removed>SUNU Assurances Vie Burkina Faso has recently mobilized alongside the National Blood Transfusion Centre of Burkina Faso (CNTS). Indeed, the fight against COVID-19 has greatly disrupted the health system of Burkina Faso leading, among other things, to the drastic reduction of the blood bank stock and supply difficulties. The CNTS launched an appeal through the national media to which SUNU Assurances Vie Burkina Faso responded favourably. A blood donation operation was therefore organized on Wednesday, April 22<sup>th</sup>, 2020 in its premises with the staff of SUNU Assurances and local companies. A total of 52 bags of blood were collected. The Managing Director of SUNU Assurances Vie Burkina Faso, Mr. Jean-François KAMBOU, did not fail to recall that his company could not remain insensitive to this situation. He then thanked all the employees of the SUNU Group subsidiaries in Burkina Faso and the local residents for having given a little of themselves to save lives.</p>\r\n\nlecture_article=>0\nfichier_article=>Don_de_sang_BF_001.jpg\ndateCreated_article=>2020-05-29 10:41:15\ndateDisabled_article=>0000-00-00 00:00:00\ncreatedBy=>2147204895\nstatut_article=>1\n'),(2440,2147204895,'2020-05-29 10:41:45','article','disable|statut_article|90|1|2'),(2441,2147204895,'2020-05-29 10:42:40','photo','insert|all|643|0|id_photo=>643\nid_article=>90\nfichier_photo=>Don_de_sang_BF_004.jpg\ndateCreated_photo=>2020-05-29 12:42:40\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2442,2147204895,'2020-05-29 10:42:40','photo','insert|all|644|0|id_photo=>644\nid_article=>90\nfichier_photo=>Don_de_sang_BF_003.jpg\ndateCreated_photo=>2020-05-29 12:42:40\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2443,2147204895,'2020-05-29 10:42:42','photo','insert|all|645|0|id_photo=>645\nid_article=>90\nfichier_photo=>Don_de_sang_BF_002.jpg\ndateCreated_photo=>2020-05-29 12:42:42\ndateDisabled_photo=>\ncreatedBy=>2147204895\nstatut_photo=>1\n'),(2444,2147204895,'2020-05-29 10:45:06','article','enable|statut_article|90|0|1'),(2445,2147204895,'2020-05-29 10:46:47','article','update|all|90|id_article=>90\ntitre_article=>SUNU ASSURANCES VIE BURKINA FASO : OPERATION DON DE SANG DANS LE CADRE DE LA LUTTE CONTRE LA COVID-19\ntitre