INSERT INTO `produit` VALUES (1,1,'Assurance Épargne','Savings Insurance','epargne.png','Grâce à l’assurance Epargne, vous vous donnez plus de chances de réaliser vos projets avec un capital qui fructifie rapidement au fil des ans.','With the savings insurance, you give yourself more chances to realise your projects with a capital that will grow quickly over years.\r\n',NULL,1,'vous collecterez des millions de succès','you will be collecting millions of successes.','2018-04-18 11:25:19','1'),(2,1,'Assurance Education','School Insurance','edu.png','L’assurance Education garantit la scolarité de votre enfant\nmême si vous n’êtes plus là. Il bénéficiera d’une épargne pour assurer ses\nétudes supérieures et son avenir quels que soient les aléas de la vie.','School insurance guarantees your child\'s scholarship even if you are no longer there. He will benefit from the savings to ensure his higher education and its future regardless of the vagaries of life.',NULL,10,'vous verrez grand pour votre petit.','you will see big for your little one.','2018-04-18 11:25:19','1'),(3,1,'Assurance Décès','Death Cover Insurance','deces.png','En cas de décès de l’assuré, nous versons aux bénéficiaires le capital décès comprenant les frais\ndes funérailles et des rentes mensuelles pour les aider à subvenir à leurs\nbesoins.','In the event of death of the insured, we pay to the beneficiaries a death benefit including funeral expenses and monthly annuities to help them meet their needs.\r\n',NULL,2,'En cas de décès de l’assuré, nous versons aux bénéficiaires le capital décès comprenant les frais\ndes funérailles et des rentes mensuelles pour les ai','In the event of death of the insured, we pay to the beneficiaries a death benefit including funeral expenses and monthly annuities.','2018-04-18 11:25:46','1'),(4,1,'Assurance Retraite','Pension Plan','retraite.png','En souscrivant dès votre entrée dans la vie active à une assurance retraite, vous profiterez du même confort et d’un repos paisible après avoir épargné à votre rythme.','By subscribing to a pension insurance as soon as you enter working life, you will enjoy the same comfort and a peaceful rest during your retirement after saving at your own pace.\r\n',NULL,10,'vous aurez le temps de prendre du bon temps.','you will have time to have a good time.','2018-04-18 11:25:46','1'),(5,2,'Assurance Automobile / Moto','Car / Motorbike Insurance','auto.png','Avec l’assurance automobile, vous bénéficiez\nd’assistance en cas d’accident et pouvez choisir les options de remorquage,\nconstat, réparation et véhicule de remplacement.','With car insurance, you benefit from assistance in the event of an accident and you can choose the options of towing, accident report, repair and replacement vehicle.',NULL,3,'vous serez loin des yeux mais près du cœur.','you will be far from the eyes but close the heart.','2018-04-18 11:27:38','1'),(6,2,'Assurance Santé','Health Insurance','sante.png','Nous couvrons les soins médicaux liés à une maladie, à\nun accident ou à une maternité.En option, nous proposons l’assistance santé (évacuation sanitaire pour les maladies ou accidents graves ne pouvant pas être traités localement,\nrapatriement de corps, retour anticipé en cas de décès d’un proche parent de\nl’assuré). ','We cover medical care related to illness, accident or maternity. As an option, we offer health assistance (medical evacuation for diseases or serious accidents that cannot be treated locally, repatriation of body, anticipated return in the event of the death of a close relative the insured).\r\n',NULL,10,'vous vous donnerez à fond et garderez la forme.','you will put yourself wholeheartedly while staying fit.','2018-04-18 11:27:38','1'),(7,2,'Assurance Habitation','Home Insurance','habitation.png','cette couverturepermet de préserver votre bien-être familial. Votre logement est couvert en\ncas d’incendie et explosion, dégâts des eaux, vol, etc.\nVotre responsabilité civile est aussi couverte pour tous les dommages que\nvous causerez à autrui.','This insurance helps preserve your family well-being. Your home is covered in case of fire and explosion, water damage, theft, etc. Your civil liability is also covered for all damages that you will cause to others.\r\n',NULL,10,'vous demeurez à l’abri dans votre foyer','you stay safe in your home.','2018-04-18 11:28:24','1'),(8,2,'Multi Risques Professionnel','Professional Multi-risk Insurance','multirisque.png','Avec la Multirisque Professionnelle, vous\nprotégez vos investissements et vos employés tout en assurant la rentabilité\nde votre business.\n','Avec la Multirisque Professionnelle, vous\r\nprotégez vos investissements et vos employés tout en assurant la rentabilité\r\nde votre business.',NULL,10,'vous aurez le meilleur actif pour maîtriser votre passif','you will have the best asset to overcome your liabilities.','2018-04-18 11:28:24','1'),(9,2,'Tous Risques Chantier','Construction All Risks','chantier.png','nous couvrons principalement les dommages à l’ouvrage assuré et les erreurs de conception\r\nsurvenus lors de la construction de l’ouvrage.','We mainly cover damage to the insured construction work and the errors in design that occur during the construction.',NULL,10,'vous mettrez la bonne pierre à votre édifice','vous mettrez la bonne pierre à votre édifice','2018-04-18 11:29:15','1'),(10,2,'Individuelle Accidents','Individual Accidents','accident.png','Nous versons un capital en cas de décès ou d’invalidité suite à un accident domestique\nqui porte atteinte à votre physique. Cette couverture peut être prise seule\nou en complément de l’Assurance maladie.','We pay a capital in the event of death or disability due to a domestic accident that affects your body. This insurance coverage can be subscribed alone or in addition to the Health Insurance.\r\n',NULL,4,'vous risquerez tout sans rien perdre','you will risk everything without loosing anything.','2018-04-18 11:29:15','1'),(11,2,'Assurance Voyage','Travel Insurance','voyage.png','Partez en voyage tout en étant rassuré en cas de\nperte de bagages ou d’ennuis de santé. Avec l’assurance voyage, vous êtes\nprotégé pendant tout le trajet et le séjour.','While traveling, stay reassured that you are covered in case of loss of luggage or health problems. With our travel insurance, you are protected throughout your journey and stay.\r\n',NULL,10,'vous ménagerez votre monture pour aller loin.','you will be prepared to move further.','2018-04-18 11:29:35','1');
