INSERT INTO `publication` VALUES (15,'Plaquette 2016','Brochure 2016','<p>Présent dans 14 pays d’Afrique de l’ouest et centrale, le Groupe SUNU est un groupe d’assurances africain créé en 1998 par M. Pathé DIONE avec d’anciens collaborateurs. Le Groupe SUNU, constitué de SUNU Participations Holding SA et de ses 23 filiales et sociétés affiliées.</p>\r\n','<p>Present in 14 countries in West and Central Africa, SUNU Group is an African insurance group created in 1998 by Mr. Pathé DIONE with former colleagues. SUNU Group consists of SUNU Participations Holding SA and its 23 subsidiaries and affiliated companies.</p>\r\n','Plaquette _SUNU2016_web.pdf','Plaquette_Instit__SUNU2016_V_anglaise_web1.pdf','2018-05-04 16:30:05','0000-00-00 00:00:00',2147484848,'1'),(16,'Rapport annuel 2016','Annual report 2016','<p>La progression du chiffre d&#39;affaires consolidé du Groupe en 2014 (6,35%) est du même ordre que celle de l&#39;exercice 2013 (6,60%): le léger tassement est dû au fait que deux sociétés affiliées sont désormais consolidées par équivalence.</p>\r\n','<p>The Group&#39;s consolidated revenue growth in 2014 (6.35%) is similar to that of 2013 (6.60%): the slight decrease is due to the fact that two affiliated companies are now consolidated by the equity method.</p>\r\n','RA_SUNU_2016_web.pdf','RA_SUNU_2016_V_anglaise_web.pdf','2018-05-04 09:17:22','0000-00-00 00:00:00',2147484848,'1'),(13,'Plaquette 2015','Brochure 2015','<p>Le Groupe SUNU est un groupe africain d’assurances créé en 1999 par M. Pathé DIONE avec des collaborateurs. Ancien directeur Afrique de l’UAP (Union des Assurances de Paris et d’AXA), il a acquis et créé au fil des ans des sociétés dans 14 pays d’Afrique de l’Ouest et Centrale.</p>\r\n','<p>SUNU Group is an African insurance group created in 1998 by Mr. Pathé DIONE with some colleagues. Former Africa Director of UAP (Union des Assurances de Paris) and AXA, he acquired and created over the years companies in 14 countries of West and Central Africa.</p>\r\n','Plaquette_SUNU_2015web.pdf','PlaquetteSUNU2015V_anglaise1.pdf','2018-05-04 16:25:13','0000-00-00 00:00:00',2147484848,'1'),(14,'Rapport annuel 2015','Annual report 2015','<p>2015 a été l&#39;année de consécration de notre image avec l&#39;uniformisation de notre identité dans la majorité de nos filiales. La marque SUNU Assurances a su s&#39;imposer dans l&#39;esprit du grand public et donner une signature forte à toutes les entités du Groupe.</p>\r\n','<p>2015 was the year of consecration of our image with the standardisation of our identity in the majority of the subsidiaries. The SUNU Assurances brand has established itself in the mind of the general public and has given a strong signature to all the entities of the Group.</p>\r\n','RAPPORT_SUNU_2015.pdf','RapportAnnuel2015Vanglaise1.pdf','2018-05-04 16:32:49','0000-00-00 00:00:00',2147484848,'3'),(12,'INTERVIEW DE M. PATHÉ DIONE, PDG DU GROUPE DANS LE HS N°47 DE JEUNE AFRIQUE','INTERVIEW WITH Mr. PATHÉ DIONE, CHAIRMAN AND CEO OF THE GROUP IN JEUNE AFRIQUE SPECIAL ISSUE N°47','<p>Interview de M. Pathé DIONE, PDG du Groupe dans le HS N°47 de Jeune Afrique.</p>\r\n','<p>Interview with Mr. Pathé DIONE, Chairman and CEO of the Group in Jeune Afrique special issue n°47.</p>\r\n','JA_m_Dione.pdf','JA_m_Dione1.pdf','2018-05-04 10:12:12','0000-00-00 00:00:00',2147484848,'0'),(11,'M. PATHÉ DIONE : «L\'ARROGANCE COLONIALE NE PASSERA PAS!»','Mr. PATHÉ DIONE : « COLONIAL ARROGANCE WON\'T WORK!»','<p>M. PATHÉ DIONE : « L&#39;arrogance coloniale ne passera pas!»</p>\r\n','<p>Mr. PATHÉ DIONE : « Colonial arrogance won&#39;t work!»</p>\r\n','GroupeSUNU_Financials_Afrik.pdf','GroupeSUNU_Financials_Afrik1.pdf','2018-05-04 10:20:36','0000-00-00 00:00:00',2147484848,'0'),(10,'LE GROUPE SUNU N\'EST PAS À VENDRE','SUNU GROUP IS NOT FOR SALE','<p>Le Groupe SUNU n&#39;est pas à vendre ! Cette phrase, montrant toute l&#39;ambition du PDG du groupe SUNU pour son continent, n&#39;a pas été appréciée de certaines convoitises internationales qui souhaitaient entrer dans son capital.</p>\r\n','<p>SUNU Group is not for sale! This sentence that shows all the ambition of SUNU Group CEO for his continent, was not appreciated by some international entities that eagerly wants to enter into its capital.</p>\r\n','Le-Groupe-SUNU-nest-pas-a-vendre.pdf','Le_Groupe_SUNU_nest_pas_à_vendre.pdf','2018-05-04 10:33:57','0000-00-00 00:00:00',2147484848,'0'),(9,'INTERVIEW DE M. VINCENT MVOLA, DIRECTEUR GÉNÉRAL ADJOINT DE SUNU ASSURANCES IARD GABON','INTERVIEW WITH Mr. VINCENT MVOLA, DEPUTY MANAGING DIRECTOR OF SUNU ASSURANCES IARD GABON','<p>Interview de M. Vincent MVOLA, Directeur Général Adjoint de SUNU Assurances IARD Gabon :\"L\'un des trois principaux produits commercialisés porte sur l\'assurance automobile\".</p>\r\n','<p>Interview with Mr.Vincent MVOLA, Deputy Managing Director of SUNU Assurances IARD Gabon :\" One of the top three products sold is car insurance\".</p>\r\n','Interview_M_MVOLA_DGA_SUNU_IARD_GABON.pdf','Interview_M_MVOLA_DGA_SUNU_IARD_GABON2.pdf','2018-05-04 16:25:58','0000-00-00 00:00:00',2147484848,'1'),(8,'INTERVIEW DE M. MOHAMED BAH, DGD GROUPE SUNU (PME MAG : 12ÈME ÉDITION DES 500 PREMIÈRES ENTREPRISES DE CI)','INTERVIEW WITH MR. MOHAMED BAH, DEPUTY MANAGING DIRECTOR OF SUNU GROUP (PME MAG: 12TH EDITION OF THE TOP 500 COMPANIES OF COTE D’IVOIRE)','<p>Interview de M. Mohamed BAH, Directeur Général Délégué du Groupe SUNU dans le PME Mag : 12ème édition des 500 premières entreprises de Côte d&#39;Ivoire.</p>\r\n','<p>Interview with Mr. MOHAMED BAH, Deputy Managing Director of SUNU Group in the magazine PME MAG: 12<sup>th</sup> edition of the top 500 companies of Cote d’Ivoire.</p>\r\n','Interview_de_M_Mohamed_BAH.pdf','Interview_de_M_Mohamed_BAH1.pdf','2018-05-14 10:49:14','0000-00-00 00:00:00',2147484848,'1'),(7,'INTERVIEW MME CHANTAL MOUELLE : DG SUNU ASSURANCES VIE CAMEROUN','INTERVIEW WITH Ms. CHANTAL MOUELLE: MANAGING DIRECTOR OF SUNU ASSURANCES VIE CAMEROUN','<p>Mme Chantal MOUELLE, Directrice Générale de SUNU Assurances Vie Cameroun et amazone hors pair, fait un point sur son parcours et explique les ambitions du Groupe SUNU pour l’assurance au Cameroun.</p>\r\n','<p>Ms. Chantal MOUELLE, Managing Director of SUNU Assurances Vie Cameroun and outstanding “amazon”, talks about her career and explains the ambitions of SUNU Group for the insurance sector in Cameroon.</p>\r\n','Interview_mme_chantal_mouelle_dg_sunu_asssurances_vie_cam..pdf','Interview_mme_chantal_mouelle_dg_sunu_asssurances_vie_cam_.pdf','2018-05-14 10:55:39','0000-00-00 00:00:00',0,'1'),(6,'CLASSEMENT 100 PREMIERS ASSUREURS AFRICAINS','RANKING OF THE TOP 100 AFRICAN INSURERS','<p>Dans le spécial Finances du magazine JEUNE AFRIQUE, un classement des 100 premières sociétés d’assurance du continent confirme une fois de plus la position de Leader de SUNU Assurances Vie Côte d’Ivoire en Afrique subsaharienne.</p>\r\n','<p>In the section dedicated to Finance of the magazine JEUNE AFRIQUE, a ranking of the top 100 insurance companies of the continent confirms once again the position of Leader of SUNU Assurances Vie Côte d’Ivoire in sub-Saharan Africa.</p>\r\n','classement_100_premiers_assureurs_africains.pdf','classement_100_premiers_assureurs_africains1.pdf','2018-05-14 10:04:15','0000-00-00 00:00:00',0,'1'),(5,'ENTRETIEN / BAKAYOKO SALIOU (PRIX FANAF 2016)','INTERVIEW / BAKAYOKO SALIOU (FANAF 2016 AWARD)','<p>ENTRETIEN / BAKAYOKO SALIOU (PRIX FANAF 2016) / Ce qu&#39;il pense du séminaire de Yamoussoukro « L’Assurance Vie évite de pleurer deux fois nos morts ».</p>\r\n','<p>INTERVIEW / BAKAYOKO SALIOU (FANAF 2016 AWARD) / What he thinks about the seminar of Yamoussoukro « Life insurance saves us from mourning our dead twice».</p>\r\n','ENTRETIEN_BAKAYOKO_SALIOU.pdf','ENTRETIEN_BAKAYOKO_SALIOU1.pdf','2018-05-14 11:04:02','0000-00-00 00:00:00',0,'1'),(23,'Interview de M. Pathé DIONE, PDG du Groupe SUNU, dans le magazine Esprit Août-Septembre','Interview de M. Pathé DIONE, PDG du Groupe SUNU, dans le magazine Esprit  Août-Septembre','<p>Focus sur M. Pathé DIONE. Un spécialiste des assurances au service de l’Afrique. Un Africain qui n’a d’yeux que pour la promotion du potentiel de son continent. Son combat pour la préservation de son Groupe des appétits des lorgneurs d’ailleurs y tire son origine…</p>\r\n','<p>Focus sur M. Pathé DIONE. Un spécialiste des assurances au service de l’Afrique. Un Africain qui n’a d’yeux que pour la promotion du potentiel de son continent. Son combat pour la préservation de son Groupe des appétitifs de lorgneurs d’ailleurs y tire son origine…  </p>\r\n','Esprit-PATHE_DIONE.pdf','Esprit-PATHE_DIONE.pdf','2018-08-23 13:33:18','0000-00-00 00:00:00',2147204895,'1'),(24,'Plaquette Institutionnelle 2017','Institutional brochure 2017','<p>Nos valeurs et nos hommes nous permettent de maintenir notre position de leader sur le marché Africain des Assurances. </p>\r\n','<p>Our values and our men allow us to maintain our LEADERSHIP position in the market African Insurance.</p>\r\n','Plaquette_Instit__SUNU2017_vdef.pdf','Plaquette_Instit__SUNU2017_VA_web.pdf','2018-09-06 10:35:20','0000-00-00 00:00:00',2147204895,'1'),(25,'Rapport Annuel 2017','Annual Report 2017','<p>Nos résultats sont conformes à nos objectifs avec une hausse de notre chiffre d’affaires de 17% par rapport à l’an dernier soit 150 Milliards FCFA, un Résultat Net de 2,3 Milliards FCFA et des actifs sous gestion s’élevant à 366 Milliards FCFA.</p>\r\n','<p>Our results are in line with our objectives with a turnover 17% higher than a year ago ; about 150 million euro. A net profit of 2.3 million euro with 366 million euro assets under management.</p>\r\n','RA_SUNU_2017_V_web.pdf','RA_SUNU_2017_V_anglaise_web.pdf','2018-09-06 10:18:44','0000-00-00 00:00:00',2147204895,'1'),(26,'Rapport Annuel 2018','Annual Report 2018','<p>Marquant la célébration des 20 ans du Groupe SUNU, 2018 aura été une année de challenges. L’augmentation de capital, exigeant aux sociétés d’assurance agrées en zone CIMA de passer de 1 à 3 Milliards F CFA avant le 31 mai 2019, a été un levier majeur dans la refonte du secteur de l’assurance.</p>\r\n','<p>Marking the 20th anniversary celebration of the SUNU Group, 2018 will have been a year of year of challenges. The increase of capital, requiring insurance companies to approved in CIMA zone to go from 1 to 3 Billions of CFA francs before May 31, 2019, has been a major lever in the redesign of the insurance sector.</p>\r\n','RA_SUNU_18_wweb.pdf','RA_SUNU18_VAweb.pdf','2019-09-18 15:10:26','0000-00-00 00:00:00',2147204895,'1'),(27,'Plaquette Institutionnelle 2018','Institutional brochure 2018','<p>Le Groupe SUNU est présent dans 14 pays d&#39;Afrique subsaharienne avec 27 sociétés d’assurances et autres sociétés affiliées.</p>\r\n','<p>The SUNU Group is present in 14 countries in sub-Saharan Africa with 27 insurance companies and other affiliated companies.</p>\r\n','Plaquette_Instit_2018_wweb1.pdf','Plaquette_Instit__SUNU2018VA_web.pdf','2019-09-17 15:54:36','0000-00-00 00:00:00',2147204895,'1'),(28,'Rapport Annuel 2018','Annual Report 2018','<p>Marquant la célébration des 20 ans du Groupe SUNU, 2018 aura été une année de challenges. L’augmentation de capital, exigeant aux sociétés d’assurance agrées en zone CIMA de passer de 1 à 3 Milliards F CFA avant le 31 mai 2019, a été un levier majeur dans la refonte du secteur de l’assurance.</p>\r\n','<p>Marking the 20th anniversary celebration of the SUNU Group, 2018 will have been a year of year of challenges. The increase of capital, requiring insurance companies to approved in CIMA zone to go from 1 to 3 Billions of CFA francs before May 31, 2019, has been a major lever in the redesign of the insurance sector.</p>\r\n','RA_SUNU_18_wweb.pdf','RA_SUNU18_VAweb.pdf','2019-09-18 17:02:06','0000-00-00 00:00:00',2147204895,'3'),(29,'test moroko','test moroko','<p>test moroko</p>\r\n','<p>test moroko</p>\r\n','ATHENA_SHIPPING-MRD316603.pdf','ATHENA_SHIPPING-MRD3166031.pdf','2019-11-14 12:57:26','0000-00-00 00:00:00',2147484848,'3');
